var suggestions=document.getElementById('suggestions');var userinput=document.getElementById('userinput');document.addEventListener('keydown',inputFocus);function inputFocus(e){if(e.keyCode===191){e.preventDefault();userinput.focus();}
if(e.keyCode===27){userinput.blur();suggestions.classList.add('d-none');}}
document.addEventListener('click',function(event){var isClickInsideElement=suggestions.contains(event.target);if(!isClickInsideElement){suggestions.classList.add('d-none');}});document.addEventListener('keydown',suggestionFocus);function suggestionFocus(e){const focusableSuggestions=suggestions.querySelectorAll('a');const focusable=[...focusableSuggestions];const index=focusable.indexOf(document.activeElement);let nextIndex=0;if(e.keyCode===38){e.preventDefault();nextIndex=index>0?index-1:0;focusableSuggestions[nextIndex].focus();}
else if(e.keyCode===40){e.preventDefault();nextIndex=index+1<focusable.length?index+1:index;focusableSuggestions[nextIndex].focus();}}
(function(){var index=new FlexSearch({preset:'score',cache:true,doc:{id:'id',field:['title','description','content',],store:['href','title','description',],},});var docs=[{id:0,href:"https://bitlogic.github.io/doks-algarrobo/docs/sis-config/introduction/",title:"Aprende a utilizar el Sistema de Configuraciones Académicas o SIS Config",description:null,content:"\u003cp\u003eCon el módulo \u003cspan style=\"color:red\"\u003e\u003cstrong\u003eNivel de estudio\u003c/strong\u003e\u003c/span\u003e (también llamado “Soporte de Nivel y Modalidad”) se establecen nuevas combinaciones de Nivel de Estudio + Modalidad de Estudio + Tipo de cursado + Grupos de Seguridad, modificar los existentes, o deshabilitar (no eliminar) aquellas que la universidad decida suspender por razones estratégicas o comerciales.\u003c/p\u003e\n\u003cp\u003eCon el módulo \u003cspan style=\"color:blue\"\u003e\u003cstrong\u003eEvaluaciones y expresiones\u003c/strong\u003e\u003c/span\u003e se establecen por cada tipo de evaluación (Exámenes Parciales, Trabajos Prácticos, Correlativas, etc.) qué combinación de factores tales como la calificación (la nota) y la asistencia deben cumplirse para que luego pueda ser “factoreado” en los criterios de regularidad.\u003c/p\u003e\n\u003cp\u003eCon el módulo \u003cspan style=\"color:green\"\u003e\u003cstrong\u003eCriterios de regularidad\u003c/strong\u003e\u003c/span\u003e se establecen cuáles son los parámetros que deben cumplirse para que el Estado o condición de la materia que un estudiante esté cursando sea, por ejemplo, de “Promoción directa” (y por lo tanto no deba rendir un examen final), o cuáles parámetros deben cumplirse para el Estado o condición de la materia sea “Regular” (por lo que el estudiante sí debe rendir un examen final).\u003c/p\u003e\n\u003ch2 id=\"módulo-nivel-de-estudio\"\u003eMódulo Nivel de Estudio\u003c/h2\u003e\n\u003cp\u003eEstablece o configura un Nivel del Estudio, lo que implica registrar una nueva combinación de Nivel de Estudio, Modalidad, Turno de cursado y Grupos de Seguridad. \u003ca href=\"/doks-algarrobo/docs/sis-config/nivel-de-estudio/\" title=\"Configurar nivel de estudio\"\u003eConfigurar nivel de estudio →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"módulo-evaluaciones-y-expresiones\"\u003eMódulo Evaluaciones y expresiones\u003c/h2\u003e\n\u003cp\u003eAntes de crear un Criterio de Regularidad para determinar cuál es el Estado en la que se encuentra un estudiante en relación a la promoción de las materias que cursa, deberás crear un Grupo de Evaluaciones y Expresiones en donde se establecen dos tipos de configuraciones, una para un ítem evaluador y una para la asistencia. \u003ca href=\"/doks-algarrobo/docs/sis-config/evaluaciones-y-expresiones/\" title=\"Crear evaluaciones y expresiones\"\u003eCrear evaluaciones y expresiones→\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"módulo-criterios-de-regularidad\"\u003eMódulo Criterios de Regularidad\u003c/h2\u003e\n\u003cp\u003eCrea un criterio de regularidad, es decir, un conjunto de condiciones a aplicar sobre diferentes tipos de evaluaciones tales como Trabajos Prácticos, parciales, finales, etc. y sobre la Asistencia que según se cumplan o no, determina el Estado académico final (regular, libre por nota, libre por inasistencia) de un estudiante en una materia. \u003ca href=\"/doks-algarrobo/docs/sis-config/criterios-de-regularidad/\" title=\"Crear Criterios de Regularidad\"\u003eCrear Criterios de Regularidad →\u003c/a\u003e\u003c/p\u003e\n"},{id:1,href:"https://bitlogic.github.io/doks-algarrobo/docs/sis-config/",title:"Criterios de regularidad",description:null,content:"\u003ch4 id=\"crear-criterios-de-regularidad\"\u003eCrear Criterios de regularidad\u003c/h4\u003e\n\u003cp\u003eEstablece cuáles son los parámetros que deben cumplirse para que el Estado o condición de la materia que un estudiante esté cursando sea, por ejemplo, de Promoción directa o Regular. \u003ca href=\"/doks-algarrobo/docs/sis-config/criterios-de-regularidad/\" title=\"Crear Criterios de regularidad\"\u003eCrear Criterios de regularidad →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-evaluaciones-y-expresiones\"\u003eCrear evaluaciones y expresiones\u003c/h4\u003e\n\u003cp\u003eCrea un Grupo de Evaluaciones y Expresiones para establecer 2 tipos de configuraciones: una para un ítem evaluador y otra para la asistencia. \u003ca href=\"/doks-algarrobo/docs/sis-config/evaluaciones-y-expresiones/\" title=\"Crear evaluaciones y expresiones\"\u003eCrear evaluaciones y expresiones →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"configurar-nivel-de-estudio\"\u003eConfigurar Nivel de Estudio\u003c/h4\u003e\n\u003cp\u003eMediante el módulo Nivel del Estudio podrás registrar nuevas combinaciones de Nivel de Estudio + Modalidad de Estudio + Turno de cursado y Grupos de Seguridad. \u003ca href=\"/doks-algarrobo/docs/sis-config/nivel-de-estudio/\" title=\"Configurar Nivel de Estudio\"\u003eConfigurar Nivel de Estudio →\u003c/a\u003e\u003c/p\u003e\n"},{id:2,href:"https://bitlogic.github.io/doks-algarrobo/docs/carga-de-notas/",title:"Carga de notas de TFGs y actividades",description:null,content:"\u003ch4 id=\"anulación-de-notas\"\u003eAnulación de notas\u003c/h4\u003e\n\u003cp\u003eAnula la nota obtenida por los estudiantes en los diferentes TFGs y actividades de las materias de su carrera. \u003ca href=\"/doks-algarrobo/docs/carga-de-notas/anular-notas/\" title=\"Anular notas\"\u003eAnular →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"carga-de-notas\"\u003eCarga de notas\u003c/h4\u003e\n\u003cp\u003eCarga la nota obtenida por los estudiantes en los diferentes TFGs y actividades de las materias de su carrera. \u003ca href=\"/doks-algarrobo/docs/carga-de-notas/cargar-notas/\" title=\"Cargar notas\"\u003eCargar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"edición-de-notas\"\u003eEdición de notas\u003c/h4\u003e\n\u003cp\u003eModifica la nota obtenida por los estudiantes en los diferentes TFGs y actividades de las materias que cursan. \u003ca href=\"/doks-algarrobo/docs/carga-de-notas/editar-notas/\" title=\"Editar notas\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualización-de-notas\"\u003eVisualización de notas\u003c/h4\u003e\n\u003cp\u003eVisualiza la nota obtenida por los estudiantes en los diferentes TFGs y actividades de las materias que cursan. \u003ca href=\"/doks-algarrobo/docs/carga-de-notas/visualizar-notas/\" title=\"Visualizar notas\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n"},{id:3,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/introduction/",title:"Conoce más sobre cómo administrar los recursos edilicios de la Universidad.",description:null,content:"\u003ch2 id=\"visualización-y-abm-de-edificios\"\u003eVisualización y ABM de edificios\u003c/h2\u003e\n\u003cp\u003e\u0026ldquo;Gestión de edificios\u0026rdquo; permite la visualización, alta, baja y modificación de los registros de edificios en el sistema para un mayor control tanto de los edificios como de sus atributos tales como Nombre, Sede, ubicación, y disponibilidad con los que cuenta la universidad.\u003c/p\u003e\n\u003ch4 id=\"visualizar-edificios\"\u003eVisualizar edificios\u003c/h4\u003e\n\u003cp\u003eLista los \u003cstrong\u003eedificios\u003c/strong\u003e existentes con sus respectivos atributos y estados de \u003cem\u003eDisponible / No disponible\u003c/em\u003e con estos simples pasos. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/visualizar-edificios/\" title=\"Visualizar edificios\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-edificios\"\u003eEditar edificios\u003c/h4\u003e\n\u003cp\u003eLuego de efectuar una búsqueda para localizar un \u003cstrong\u003eEdificio\u003c/strong\u003e, \u0026ldquo;Gestión de edificios\u0026rdquo; te permite modificar los \u003cstrong\u003eAtributos\u003c/strong\u003e del mismo: Nombre, Sede/CAU, Estado (\u003cem\u003eDisponible\u003c/em\u003e / \u003cem\u003eNo disponible\u003c/em\u003e) y ubicación. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"dar-de-baja-un-edificio\"\u003eDar de baja un edificio\u003c/h4\u003e\n\u003cp\u003eLuego de efectuar una búsqueda para localizar un \u003cstrong\u003eEdificio\u003c/strong\u003e en particular, \u0026ldquo;Gestión de edificios\u0026rdquo; te permite dar de baja al registro de dicho \u003cem\u003eedificio\u003c/em\u003e al hacer que su Estado pase de \u003cem\u003eDisponible\u003c/em\u003e a \u003cem\u003eNo disponible\u003c/em\u003e. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"dar-de-alta-un-edificio\"\u003eDar de alta un edificio\u003c/h4\u003e\n\u003cp\u003e\u0026ldquo;Gestión de edificios\u0026rdquo; te permite dar de alta o ingresar el registro de un \u003cstrong\u003eEdificio\u003c/strong\u003e al sistema y asignarle los atributos correspondientes (Nombre, Sede/CAU, Estado (\u003cem\u003eDisponible\u003c/em\u003e / \u003cem\u003eNo disponible\u003c/em\u003e) y ubicación) para que luego se liste entre los Edificios que posee la universidad. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta un edificio\"\u003eDar de alta →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"visualización-y-abm-de-aulas\"\u003eVisualización y ABM de aulas\u003c/h2\u003e\n\u003cp\u003e\u0026ldquo;Gestión de aulas\u0026rdquo; permite la visualización, alta, baja y modificación de los registros de aulas en el sistema para un mayor control tanto de las aulas como de sus atributos tales como Nombre del aula, Edificio en donde se encuentra, Estado, SEDE/CAU (solo visualización), Capacidad y Tipo de aula con las que cuenta la universidad.\u003c/p\u003e\n\u003ch4 id=\"visualizar-aulas\"\u003eVisualizar aulas\u003c/h4\u003e\n\u003cp\u003eLista las \u003cstrong\u003eaulas\u003c/strong\u003e existentes con sus respectivos atributos y estados de \u003cem\u003eDisponible / No disponible\u003c/em\u003e con estos simples pasos. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aulas\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-aulas\"\u003eEditar aulas\u003c/h4\u003e\n\u003cp\u003eLuego de efectuar una búsqueda para localizar un \u003cstrong\u003eAula\u003c/strong\u003e, \u0026ldquo;Gestión de aulas\u0026rdquo; te permite modificar los \u003cstrong\u003eAtributos\u003c/strong\u003e de esta: Nombre de aula, Tipo de aula, Edificio, Capacidad, Metros cuadrados, y Estado del aula (\u003cem\u003eDisponible\u003c/em\u003e / \u003cem\u003eNo disponible\u003c/em\u003e). \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"dar-de-baja-un-aula\"\u003eDar de baja un aula\u003c/h4\u003e\n\u003cp\u003eLuego de efectuar una búsqueda para localizar un \u003cstrong\u003eAula\u003c/strong\u003e en particular, \u0026ldquo;Gestión de aulas\u0026rdquo; te permite dar de baja al registro de dicha \u003cem\u003eaula\u003c/em\u003e al hacer que su Estado pase de \u003cem\u003eDisponible\u003c/em\u003e a \u003cem\u003eNo disponible\u003c/em\u003e. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"dar-de-alta-un-aula\"\u003eDar de alta un aula\u003c/h4\u003e\n\u003cp\u003e\u0026ldquo;Gestión de aulas\u0026rdquo; te permite dar de alta o ingresar el registro de un \u003cstrong\u003eAula\u003c/strong\u003e al sistema y asignarle los atributos correspondientes (Nombre, Tipo de aula, Estado del aula (\u003cem\u003eDisponible\u003c/em\u003e / \u003cem\u003eNo disponible\u003c/em\u003e), Edificio, Capacidad, etc.) para que luego se liste entre las aulas que posee la universidad. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta →\u003c/a\u003e\u003c/p\u003e\n"},{id:4,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/",title:"Visualización y ABM de aulas",description:null,content:"\u003ch4 id=\"visualizar-aulas\"\u003eVisualizar aulas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás localizar y luego visualizar los atributos de un aula. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aula\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-aulas\"\u003eEditar aulas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás modificar un aula al editar uno o más de sus atributos. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"dar-de-baja-un-aula\"\u003eDar de baja un aula\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás dar de baja un aula para que no esté disponible en el sistema. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"dar-de-alta-un-aula\"\u003eDar de alta un aula\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás dar de alta un aula para que así se pueda localizar en el sistema. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta →\u003c/a\u003e\u003c/p\u003e\n"},{id:5,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/",title:"Visualización y ABM de edificios",description:null,content:"\u003ch4 id=\"visualizar-edificios\"\u003eVisualizar edificios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás localizar y luego visualizar los atributos de un edificio. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/visualizar-edificios/\" title=\"Visualizar edificio\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-edificios\"\u003eEditar edificios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás modificar un edificio al editar uno o más de sus atributos. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"dar-de-baja-un-edificio\"\u003eDar de baja un edificio\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás dar de baja un edificio para que no esté disponible en el sistema. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"dar-de-alta-a-un-edificio\"\u003eDar de alta a un edificio\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás dar de alta un edificio para que así se pueda localizar en el sistema. \u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta a un edificio\"\u003eDar de alta →\u003c/a\u003e\u003c/p\u003e\n"},{id:6,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/introduction/",title:"Conoce más sobre cómo gestionar carreras y sus respectivos Planes de Estudio.",description:null,content:"\u003ch2 id=\"visualización-alta-y-edición-de-carreras\"\u003eVisualización, alta y edición de carreras\u003c/h2\u003e\n\u003cp\u003eEl \u0026ldquo;Administrador de carreras\u0026rdquo; permite la visualización y modificación de carreras en el sistema para un mayor control de la oferta académica al tiempo que asiste con el diseño de una carrera nueva con todos sus atributos para que luego sea aprobada como tal por resolución rectoral y ministerial.\u003c/p\u003e\n\u003ch4 id=\"visualizar-una-carrera\"\u003eVisualizar una carrera\u003c/h4\u003e\n\u003cp\u003eLocaliza una \u003cstrong\u003eCarrera\u003c/strong\u003e y visualiza detalles como el \u003cstrong\u003eDecanato\u003c/strong\u003e, el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e o su estado de \u003cem\u003eActivo / Inactivo\u003c/em\u003e con estos simples pasos. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-una-carrera\"\u003eEditar una carrera\u003c/h4\u003e\n\u003cp\u003eLuego de efectuar una búsqueda para localizar una \u003cstrong\u003eCarrera\u003c/strong\u003e, el \u0026ldquo;Administrador de carreras\u0026rdquo; te permite modificar algunos de los \u003cstrong\u003eAtributos\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-una-carrera\"\u003eCrear una carrera\u003c/h4\u003e\n\u003cp\u003eEl \u0026ldquo;Administrador de carreras\u0026rdquo; permite diseñar una carrera nueva con todos sus atributos para que luego sea aprobada como tal por resolución rectoral y ministerial. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"visualización-alta-y-edición-de-materias\"\u003eVisualización, alta y edición de materias\u003c/h2\u003e\n\u003cp\u003eEl \u0026ldquo;Administrador de carreras\u0026rdquo; permite la visualización y modificación de materias en el sistema como así también el ingreso o alta de una materia con todos sus atributos para que luego pueda ser incluida en un Plan de Estudios de una carrera determinada.\u003c/p\u003e\n\u003ch4 id=\"visualizar-una-materia\"\u003eVisualizar una materia\u003c/h4\u003e\n\u003cp\u003eLista las \u003cstrong\u003eMaterias\u003c/strong\u003e ya ingresadas en el sistema con sus respectivos atributos y estados de \u003cem\u003eActivo / Inactivo\u003c/em\u003e con estos simples pasos. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-una-materia\"\u003eEditar una materia\u003c/h4\u003e\n\u003cp\u003eLuego de efectuar una búsqueda para localizar una \u003cstrong\u003eMateria\u003c/strong\u003e, el \u0026ldquo;Administrador de carreras\u0026rdquo; permite modificar algunos de sus \u003cstrong\u003eAtributos\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-una-materia\"\u003eCrear una materia\u003c/h4\u003e\n\u003cp\u003eEl \u0026ldquo;Administrador de carreras\u0026rdquo; permite crear o ingresar el registro de una \u003cstrong\u003eMateria\u003c/strong\u003e al sistema y asignarle los atributos correspondientes para que luego se liste entre las materias que conforman las diversas carreras de la universidad. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"visualización-alta-clonación-y-edición-de-plan-de-estudio\"\u003eVisualización, alta, clonación y edición de plan de estudio\u003c/h2\u003e\n\u003cp\u003eEl \u0026ldquo;Administrador de carreras\u0026rdquo; permite la visualización y modificación de \u003cstrong\u003ePlanes de Estudio\u003c/strong\u003e en el sistema para un mayor control de la oferta académica al tiempo que asiste con el diseño de un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e nuevo con todos sus atributos para que luego se active una vez aprobada la carrera.\u003c/p\u003e\n\u003ch4 id=\"visualizar-un-plan-de-estudio\"\u003eVisualizar un plan de estudio\u003c/h4\u003e\n\u003cp\u003eLocaliza una \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e y visualiza detalles tales como el \u003cstrong\u003eTítulo final\u003c/strong\u003e a obtener, el \u003cstrong\u003eTítulo intermedio\u003c/strong\u003e si lo hubiere, la \u003cstrong\u003eResolución rectoral\u003c/strong\u003e y la \u003cstrong\u003eResolución ministerial\u003c/strong\u003e además de todas las materias que conforman la carrera de acuerdo a dicho Plan de estudios. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-un-plan-de-estudio\"\u003eEditar un plan de estudio\u003c/h4\u003e\n\u003cp\u003eLuego de efectuar una búsqueda para localizar un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e, el \u0026ldquo;Administrador de carreras\u0026rdquo; te permite modificar algunos de los \u003cstrong\u003eAtributos\u003c/strong\u003e de dicho plan . \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"diseñar-un-plan-de-estudio\"\u003eDiseñar un plan de estudio\u003c/h4\u003e\n\u003cp\u003eEl \u0026ldquo;Administrador de carreras\u0026rdquo; permite diseñar o armar un Plan de Estudio para una carrera en particular que luego será listado como un plan existente a visualizar o editar. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"clonar-un-plan-de-estudio\"\u003eClonar un plan de estudio\u003c/h4\u003e\n\u003cp\u003eEl Administrador de carreras permite buscar un Plan de Estudio de una carrera determinada para clonarlo y así utilizar como base los atributos y las materias que lo componen. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar →\u003c/a\u003e\u003c/p\u003e\n"},{id:7,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/introduction/",title:"Conoce más sobre cómo se solicitan y gestionan las equivalencias.",description:null,content:"\u003ch2 id=\"administrador-de-equivalencias\"\u003eAdministrador de Equivalencias\u003c/h2\u003e\n\u003cp\u003e\u003cstrong\u003eEquivalencias\u003c/strong\u003e es un aplicativo que permite gestionar las solicitudes de equivalencias de estudiantes que aspiran a cursar en Siglo 21 para que la universidad analice si les reconoce las materias ya aprobadas en la misma o en otra institución educativa ya sea para la misma o para otra carrera de su elección.\u003c/p\u003e\n\u003ch4 id=\"añadir-regla-de-equivalencias\"\u003eAñadir Regla de Equivalencias\u003c/h4\u003e\n\u003cp\u003eGenera reglas de equivalencia para definir qué Materia o Actividad de una institución dada tiene su equivalencia en Siglo 21 y por la cual dicha Materia o Actividad será reconocida como aprobada por la universidad. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-regla-de-equivalencias\"\u003eEditar Regla de Equivalencias\u003c/h4\u003e\n\u003cp\u003eEdita las reglas de equivalencia que definen qué Materia o Actividad de una institución dada tiene su equivalencia en Siglo 21 y por la que dicha Materia o Actividad será reconocida como aprobada por la universidad. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-regla-de-equivalencias\"\u003eVisualizar Regla de Equivalencias\u003c/h4\u003e\n\u003cp\u003eConoce la configuración de las reglas de equivalencia que definen qué Materia o Actividad de una institución dada tiene su equivalencia en Siglo 21 y por la que dicha Materia o Actividad es reconocida como aprobada por la universidad. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"añadir-institución\"\u003eAñadir Institución\u003c/h4\u003e\n\u003cp\u003eAgrega instituciones y las carreras que ofrecen con sus respectivos Planes de Estudio. Esto permitirá generar reglas de equivalencia que determinarán si una Materia o Actividad de la institución ingresada tiene su equivalente en Siglo 21. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir Institucion\"\u003eAñadir →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-institución\"\u003eEditar Institución\u003c/h4\u003e\n\u003cp\u003eEdita la información acerca de las instituciones de origen, de las carreras que ofrecen o de los Planes de Estudio. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar Institucion\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"eliminar-institución\"\u003eEliminar Institución\u003c/h4\u003e\n\u003cp\u003eElimina instituciones con sus diferentes carreras y respectivos Planes de Estudio. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar Institucion\"\u003eEliminar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-institución\"\u003eVisualizar Institución\u003c/h4\u003e\n\u003cp\u003eConoce cuáles son las instituciones llamadas \u0026ldquo;de origen\u0026rdquo; y cuáles son las carreras con sus respectivos Planes de Estudio que ofrecen. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar Institucion\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"revisar-solicitud-de-equivalencia\"\u003eRevisar Solicitud de Equivalencia\u003c/h4\u003e\n\u003cp\u003eRevisa los datos ingresados en una solicitud de equivalencias la cual determina si una o más materias o actividades pueden otorgarse como equivalencias en Siglo 21. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar Solicitud\"\u003eRevisar Solicitud →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-solicitud-de-equivalencia\"\u003eVisualizar Solicitud de Equivalencia\u003c/h4\u003e\n\u003cp\u003eVisualiza los datos ingresados en una solicitud de equivalencias la cual determina si una o más materias o actividades pueden otorgarse como equivalencias en Siglo 21. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-visualizar-solicitud/\" title=\"Visualizar Solicitud\"\u003eVisualizar Solicitud →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"solicitud-de-equivalencias-y-consulta-de-estado-de-solicitud\"\u003eSolicitud de Equivalencias y consulta de Estado de solicitud\u003c/h2\u003e\n\u003cp\u003eSolicita que Siglo 21 evalúe la adjudicación de equivalencias de materias o actividades que hayas cursado en Siglo 21 o en cualquier otra universidad o institución a través del \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e y realiza el seguimiento de tu solicitud.\u003c/p\u003e\n\u003ch4 id=\"realizar-solicitud-de-equivalencia\"\u003eRealizar solicitud de Equivalencia\u003c/h4\u003e\n\u003cp\u003eEnvía tu solicitud de equivalencias a Siglo 21 mediante el \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud\"\u003eRealizar solicitud →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-estado-de-solicitud-de-equivalencia\"\u003eConsultar Estado de solicitud de Equivalencia\u003c/h4\u003e\n\u003cp\u003eRealiza el seguimiento de tu solicitud de equivalencias mediante el \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estaddo de solicitud\"\u003eConsultar Estado de solicitud →\u003c/a\u003e\u003c/p\u003e\n"},{id:8,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/",title:"Procesar Admisiones y Pre admisiones de forma masiva",description:null,content:"\u003ch4 id=\"paso-1---datos-de-la-oferta-académica\"\u003ePaso 1 - Datos de la oferta académica\u003c/h4\u003e\n\u003cp\u003eEn este primer paso, podrás ingresar los datos necesarios para comenzar a procesar Admisiones o Pre admisiones en lote, es decir de a uno a cientos de registros. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/1-datos-oferta-academica/\" title=\"Paso 1 - Ingresar datos de la oferta académica\"\u003ePaso 1 →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"paso-2---cargar-archivo\"\u003ePaso 2 - Cargar archivo\u003c/h4\u003e\n\u003cp\u003eEn este segundo paso, podrás cargar el archivo que contiene los registros de los estudiantes a admitir o pre admitir. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/2-cargar-archivo/\" title=\"Paso 2 - Cargar archivo\"\u003ePaso 2 →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"paso-3---resultado-de-la-importación\"\u003ePaso 3 - Resultado de la importación\u003c/h4\u003e\n\u003cp\u003eEn este tercer paso, podrás corroborar el resultado de la importación del archivo que utilizaste para realizar la Admisión o Pre admisión masiva. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/3-resultado-importacion/\" title=\"Paso 3 - Visualizar resultado de la importación\"\u003ePaso 3 →\u003c/a\u003e\u003c/p\u003e\n"},{id:9,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/",title:"Verficiar admisión o pre admisión",description:null,content:"\u003ch3 id=\"verificar-admisión\"\u003eVerificar admisión\u003c/h3\u003e\n\u003cp\u003eVerificar que una admisión se ha procesado correctamente mediante la verificación del Estado del estudiante (Activo). \u003ca href=\"/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/verificar-admision/\" title=\"Verificar admisión\"\u003eVerificar admisión →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"verificar-pre-admisión\"\u003eVerificar pre admisión\u003c/h4\u003e\n\u003cp\u003eVerificar que una pre admisión se ha procesado correctamente al corroborar que se hayan generado los tickets de pago de la Matrícula y el Arancel que el estudiante debe pagar. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/verificar-preadmision/\" title=\"Verificar pre admisión\"\u003eVerificar pre admisión →\u003c/a\u003e\u003c/p\u003e\n"},{id:10,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/visualizar-admision-preadmision/",title:"Visualizar admisión o pre admisión",description:null,content:"\u003ch2 id=\"visualizar-admisión-o-pre-admisión\"\u003eVisualizar admisión o pre admisión\u003c/h2\u003e\n\u003cp\u003eVisualiza los resultados de una admisión o pre admisión. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/visualizar-admision-preadmision/\" title=\"Visualizar admisión o pre admisión\"\u003eVisualizar admisión o pre admisión →\u003c/a\u003e\u003c/p\u003e\n"},{id:11,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/introduction/",title:"Conoce más sobre cómo realizar una admisión o pre admisión masiva",description:null,content:"\u003ch2 id=\"procesar-admisiones-y-pre-admisiones\"\u003eProcesar Admisiones y Pre admisiones\u003c/h2\u003e\n\u003cp\u003eAntes que nada, debes tener que en claro que una \u003cstrong\u003eAdmisión\u003c/strong\u003e no genera ningún ticket de pago y en cambio una \u003cstrong\u003ePre admisión\u003c/strong\u003e genera tickets que el estudiante debe pagar para quedar efectivamente inscripto a la o las carreras de su elección.\u003c/p\u003e\n\u003ch4 id=\"paso-1-datos-de-la-oferta-académica\"\u003ePaso 1: Datos de la oferta académica\u003c/h4\u003e\n\u003cp\u003ePara comenzar a procesar una \u003cstrong\u003eAdmisión\u003c/strong\u003e o \u003cstrong\u003ePre admisión\u003c/strong\u003e, lo primero que debes hacer es cargar los datos iniciales que identifican el tipo de admisión, la carrera y detalles relacionados con la carrera. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/1-datos-oferta-academica/\" title=\"Paso 1 - Ingresar datos de la oferta académica\"\u003ePaso 1 →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"paso-2-cargar-archivo\"\u003ePaso 2: Cargar archivo\u003c/h4\u003e\n\u003cp\u003eEl siguiente paso para procesar una \u003cstrong\u003eAdmisión\u003c/strong\u003e o \u003cstrong\u003ePre admisión\u003c/strong\u003e consiste en subir un archivo con datos específicos de los estudiantes a admitir. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/2-cargar-archivo/\" title=\"Paso 2 - Cargar archivo\"\u003ePaso 2 →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"paso-3-resultado-de-la-importación\"\u003ePaso 3: Resultado de la importación\u003c/h4\u003e\n\u003cp\u003eEste último y tercer paso de la \u003cstrong\u003eAdmisión\u003c/strong\u003e o \u003cstrong\u003ePre admisión\u003c/strong\u003e masiva informa al usuario si la operación ha sido exitosa o si hubo errores a corregir. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/3-resultado-importacion/\" title=\"Paso 3 - Visualizar resultado de la importación\"\u003ePaso 3 →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"visualizar-admisiones-y-pre-admisiones\"\u003eVisualizar admisiones y pre admisiones\u003c/h2\u003e\n\u003cp\u003eLa app te permite realizar una búsqueda de admisiones o pre admisiones ya procesadas, ya sea por tí o por otro usuario y desplegar el resultado de las mismas. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/visualizar-admision-preadmision/buscar-admision-preadmision/\" title=\"Visualizar admisión o pre admisión\"\u003eVisualizar admisión o pre admisión →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"errores-en-el-procesamiento-de-admisiones-y-pre-admisiones\"\u003eErrores en el procesamiento de admisiones y pre admisiones\u003c/h2\u003e\n\u003cp\u003eEl resultado de la importación al que se llega en el Paso 3 puede tener errores a nivel registro - es decir, en los datos de 1 o más estudiantes en particular, o a nivel archivo, por ejemplo, en el caso de que el archivo le falte una columna.\u003c/p\u003e\n\u003ch4 id=\"errores-a-nivel-de-datos\"\u003eErrores a nivel de datos\u003c/h4\u003e\n\u003cp\u003eSi es a nivel datos, el sistema advierte cuál ha sido el error en el archivo Resumen de la importación. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/errores-admision-preadmision/errores-datos/\" title=\"Errores a nivel datos\"\u003eErrores a nivel datos →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"errores-a-nivel-de-archivo\"\u003eErrores a nivel de archivo\u003c/h4\u003e\n\u003cp\u003eSi el error es a nivel archivo, el sistema despliega una advertencia y directamente no procesa el archivo que se cargó. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/errores-admision-preadmision/errores-archivo/\" title=\"Errores a nivel de archivo\"\u003eErrores a nivel de archivo →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"verificar-admisiones-o-pre-admisiones\"\u003eVerificar admisiones o pre admisiones\u003c/h2\u003e\n\u003cp\u003eLas admisiones y la pre admisiones no se verifican de la misma manera porque las admisiones \u003cstrong\u003eno\u003c/strong\u003e generan tickets de pago y las pre admisiones sí. Ingresa en las sección correspondiente para conocer cómo se puede verificar que una \u003cstrong\u003eAdmision\u003c/strong\u003e o una **Pre admisión\u0026quot; fue procesada.\u003c/p\u003e\n\u003ch4 id=\"verificar-admisiones\"\u003eVerificar admisiones\u003c/h4\u003e\n\u003cp\u003eVerifica que una \u003cstrong\u003eAdmisión\u003c/strong\u003e ha sido procesada correctamente y por lo tanto, el Estado de los estudiantes es el de \u0026ldquo;Activo\u0026rdquo;. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/verificar-admision/\" title=\"Verificar admisiones\"\u003eVerificar admisiones →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"verificar-pre-admisiones\"\u003eVerificar pre admisiones\u003c/h4\u003e\n\u003cp\u003eVerifica que una \u003cstrong\u003ePre admisión\u003c/strong\u003e ha sido procesada correctamente y por lo tanto se generaron tickets de pago de la Matrícula y el Arancel para ser pagados por los estudiantes pre admitidos. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/verificar-preadmision/\" title=\"Verificar pre admisiones\"\u003eVerificar pre admisiones →\u003c/a\u003e\u003c/p\u003e\n"},{id:12,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/errores-admision-preadmision/",title:"Errores en la admisión o pre admisión",description:null,content:"\u003ch2 id=\"errores-en-el-procesamiento-de-admisiones-y-pre-admisiones\"\u003eErrores en el procesamiento de admisiones y pre admisiones\u003c/h2\u003e\n\u003cp\u003eLa app te informa si ha habido uno o más errores que impiden procesar una admisión o pre admisión ya sea a nivel de datos o por un problema con el archivo. \u003ca href=\"/doks-algarrobo/docs/admision-masiva/visualizar-admision-preadmision/\" title=\"Visualizar admisión o pre admisión\"\u003eVisualizar admisión o pre admisión →\u003c/a\u003e\u003c/p\u003e\n"},{id:13,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/introduction/",title:"Conoce más sobre cómo registrar la asistencia a clase",description:null,content:"\u003ch2 id=\"docentes-bedeles-y-supervisores\"\u003eDocentes, bedeles y supervisores\u003c/h2\u003e\n\u003ch4 id=\"abrir-la-clase-y-generar-el-código-qr\"\u003eAbrir la clase y generar el código QR\u003c/h4\u003e\n\u003cp\u003ePara comenzar a tomar asistencia lo primero que debes hacer es abrir la clase y luego generar el \u003cstrong\u003ecódigo QR\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/abrir-clase/\" title=\"Abrir la clase\"\u003eAbrir la clase →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-asistencia\"\u003eVisualizar asistencia\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás visualizar la asistencia de los estudiantes a un módulo.\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/visualizar-asistencia/\" title=\"Visualizar asistencia con la App o con la Botonera\"\u003eVisualizar asistencia con la App o con la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-y-registrar-la-asistencia-de-forma-manual---clase-abierta\"\u003eEditar y registrar la asistencia de forma manual - Clase Abierta\u003c/h4\u003e\n\u003cp\u003eComo docente, bedel o supervisor, con esta funcionalidad podrás registrar y también modificar la asistencia de los estudiantes a un módulo que se encuentre abierto ya sea mediante la app o mediante la Botonera.\n\u003cbr\u003e\n\u003ca href=\"/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-abierta/\" title=\"Editar y registrar asistencia - Clase Abierta con la App o con la Botonera\"\u003eRegistrar o Editar Clase Abierta con la App o con la Botonera →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-y-registrar-la-asistencia-de-forma-manual---clase-cerrada\"\u003eEditar y registrar la asistencia de forma manual - Clase Cerrada\u003c/h4\u003e\n\u003cp\u003eComo bedel o supervisor, con esta funcionalidad podrás registrar y también modificar la asistencia de los estudiantes a un módulo o a todos los módulos de una clase aún cuando dichos módulos hayan finalizado.\n\u003cbr\u003e\n\u003ca href=\"/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-cerrada/\" title=\"Registrar o editar la asistencia a un módulo o clase finalizado con la app o con la Botonera\"\u003eRegistrar o Editar Asistencia de Clase Cerrada con la App o con la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"estudiantes\"\u003eEstudiantes\u003c/h2\u003e\n\u003ch4 id=\"registro-de-asistencia\"\u003eRegistro de asistencia\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes registrar tu asistencia a un módulo al escanear un \u003cstrong\u003ecódigo QR\u003c/strong\u003e que el docente o un bedel o supervisor te facilitará. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/estudiantes/registrar-asistencia/\" title=\"Registrar asistencia\"\u003eRegistrar asistencia→\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualización-de-asistencia\"\u003eVisualización de asistencia\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás visualizar tu asistencia a una clase en un formato que te indicará si has superado o estás por alcanzar el máximo número de inasistencias permitidas. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/estudiantes/visualizar-asistencia-estudiante/\" title=\"Visualizar asistencia\"\u003eVisualizar asistencia →\u003c/a\u003e\u003c/p\u003e\n"},{id:14,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/cerrar-sesion-movil/",title:"Cerrar sesión",description:null,content:""},{id:15,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/iniciar-sesion-movil/",title:"Iniciar sesión",description:null,content:""},{id:16,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/inscribirse-examen/",title:"Inscribirse a un examen",description:"Inscríbete para rendir un examen.",content:"\u003col\u003e\n\u003cli\u003eInicia sesión en la app usando tus credenciales.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación ubicado en la barra inferior de la pantalla, pulsa el icono de \u0026ldquo;Exámenes\u0026rdquo; \n\n\u003cimg src=\"exam%20icon.png\" alt=\"Botón \u0026#39;Examen\u0026#39;\" class=\"inlineImage\"\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla correspondiente, haz clic en en el botón más \u003cstrong\u003e+\u003c/strong\u003e. En la pantalla verás la sección “Elige la materia que quieres rendir” se muestran lo exámenes que se encuentran disponibles para que te inscribas.\u003c/li\u003e\n\u003cli\u003eSelecciona del listado aquel examen en el que te quieres inscribir. Tu elección se mostrará en la sección “Resumen de inscripción”, dentro del cuadro “Materia”.\u003c/li\u003e\n\u003cli\u003eLuego, pulsa de la lista el lugar dónde quieres rendir. Tu elección se mostrará en la sección “Resumen de inscripción”, dentro del cuadro “Lugar”.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi la sede que elegiste no cuenta con mesas disponibles el sistema te alertará con un mensaje y deberás elegir otro lugar.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eSi el lugar posee mesas disponibles, selecciona uno de los horarios que se muestran en la pantalla. Aquí también verás marcadas con diferentes colores las mesas en las que tengas que llevar tu dispositivo para rendir o en las que las computadoras sean provistas por la universidad.\u003c/li\u003e\n\u003cli\u003eAl finalizar la selección de los datos de estas tres secciones, el cuadro “Resumen de inscripción” se mostrará completo.\u003c/li\u003e\n\u003cli\u003ePara concluir, pulsa el botón \u003cstrong\u003eInscribirme al examen\u003c/strong\u003e. Un mensaje con un resumen de tus inscripción se desplegará en la pantalla.\u003c/li\u003e\n\u003cli\u003eUn mensaje con los datos de tu inscripción se abrirá en la pantalla. Pulsa el botón “Confirmar” o \u0026ldquo;Cancelar\u0026rdquo; si deseas realizar algún cambio.\u003c/li\u003e\n\u003cli\u003eLa aplicación volverá automáticamente a la pantalla de \u0026ldquo;Exámenes\u0026rdquo; y tu registro de inscripción se agregará a la solapa \u0026ldquo;Por rendir\u0026rdquo;.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-historial-materias/\" title=\"Consultar historial de materias de la carrera\"\u003eConsultar historial de materias de la carrera →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/\" title=\"Consultar historial de inscripciones a exámenes\"\u003eConsultar historial de inscripciones a exámenes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/anular-inscripcion/\" title=\"Anular inscripción a exámenes\"\u003eAnular inscripciones a exámenes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n"},{id:17,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/",title:"Navegar la aplicación",description:null,content:"\u003col\u003e\n\u003cli\u003eEn primer lugar, descarga la aplicación a tu dispositivo móvil desde APP Store o Play Store.\u003c/li\u003e\n\u003cli\u003eInstala la aplicación y acepta los términos y condiciones.\u003c/li\u003e\n\u003cli\u003eInicia sesión con el usuario y las credenciales que te provea el asesor comercial que te inscribió en la carrera que deseas comenzar a cursar y si ya eres parte de la comunidad educativa, solicita a la universidad tu usuario y credenciales de acceso.\u003c/li\u003e\n\u003cli\u003eUna vez que estás dentro de la aplicación, en la pantalla de inicio encontrarás las siguientes seccione:\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003ePerfil\u003c/strong\u003e (1): esta es la sección ubicada en la parte superior de la pantalla. Pulsa el icono \n\n\u003cimg src=\"user%20section.png\" alt=\"user icon\" class=\"inlineIcon\"\u003e para acceder a ver y editar tu información personal.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eLegajo\u003c/strong\u003e (3): en esta sección puedes ver información sobre las carreras en las que estás inscripto, su avance, la modalidad elegida, tu número de legajo, entre otras. Pulsa el botón \u003cstrong\u003eHistorial\u003c/strong\u003e para acceder al estado de las materias relacionadas a cada una. Desliza el dedo horizontalmente hacia la izquierda o la derecha para navegar entre los tipos de materia y las notas.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePróximos eventos\u003c/strong\u003e (4): en esta sección se visualizan los próximos 5 eventos a los que te has registrado. Pueden ser información de clases, exámenes u otros eventos. Los exámenes se muestran en otro color para que te sea más fácil identificarlos. Para navegar por todos los eventos desliza el dedo hacia la derecha y la izquierda en esta sección. Presiona \u003cstrong\u003eVER TODO\u003c/strong\u003e para acceder a la agenda completa.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eÚltimas notas\u003c/strong\u003e (5): desde aquí puedes ver a las últimas 5 notas de tus últimos exámenes. Desliza el dedo horizontalmente hacia la izquierda o la derecha para navegar entre las notas.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePanel de navegación\u003c/strong\u003e (2): esta barra ubicada en la parte inferior de la pantalla puedes navegar por la aplicación. Pulsa el icono cursado \n\n\u003cimg src=\"graduate.png\" alt=\"cursado icon\" class=\"inlineIcon\"\u003e, exámenes \n\n\u003cimg src=\"exam%20icon.png\" alt=\"exam icon\" class=\"inlineIcon\"\u003e. Si estás en otra pantalla puedes volver al inicio presionando el botón de cursado. Al presionar el icono de pagos \n\n\u003cimg src=\"receipt.png\" alt=\"payments icon\" class=\"inlineIcon\"\u003e la aplicación abre automáticamente la funcionalidad de pago electrónico para que puedas para realizar los pagos de aranceles relacionados con tu cuenta. Por último, el icono más acciones \n\n\u003cimg src=\"more%20actions%20V.png\" alt=\"more actions vertical icon\" class=\"inlineIcon\"\u003e te permite ver y editar los datos de tu perfil y además, te permite ir directamente a las pantallas de tu historial académico y el calendario de eventos o agenda que tienes programada. Desde aquí también puedes ver los medios de contacto con la universidad.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003cimg src=\"navigate app.png\" alt=\"My mobile\"/\u003e\n\u003cbr\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003ePara continuar conociendo más sobre la aplicación móvil para estudiantes, consulta los documentos listados en la siguiente sección.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-historial-materias/\" title=\"Consultar historial de de materias de la carrera\"\u003eConsultar historial de materias de la carrera →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-historial-inscripciones-examenes/\" title=\"Consultar historial de inscripciones a exámenes\"\u003eConsultar historial de inscripciones a exámenes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/inscribirse-examen/\" title=\"Inscribirse a un examen\"\u003eInscribirse a un examen →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/pagos/realizar-pago/\" title=\"Acceder a la aplicación de pagos electrónicos\"\u003eAcceder a la aplicación de pagos electrónicos →\u003c/a\u003e\u003c/p\u003e\n"},{id:18,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/pagos/realizar-pago/",title:"Realizar pagos de aranceles, matrículas y otros conceptos",description:null,content:"\u003col\u003e\n\u003cli\u003eInicia sesión en la aplicación con tu usuario y contraseña.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación ubicado en la barra inferior, pulsa el icono \n\n\u003cimg src=\"receipt.png\" alt=\"payment icon\" class=\"inlineIcon\"\u003e. La aplicación abrirá automáticamente la página web de la aplicación de pagos electrónicos.\u003c/li\u003e\n\u003cli\u003ePara más detalles sobre el pago electrónico de matrículas y aranceles, consulta el documento \u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar tus tickets pendientes de pago\"\u003eConsultar tus tickets pendientes de pago →\u003c/a\u003e Al hacer click en “Pagos” desde el portal de estudiantes.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la sección \u003cb\u003eVéase también\u003c/b\u003e podrás encontrar más documentos que explican el uso de la aplicación de pagos electrónicos en detalle.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar tus tickets pendientes de pago\"\u003eConsultar tus tickets pendientes de pago →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-estudiante/\" title=\"Cargar salfo a tu cuenta\"\u003eCargar saldo a tu cuenta →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/otros/realizar-otros-pagos-estudiante/\" title=\"Realizar otros pagos\"\u003eRealizar otros pagos →\u003c/a\u003e\u003c/p\u003e\n"},{id:19,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/editar-perfil-movil/",title:"Ver tu perfil",description:null,content:"\u003col\u003e\n\u003cli\u003eInicia sesión en la app con tu usuario y credenciales.\u003c/li\u003e\n\u003cli\u003ePulsa el ícono de usuario \n\n\u003cimg src=\"user%20section.png\" alt=\"user icon\" class=\"inlineIcon\"\u003e en la parte superior derecha de la pantalla.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eOtra forma de acceder a la sección usuario es desde el icono de más acciones {{\u003cinline-icon image=\"more actions V.png\" alt=\"more actions vertical icon\"\u003e}} en la barra de navegación inferior.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eEn la pantalla verás los datos de cuenta: nombre, apellido, correo electrónico y teléfonos.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/\" title=\"Navegar la aplicación\"\u003eNavegar la aplicación →\u003c/a\u003e\u003c/p\u003e\n"},{id:20,href:"https://bitlogic.github.io/doks-algarrobo/docs/carga-de-notas/introduction/",title:"Conoce cómo cargar notas",description:null,content:"\u003ch2 id=\"visualizar-notas\"\u003eVisualizar notas\u003c/h2\u003e\n\u003cp\u003eCon esta funcionalidad, tanto docentes como co-docentes podrán visualizar las notas de los TFGs y de las actividades que un estudiante haya realizado con solo unos simples pasos. \u003ca href=\"/doks-algarrobo/docs/carga-de-notas/visualizar-notas/\" title=\"Visualizar notas\"\u003eVisualizar notas→\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"cargar-notas\"\u003eCargar notas\u003c/h2\u003e\n\u003cp\u003eCon esta funcionalidad, tanto docentes como co-docentes podrán cargar las notas de los TFGs y de las actividades que un estudiante haya realizado con solo unos simples pasos. \u003ca href=\"/doks-algarrobo/docs/carga-de-notas/cargar-notas/\" title=\"Cargar notas\"\u003eCargar notas→\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"editar-notas\"\u003eEditar notas\u003c/h2\u003e\n\u003cp\u003eCon esta funcionalidad, tanto docentes como co-docentes podrán modificar las notas obtenidas por los estudiantes en los TFGs y en las actividades que ya se hayan ingresado en el sistema. \u003ca href=\"/doks-algarrobo/docs/carga-de-notas/editar-notas/\" title=\"Editar notas\"\u003eEditar notas→\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"anular-notas\"\u003eAnular notas\u003c/h2\u003e\n\u003cp\u003eCon esta funcionalidad, tanto docentes como co-docentes podrán anular las notas obtenidas por los estudiantes en los TFGs y en las actividades que ya estén ingresadas en el sistema. \u003ca href=\"/doks-algarrobo/docs/carga-de-notas/anular-notas/\" title=\"Anular notas\"\u003eAnular notas→\u003c/a\u003e\u003c/p\u003e\n"},{id:21,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/introduccion/",title:"Conoce más sobre admisión",description:null,content:"\u003ch2 id=\"inscripción-de-ingresantes\"\u003eInscripción de ingresantes\u003c/h2\u003e\n\u003ch4 id=\"inscribir-ingresantes-en-carreras-de-grado-con-modalidad-presencial\"\u003eInscribir ingresantes en carreras de grado con modalidad presencial\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar la inscripción a carreras de grado que posean la modalidad presencial. \u003ca href=\"/doks-algarrobo/docs/admision/inscripcion-ingresantes/carreras-grado-presencial/\" title=\"Realizar inscripción\"\u003eInscripción →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribir-ingresantes-en-otras-carreras-con-otras-modalidades\"\u003eInscribir ingresantes en otras carreras con otras modalidades\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar la inscripción a otras carreras que posean otra modalidad. \u003ca href=\"/doks-algarrobo/docs/admision/inscripcion-ingresantes/carreras-otras-modalidades/\" title=\"Realizar inscripción\"\u003eInscripción →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"registrar-admisiones\"\u003eRegistrar admisiones\u003c/h2\u003e\n\u003ch4 id=\"crear-admisión\"\u003eCrear admisión\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes registrar admisiones con convenios con otras instituciones o departamentos de la institución. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/crear-admisiones/\" title=\"Crear admisión\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-admisiones\"\u003eBuscar admisiones\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes buscar todos las admisiones registradas en el sistema. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/buscar-admisiones/\" title=\"Buscar admisiones\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-admisión\"\u003eEditar admisión\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar cambios en los detalles de las admisiones que se han creado en el sistema. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/editar-admisiones/\" title=\"Editar admisión\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"anular-admisiones\"\u003eAnular admisiones\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes anular registros de admisión que se hayan creado en el sistema. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/anular-admisiones/\" title=\"Anular admisión\"\u003eAnular →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribir-aspirantes-individualmente\"\u003eInscribir aspirantes individualmente\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes inscribir uno por uno aquellas personas que decidan registrarse en la universidad como resultado de un contrato o convenio. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-individualmente/\" title=\"Inscribir aspirantes individualmente\"\u003eInscribir aspirantes individualmente →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribir-aspirantes-masivamente\"\u003eInscribir aspirantes masivamente\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes inscribir aspirantes de manera masiva cuyo origen sea el resultado de los convenios acordados con otras instituciones o departamentos de la universidad. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-masivamente/\" title=\"Inscribir aspirates masivamente\"\u003eInscribir aspirantes masivamente →\u003c/a\u003e\u003c/p\u003e\n"},{id:22,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/introduction/",title:"Conoce más sobre el portal",description:"Introducción funcional al nuevo portal de estudiantes.",content:"\u003ch2 id=\"información-general\"\u003eInformación general\u003c/h2\u003e\n\u003ch4 id=\"navegar-el-portal\"\u003eNavegar el portal\u003c/h4\u003e\n\u003cp\u003eConoce más sobre las secciones del portal y las acciones que puedes realizar desde cada una. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/mas-opciones/navegar-portal/\" title=\"Navegar el portal\"\u003eNavegar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"menú-de-más-opciones\"\u003eMenú de más opciones\u003c/h4\u003e\n\u003cp\u003eConsulta los atajos disponibles y las diferentes opciones del menú. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/mas-opciones/menu/\" title=\"Acceder al menú\"\u003eAcceder →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"cursado\"\u003eCursado\u003c/h2\u003e\n\u003ch4 id=\"consultar-carreras-yo-historial-de-cursado\"\u003eConsultar carreras y/o historial de cursado\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las carreras y/o el historial de cursado. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-carreras-e-historial-cursado/\" title=\"Consultar carreras\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-calendario-académicoagenda\"\u003eConsultar calendario académico/agenda\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar el calendario académico. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/\" title=\"Consultar calendario\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-el-historial-de-inscripciones-a-exámenes\"\u003eConsultar el historial de inscripciones a exámenes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar los exámenes a los que te has inscripto. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-historial-inscripciones/\" title=\"Consultar historial\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribirse-a-materias\"\u003eInscribirse a materias\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás inscribirte en las materias que tengas habilitadas para tu período académico. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/inscribirse-a-materias/\" title=\"Inscribirse a materias\"\u003eInscribirse →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"exámenes\"\u003eExámenes\u003c/h2\u003e\n\u003ch4 id=\"inscribirte-en-un-examen\"\u003eInscribirte en un examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás inscribirte en un examen. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/examenes/inscripcion-examen/\" title=\"Inscribite a un examen\"\u003eInscribite →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"pagos\"\u003ePagos\u003c/h2\u003e\n\u003ch4 id=\"acceder-a-la-aplicación-de-pagos-electrónicos\"\u003eAcceder a la aplicación de pagos electrónicos\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás acceder a la aplicación que se utiliza para realizar y consultar los pagos relacionados con tu vida académica. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/pagos/acceder-aplicacion/\" title=\"Acceder a la aplicación\"\u003eAcceder →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"simular-precios\"\u003eSimular precios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar una simulación de pago de tus aranceles. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/pagos/simulador-precios/\" title=\"Simular precios\"\u003eSimular →\u003c/a\u003e\u003c/p\u003e\n"},{id:23,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/introduction/",title:"Conoce más sobre el portal de estudiantes disponible en tu dispositivo móvil",description:"Introducción funcional al nuevo sistema de promociones comerciales.",content:"\u003ch2 id=\"cursado\"\u003eCursado\u003c/h2\u003e\n\u003ch4 id=\"consultar-historial-de-materias-de-la-carrera\"\u003eConsultar historial de materias de la carrera\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar e de materias de la carrera. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-historial-materias/\" title=\"Consultar historial\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-calendario-académicoagenda\"\u003eConsultar calendario académico/agenda\u003c/h4\u003e\n\u003cp\u003eUsando esta funcionalidad puedes acceder de manera sencilla a tu agenda de próximos exámenes y eventos en general. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-agenda/\" title=\"Consultar calendario\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"exámenes\"\u003eExámenes\u003c/h2\u003e\n\u003ch4 id=\"consultar-últimas-notas-obtenidas\"\u003eConsultar últimas notas obtenidas\u003c/h4\u003e\n\u003cp\u003eDesde la aplicación podrás consultar las últimas notas obtenidas en tus últimos exámenes. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-notas/\" title=\"Consultar notas\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribirse-a-un-examen\"\u003eInscribirse a un examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás inscribirte a un examen. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/examenes/inscribirse-examen/\" title=\"Inscríbite a un examen\"\u003eInscríbete →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"anular-la-inscripción-a-un-examen\"\u003eAnular la inscripción a un examen\u003c/h4\u003e\n\u003cp\u003eSi por algún motivo te das cuenta que no puedes rendir un examen en el que te inscribiste puedes anular dicha inscripción. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/examenes/anular-inscripcion/\" title=\"Anular inscripción\"\u003eAnular →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-el-historial-de-inscripciones-a-exámenes\"\u003eConsultar el historial de inscripciones a exámenes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar todos los exámenes a los que te has inscripto. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-historial-inscripciones/\" title=\"Consultar historial de inscripciones\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"pagos\"\u003ePagos\u003c/h2\u003e\n\u003ch4 id=\"realizar-pagos\"\u003eRealizar pagos\u003c/h4\u003e\n\u003cp\u003eDesde esta app podrás acceder al portal de pagos electrónicos de aranceles, matrículas y otros conceptos. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/pagos/realizar-pago/\" title=\"Pagar aranceles\"\u003ePagar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"más-opciones\"\u003eMás opciones\u003c/h2\u003e\n\u003ch4 id=\"navegar-la-aplicación\"\u003eNavegar la aplicación\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás conocer más sobre las funcionalidades que tiene la aplicación. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/editar-perfil-movil/\" title=\"Navegar la aplicación\"\u003eNavegar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"ver-tu-perfil\"\u003eVer tu perfil\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás ver tu perfil. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/editar-perfil-movil/\" title=\"Ver tu perfil\"\u003eVer →\u003c/a\u003e\u003c/p\u003e\n"},{id:24,href:"https://bitlogic.github.io/doks-algarrobo/docs/examenes/introduction/",title:"Conoce más sobre exámenes",description:null,content:"\u003ch2 id=\"configuración\"\u003eConfiguración\u003c/h2\u003e\n\u003ch4 id=\"gestionar-enunciados\"\u003eGestionar enunciados\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás gestionar enunciados. \u003ca href=\"/doks-algarrobo/docs/examenes/configuracion/gestionar-enunciados/\" title=\"Gestionar enunciados\"\u003eGestionar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-tipo-de-examen\"\u003eCrear tipo de examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear un tipo de examen. \u003ca href=\"/doks-algarrobo/docs/examenes/configuracion/crear-tipo-examen/\" title=\"Crear examen\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"instancia-de-examen\"\u003eInstancia de examen\u003c/h2\u003e\n\u003ch4 id=\"rendir-un-examen\"\u003eRendir un examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad rendir un examen. \u003ca href=\"/doks-algarrobo/docs/examenes/instancia-examen/rendir-examen/\" title=\"Rendir examen\"\u003eRendir →\u003c/a\u003e\u003c/p\u003e\n"},{id:25,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/introduction/",title:"Conoce más sobre nuestro Planificador",description:"Introducción funcional al nuevo sistema de promociones comerciales.",content:"\u003ch2 id=\"gestión-de-cátedras\"\u003eGestión de cátedras\u003c/h2\u003e\n\u003ch4 id=\"crear-una-cátedra-presencial\"\u003eCrear una cátedra presencial\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear una cátedra presencial. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-catedra-presencial/\" title=\"Crear cátedra\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-una-cátedra-virtual\"\u003eCrear una cátedra virtual\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear una cátedra virtual. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-catedra-virtual/\" title=\"Crear cátedra\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-seminario-experimenta\"\u003eCrear seminario Experimenta\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear un seminario Experimenta. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-seminario-experimenta/\" title=\"Crear seminario\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-otros-seminarios\"\u003eCrear otros seminarios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear otros seminarios. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-otros-seminarios/\" title=\"Crear otros seminarios\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-cátedras\"\u003eBuscar cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar cátedras. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"abrir-cátedras\"\u003eAbrir cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás abrir cátedras. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-cátedras\"\u003eEditar cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar cátedras. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"descargar-archivo-en-csv-co-docente\"\u003eDescargar archivo en CSV (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás descargar el archivo en CSV. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/descargar-archivo-csv/\" title=\"Descargar archivo\"\u003eDescargar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-y-asignar-docentes-co-docente\"\u003eBuscar y asignar docentes (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar y asignar docentes. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-asignar-docentes/\" title=\"Buscar docentes\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"ver-estudiantes-con-inscripción-en-cada-cátedra-mesa-de-ayuda\"\u003eVer estudiantes con inscripción en cada cátedra (mesa de ayuda)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás ver estudiantes que se inscribieron en las cátedras. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/ver-estudiantes-inscriptos/\" title=\"Ver estudiantes\"\u003eVer →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"mover-estudiantes-de-una-cátedra-a-otra-de-manera-masiva-área-de-planificación\"\u003eMover estudiantes de una cátedra a otra de manera masiva (área de planificación)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás ver cambiar de cátedra a todos las personas que se encuentren inscripta en otra. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/mover-estudiantes/\" title=\"Mover estudiantes\"\u003eCambiar de cátedra →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"mover-estudiantes-de-una-cátedra-a-otra\"\u003eMover estudiantes de una cátedra a otra\u003c/h4\u003e\n\u003cp\u003eSi un estudiante se contacta porque desea cambiarse de cátedra, puedes usar esta funcionalidad para realizar el cambio. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/mover-estudiantes-individual/\" title=\"Mover estudiantes de una cátedra a otra\"\u003eCambiar de cátedra →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"importación-de-cátedras\"\u003eImportación de cátedras\u003c/h2\u003e\n\u003ch4 id=\"importar-cátedras\"\u003eImportar cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás importar cátedras presenciales y a distancia. \u003ca href=\"/doks-algarrobo/docs/planificacion/importar-catedras/\" title=\"Importar cátedras\"\u003eImportar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"habilitación-de-inscripciones\"\u003eHabilitación de inscripciones\u003c/h2\u003e\n\u003ch4 id=\"gestionar-apertura-masiva-de-cátedras-por-períodos\"\u003eGestionar apertura masiva de cátedras por períodos\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás habilitar de manera masiva la inscripción a las cátedras para que los estudiantes se puedan inscribir para un período particular. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-periodos/gestionar-periodos/\" title=\"Gestionar períodos\"\u003eGestionar →\u003c/a\u003e\u003c/p\u003e\n"},{id:26,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/introduction/",title:"Conocé más sobre gestión de ingresos",description:"Introducción funcional al nuevo sistema de promociones comerciales.",content:"\u003ch2 id=\"promociones-financieras\"\u003ePromociones financieras\u003c/h2\u003e\n\u003ch4 id=\"consultar-promociones-financieras\"\u003eConsultar promociones financieras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las promociones financieras disponibles. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-financieras/consultar-promosfinancieras/\" title=\"Consultar\"\u003eConsultar →\n\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-promociones-financieras\"\u003eEditar promociones financieras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar las promociones financieras disponibles. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-financieras/editar-promosfinancieras/\" title=\"Editar\"\u003eEditar →\n\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"medios-de-pago\"\u003eMedios de pago\u003c/h2\u003e\n\u003ch4 id=\"consultar-medios-de-pago\"\u003eConsultar medios de pago\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar los medios de pago disponibles. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/medios-pago/consultar-mediosdepago/\" title=\"Consultar\"\u003eConsultar →\n\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-medios-de-pago\"\u003eEditar medios de pago\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar los medios de pago disponibles. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/medios-pago/editar-mediosdepago/\" title=\"Editar\"\u003eEditar →\n\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"reportes\"\u003eReportes\u003c/h2\u003e\n\u003ch4 id=\"consultar-tickets\"\u003eConsultar tickets\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta puedes consultar las promociones comerciales que se aplicarán a los tickets. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/reportes/consultar-tickets/\" title=\"Buscar tickets\"\u003eBuscar →\n\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"obtener-reporte-de-promociones-comerciales\"\u003eObtener reporte de promociones comerciales\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta puedes obtener un reporte personalizado de las promociones comerciales que se aplicarán a los tickets. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/reportes/reporte-promociones-comerciales/\" title=\"Obtener reporte de promociones\"\u003eBuscar promociones →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"promociones-comerciales\"\u003ePromociones comerciales\u003c/h2\u003e\n\u003ch4 id=\"crear-promociones-comerciales\"\u003eCrear promociones comerciales\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/crear-promos/\" title=\"Crear\"\u003eCrear →\n\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-promociones-comerciales\"\u003eBuscar promociones comerciales\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar las promociones comerciales que se hayan generado anteriormente. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/buscar-promos/\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-promociones-comerciales\"\u003eEditar promociones comerciales\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar los cambios que consideres necesarios tanto en la información general de una promoción, como en sus reglas o criterios relacionados. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/editar-promos/\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"becas-y-beneficios\"\u003eBecas y beneficios\u003c/h2\u003e\n\u003ch4 id=\"crear-becas-y-beneficios\"\u003eCrear becas y beneficios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás registrar nuevas becas y beneficios. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/crear-becas/\" title=\"Crear\"\u003eCrear →\n\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-becas-y-beneficios\"\u003eBuscar becas y beneficios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar todas las becas y los beneficios que se han registrado en el sistema. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/buscar-becas/\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-becas-y-beneficios\"\u003eEditar becas y beneficios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar cambios en becas y beneficios que se hayan creado en otro momentos. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/editar-becas/\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asignar-o-rechazar-el-otorgamiento-de-becas-y-beneficios-a-estudiantes\"\u003eAsignar o rechazar el otorgamiento de becas y beneficios a estudiantes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar de manera individual la asignación o rechazo de becas o beneficios a los estudiantes. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-individual/\"\u003eAsignar o rechazar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asignar-o-rechazar-masivamente-el-otorgamiento-de-becas-y-beneficios-a-estudiantes\"\u003eAsignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar de manera masiva la asignación o rechazo de becas o beneficios a los estudiantes. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-masivo/\"\u003eAsignar o rechazar →\u003c/a\u003e\u003c/p\u003e\n"},{id:27,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/introduction/",title:"Conocé más sobre oferta académica",description:"Introducción Exámenes....",content:"\u003ch2 id=\"gestión-de-paquetes-de-estudio\"\u003eGestión de paquetes de estudio\u003c/h2\u003e\n\u003ch4 id=\"buscar-paquetes\"\u003eBuscar paquetes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar paquetes de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/buscar-paquetes/\" title=\"Buscar paquetes\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-paquetes\"\u003eCrear paquetes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear paquetes de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/crear-paquetes/\" title=\"Crear paquetes\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-paquetes\"\u003eEditar paquetes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar paquetes de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/editar-paquetes/\" title=\"Editar paquetes\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"gestión-de-clases-de-estudio\"\u003eGestión de clases de estudio\u003c/h2\u003e\n\u003ch4 id=\"buscar-clases-de-estudio\"\u003eBuscar clases de estudio\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar clases de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/buscar-clases-estudio/\" title=\"Buscar clases\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asociar-paquetes-a-clases\"\u003eAsociar paquetes a clases\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás asociar paquetes a clases. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/asociar-paquetes-clases/\" title=\"Asociar paquetes\"\u003eAsociar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-paquetes-1\"\u003eEditar paquetes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar paquetes de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/editar-paquetes-clases/\" title=\"Editar paquetes\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"gestión-de-carreras\"\u003eGestión de carreras\u003c/h2\u003e\n\u003ch4 id=\"buscar-carreras\"\u003eBuscar carreras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar carreras (marketing). \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/buscar-carreras/\" title=\"Buscar carreras\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-paquetes-asociados\"\u003eConsultar paquetes asociados\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar paquetes asociados. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/consultar-paquetes-asociados/\" title=\"Consultar paquetes\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-sedescau-asociados\"\u003eConsultar sedes/CAU asociados\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar sedes/CAU asociados. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/consultar-sedes/\" title=\"Consultar sedes/CAU\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-productos-asociados-a-un-sitecau\"\u003eEditar productos asociados a un site/CAU\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar productos asociados a un site/CAU. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/editar-productos/\" title=\"Editar productos\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asociar-sedescau-a-carreras\"\u003eAsociar sedes/CAU a carreras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás asociar sedes/CAU a carreras. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/asociar-sedes/\" title=\"Asociar sedes/CAU\"\u003eAsociar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"sedescau\"\u003eSedes/CAU\u003c/h2\u003e\n\u003ch4 id=\"buscar-sedescau\"\u003eBuscar sedes/CAU\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar sedes/CAU. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/sedes-cau/buscar-sedes/\" title=\"Buscar sedes/CAU\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-carreras-ofrecidas-en-cada-sedecau\"\u003eConsultar carreras ofrecidas en cada sede/CAU\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar carreras ofrecidas en cada sede/CAU. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/sedes-cau/consultar-carreras-ofrecidas/\" title=\"Consultar carreras\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"gestión-oferta-académica\"\u003eGestión oferta académica\u003c/h2\u003e\n\u003ch4 id=\"buscar-ofertas-académicas\"\u003eBuscar ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-ofertas-academicas/\" title=\"Buscar ofertas\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-ofertas-académicas\"\u003eCrear ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/crear-ofertas-academicas/\" title=\"Crear ofertas\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-ofertas-académicas\"\u003eEditar ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/editar-ofertas-academicas/\" title=\"Editar ofertas\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"obtener-reporte-de-oferta-académica\"\u003eObtener reporte de oferta académica\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás obtener un reporte de oferta académica. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/obtener-reporte/\" title=\"Obtener reporte\"\u003eObtener →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-carreras-asociadas-a-ofertas-académicas\"\u003eBuscar carreras asociadas a ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar carreras asociadas a ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-carreras-asociadas-oferta/\" title=\"Buscar carreras\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-sedescau-asociadas-a-ofertas-académicas\"\u003eBuscar sedes/CAU asociadas a ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar sedes/CAU asociadas a ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-sedes-asociadas-oferta/\" title=\"Buscar sedes\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-precios-de-carreras\"\u003eConsultar precios de carreras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar precios de carreras. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/consultar-precios-carreras/\" title=\"Consultar precios\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"sincronizar-oferta-académica\"\u003eSincronizar oferta académica\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás sincronizar la oferta académica. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/sincronizar-oferta/\" title=\"Sincronizar oferta\"\u003eSincronizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asociar-carreras-a-ofertas-académicas\"\u003eAsociar carreras a ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás asociar carreras a ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/asociar-carreras-ofertas/\" title=\"Asociar carreras\"\u003eAsociar →\u003c/a\u003e\u003c/p\u003e\n"},{id:28,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/introduction/",title:"Conocé más sobre pagos electrónicos",description:null,content:"\u003ch2 id=\"historial-de-pagos\"\u003eHistorial de pagos\u003c/h2\u003e\n\u003ch4 id=\"consultar-tu-historial-de-pagos-estudiante\"\u003eConsultar tu historial de pagos (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta podrás consultar tu historial de pagos. \u003ca href=\"/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-estudiante/\" title=\"Consultar historial\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-el-historial-de-pagos-de-un-estudiante-mesa-de-ayuda\"\u003eConsultar el historial de pagos de un estudiante (mesa de ayuda)\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta podrás consultar tu historial de pagos. \u003ca href=\"/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-asistente/\" title=\"Consultar historial\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"cuenta\"\u003eCuenta\u003c/h2\u003e\n\u003ch4 id=\"consultar-el-estado-de-tu-cuenta-estudiante\"\u003eConsultar el estado de tu cuenta (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta podrás consultar el estado de tu cuenta. \u003ca href=\"/doks-algarrobo/docs/epagos/cuenta/consultar-cuenta-estudiante/\" title=\"Consultar cuenta\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-el-estado-de-la-cuenta-de-un-estudiante-co-docente\"\u003eConsultar el estado de la cuenta de un estudiante (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta podrás consultar el estado de la cuenta de un estudiante. \u003ca href=\"/doks-algarrobo/docs/epagos/cuenta/consultar-cuenta-asistente/\" title=\"Consultar cuenta\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"matrícula-y-aranceles\"\u003eMatrícula y aranceles\u003c/h2\u003e\n\u003ch4 id=\"consultar-tus-tickets-pendientes-de-pago-estudiante\"\u003eConsultar tus tickets pendientes de pago (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar tus tickets pendientes de pago. \u003ca href=\"/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar tickets\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-los-tickets-pendientes-de-pago-de-un-estudiante-co-docente\"\u003eConsultar los tickets pendientes de pago de un estudiante (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar los tickets pendientes de pago de un estudiante. \u003ca href=\"/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-asistente/\" title=\"Consultar tickets\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"pago-a-cuenta\"\u003ePago a cuenta\u003c/h2\u003e\n\u003ch4 id=\"cargar-saldo-a-tu-cuenta-estudiante\"\u003eCargar saldo a tu cuenta (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás cargar saldo a tu cuenta. \u003ca href=\"/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-estudiante/\" title=\"Cargar Saldo\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"cargar-saldo-a-la-cuenta-de-un-estudiante-co-docente\"\u003eCargar saldo a la cuenta de un estudiante (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás cargar saldo a la cuenta de un estudiante. \u003ca href=\"/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-asistente/\" title=\"Cargar Saldo\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"otros\"\u003eOtros\u003c/h2\u003e\n\u003ch4 id=\"realizar-otros-pagos-estudiante\"\u003eRealizar otros pagos (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar otros pagos. \u003ca href=\"/doks-algarrobo/docs/epagos/otros/realizar-otros-pagos-estudiante/\" title=\"Realizar pagos\"\u003ePagar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"realizar-otros-pagos-del-estudiante-co-docente\"\u003eRealizar otros pagos del estudiante (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar otros pagos del estudiante. \u003ca href=\"/doks-algarrobo/docs/epagos/otros/realizar-otros-pagos-asistente/\" title=\"Realizar pagos\"\u003ePagar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"políticas-de-seguridad\"\u003ePolíticas de seguridad\u003c/h2\u003e\n\u003ch4 id=\"consultar-las-políticas-de-seguridad\"\u003eConsultar las políticas de seguridad\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las políticas de seguridad. \u003ca href=\"/doks-algarrobo/docs/epagos/politicas-seguridad/consultar-politicas/\" title=\"Consultar políticas\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-los-canales-de-contacto\"\u003eConsultar los canales de contacto\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar los canales de contacto. \u003ca href=\"/doks-algarrobo/docs/epagos/politicas-seguridad/consultar-canales-contacto/\" title=\"Consultar canales\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"métodos-de-pagos\"\u003eMétodos de pagos\u003c/h2\u003e\n\u003ch4 id=\"consultar-formas-de-pago\"\u003eConsultar formas de pago\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las distintas formas de pago. \u003ca href=\"/doks-algarrobo/docs/epagos/metodos-pago/consultar-formas-pago/\" title=\"Consultar formas de pago\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"editar-facturación\"\u003eEditar facturación\u003c/h2\u003e\n\u003ch4 id=\"editar-contacto-de-facturación\"\u003eEditar contacto de facturación\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar tu contacto de facturación. \u003ca href=\"/doks-algarrobo/docs/epagos/editar-facturacion/editar-contacto/\" title=\"Editar contacto\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n"},{id:29,href:"https://bitlogic.github.io/doks-algarrobo/docs/examenes/configuracion/",title:"Configuración",description:null,content:"\u003ch4 id=\"gestionar-enunciados\"\u003eGestionar enunciados\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás gestionar enunciados. \u003ca href=\"/doks-algarrobo/docs/examenes/configuracion/gestionar-enunciados/\" title=\"Gestionar enunciados\"\u003eGestionar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-tipo-de-examen\"\u003eCrear tipo de examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear un tipo de examen. \u003ca href=\"/doks-algarrobo/docs/examenes/configuracion/crear-tipo-examen/\" title=\"Crear examen\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n"},{id:30,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/cuenta/",title:"Cuenta",description:null,content:"\u003ch4 id=\"consultar-el-estado-de-tu-cuenta-estudiante\"\u003eConsultar el estado de tu cuenta (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta podrás consultar el estado de tu cuenta. \u003ca href=\"/doks-algarrobo/docs/epagos/cuenta/consultar-cuenta-estudiante/\" title=\"Consultar cuenta\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-el-estado-de-la-cuenta-de-un-estudiante-co-docente\"\u003eConsultar el estado de la cuenta de un estudiante (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta podrás consultar el estado de la cuenta de un estudiante. \u003ca href=\"/doks-algarrobo/docs/epagos/cuenta/consultar-cuenta-asistente/\" title=\"Consultar cuenta\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:31,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/",title:"Cursado",description:null,content:"\u003ch4 id=\"consultar-carreras-yo-historial-de-cursado\"\u003eConsultar carreras y/o historial de cursado\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las carreras y/o el historial de cursado. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-carreras-e-historial-cursado/\" title=\"Consultar carreras\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-calendario-académicoagenda\"\u003eConsultar calendario académico/agenda\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar el calendario académico. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/\" title=\"Consultar calendario\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-el-historial-de-inscripciones-a-exámenes\"\u003eConsultar el historial de inscripciones a exámenes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar el calendario académico. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-historial-inscripciones/\" title=\"Consultar historial\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribirse-a-materias\"\u003eInscribirse a materias\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás inscribirte en las materias que tengas habilitadas para tu período académico. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/inscribirse-a-materias/\" title=\"Inscribirse a materias\"\u003eInscribirse →\u003c/a\u003e\u003c/p\u003e\n"},{id:32,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/cursado/",title:"Cursado - Móvil",description:null,content:"\u003ch4 id=\"consultar-historial-de-materias-de-la-carrera\"\u003eConsultar historial de materias de la carrera\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar el historial de materias de la carrera. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-historial-materias/\" title=\"Consultar historial\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-calendario-académicoagenda\"\u003eConsultar calendario académico/agenda\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar el calendario académico. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-agenda/\" title=\"Consultar calendario\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:33,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/",title:"Diseñar, editar y visualizar un Plan de Estudio",description:null,content:"\u003ch4 id=\"visualización-de-planes-de-estudio\"\u003eVisualización de planes de estudio\u003c/h4\u003e\n\u003cp\u003eLocaliza una \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e y visualiza detalles tales como el \u003cstrong\u003eTítulo final\u003c/strong\u003e a obtener, el \u003cstrong\u003eTítulo intermedio\u003c/strong\u003e si lo hubiere, la \u003cstrong\u003eResolución rectoral\u003c/strong\u003e y la \u003cstrong\u003eResolución ministerial\u003c/strong\u003e además de todas las materias que conforman la carrera de acuerdo al Plan de estudios localizado. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"diseño-de-planes-de-estudio\"\u003eDiseño de planes de estudio\u003c/h4\u003e\n\u003cp\u003eEl \u0026ldquo;Administrador de carreras\u0026rdquo; permite diseñar o armar un Plan de Estudio para una carrera en particular que luego será listado como un plan existente a visualizar o editar. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"edición-de-planes-de-estudio\"\u003eEdición de planes de estudio\u003c/h4\u003e\n\u003cp\u003eLuego de efectuar una búsqueda para localizar un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e, el \u0026ldquo;Administrador de carreras\u0026rdquo; te permite modificar algunos de los \u003cstrong\u003eAtributos\u003c/strong\u003e de dicho plan . \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"clonación-de-planes-de-estudio\"\u003eClonación de planes de estudio\u003c/h4\u003e\n\u003cp\u003eEl \u0026ldquo;Administrador de carreras\u0026rdquo; te permite clonar un Plan de Estudio de una carrera determinada para reutilizar atributos o las materias que lo componen. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar →\u003c/a\u003e\u003c/p\u003e\n"},{id:34,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/",title:"Docentes, bedeles y supervisores",description:null,content:"\u003ch4 id=\"abrir-la-clase-y-generar-el-código-qr\"\u003eAbrir la clase y generar el código QR\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás abrir la clase y generar el código QR para el registro de asistencia de los estudiantes. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/abrir-clase/\" title=\"Abrir clase\"\u003eAbrir →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-asistencia-con-la-app-o-con-la-botonera\"\u003eVisualizar asistencia con la App o con la Botonera\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás visualizar la asistencia a clases de los estudiantes ya sea mediante la app o mediante la Botonera. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/visualizar-asistencia/\" title=\"Visualizar asistencia con la App o con la Botonera\"\u003eVisualizar la asistencia con la App o con la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-y-registrar-asistencia-de-una-clase-abierta-con-la-app-o-con-la-botonera\"\u003eEditar y registrar asistencia de una clase Abierta con la App o con la Botonera\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar y registrar la asistencia a clases de los estudiantes de forma manual mediante la App \u003cstrong\u003eRegistro de Asistencia\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-abierta/\" title=\"Editar o Registrar asistencia de clase Abierta con la App o con la Botonera\"\u003eEditar o Registrar asistencia de clase Abierta con la App o con la Botonera →\u003c/a\u003e\u003c/p\u003e\n\u003ch5 id=\"editar-y-registrar-la-asistencia-de-una-clase-cerrada-con-la-app-o-con-la-botonera\"\u003eEditar y registrar la asistencia de una clase Cerrada con la App o con la Botonera\u003c/h5\u003e\n\u003cp\u003eCon esta funcionalidad podrás registrar y también modificar la asistencia de los estudiantes a un módulo o a toda una clase aún cuando haya finalizado mediante la App \u003cstrong\u003eRegistro de Asistencia\u003c/strong\u003e o con la Botonera. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-cerrada/\" title=\"Registrar o editar asistencia de clase finalizada con la App o con la Botonera\"\u003eRegistrar o Editar asistencia de clase finalizada con la App o con la Botonera→\u003c/a\u003e\u003c/p\u003e\n"},{id:35,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/editar-facturacion/",title:"Editar facturación",description:null,content:"\u003ch4 id=\"editar-contacto-de-facturación\"\u003eEditar contacto de facturación\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar tu contacto de facturación. \u003ca href=\"/doks-algarrobo/docs/epagos/editar-facturacion/editar-contacto/\" title=\"Editar contacto\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n"},{id:36,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/",title:"Estudiantes",description:null,content:"\u003ch4 id=\"registrar-la-asistencia-a-un-módulo\"\u003eRegistrar la asistencia a un módulo\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás registrar tu asistencia a un módulo simplemente escaneando un código QR con tu app móvil. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/estudiantes/registrar-asistencia/\" title=\"Registrar asistencia\"\u003eRegistrar asistencia→\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visulaizar-la-asistencia-a-un-módulo-o-más-módulos\"\u003eVisulaizar la asistencia a un módulo o más módulos\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás visualizar tu asistencia a uno o más módulos mediante el uso de la App móvil S21. \u003ca href=\"/doks-algarrobo/docs/registro-asistencia/estudiantes/visualizar-asistencia-estudiante/\" title=\"Visualizar asistencia\"\u003eVisualizar asistencia con la App móvil →\u003c/a\u003e\u003c/p\u003e\n"},{id:37,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/examenes/",title:"Exámenes",description:null,content:"\u003ch4 id=\"inscribirse-a-un-examen\"\u003eInscribirse a un examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás inscribirte a un examen. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/examenes/inscripcion-examen/\" title=\"Inscribite a un examen\"\u003eInscribite →\u003c/a\u003e\u003c/p\u003e\n"},{id:38,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/",title:"Exámenes - Móvil",description:null,content:"\u003ch4 id=\"consultar-últimas-notas-obtenidas\"\u003eConsultar últimas notas obtenidas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las últimas notas obtenidas de los exámenes. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-notas/\" title=\"Consultar notas\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribirse-a-un-examen\"\u003eInscribirse a un examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás inscribirte a un examen. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/examenes/inscribirse-examen/\" title=\"Inscríbete a un examen\"\u003eInscríbete →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"anular-la-inscripción-a-un-examen\"\u003eAnular la inscripción a un examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás anular la inscripción de un examen. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/examenes/anular-inscripcion/\" title=\"Anular inscripción\"\u003eAnular →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-el-historial-de-inscripciones-a-exámenes\"\u003eConsultar el historial de inscripciones a exámenes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar el historial de inscripciones a exámenes. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-historial-inscripciones/\" title=\"Consultar historial de inscripciones\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:39,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-carreras/",title:"Gestión de carreras",description:null,content:"\u003ch4 id=\"buscar-carreras\"\u003eBuscar carreras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar carreras (marketing). \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/buscar-carreras/\" title=\"Buscar carreras\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-paquetes-asociados\"\u003eConsultar paquetes asociados\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar paquetes asociados. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/consultar-paquetes-asociados/\" title=\"Consultar paquetes\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-sedescau-asociados\"\u003eConsultar sedes/CAU asociados\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar sedes/CAU asociados. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/consultar-sedes/\" title=\"Consultar sedes/CAU\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-productos-asociados-a-un-sitecau\"\u003eEditar productos asociados a un site/CAU\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar productos asociados a un site/CAU. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/editar-productos/\" title=\"Editar productos\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asociar-sedescau-a-carreras\"\u003eAsociar sedes/CAU a carreras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás asociar sedes/CAU a carreras. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-carreras/asociar-sedes/\" title=\"Asociar sedes/CAU\"\u003eAsociar →\u003c/a\u003e\u003c/p\u003e\n"},{id:40,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/",title:"Gestión de clases de estudio",description:null,content:"\u003ch4 id=\"buscar-clases-de-estudio\"\u003eBuscar clases de estudio\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar clases de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/buscar-clases-estudio/\" title=\"Buscar clases\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asociar-paquetes-a-clases\"\u003eAsociar paquetes a clases\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás asociar paquetes a clases. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/asociar-paquetes-clases/\" title=\"Asociar paquetes\"\u003eAsociar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-paquetes\"\u003eEditar paquetes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar paquetes de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/editar-paquetes-clases/\" title=\"Editar paquetes\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n"},{id:41,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/",title:"Gestión de cátedras",description:null,content:"\u003ch4 id=\"crear-una-cátedra-presencial\"\u003eCrear una cátedra presencial\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear una cátedra presencial. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-catedra-presencial/\" title=\"Crear cátedra\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-una-cátedra-virtual\"\u003eCrear una cátedra virtual\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear una cátedra virtual. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-catedra-virtual/\" title=\"Crear cátedra\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-seminario-experimenta\"\u003eCrear seminario Experimenta\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear un seminario Experimenta. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-seminario-experimenta/\" title=\"Crear seminario\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-otros-seminarios\"\u003eCrear otros seminarios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear otros seminarios. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-otros-seminarios/\" title=\"Crear otros seminarios\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-cátedras\"\u003eBuscar cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar cátedras. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"abrir-cátedras\"\u003eAbrir cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás abrir cátedras. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-cátedras\"\u003eEditar cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar cátedras. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"descargar-archivo-en-csv-codocente\"\u003eDescargar archivo en CSV (Codocente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás descargar el archivo en CSV. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/descargar-archivo-csv/\" title=\"Descargar archivo\"\u003eDescargar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"obtener-reportes-de-cátedras\"\u003eObtener reportes de cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás generar y descargar dos tipos de informes que te ayudarán en la gestión de las cátedras y módulos. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/obtener-reportes/\" title=\"Obtener reportes de cátedras\"\u003eGenerar reportes →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asignar-docentes-codocente\"\u003eAsignar docentes (Codocente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar y asignar docentes. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-asignar-docentes/\" title=\"Buscar docentes\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"ver-estudiantes-con-inscripción-en-cada-cátedra-mesa-de-ayuda\"\u003eVer estudiantes con inscripción en cada cátedra (Mesa de ayuda)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás ver estudiantes que se inscribieron en cada cátedra. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/ver-estudiantes-inscriptos/\" title=\"Ver estudiantes\"\u003eVer →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"mover-estudiantes-de-una-cátedra-a-otra-masivamente\"\u003eMover estudiantes de una cátedra a otra masivamente\u003c/h4\u003e\n\u003cp\u003eSi por algún motivo lo necesitas, con esta funcionalidad podrás ver mover estudiantes de manera masiva de una cátedra a otra. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/mover-estudiantes/\" title=\"Mover estudiantes de una cátedra a otra masivamente\"\u003eLeer →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"mover-estudiantes-de-una-cátedra-a-otra\"\u003eMover estudiantes de una cátedra a otra\u003c/h4\u003e\n\u003cp\u003eSi un estudiante se contacta porque desea cambiarse de cátedra, puedes usar esta funcionalidad para realizar el cambio. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/mover-estudiantes-individual/\" title=\"Mover estudiantes de una cátedra a otra\"\u003eMover →\u003c/a\u003e\u003c/p\u003e\n"},{id:42,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/",title:"Gestión de oferta académica",description:null,content:"\u003ch4 id=\"buscar-ofertas-académicas\"\u003eBuscar ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-ofertas-academicas/\" title=\"Buscar ofertas\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-ofertas-académicas\"\u003eCrear ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/crear-ofertas-academicas/\" title=\"Crear ofertas\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-ofertas-académicas\"\u003eEditar ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/editar-ofertas-academicas/\" title=\"Editar ofertas\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"obtener-reporte-de-oferta-académica\"\u003eObtener reporte de oferta académica\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás obtener un reporte de oferta académica. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/obtener-reporte/\" title=\"Obtener reporte\"\u003eObtener →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-carreras-asociadas-a-ofertas-académicas\"\u003eBuscar carreras asociadas a ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar carreras asociadas a ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-carreras-asociadas-oferta/\" title=\"Buscar carreras\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-sedescau-asociadas-a-ofertas-académicas\"\u003eBuscar sedes/CAU asociadas a ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar sedes/CAU asociadas a ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-sedes-asociadas-oferta/\" title=\"Buscar sedes\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-precios-de-carreras\"\u003eConsultar precios de carreras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar precios de carreras. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/consultar-precios-carreras/\" title=\"Consultar precios\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"sincronizar-oferta-académica\"\u003eSincronizar oferta académica\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás sincronizar la oferta académica. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/sincronizar-oferta/\" title=\"Sincronizar oferta\"\u003eSincronizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asociar-carreras-a-ofertas-académicas\"\u003eAsociar carreras a ofertas académicas\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás asociar carreras a ofertas académicas. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/asociar-carreras-ofertas/\" title=\"Asociar carreras\"\u003eAsociar →\u003c/a\u003e\u003c/p\u003e\n"},{id:43,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/",title:"Gestión de paqetes de estudio",description:null,content:"\u003ch4 id=\"buscar-paquetes\"\u003eBuscar paquetes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar paquetes de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/buscar-paquetes/\" title=\"Buscar paquetes\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"crear-paquetes\"\u003eCrear paquetes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás crear paquetes de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/crear-paquetes/\" title=\"Crear paquetes\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-paquetes\"\u003eEditar paquetes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar paquetes de estudio. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/editar-paquetes/\" title=\"Editar paquetes\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n"},{id:44,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/historial-pagos/",title:"Historial de pagos",description:null,content:"\u003ch4 id=\"consultar-tu-historial-de-pagos-estudiante\"\u003eConsultar tu historial de pagos (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta podrás consultar tu historial de pagos. \u003ca href=\"/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-estudiante/\" title=\"Consultar historial\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-tu-historial-de-pagos-asistente\"\u003eConsultar tu historial de pagos (asistente)\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta podrás consultar tu historial de pagos. \u003ca href=\"/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-asistente/\" title=\"Consultar historial\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:45,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/inscripcion-ingresantes/",title:"Inscripción de ingresantes",description:null,content:"\u003ch4 id=\"inscripción-a-carreras-de-grado-modalidad-presencial\"\u003eInscripción a carreras de grado modalidad presencial\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar la inscripción a carreras de grado que posean la modalidad presencial. \u003ca href=\"/doks-algarrobo/docs/admision/inscripcion-ingresantes/carreras-grado-presencial/\" title=\"Realizar inscripción\"\u003eInscripción →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscripción-a-otras-carreras-con-otras-modalidades\"\u003eInscripción a otras carreras con otras modalidades\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar la inscripción a otras carreras que posean otra modalidad. \u003ca href=\"/doks-algarrobo/docs/admision/inscripcion-ingresantes/carreras-otras-modalidades/\" title=\"Realizar inscripción\"\u003eInscripción →\u003c/a\u003e\u003c/p\u003e\n"},{id:46,href:"https://bitlogic.github.io/doks-algarrobo/docs/examenes/instancia-examen/",title:"Instancia de examen",description:null,content:"\u003ch4 id=\"rendir-un-examen\"\u003eRendir un examen\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad rendir un examen. \u003ca href=\"/doks-algarrobo/docs/examenes/instancia-examen/rendir-examen/\" title=\"Rendir examen\"\u003eRendir →\u003c/a\u003e\u003c/p\u003e\n"},{id:47,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/",title:"Matrícula y aranceles",description:null,content:"\u003ch4 id=\"consultar-tus-tickets-pendientes-de-pago-estudiante\"\u003eConsultar tus tickets pendientes de pago (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar tus tickets pendientes de pago. \u003ca href=\"/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar tickets\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-los-tickets-pendientes-de-pago-de-un-estudiante-co-docente\"\u003eConsultar los tickets pendientes de pago de un estudiante (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar los tickets pendientes de pago de un estudiante. \u003ca href=\"/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-asistente/\" title=\"Consultar tickets\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:48,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/medios-pago/",title:"Medios de pago",description:null,content:"\u003ch4 id=\"consultar-medios-de-pago\"\u003eConsultar medios de pago\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar los medios de pago disponibles. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/medios-pago/consultar-mediosdepago/\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-medios-de-pago\"\u003eEditar medios de pago\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar los medios de pago disponibles. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/medios-pago/editar-mediosdepago/\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n"},{id:49,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/",title:"Más opciones",description:null,content:"\u003ch4 id=\"ver-perfil\"\u003eVer perfil\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás ver tu información de perfil. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/editar-perfil-movil/\" title=\"Ver tu perfil\"\u003eVer →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"iniciar-sesión\"\u003eIniciar sesión\u003c/h4\u003e\n\u003cp\u003eDesde aquí podrás iniciar sesión. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/iniciar-sesion-movil/\" title=\"Iniciar sesión\"\u003eIniciar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"cerrar-sesión\"\u003eCerrar sesión\u003c/h4\u003e\n\u003cp\u003eDesde aquí podrás cerrar sesión. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/cerrar-sesion-movil/\" title=\"Cerrar sesión\"\u003eCerrar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"navegar-la-aplicación\"\u003eNavegar la aplicación\u003c/h4\u003e\n\u003cp\u003eDesde aquí podrás aprender cómo navegar la app de manera fácil y ágil. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/\" title=\"Navegar la aplicación\"\u003eNavegar →\u003c/a\u003e\u003c/p\u003e\n"},{id:50,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/metodos-pago/",title:"Métodos de pago",description:null,content:"\u003ch4 id=\"consultar-formas-de-pago\"\u003eConsultar formas de pago\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las distintas formas de pago. \u003ca href=\"/doks-algarrobo/docs/epagos/metodos-pago/consultar-formas-pago/\" title=\"Consultar formas de pago\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:51,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/mas-opciones/",title:"Navegar el portal y realizar más acciones",description:null,content:"\u003ch4 id=\"navegar-el-portal\"\u003eNavegar el portal\u003c/h4\u003e\n\u003cp\u003eConoce más sobre las secciones del portal y las acciones que puedes realizar desde cada una. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/mas-opciones/navegar-portal/\" title=\"Navegar el portal\"\u003eNavegar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"realizar-más-opciones\"\u003eRealizar más opciones\u003c/h4\u003e\n\u003cp\u003eConsulta los atajos disponibles y las diferentes opciones del menú. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/mas-opciones/menu/\" title=\"Acceder al menú\"\u003eAcceder →\u003c/a\u003e\u003c/p\u003e\n"},{id:52,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/otros/",title:"Otros",description:null,content:"\u003ch4 id=\"realizar-otros-pagos-estudiante\"\u003eRealizar otros pagos (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar otros pagos. \u003ca href=\"/doks-algarrobo/docs/epagos/otros/realizar-otros-pagos-estudiante/\" title=\"Realizar pagos\"\u003ePagar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"realizar-otros-pagos-del-estudiante-co-docente\"\u003eRealizar otros pagos del estudiante (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar otros pagos del estudiante. \u003ca href=\"/doks-algarrobo/docs/epagos/otros/realizar-otros-pagos-asistente/\" title=\"Realizar pagos\"\u003ePagar →\u003c/a\u003e\u003c/p\u003e\n"},{id:53,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/",title:"Pagar cuenta",description:null,content:"\u003ch4 id=\"cargar-saldo-a-tu-cuenta-estudiante\"\u003eCargar saldo a tu cuenta (estudiante)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás cargar saldo a tu cuenta. \u003ca href=\"/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-estudiante/\" title=\"Cargar Saldo\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"cargar-saldo-a-la-cuenta-de-un-estudiante-co-docente\"\u003eCargar saldo a la cuenta de un estudiante (co-docente)\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás cargar saldo a la cuenta de un estudiante. \u003ca href=\"/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-asistente/\" title=\"Cargar Saldo\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:54,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/pagos/",title:"Pago electrónico",description:null,content:"\u003ch4 id=\"acceder-a-la-aplicación-de-pagos-electrónicos\"\u003eAcceder a la aplicación de Pagos Electrónicos\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás acceder a la aplicación. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/pagos/acceder-aplicacion/\" title=\"Acceder a la aplicación\"\u003eAcceder →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"simular-precios\"\u003eSimular precios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar una simulación de pago de tus aranceles. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/pagos/simulador-precios/\" title=\"Simular precios\"\u003eSimular →\u003c/a\u003e\u003c/p\u003e\n"},{id:55,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/pagos/",title:"Pagos - Versión Móvil",description:null,content:"\u003ch4 id=\"acceder-a-la-aplicación-de-pagos-electrónicos\"\u003eAcceder a la aplicación de pagos electrónicos\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar un pago. \u003ca href=\"/doks-algarrobo/docs/portal-alumno-movil/pagos/realizar-pago/\" title=\"Realizar un pago\"\u003ePagar →\u003c/a\u003e\u003c/p\u003e\n"},{id:56,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/politicas-seguridad/",title:"Políticas de seguridad",description:null,content:"\u003ch4 id=\"consultar-las-políticas-de-seguridad\"\u003eConsultar las políticas de seguridad\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las políticas de seguridad. \u003ca href=\"/doks-algarrobo/docs/epagos/politicas-seguridad/consultar-politicas/\" title=\"Consultar políticas\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-los-canales-de-contacto\"\u003eConsultar los canales de contacto\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar los canales de contacto. \u003ca href=\"/doks-algarrobo/docs/epagos/politicas-seguridad/consultar-canales-contacto/\" title=\"Consultar canales\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:57,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/",title:"Promociones comerciales",description:null,content:"\u003ch4 id=\"crear-promociones-comerciales\"\u003eCrear promociones comerciales\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/crear-promos/\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-promociones-comerciales\"\u003eBuscar promociones comerciales\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar las promociones comerciales que se hayan generado anteriormente. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/buscar-promos/\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-promociones-comerciales\"\u003eEditar promociones comerciales\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar los cambios que consideres necesarios tanto en la información general de una promoción, como en sus reglas o criterios relacionados. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/editar-promos/\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n"},{id:58,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-financieras/",title:"Promociones financieras",description:null,content:"\u003ch4 id=\"consultar-promociones-financieras\"\u003eConsultar promociones financieras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar las promociones financieras disponibles. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-financieras/consultar-promosfinancieras/\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-promociones-financieras\"\u003eEditar promociones financieras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar las promociones financieras disponibles. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/promos-financieras/editar-promosfinancieras/\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n"},{id:59,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/",title:"Realizar una solicitud de equivalencias y consultar su Estado",description:null,content:"\u003ch4 id=\"realizar-una-solicitud-de-equivalencia\"\u003eRealizar una solicitud de Equivalencia\u003c/h4\u003e\n\u003cp\u003eSi aspiras a a ser estudiante en Siglo 21 y ya tienes materias aprobadas en nuestra universidad o en otra institución, podrás solicitar que se evalúe la adjudicación de equivalencias en \u003cstrong\u003eSiglo 21\u003c/strong\u003e a través del \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Solicitar Equivalencia\"\u003eSolicitar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-el-estado-de-una-solicitud-de-equivalencia\"\u003eConsultar el Estado de una solicitud de Equivalencia\u003c/h4\u003e\n\u003cp\u003eConsulta el \u003cstrong\u003eEstado\u003c/strong\u003e de tu pedido de equivalencias ingresando al \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e o directamente mediante el enlace proporcionado por la app al ingresar tu solicitud. \u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de Solicitud\"\u003eConsultar Estado →\u003c/a\u003e\u003c/p\u003e\n"},{id:60,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/reportes/",title:"Reportes",description:null,content:"\u003ch4 id=\"consultar-tickets\"\u003eConsultar tickets\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/reportes/consultar-tickets/\" title=\"Buscar tickets\"\u003eBuscar →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch4 id=\"obtener-reporte-de-promociones-comerciales\"\u003eObtener reporte de promociones comerciales\u003c/h4\u003e\n\u003cp\u003eCon esta herramienta puedes obtener un reporte personalizado de las promociones comerciales que se aplicarán a los tickets. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/reportes/reporte-promociones-comerciales/\" title=\"Obtener reporte de promociones\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n"},{id:61,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/",title:"Revisar solicitudes de equivalencias, gestionar reglas de equivalencias y administrar instituciones educativas",description:null,content:"\u003ch4 id=\"añadir-regla-de-equivalencia\"\u003eAñadir Regla de Equivalencia\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás agregar Reglas de Equivalencia para establecer cuáles son la o las Materias o Actividades aprobadas en una institución \u003cem\u003ede Origen\u003c/em\u003e que serán reconocidas como aprobadas por una institución \u003cem\u003ede Destino\u003c/em\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencia\"\u003eAñadir →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-regla-de-equivalencia\"\u003eEditar Regla de Equivalencia\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás edita \u003cstrong\u003eReglas de Equivalencia\u003c/strong\u003e para cambiar algunos de los componentes que indican cuáles son las \u003cstrong\u003eMaterias\u003c/strong\u003e o \u003cstrong\u003eActividades\u003c/strong\u003e aprobadas en una institución \u003cem\u003ede Origen\u003c/em\u003e que serán reconocidas como aprobadas por una institución \u003cem\u003ede Destino\u003c/em\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencia\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-regla-de-equivalencia\"\u003eVisualizar Regla de Equivalencia\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás visualizar \u003cstrong\u003eReglas de Equivalencia\u003c/strong\u003e para conocer cuáles son la o las \u003cstrong\u003eMaterias\u003c/strong\u003e o \u003cstrong\u003eActividades\u003c/strong\u003e aprobadas en una institución \u003cem\u003ede Origen\u003c/em\u003e que serán reconocidas como aprobadas por una institución \u003cem\u003ede Destino\u003c/em\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencia\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"añadir-institución\"\u003eAñadir Institución\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás agrega las universidades o instituciones educativas con sus diferentes \u003cstrong\u003eCarreras\u003c/strong\u003e y \u003cstrong\u003ePlanes de Estudio\u003c/strong\u003e que serán parte de las \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir Institución\"\u003eAñadir →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-institución\"\u003eEditar Institución\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás editar una institución al modificar su \u003cstrong\u003eNombre\u003c/strong\u003e o su condición de institución \u003cem\u003ede Origen\u003c/em\u003e o \u003cem\u003ede Destino\u003c/em\u003e o al añadir una \u003cstrong\u003eCarrera\u003c/strong\u003e con su respectivo \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar Institución\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"eliminar-institución\"\u003eEliminar Institución\u003c/h4\u003e\n\u003cp\u003eElimina instituciones con sus diferentes \u003cstrong\u003eCarreras\u003c/strong\u003e y respectivos \u003cstrong\u003ePlanes de Estudio\u003c/strong\u003e siempre y cuando no exista ninguna \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e que involucre a la institución a eliminar. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar Institución\"\u003eEliminar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-institución\"\u003eVisualizar Institución\u003c/h4\u003e\n\u003cp\u003eVisualiza las universidades o instituciones educativas con sus diferentes \u003cstrong\u003eCarreras\u003c/strong\u003e y \u003cstrong\u003ePlanes de Estudio\u003c/strong\u003e que a su vez son o serán parte de las \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar Institución\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-solicitud-de-equivalencia\"\u003eVisualizar Solicitud de Equivalencia\u003c/h4\u003e\n\u003cp\u003eA través del Módulo \u003cstrong\u003ePedido de Equivalencia\u003c/strong\u003e podrás visualizar las solicitudes de equivalencias que ha recibido la universidad para su análisis y acreditación. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-visualizar-solicitud/\" title=\"Visualizar Solicitud\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"revisar-solicitud-de-equivalencia\"\u003eRevisar Solicitud de Equivalencia\u003c/h4\u003e\n\u003cp\u003eRevisa minuciosamente la documentación presentada por los estudiantes que realizaron \u003cstrong\u003ePedidos de equivalencia\u003c/strong\u003e para luego aprobarla o rechazarla. \u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar Solicitud\"\u003eRevisar →\u003c/a\u003e\u003c/p\u003e\n"},{id:62,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/sedes-cau/",title:"Sedes/CAU",description:null,content:"\u003ch4 id=\"buscar-sedescau\"\u003eBuscar sedes/CAU\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar sedes/CAU. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/sedes-cau/buscar-sedes/\" title=\"Buscar sedes/CAU\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"consultar-carreras-ofrecidas-en-cada-sedecau\"\u003eConsultar carreras ofrecidas en cada sede/CAU\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar carreras ofrecidas en cada sede/CAU. \u003ca href=\"/doks-algarrobo/docs/oferta-academica/sedes-cau/consultar-carreras-ofrecidas/\" title=\"Consultar carreras\"\u003eConsultar →\u003c/a\u003e\u003c/p\u003e\n"},{id:63,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/",title:"Visualizar, crear y editar carreras",description:null,content:"\u003ch4 id=\"visualización-de-carreras\"\u003eVisualización de carreras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás localizar para luego desplegar, y si fuera necesario editar, información acerca de una carrera en particular. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"creación-de-carreras\"\u003eCreación de carreras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes diseñar una carrera nueva con todos sus atributos para que luego sea aprobada como tal por resolución rectoral y ministerial. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"edición-de-carreras\"\u003eEdición de carreras\u003c/h4\u003e\n\u003cp\u003eLuego de localizar una carrera, con esta funcionalidad podrás modificar algunos de sus atributos. \u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n"},{id:64,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/importar-catedras/",title:"Importación de cátedras",description:null,content:"\u003ch4 id=\"importar-cátedras\"\u003eImportar cátedras\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás cargar masivamente datos de cátedras. \u003ca href=\"/doks-algarrobo/docs/planificacion/importar-catedras/importador-de-catedras/\" title=\"Importar cátedras\"\u003eImportar →\u003c/a\u003e\u003c/p\u003e\n"},{id:65,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-periodos/",title:"Habilitación de inscripciones",description:null,content:"\u003ch4 id=\"habilitar-inscripciones\"\u003eHabilitar inscripciones\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás habilitar masivamente las cátedras para su inscripción en un período particular. \u003ca href=\"/doks-algarrobo/docs/planificacion/gestion-periodos/gestionar-periodos/\" title=\"Habilitar isncripciones\"\u003eHabilitar →\u003c/a\u003e\u003c/p\u003e\n"},{id:66,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/",title:"Registrar admisiones",description:null,content:"\u003ch4 id=\"crear-admisión\"\u003eCrear admisión\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes registrar en el sistema los convenios o acuerdos realizados con otras instituciones, empresas o áreas internas de la universidad. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/crear-admisiones/\" title=\"Crear admisión\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-admisión\"\u003eEditar admisión\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar cambios en las admisiones que estén cargadas en el sistema. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/editar-admisiones/\" title=\"Editar admisión\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-admisiones\"\u003eBuscar admisiones\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes buscar las admisiones que están registradas en el sistema. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/buscar-admisiones/\" title=\"Buscar admisiones\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"anular-admisiones\"\u003eAnular admisiones\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes anular las admisiones registradas en el sistema y sus inscripciones relacionadas. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/anular-admisiones/\" title=\"Anular admisiones\"\u003eAnular →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribir-aspirantes-individualmente\"\u003eInscribir aspirantes individualmente\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes inscribir uno por uno aquellas personas que decidan registrarse en la universidad como resultado de un contrato o convenio. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-individualmente/\" title=\"Inscribir aspirantes individualmente\"\u003eInscribir aspirantes individualmente →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"inscribir-aspirantes-masivamente\"\u003eInscribir aspirantes masivamente\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad puedes inscribir aspirantes de manera masiva cuyo origen sea el resultado de los convenios acordados con otras instituciones o departamentos de la universidad. \u003ca href=\"/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-masivamente/\" title=\"Inscribir aspirates masivamente\"\u003eInscribir aspirantes masivamente →\u003c/a\u003e\u003c/p\u003e\n"},{id:67,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/crear-promos/",title:"Crear promociones comerciales",description:"Con esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono \n\n\u003cimg src=\"price.png\" alt=\"price tag icon\" class=\"inlineIcon\"\u003e para que puedas acceder a la pantalla \u0026ldquo;Promociones comerciales\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003e+ NUEVA PROMOCIÓN\u003c/strong\u003e para comenzar.\u003c/li\u003e\n\u003cli\u003eEn la pantalla “Nueva promoción”, comienza a completar los campos con los datos de la promoción que quieres crear. Selecciona en primer lugar si el descuento va a corresponder a un monto fijo o un porcentaje.\u003c/li\u003e\n\u003cli\u003eLuego, completa el nombre y descripción, selecciona el tipo de estudiante, el período y la validez de la promoción.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa definición del tipo de estudiante llamado \"Nuevo inscripto\" hace referencia a un estudiante que acaba de ingresar a la carrera. Mientras que el término \"Re-inscripto\" abarca a aquellos estudiantes que han cursado esa carrera anteriormente.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eActiva la promoción deslizando el botón de \u0026ldquo;Estado\u0026rdquo; hacia la derecha. Para desactivarlo, deslízalo hacia la izquierda. Si se encuentra marcado en verde significa que la promoción está activa.\u003c/li\u003e\n\u003cli\u003eEn la pestaña \u0026ldquo;Tickets\u0026rdquo; puedes optar por el tipo de arancel y tickets a los que afectará esta promoción.\u003c/li\u003e\n\u003cli\u003eDirígete a la pestaña \u0026ldquo;Criterios\u0026rdquo; (ubicada a la derecha de “Tickets”). Aquí podrás configurar las reglas que se considerarán para hacer efectivo el descuento.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLos criterios que definas aquí indican a quiénes aplica y cuál es el monto o porcentaje de la promoción. Por eso es importante aclarar que cada regla \"incluye\" la población destino y al mismo tiempo \"excluye\" al resto de las opciones que no se han mencionado en esa definición. Entonces, si no se definen criterios, la promoción aplica a \"todos\". En cambio, si se incluye al menos una combinación para un segmento de población, habrá que configurar entonces qué sucede con el resto de las opciones que quedan automáticamente excluidas. Para más detalles, ve a la siguiente nota.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003eHaz clic en el icono de \u0026ldquo;Entradas\u0026rdquo; para elegir la población para quiénes aplican estas reglas. Puedes optar entre: Región, Modalidad, SubModalidad, Clase estudio, Carrera, Sede/CAU, Turno, Marca y Paquete. Todas estas opciones tienen listas desplegables.\u003c/li\u003e\n\u003cli\u003eEn las columnas de salida, dentro del campo \u0026ldquo;Valor\u0026rdquo; puedes definir el monto de la promoción o el valor del porcentaje dependiendo del tipo de promoción seleccionado.\u003c/li\u003e\n\u003cli\u003eSi deseas configurar esta promoción para que su aplicación abarque diferentes opciones de población, tendrás que seleccionar el botón \u003cstrong\u003e+ AGREGAR\u003c/strong\u003e y definir estos valores para todos los escenarios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas reglas se aplican con un orden de prioridad de arriba hacia abajo. Puedes agregar tantas reglas como desees. Las siguientes acciones están disponibles en esta grilla:\n\u003cbr\u003e\n\n\u003cb\u003eClonar\u003c/b\u003e: si una regla ya está definida, al hacer clic en este icono puedes copiar debajo exactamente la misma información.\n\u003cbr\u003e\n\n\u003cb\u003eOrdenar\u003c/b\u003e: cuando tengas varias reglas y quieras asignarles un nuevo orden en la grilla, puedes hacer clic en este ícono en el renglón de la regla que deseas mover y arrastrarla hacia su nuevo lugar. La herramienta te informa acerca de esta posibilidad con un mensaje en la parte inferior de la grilla.\n\u003cbr\u003e\n\n\u003cb\u003eEliminar\u003c/b\u003e: usa este botón para eliminar una regla.\n\u003cbr\u003e\n\nPor último, si has incluido varios criterios, será necesario que en la última fila definas cómo se aplicará la promoción a la parte de la población excluida. Si colocas un cero en el campo valor, esto significa que no se desea incluir ningún otro tipo de población a la promoción y si ingresas otro valor (por ejemplo, cinco) este descuento será aplicado al resto de la población que se excluyó en los criterios anteriores.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"12\"\u003e\n\u003cli\u003eUna vez definidos los datos generales de la promoción, los tickets asociados y las reglas o criterios de aplicación haz clic en el botón \u003cstrong\u003eGuardar.\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/buscar-promos/\" title=\"Buscar promociones comerciales\"\u003eBuscar promociones comerciales →\u003c/a\u003e\n\u003c/br\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/editar-promos/\" title=\"Editar promociones comerciales\"\u003eEditar promociones comerciales →\u003c/a\u003e\u003c/p\u003e\n"},{id:68,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/",title:"Becas y beneficios",description:null,content:"\u003ch4 id=\"crear-becas-y-beneficios\"\u003eCrear becas y beneficios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás registrar nuevas becas y beneficios. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/crear-becas/\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"buscar-becas-y-beneficios\"\u003eBuscar becas y beneficios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás consultar todas las becas y los beneficios que se han registrado en el sistema. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/buscar-becas/\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-becas-y-beneficios\"\u003eEditar becas y beneficios\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar cambios en becas y beneficios que se hayan creado en otro momento. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/editar-becas/\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asignar-o-rechazar-el-otorgamiento-de-becas-y-beneficios-a-estudiantes\"\u003eAsignar o rechazar el otorgamiento de becas y beneficios a estudiantes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar de manera individual la asignación o rechazo de becas o beneficios a los estudiantes. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-individual/\"\u003eAsignar o rechazar →\u003c/a\u003e\u003c/p\u003e\n\u003ch4 id=\"asignar-o-rechazar-masivamente-el-otorgamiento-de-becas-y-beneficios-a-estudiantes\"\u003eAsignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes\u003c/h4\u003e\n\u003cp\u003eCon esta funcionalidad podrás realizar de manera masiva la asignación o rechazo de becas o beneficios a los estudiantes. \u003ca href=\"/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-masivo/\"\u003eAsignar o rechazar →\u003c/a\u003e\u003c/p\u003e\n"},{id:69,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/medios-pago/consultar-mediosdepago/",title:"Consultar medios de pago",description:"Con esta funcionalidad podrás buscar los medios de pagos vigentes.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono\n\n\n\u003cimg src=\"payment.png\" alt=\"payment icon\" class=\"inlineIcon\"\u003e para que puedas acceder a la pantalla \u0026ldquo;Medios de pago\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior puedes comenzar a completar el campo de búsqueda con el nombre del medio de pago cuyos detalles deseas ver.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa grilla de búsqueda se irá filtrando automáticamente dependiendo del nombre que ingreses en el campo de búsqueda. Puedes utilizar el icono a la izquierda de los registros para arrastrar los medios de pagos y ubicarlos en el orden que desees.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/medios-pago/editar-mediosdepago/\" title=\"Editar medios de pago\"\u003eEditar medios de pago →\u003c/a\u003e\u003c/p\u003e\n"},{id:70,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/crear-becas/",title:"Crear becas y beneficios",description:"Con esta funcionalidad podrás generar nuevas becas y beneficios para los estudiantes de tu institución.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la aplicación “Gestión de ingresos”.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, haz clic en el icono \n\n\u003cimg src=\"becas.png\" alt=\"becas icon\" class=\"inlineIcon\"\u003e para que puedas acceder a la pantalla “Gestión de becas/beneficios”.\u003c/li\u003e\n\u003cli\u003eEn la parte inferior derecha de la pantalla, posa el cursor sobre el icono de más opciones \n\n\u003cimg src=\"more%20actions.png\" alt=\"more actions icon\" class=\"inlineIcon\"\u003e y presiona el botón de signo más \n\n\u003cimg src=\"plus.png\" alt=\"plus icon\" class=\"inlineIcon\"\u003e. La pantalla “Configuración de becas/beneficios” se abrirá.\u003c/li\u003e\n\u003cli\u003eDesde aquí puedes comenzar a definir los requisitos y a aquellos tipos de estudiantes a quiénes se podrá asignar. En esta ventana verás los siguientes campos y casillas de verificación. Recuerda que aquellos campos marcados con asterisco son obligatorios.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eNombre: define aquí cómo se llamará la beca o el beneficio.\u003c/li\u003e\n\u003cli\u003eDescripción: aquí puedes detallar un resumen del motivo o razón de la beca o el beneficio.\u003c/li\u003e\n\u003cli\u003eTipo de estudiante: las opciones “NI” y “RI” hacen referencia a estudiantes con “Nueva Inscripción” y “Reinscripción” respectivamente.\u003c/li\u003e\n\u003cli\u003eTipo de beca: registra si vas a configurar una beca o un beneficio.\u003c/li\u003e\n\u003cli\u003eClase de estudio: elige el nivel académico del programa de cursado. Por ejemplo, grado o posgrado.\u003c/li\u003e\n\u003cli\u003eConcepto: define si la beca o el beneficio aplica a una matrícula o a un arancel.\u003c/li\u003e\n\u003cli\u003eCantidad de aplazos: registra el número de aplazos máximos que se permiten para que el o la estudiante pueda acceder a la beca o al beneficio.\u003c/li\u003e\n\u003cli\u003ePromedio: si fuese requerido cumplir con un promedio mínimo en las notas obtenidas se debe definir el dato en este campo. Se permiten únicamente valores entre 0 y 10.\u003c/li\u003e\n\u003cli\u003ePorcentaje: el valor porcentual que se va a aplicar sobre el paquete de pago de la matrícula o arancel.\u003c/li\u003e\n\u003cli\u003eDocumentación requerida: en este combo desplegable debes seleccionar las casillas que correspondan para las opciones de tipo de documentación que es necesario tener para poder acceder a la beca o al beneficio. Por ejemplo, foto de DNI, certificado de trabajo, entre otros.\u003c/li\u003e\n\u003cli\u003eRenovable: marca “Sí” o “No” según corresponda. Si la beca o el beneficio se marcan con esta opción significa que la asignación o rechazo no será por única vez sino que es posible que se puede renovar en un período próximo.\u003c/li\u003e\n\u003cli\u003ePermiso para sanciones: marca “Sí” o “No” según corresponda. Si un estudiante tiene sanciones y en la configuración el casillero “Sí” está marcado, significa que aún así puede acceder a la beca o al beneficio.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eUna vez que finalices con la configuración de una beca o un beneficio, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e. El sistema volverá automáticamente a la pantalla de “Gestión de becas/beneficios” y verás en la grilla de búsqueda el nuevo registro que acabas de crear.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/buscar-becas/\" title=\"Buscar becas y beneficios\"\u003eBuscar becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/editar-becas/\" title=\"Editar becas y beneficios\"\u003eEditar becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-individual/\" title=\"Asignar o rechazar el otorgamiento de becas y beneficios a estudiantes\"\u003eAsignar o rechazar el otorgamiento de becas y beneficios a estudiantes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-masivo/\" title=\"Asignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes\"\u003eAsignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes →\u003c/a\u003e\u003c/p\u003e\n"},{id:71,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/buscar-becas/",title:"Buscar becas y beneficios",description:"Con esta funcionalidad podrás buscar todas las becas y beneficios disponibles para los estudiantes de tu institución.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la aplicación “Gestión de ingresos”.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, presiona el icono \n\n\u003cimg src=\"becas.png\" alt=\"becas icon\" class=\"inlineIcon\"\u003e para acceder a la pantalla “Gestión de becas/beneficios”.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, ingresa el nombre de la beca o el beneficio que deseas buscar si lo conoces.\u003c/li\u003e\n\u003cli\u003eTambién puedes filtrar por tipo. Es decir, si lo que quieres consultar es una beca o un beneficio.\u003c/li\u003e\n\u003cli\u003eDe lo contrario, puedes acotar la búsqueda por porcentaje de 0% a 100% deslizando los extremos de la línea. Si ambos extremos coinciden en un punto, el sistema buscará exactamente los registros con ese único valor.\u003c/li\u003e\n\u003cli\u003ePor último, presiona el botón \u003cstrong\u003eBUSCAR\u003c/strong\u003e. Los resultados se podrán ver en la grilla de búsqueda.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn los encabezados de las columnas, puedes optar por ordenar los resultados de “Nombre” y “Porcentaje” y “Tipo” de manera ascendente y descendente presionando las flechas.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eDesde la columna acciones puedes presionar el icono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e para editar la información y el icono de eliminar \n\n\u003cimg src=\"delete.png\" alt=\"delete icon\" class=\"inlineIcon\"\u003e para desactivar la beca o el beneficio.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl borrar una beca o un beneficio se lo inhabilita y deja de estar visible en el listado de resultados de búsquedas.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003ePara más detalles sobre la edición de contenido, lee el artículo “Editar becas y beneficios”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/crear-becas/\" title=\"Crear becas y beneficios\"\u003eCrear becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/editar-becas/\" title=\"Editar becas y beneficios\"\u003eEditar becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-individual/\" title=\"Asignar o rechazar el otorgamiento de becas y beneficios a estudiantes\"\u003eAsignar o rechazar el otorgamiento de becas y beneficios a estudiantes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-masivo/\" title=\"Asignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes\"\u003eAsignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes →\u003c/a\u003e\u003c/p\u003e\n"},{id:72,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/editar-becas/",title:"Editar becas y beneficios",description:"Con esta funcionalidad podrás realizar cambios en becas y beneficios ya cargados.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la aplicación “Gestión de ingresos”.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, accede a la pantalla “Gestión de becas/beneficios” presionando el icono \n\n\u003cimg src=\"becas.png\" alt=\"becas icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, ingresa el nombre de la beca o el beneficio que deseas editar. Otra forma de buscar esta información es por tipo de beneficio o por el porcentaje de descuento que tienen configurado. Para más información sobre la búsqueda, ingresa al enlace del artículo incluido en la sección Véase también.\u003c/li\u003e\n\u003cli\u003ePor último, presiona el botón \u003cstrong\u003eBUSCAR\u003c/strong\u003e. Los resultados se podrán ver en la grilla de búsqueda.\u003c/li\u003e\n\u003cli\u003eUna vez que detectes el registro que quieres modificar, presiona el icono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e. La ventana de “Configuración de becas/beneficios” se abrirá automáticamente.\u003c/li\u003e\n\u003cli\u003eAquí puedes editar los campos con los datos que correspondan.\u003c/li\u003e\n\u003cli\u003eUna vez que finalices con la carga de la información, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara más información sobre los datos que se deben incluir en los campos que se pueden modificar, consulta el documento con instrucciones para “Crear becas y beneficios” cuyo enlace está en la siguiente sección del documento.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/crear-becas/\" title=\"Crear becas y beneficios\"\u003eCrear becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/buscar-becas/\" title=\"Buscar becas y beneficios\"\u003eBuscar becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-individual/\" title=\"Asignar o rechazar el otorgamiento de becas y beneficios a estudiantes\"\u003eAsignar o rechazar el otorgamiento de becas y beneficios a estudiantes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-masivo/\" title=\"Asignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes\"\u003eAsignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes →\u003c/a\u003e\u003c/p\u003e\n"},{id:73,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-financieras/consultar-promosfinancieras/",title:"Consultar promociones financieras",description:"Con Paypertic puedes ver los detalles de las promociones financieras que se aplicarán a los tickets dependiendo de los medios de pago que se elijan.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono \n\n\u003cimg src=\"currency.png\" alt=\"currency icon\" class=\"inlineIcon\"\u003epara que puedas acceder a la pantalla \u0026ldquo;Promociones financieras\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior, ingresa en nombre de la promoción cuyos detalles deseas consultar.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa grilla de búsqueda se irá filtrando automáticamente dependiendo del nombre que ingreses en el campo de búsqueda. En los títulos de las columnas de la grilla puedes usar las flechas para ordenar los datos de manera ascendente o descendente. Desde esta grilla también puedes activar o desactivar una promoción. Además, al hacer clic en el icono de lápiz podrás editar los datos de la promoción seleccionada.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eEn los campos disponibles en la grilla puedes ver los detalles de las promociones como: medio de pago, tasa de interés (si no hay interés, entonces se verá el campo vacío) y cantidad de cuotas disponibles.\u003c/li\u003e\n\u003cli\u003eSi te desplazas hacia abajo hasta el final de la grilla, podrás ver un botón \u003cstrong\u003eVER PROMOCIONES INACTIVAS\u003c/strong\u003e que te servirá para acceder a aquellas promociones que ya no están vigentes al final de la tabla debajo de aquellas promociones que sí están activas.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-financieras/editar-promosfinancieras/\" title=\"Editar promociones financieras\"\u003eEditar promociones financieras →\u003c/a\u003e\u003c/p\u003e\n"},{id:74,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-masivo/",title:"Asignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes",description:"Con esta funcionalidad podrás vincular de manera masiva las becas y los beneficios que creaste con los legajos los estudiantes.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la aplicación “Gestión de ingresos”.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, presiona el icono \n\n\u003cimg src=\"becas.png\" alt=\"becas icon\" class=\"inlineIcon\"\u003e\npara acceder a la pantalla “Gestión de becas/beneficios”.\u003c/li\u003e\n\u003cli\u003eLuego, posa el cursor sobre el ícono de más opciones \n\n\u003cimg src=\"more%20actions.png\" alt=\"more actions icon\" class=\"inlineIcon\"\u003e en la parte inferior derecha de la pantalla.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \n\n\u003cimg src=\"screen%20share.png\" alt=\"screen share 1icon\" class=\"inlineIcon\"\u003e para seleccionar la opción \u003cstrong\u003eCONTROL DE BECAS/BENEFICIOS\u003c/strong\u003e. La pantalla “Control de becas/beneficios” se abrirá.\u003c/li\u003e\n\u003cli\u003ePuedes ingresar el nombre de la beca o el beneficio que deseas verificar si lo conoces o los datos de un período en particular. También puedes filtrar por tipo. Es decir, si lo que quieres consultar es una beca o un beneficio.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa casilla de verificación “Solo pendientes” estará marcada por defecto para que puedas ver aquellos estudiantes que cumplen, en mayor o menor medida, con los requisitos configurados en las becas o en los beneficios y cuyo estado ha sido validado automáticamente por el sistema y están preaprobados o prerrechazados y necesitan una resolución. Si sacas la marca de la casilla, podrás ver todos los trámites que ya fueron controlados y los que se encuentran pendientes de controlar y por consecuencia definir su asignación o rechazo.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003ePor último, presiona el botón \u003cstrong\u003eBUSCAR\u003c/strong\u003e. Los resultados se podrán ver en la grilla de búsqueda.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUsa el botón \u003cb\u003eLimpiar filtros\u003c/b\u003e para realizar una nueva búsqueda y en la pantalla de resultados en la parte inferior izquierda puedes definir la cantidad de registros que verás por página en la pantalla.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eEn la grilla de resultados verás tarjetas con los siguientes datos:\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eIndicador numérico con la cantidad de becas para asignar/rechazar. Es decir que necesitan una resolución por parte del usuario.\u003c/li\u003e\n\u003cli\u003eNombre de la beca o del beneficio.\u003c/li\u003e\n\u003cli\u003eIndicador numérico con la cantidad de aprobaciones y rechazos que tuvo esa beca desde que se creó.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003ePara ver más detalles presiona una tarjeta. Una ventana se abrirá mostrando la siguiente información:\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003eEn la parte superior se incluyen todos los detalles de la configuración. Es decir, los requisitos que se cargaron al momento de crear o editar la beca o el beneficio. Para más información sobre estas acciones, accede a los links de los documentos listados en la sección \u003cstrong\u003eVéase también\u003c/strong\u003e.\n\u003cbr\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLuego verás una grilla con las solapas “Preaprobado”, “Prerrechazado” y “Todos”. En la solapa “Preaprobado” puedes ver aquellos estudiantes que el sistema ha comparado considerando los requisitos de la beca o el beneficio y su legajo académico y cumplen con lo requerido. En “Prerrechazado” puedes observar aquellos candidatos al beneficio o a la beca que el sistema detectó no cumplen con los requisitos. Por último en la tercer pestaña puedes ver, por ejemplo, para un período o una beca o un beneficio particular la cantidad de estudiantes a quiénes se otorgó o rechazó. Desde esta última solapa “Todos”, podrás renovar o volver a asignar becas o rechazarlas también de manera masiva.\n\u003cbr\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eHaz clic en el icono de flecha de los registros en cualquiera de las tres solapas para desplegar más información sobre su legajo como carrera, promedio, etc.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003eUna vez que hayas verificado los datos de la ventana, selecciona aquellos registros de estudiantes de las solapas descriptas anteriormente presionando las casillas de verificación.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePuedes seleccionar la casilla en la parte superior de la grilla para incluir todos los ítems de la página en cada una de las solapas.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"10\"\u003e\n\u003cli\u003eLuego, haz clic en \u003cstrong\u003eASIGNAR\u003c/strong\u003e o \u003cstrong\u003eRECHAZAR\u003c/strong\u003e según corresponda. Una ventana se abrirá para que ingreses un comentario. Este dato no es obligatorio.\u003c/li\u003e\n\u003cli\u003ePara finalizar, presiona \u003cstrong\u003eACEPTAR\u003c/strong\u003e en el mensaje. El sistema mostrará el registro con la resolución que acabas de tomar en la lista de ítems de la solapa \u003cstrong\u003eTODOS\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/crear-becas/\" title=\"Crear becas y beneficios\"\u003eCrear becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/buscar-becas/\" title=\"Buscar becas y beneficios\"\u003eBuscar becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/editar-becas/\" title=\"Editar becas y beneficios\"\u003eEditar becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-individual/\" title=\"Asignar o rechazar el otorgamiento de becas y beneficios a estudiantes\"\u003eAsignar o rechazar el otorgamiento de becas y beneficios a estudiantes →\u003c/a\u003e\u003c/p\u003e\n"},{id:75,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-individualmente/",title:"Inscribir aspirantes individualmente",description:"Con esta funcionalidad puedes sumar estudiantes a la universidad cuyo origen o interés surja de un registro de admisión con la organización o con el departamento con el que se acordó la capacitación o curso.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la pantalla “Admisión masiva”.\u003c/li\u003e\n\u003cli\u003eEn la parte superior, completa los datos para realizar la búsqueda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara más detalles sobre los campos, consulta el artículo llamado “Buscar admisiones” en la sección Véase también.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003ePor último, presiona \u003cstrong\u003eBuscar\u003c/strong\u003e. Los resultados de tu búsqueda se mostrarán en la grilla.\nSelecciona el contrato con el que vas a registrar a los aspirantes. Una ventana con más detalles se abrirá.\u003c/li\u003e\n\u003cli\u003eSelecciona la admisión con la que vas a registrar a los aspirantes. Una ventana con más detalles se abrirá.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa admisión debe estar en estado en proceso/procesado para que puedas cargar esta información.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eHaz clic en el icono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla, ingresa a la solapa “Estudiantes”.\u003c/li\u003e\n\u003cli\u003ePresiona el botón “Agregar un estudiante”. Una ventana se abrirá para que ingreses todos sus datos personales y académicos.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eRecuerda que si son muchos los aspirantes que necesitas cargar es conveniente que lo hagas de manera masiva. Para más datos sobre esta funcionalidad, consulta el artículo relacionado en la sección Véase también.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003ePresiona \u003cstrong\u003eGuardar\u003c/strong\u003e. El registro del estudiante se verá en la pantalla en la grilla de inscriptos y se lo puede editar o eliminar en esta instancia.\u003c/li\u003e\n\u003cli\u003ePor último, si deseas completar este proceso de inscripción, dirígete a la solapa “Validación\u0026quot;, verifica los datos y haz clic en \u003cstrong\u003eFinalizar\u003c/strong\u003e. El estado de la admisión pasará a procesado, los estudiantes estarán inscriptos y ya no podrás realizar cambios sobre este contrato.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/crear-admisiones/\" title=\"Crear admisiones\"\u003eCrear admisión →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/buscar-admisiones/\" title=\"Buscar admisiones\"\u003eBuscar admisiones →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/editar-admisiones/\" title=\"Editar admisiones\"\u003eEditar admisión →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-masivamente/\" title=\"Inscribir aspirantes masivamente\"\u003eInscribir aspirantes masivamente →\u003c/a\u003e\u003c/p\u003e\n"},{id:76,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-masivamente/",title:"Inscribir aspirantes masivamente",description:"Con esta funcionalidad puedes sumar estudiantes a la universidad cuyo origen o interés surjan de un registro de admisión acordado con una organización externa o con un departamento interno de la universidad con el que se acordó la capacitación o curso.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la pantalla “Admisión masiva”.\u003c/li\u003e\n\u003cli\u003eEn la parte superior, completa los datos para realizar la búsqueda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara más detalles sobre los campos, consulta el artículo Buscar admisiones en la sección Véase también.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003ePor último, presiona \u003cstrong\u003eBuscar\u003c/strong\u003e. Los resultados de tu búsqueda se mostrarán en la grilla.\u003c/li\u003e\n\u003cli\u003eSelecciona la admisión sobre la que vas a registrar a los aspirantes. Una ventana con más detalles se abrirá.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa admisión debe estar en estado en proceso/procesado para que puedas cargar esta información.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eHaz clic en el icono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla, ingresa a la solapa “Estudiantes”.\u003c/li\u003e\n\u003cli\u003eEn la sección “Cargar planilla” arrastra y suelta el archivo que completó la institución o área con los aspirantes. Otra forma en la que puedes subir este archivo desde tu computadora es presionando el botón “Cargar planilla”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi deseas agregar algún estudiante más de manera individual, haz clic el botón “Agregar un estudiante”. Una ventana se abrirá para que ingreses todos sus datos personales y académicos. Para más detalles, consulta el artículo relacionado al final de este documento.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eSe te habilitará el campo “Tipo de planilla”, siempre que la oferta no esté seleccionada y podrás completar el dato correspondiente.\u003c/li\u003e\n\u003cli\u003eAl finalizar con la carga de la plantilla, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e. Los registros de los estudiantes se verán en la pantalla en la grilla de inscriptos y se los puede editar o eliminar en esta instancia.\u003c/li\u003e\n\u003cli\u003ePor último, si deseas completar este proceso de inscripción y vinculación con la admisión, dirígete a la solapa “Validación”, verifica los datos y haz clic en Finalizar.\nEl estado de la admisión pasará a Procesado, los estudiantes estarán inscriptos y ya no podrás realizar cambios sobre este registro. Los únicos cambios que se admiten son:\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eModificar el cupo: se puede ampliar, pero no disminuir.\u003c/li\u003e\n\u003cli\u003eAgregar estudiantes: siempre que la admisión tenga cupo disponible. De lo contrario, si se agregan nuevos estudiantes y no hay capacidad en el cupo un error te advertirá de esta situación. En una situación como esta se pueden tomar dos acciones: ampliar el cupo de la admisión o  eliminar aquellos registros de estudiantes que excedan la capacidad.\u003c/li\u003e\n\u003cli\u003eModificar datos de un aspirante que se registró con error: si se agregó un nuevo estudiante y este contiene errores puedes modificar los datos. Recuerda que solo se pueden editar registros en progreso o con errores y no los que ya fueron procesados.\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/crear-admisiones/\" title=\"Crear admisión\"\u003eCrear admisión →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/buscar-admisiones/\" title=\"Buscar admisiones\"\u003eBuscar admisiones →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/editar-admisiones/\" title=\"Editar admisión\"\u003eEditar admisión →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-individualmente/\" title=\"Inscribir aspirantes individualmente\"\u003eInscribir aspirantes individualmente →\u003c/a\u003e\u003c/p\u003e\n"},{id:77,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-individual/",title:"Asignar o rechazar el otorgamiento de becas y beneficios a estudiantes",description:"Con esta funcionalidad podrás vincular las becas y los beneficios con los legajos de un estudiante.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla de “Gestión de becas/beneficios”.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla puedes ver los datos del legajo del estudiante que se ha seleccionado anteriormente.\u003c/li\u003e\n\u003cli\u003eLa pantalla tiene dos solapas “ASIGNAR BECA/BENEFICIO” e “HISTORIAL DE ASIGNACIONES”. Para comenzar con el otorgamiento o rechazo ingresa en la primera solapa.\u003c/li\u003e\n\u003cli\u003eIngresa el nombre de la beca que deseas asociar al estudiante en el campo de búsqueda.\u003c/li\u003e\n\u003cli\u003eUna vez que se carguen los resultados de la búsqueda, en la parte inferior de la pantalla puedes ver los detalles de la configuración de la beca o del beneficio y ver qué tipo de documentación es requerida.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, selecciona el período para el que quieres asignarla o rechazarla.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn esta pantalla puedes ver una etiqueta que te informa si la solicitud se encuentra en estado “Preaprobado” o “Prerrechazado”. El sistema realiza esta validación comparando los datos del legajo del estudiante y los requerimientos definidos en la configuración de la beca o del beneficio. \n\u003cbr\u003e\n\nSi un trámite de asignación se encuentra “Prerrechazado”, en la sección de “Detalle” verás marcado con un icono de alerta aquellos requerimientos que el sistema detectó que no se se cumplen. Al posar el mouse sobre el icono verás una leyenda que dice: “No se cumple este requisito”.\n\u003cbr\u003e\n\nLa persona a cargo de tomar la decisión sobre la asignación o el rechazo de estas becas y estos beneficios puede decidir asignar una beca a pesar de saber que se encuentra en estado “Prerrechazado”; o bien, rechazar una solicitud que se encuentre en estado “Preaprobado”. En ambos casos, se deberá ingresar un comentario u observación con el motivo de esta decisión.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eSi deseas, agrega comentarios en el campo “Observaciones”. Este campo no es obligatorio.\u003c/li\u003e\n\u003cli\u003ePara finalizar, presiona el botón \u003cstrong\u003eASIGNAR\u003c/strong\u003e o \u003cstrong\u003eRECHAZAR\u003c/strong\u003e según corresponda.\u003c/li\u003e\n\u003cli\u003eUn mensaje de confirmación se abrirá en la pantalla. Confirma o cancela la opción seleccionada en el paso anterior.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la solapa “HISTORIAL DE ASIGNACIONES” puedes acceder a un resumen de todas las instancias en las que se aprobó o rechazó la asignación de una beca o beneficio a un estudiante. Haz clic en cada registro o en la flecha () para expandir la sección y ver los detalles de esa solicitud.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/crear-becas/\" title=\"Crear becas y beneficios\"\u003eCrear becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/buscar-becas/\" title=\"Buscar becas y beneficios\"\u003eBuscar becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/editar-becas/\" title=\"Editar becas y beneficios\"\u003eEditar becas y beneficios →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/becas-beneficios/asignar-rechazar-masivo/\" title=\"Asignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes\"\u003eAsignar o rechazar masivamente el otorgamiento de becas y beneficios a estudiantes →\u003c/a\u003e\u003c/p\u003e\n"},{id:78,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/anular-admisiones/",title:"Anular admisiones",description:"Con esta funcionalidad puedes anular una admisión creada en el sistema y los estudiantes que se inscribieron en esa admisión.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la pantalla “Admisión masiva”.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, completa los datos para realizar la búsqueda de aquella admisión que deseas anular. Para más información sobre esta funcionalidad de búsqueda, consulta el artículo relacionado en la sección \u0026ldquo;Véase también al final de este documento.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas admisiones que pueden anularse son aquellas cuyo estado es diferente a Anulado, Procesado (sin cupo disponible) y Finalizado. Los registros que se encuentren en estos estados no se mostrarán habilitados en la grilla.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eEn la grilla de resultados, selecciona el/los casillero/s de uno o más registros de admisión de cada página. En la parte superior de la grilla, se habilitará el botón \u003cstrong\u003eAnular\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003ePresiona el botón.\u003c/li\u003e\n\u003cli\u003eUn mensaje de confirmación se abrirá para ingresar un motivo por el que deseas realizar esta acción.\u003c/li\u003e\n\u003cli\u003ePor último, haz clic en \u003cstrong\u003eAnular\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eRecuerda que al anular una admisión también se anularán las inscripciones de estudiantes relacionados con el registro.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/buscar-admisiones/\" title=\"Buscar admisiones\"\u003eBuscar admisiones →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-individualmente/\" title=\"Inscribir aspirantes individualmente\"\u003eInscribir aspirantes individualmente →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-masivamente/\" title=\"Inscribir aspirantes masivamente\"\u003eInscribir aspirantes masivamente →\u003c/a\u003e\u003c/p\u003e\n"},{id:79,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-financieras/editar-promosfinancieras/",title:"Editar promociones financieras",description:"Con esta herramienta puedes configurar promociones financieras que se aplicarán a los tickets.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono \n\n\u003cimg src=\"currency.png\" alt=\"currency icon\" class=\"inlineIcon\"\u003epara que puedas acceder a la pantalla \u0026ldquo;Promociones financieras\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior, ingresa en nombre de la promoción cuya configuración deseas editar.\u003c/li\u003e\n\u003cli\u003eEn la ventana \u0026ldquo;Detalles de la promoción\u0026rdquo;, ve a la sección \u0026ldquo;Reglas/Criterios\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de \u0026ldquo;Entradas\u0026rdquo; para elegir la población para quiénes aplican estas reglas. Puedes optar entre: Tipo de producto, Región, Modalidad, SubModalidad, Clase estudio, Carrera, Sede/CAU, Rol, Tipo de estudiante, Período y Paquete. Todas estas opciones tienen listas desplegables.\u003c/li\u003e\n\u003cli\u003ePresiona el botón para activar la promoción y si deseas agrega una nota.\u003c/li\u003e\n\u003cli\u003eSi deseas configurar esta promoción para que su aplicación abarque diferentes opciones de población, tendrás que seleccionar el botón \u003cstrong\u003e+ AGREGAR\u003c/strong\u003e y definir estos valores para todos los escenarios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas reglas se aplican con un orden de prioridad de arriba hacia abajo. Puedes agregar tantas reglas como desees. Las siguientes acciones están disponibles en esta grilla:\n\u003cbr\u003e\n\n\u003cb\u003eClonar\u003c/b\u003e: si una regla ya está definida, al hacer clic en este icono puedes copiar debajo exactamente la misma información.\n\u003cbr\u003e\n\n\u003cb\u003eOrdenar\u003c/b\u003e: cuando tengas varias reglas y quieras asignarles un nuevo orden en la grilla, puedes hacer clic en este ícono en el renglón de la regla que deseas mover y arrastrarla hacia su nuevo lugar. La herramienta te informa acerca de esta posibilidad con un mensaje en la parte inferior de la grilla.\n\u003cbr\u003e\n\n\u003cb\u003eEliminar\u003c/b\u003e: usa este botón para eliminar una regla.\n\u003cbr\u003e\n\nPor último, si has incluido varios criterios, será necesario que en la última fila definas cómo se aplicará la promoción a la parte de la población excluida. Si colocas un cero en el campo valor, esto significa que no se desea incluir ningún otro tipo de población a la promoción y si ingresas otro valor (por ejemplo, cinco) este descuento será aplicado al resto de la población que se excluyó en los criterios anteriores.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez definidos las reglas o criterios de aplicación haz clic en el botón \u003cstrong\u003eGuardar.\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-financieras/consultar-promosfinancieras/\" title=\"Consultar promociones financieras\"\u003eConsultar promociones financieras →\u003c/a\u003e\u003c/p\u003e\n"},{id:80,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/buscar-promos/",title:"Buscar promociones comerciales",description:"Con esta funcionalidad podrás buscar las promociones comerciales que se hayan generado anteriormente.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono \n\n\u003cimg src=\"price.png\" alt=\"price tag icon\" class=\"inlineIcon\"\u003e para que puedas acceder a la pantalla \u0026ldquo;Promociones comerciales\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior puedes comenzar a completar los campos con algunos datos de las promociones que deseas ver.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDependiendo de las opciones que seleccionas en los filtros, algunos datos se volverán obligatorios.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003ePor último, presiona \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLos resultados de la búsqueda se verán en el listado en la parte inferior de la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn los títulos de las columnas de la grilla puedes usar las flechas para ordenar los datos de manera ascendente o descendente. Desde esta grilla también puedes activar o desactivar una promoción. Además, al hacer clic en el icono de lápiz podrás editar los datos de la promoción seleccionada. \u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/crear-promos/\" title=\"Crear promociones comerciales\"\u003eCrear promociones comerciales →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/editar-promos/\" title=\"Editar promociones comerciales\"\u003eEditar promociones comerciales →\u003c/a\u003e\u003c/p\u003e\n"},{id:81,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/mas-opciones/navegar-portal/",title:"Navegar el portal de estudiantes",description:null,content:"\u003col\u003e\n\u003cli\u003eEn primer lugar, accede al portal desde la página de la universidad e inicia sesión con el usuario que te provea el asesor comercial que te inscribió en la carrera que deseas comenzar a cursar. Si ya eres estudiante, puedes ingresar con tus datos y credenciales.\u003c/li\u003e\n\u003cli\u003eUna vez que estás dentro del portal verás que la pantalla principal cuenta con las siguientes secciones:\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003ePerfil\u003c/strong\u003e (1): esta sección está ubicada en la barra en la parte superior de la pantalla. Si haces clic en el icono de usuario \n\n\u003cimg src=\"user%20section.png\" alt=\"user icon\" class=\"inlineIcon\"\u003e, puedes acceder a ver y editar tu información personal.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePanel de navegación\u003c/strong\u003e (2): en esta barra ubicada en la parte izquierda de la pantalla puedes navegar por el portal para acceder a información más detallada sobre tu cursado \n\n\u003cimg src=\"graduate.png\" alt=\"cursado icon\" class=\"inlineIcon\"\u003e y exámenes \n\n\u003cimg src=\"exam%20icon.png\" alt=\"exam icon\" class=\"inlineIcon\"\u003e. Si estás en otra pantalla puedes volver al inicio presionando el botón de cursado. El icono de pagos \n\n\u003cimg src=\"receipt.png\" alt=\"payments icon\" class=\"inlineIcon\"\u003e abre una nueva pestaña para realizar pagos electrónicos relacionados con tu cuenta. Por último el icono más acciones \n\n\u003cimg src=\"more%20actions%20V.png\" alt=\"more actions vertical icon\" class=\"inlineIcon\"\u003e te permite ver en detalle tu historial académico y el calendario de eventos. Además desde aquí puedes ver los medios de contacto con la universidad.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eLegajo\u003c/strong\u003e (3): en esta sección del inicio del portal puedes ver información sobre la/s carrera/s en las que estás inscripto con otros detalles más de tu legajo de estudiante y desde el botón \u003cstrong\u003eHistorial\u003c/strong\u003e puedes ver el estado de todas las materias relacionadas.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePróximos eventos\u003c/strong\u003e (4): en esta sección se incluyen todos los eventos a los que te has registrado. Pueden ser información de clases, exámenes u otros eventos. Haz clic en \u003cstrong\u003eVER TODO\u003c/strong\u003e para acceder el calendario completo.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eÚltimas notas\u003c/strong\u003e (5): desde aquí puedes tener una vista general de los datos de tus últimos exámenes.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003cimg src=\"portal de estudiantes 2.png\" alt=\"My portal\"/\u003e\n\u003cbr\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003ePara continuar conociendo más sobre el portal para estudiantes consulta los documentos listados en la siguiente sección.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/\" title=\"Consultar agenda de eventos\"\u003eConsultar agenda de eventos →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-historial-inscripciones-examenes/\" title=\"Consultar historial de inscripciones a exámenes\"\u003eConsultar historial de inscripciones a exámenes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/examenes/inscripcion-examen/\" title=\"Inscribirse a un examen\"\u003eInscribirse a un examen →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/pagos/acceder-aplicacion/\" title=\"Acceder a la aplicación de pagos electrónicos\"\u003eAcceder a la aplicación de pagos electrónicos →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/editar-perfil-movil/\" title=\"Realizar más acciones\"\u003eRealizar más acciones →\u003c/a\u003e\u003c/p\u003e\n"},{id:82,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/buscar-admisiones/",title:"Buscar admisiones",description:"Con esta funcionalidad podrás consultar las admisiones creados en el sistema.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la pantalla “Admisión masiva”.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, completa los datos para realizar la búsqueda. Los campos disponibles son:\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e“Clase de estudio”: hace referencia al nivel académico de estudio de la oferta relacionada con la admisión. Es decir, si es de grado, posgrado, etc.\u003c/li\u003e\n\u003cli\u003e“Modalidad”: incluir si es presencial,  a distancia o una modalidad híbrida.\u003c/li\u003e\n\u003cli\u003e“Cliente”: ingresar el nombre o descripción de la institución.\u003c/li\u003e\n\u003cli\u003e“Carrera”: el nombre de la carrera o curso que se vinculó en la oferta académica.\u003c/li\u003e\n\u003cli\u003e“Tipo de admisión\u0026quot;: elegir si es privado, público o interno. Para conocer más sobre estos tipos, consulta el artículo Crear admisión listado al final de este artículo.\u003c/li\u003e\n\u003cli\u003e“Estado”: elige las opciones del estado de la admisión: en progreso (se puede editar) y procesado / procesado con cupo (no se puede editar los campos de cliente y oferta seleccionado y en la medida que aún tenga cupo disponible se puede continuar agregando estudiantes). Hay otras opciones de estado como cancelado, anulado, finalizado, entre otras.\u003c/li\u003e\n\u003cli\u003e“Nombre de la admisión”: ingresa datos generales sobre el contenido de la admisión.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003ePor último, presiona \u003cstrong\u003eBuscar\u003c/strong\u003e. Los resultados de tu búsqueda se mostrarán en la grilla.\u003c/li\u003e\n\u003cli\u003eSi haces clic en los resultados, una ventana se abrirá para mostrar más detalles de la admisión.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi deseas puedes hacer clic en el icono de lápiz para editar la admisión. Al presionar el icono de ojo puedes acceder a la solapa \"Validación\". Aquí puedes procesar la admisión haciendo clic en el botón Finalizar, pero para que se habilite se deberá inscribir al menos un estudiante. \n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/crear-admisiones/\" title=\"Cear admisión\"\u003eCrear admisión →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/editar-admisiones/\" title=\"Editar admisión\"\u003eEditar admisión →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-individualmente/\" title=\"Inscribir aspirantes individualmente\"\u003eInscribir aspirantes individualmente →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-masivamente/\" title=\"Inscribir aspirantes masivamente\"\u003eInscribir aspirantes masivamente →\u003c/a\u003e\u003c/p\u003e\n"},{id:83,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/anular-inscripcion/",title:"Anular inscripción a un examen",description:"Desde la app puedes anular aquellas inscripciones a exámenes que hayas realizado de una manera rápida y sencilla.",content:"\u003col\u003e\n\u003cli\u003eInicia sesión en la app usando tus credenciales.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación ubicado en la barra inferior de la pantalla, pulsa el icono de \u0026ldquo;Exámenes\u0026rdquo; \n\n\u003cimg src=\"exam%20icon.png\" alt=\"Botón \u0026#39;Examen\u0026#39;\" class=\"inlineImage\"\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla, accede a la solapa \u0026ldquo;Por rendir\u0026rdquo; donde puedes ver los registros de tus inscripciones.\u003c/li\u003e\n\u003cli\u003eEn la tarjeta de inscripción, pulsa el ícono de más opciones \n\n\u003cimg src=\"more%20actions%20V.png\" alt=\"Botón \u0026#39;More actions\u0026#39;\" class=\"inlineImage\"\u003e.\u003c/li\u003e\n\u003cli\u003eLuego, presiona “Anular pedido”. Un mensaje de confirmación se abrirá en la pantalla. Toca \u0026ldquo;Anular\u0026rdquo; o \u0026ldquo;Cancelar\u0026rdquo; la inscripción. Una vez finalizada esta acción, la inscripción desaparecerá de la pantalla de inscripción a exámenes.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la solapa \"Histórico\" puedes consultar el historial de tus inscripciones y anulaciones. Para más detalles, accede el documento llamado \"Consultar historial de inscripciones a exámenes\" desde la sección **Véase también** a continuación.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/\" title=\"Consultar historial de inscripciones a exámenes\"\u003eConsultar historial de inscripciones a exámenes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/inscribirse-examen/\" title=\"Inscribirse a un examen\"\u003eInscribirse a un examen →\u003c/a\u003e\u003c/p\u003e\n"},{id:84,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/crear-admisiones/",title:"Crear admisión",description:"Registra admisiones basadas en convenios con otras instituciones o departamentos para ofrecer capacitaciones o cursos que incluyan el ingreso de nuevos estudiantes a la universidad.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la pantalla “Admisión masiva”.\u003c/li\u003e\n\u003cli\u003eEn la parte inferior derecha de la pantalla haz clic en el botón CREAR.\u003c/li\u003e\n\u003cli\u003eLuego, selecciona la opción de admisión que desees registrar. La pantalla  de creación se abrirá.\u003c/li\u003e\n\u003cli\u003eIngresa la información general: “Nombre” y “Cupo”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDependiendo del tipo de admisión que elijas se habilitarán las solapas con datos particulares de cada tipo de admisión.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn la solapa “Datos de la admisión” comienza completando en “Cliente” la información de la institución/área con la que la universidad realiza el acuerdo.\u003c/li\u003e\n\u003cli\u003eCarga el CUIL o CUIT de la institución y luego presiona \u003cstrong\u003eBuscar\u003c/strong\u003e. Los campos que están a continuación se autocompletarán.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEsta información viene de la base de datos de AFIP es fidedigna y no podrás editarla.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eLuego, en la solapa “Oferta académica” registra todos los detalles asociados a la carrera o curso que se ofrecerá en la admisión. Esta sección contiene información sobre: “Período”, “Clase de estudio”, “CAU”, “Carrera”, “Modalidad de cursado”, “Modalidad de estudio”, “Subperíodo”, “Paquetes” y “Tipo de oferta”.\u003c/li\u003e\n\u003cli\u003eCuando finalices, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e. El estado de la admisión será EN PROGRESO.\u003c/li\u003e\n\u003cli\u003eEn la solapa “Estudiantes” puedes descargar la plantilla para que la institución o área la completen con los interesados.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/buscar-admisiones/\" title=\"Buscar admisiones\"\u003eBuscar admisiones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/editar-admisiones/\" title=\"Editar admisiones\"\u003eEditar admisión →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-individualmente/\" title=\"Inscribir aspirantes individualmente\"\u003eInscribir aspirantes individualmente →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-masivamente/\" title=\"Inscribir aspirantes masivamente\"\u003eInscribir aspirantes masivamente →\u003c/a\u003e\u003c/p\u003e\n"},{id:85,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/editar-admisiones/",title:"Editar admisión",description:"Con esta herramienta puedes realizar cambios en los registros de admisiones que se registraron en el sistema.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la pantalla “Admisión masiva”.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, completa los datos para realizar la búsqueda. Puedes ver más detalles en el artículo relacionado de la sección “Veáse también”.\u003c/li\u003e\n\u003cli\u003ePresiona \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la grilla de resultados haz clic en la admisión que quieres modificar. Una ventana con sus detalles se abrirá.\u003c/li\u003e\n\u003cli\u003ePresiona el ícono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e. La ventana del registro de la admisión se desplegará.\u003c/li\u003e\n\u003cli\u003eRealiza los cambios que consideres necesarios y haz clic en \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eIncluso desde esta ventana podrás agregar más estudiantes, consulta los artículos con instrucciones para inscribir aspirantes que se encuentran al final de este documento.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/crear-admisiones/\" title=\"Crear admisión\"\u003eCrear admisión →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/buscar-admisiones/\" title=\"Buscar admisiones\"\u003eBuscar admisiones →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-individualmente/\" title=\"Inscribir aspirantes individualmente\"\u003eInscribir aspirantes individualmente →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/registrar-admisiones/inscribir-aspirantes-masivamente/\" title=\"Inscribir aspirantes masivamente\"\u003eInscribir aspirantes masivamente →\u003c/a\u003e\u003c/p\u003e\n"},{id:86,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/asociar-paquetes-clases/",title:"Asociar clases de estudio",description:null,content:"\u003col\u003e\n\u003cli\u003eHacer click en el botón “Asociar paquete” (8).\u003c/li\u003e\n\u003cli\u003eLa pantalla siguiente permite buscar (9) y seleccionar los paquetes disponible para ser asociados (13).\u003c/li\u003e\n\u003cli\u003eTambién se pueden filtrar los paquetes por “Tipos de estudiante (10), “Modalidades“ (11), y “Tipos de paquetes“ (12).\u003c/li\u003e\n\u003cli\u003eUna vez seleccionados los paquetes presionar el botón “Asociar paquetes seleccionados” (14).\u003c/li\u003e\n\u003cli\u003ePresionar “Cerrar” (15) en caso de querer volver a la pantalla anterior.\u003c/li\u003e\n\u003cli\u003eConfirmar o cancelar la acción mediante las opciones siguientes.\u003c/li\u003e\n\u003cli\u003eEl nuevo paquete asociado se muestra en el listado de paquetes asociados.\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:87,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-carreras/asociar-sedes/",title:"Asociar Sites a una carrera",description:null,content:"\u003col\u003e\n\u003cli\u003eAl hacer click en “Asociar Sites” (12) podemos asociar un Site a una carrera.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eBuscar un Site\u003c/li\u003e\n\u003cli\u003eFiltrar Sites por provincia\u003c/li\u003e\n\u003cli\u003eFiltrar Sites por estado\u003c/li\u003e\n\u003cli\u003eSeleccionar todos los sites\u003c/li\u003e\n\u003cli\u003eSeleccionar un site determinado\u003c/li\u003e\n\u003cli\u003ePágina seleccionada\u003c/li\u003e\n\u003cli\u003eCancelar cambios\u003c/li\u003e\n\u003cli\u003eGuardar cambios\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eSeguir los pasos siguientes para asociar un site:\u003c/p\u003e\n\u003c!-- Colocar los pasos que aparecen en el gif --\u003e\n"},{id:88,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/asociar-carreras-ofertas/",title:"Asociar una carrera a la oferta académica seleccionada ",description:null,content:"\u003cp\u003eAl hacer click en “Asociar Carreras” se puede agregar una nueva carrera a la oferta académica\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eBuscar la carrera que se desea asociar\u003c/li\u003e\n\u003cli\u003eFiltrar carrera por Clase de estudio\u003c/li\u003e\n\u003cli\u003eFiltrar carrera por estado\u003c/li\u003e\n\u003cli\u003eSeleccionar todas las carreras\u003c/li\u003e\n\u003cli\u003eSeleccionar una carrera en particular\u003c/li\u003e\n\u003cli\u003eSolapa de carreras en la que me encuentro posicionado\u003c/li\u003e\n\u003cli\u003eCancelar cambios\u003c/li\u003e\n\u003cli\u003eGuardar la nueva carrera seleccionada\u003c/li\u003e\n\u003c/ul\u003e\n"},{id:89,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-carreras/buscar-carreras/",title:"Buscar carreras",description:null,content:"\u003col\u003e\n\u003cli\u003ePara buscar una Carrera, escribir en el campo de búsqueda (1) cualquier dato conocido de la carrera (nombre o código). La lista de resultados de divide en tantas páginas (4) como sea necesario para mostrar todos las coincidencias.\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:90,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/buscar-clases-estudio/",title:"Buscar clases de estudio",description:null,content:"\u003col\u003e\n\u003cli\u003ePara buscar una clase de estudio, escribir en el campo de búsqueda (1) cualquier dato conocido (nombre o parte del nombre, total de materias, fecha de vigencia, estado, etc.).\u003c/li\u003e\n\u003cli\u003eEn el listado se muestran todas las clases de estudio que coincidan con la búsqueda, con los siguientes datos: “Nombre” (2) y “Paquetes activos” (3).\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:91,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/buscar-paquetes/",title:"Buscar paquetes",description:null,content:"\u003col\u003e\n\u003cli\u003ePara buscar un paquete, escribir en el campo de búsqueda (1) cualquier dato conocido (nombre o parte del nombre, total de materias, fecha de vigencia, estado, etc.).\u003c/li\u003e\n\u003cli\u003ePara filtrar por estado del paquete (2), hacer click sobre el botón desplegable “ESTADO” y seleccionar “Activo” o “Inactivo”.\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:92,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-sedes-asociadas-oferta/",title:"Buscar un Cau/Sede asociado a la oferta académica",description:null,content:"\u003cp\u003ePara buscar si un Cau/ Sede forma parte de una oferta académica, estar posicionado en CAU/SEDES (20) y escribir en el campo de búsqueda (21) cualquier dato conocido (nombre de la sede, modalidad o turno de cursado, código).\u003c/p\u003e\n\u003ch3 id=\"visualizar-productos-de-un-cau-sede\"\u003eVisualizar productos de un CAU/ Sede\u003c/h3\u003e\n\u003cp\u003eAl hacer click en un CAU (22), se muestran todas las carreras asociadas al CAU seleccionado.\u003c/p\u003e\n"},{id:93,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-carreras/consultar-sedes/",title:"Buscar un Site asociado a la carrera seleccionada",description:null,content:"\u003cp\u003ePara buscar un Site asociada a la carrera, escribir en el campo de búsqueda (9) cualquier dato conocido (nombre o código).\u003c/p\u003e\n"},{id:94,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-carreras-asociadas-oferta/",title:"Buscar una carrera asociada a la oferta académica",description:null,content:"\u003cp\u003ePara buscar si una carrera forma parte de la oferta académica, estar posicionado en CARRERAS (12) y escribir en el campo de búsqueda (15) cualquier dato conocido (nombre de la carrera, modalidad o turno de cursado).\u003c/p\u003e\n\u003ch3 id=\"visualizar-productos-de-una-carrera\"\u003eVisualizar productos de una carrera\u003c/h3\u003e\n\u003cp\u003eAl hacer click en una carrera (16), se muestran todos los centros en donde se dicta la carrera seleccionada.\u003c/p\u003e\n"},{id:95,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/buscar-ofertas-academicas/",title:"Buscar una Oferta Académica",description:null,content:"\u003ch3 id=\"filtrar-por-estado-una-oferta-académica\"\u003eFiltrar por estado una Oferta Académica\u003c/h3\u003e\n\u003cp\u003ePara buscar una oferta académica, escribir en el campo de búsqueda (1) cualquier dato conocido (descripción o parte de la descripción de una oferta, código del período, tipo de estudiante, etc). La lista de resultados de divide en tantas páginas (5) como sea necesario para mostrar todos las coincidencias.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003ePara filtrar por estado de la oferta , hacer click sobre el botón desplegable “ESTADO” (2) y seleccionar “Activo” o “Inactivo”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"visualizar-oferta-académica\"\u003eVisualizar Oferta Académica\u003c/h3\u003e\n\u003cp\u003eAl hacer click en “visualizar oferta” (3) se muestra una nueva pantalla con todos los datos de la oferta académica seleccionada\u003c/p\u003e\n\u003ch3 id=\"visualizar-resumen\"\u003eVisualizar resumen\u003c/h3\u003e\n\u003cp\u003eAl hacer click en “Resumen” (9) se muestra una pantalla con los productos que forman parte de la oferta académica y que se encuentran validados y publicados.\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eCerrar\u003c/li\u003e\n\u003cli\u003eValidar productos\u003c/li\u003e\n\u003cli\u003ePublicar productos\u003c/li\u003e\n\u003c/ul\u003e\n"},{id:96,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/sedes-cau/buscar-sedes/",title:"Buscar y/o filtrar Sites",description:null,content:"\u003cp\u003ePara buscar un Site, escribir en el campo de búsqueda (1) cualquier dato conocido (nombre o  código). La lista de resultados de divide en tantas páginas (7) como sea necesario para mostrar todos las coincidencias.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003ePara filtrar por provincia y/o por por estado (Activo o Inactivo) del Site hacer click sobre “Provincias” (2) y “Estado” (3).\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:97,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-notas/",title:"Consultar las últimas notas obtenidas",description:"Desde la app puedes consultar las notas de los últimos exámenes que rendiste y el historial de notas de las materias relacionadas con tu carrera.",content:"\u003col\u003e\n\u003cli\u003eInicia sesión en la app usando tus credenciales.\u003c/li\u003e\n\u003cli\u003eEn la pantalla de cursado, deslízate hacia abajo hasta la sección \u0026ldquo;Últimas Notas\u0026rdquo;. En esta sección podrás ver las últimas 5 notas que obtuviste. Puedes deslizarte horizontalmente hacia la derecha y hacia la izquierda para ver todas las calificaciones.\u003c/li\u003e\n\u003cli\u003eEn cada registro de las notas puedes ver detalles sobre las notas, el nombre de la materia y la fecha en que aprobaste o reprobaste el examen.\u003c/li\u003e\n\u003cli\u003eSi deseas ver más información sobre tus notas, accede a la sección \u0026ldquo;Cursado\u0026rdquo; y pulsa \u003cstrong\u003eHistorial\u003c/strong\u003e. En el documento \u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-historial-materias/\" title=\"Consultar historial de materias\"\u003eConsultar historial de materias →\u003c/a\u003e puedes obtener más información sobre esta funcionalidad.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-historial-materias/\" title=\"Consultar historial de materias de la carrera\"\u003eConsultar historial de materias de la carrera →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/\" title=\"Consultar historial de inscripciones a exámenes\"\u003eConsultar historial de inscripciones a exámenes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/inscribirse-examen/\" title=\"Inscribirse a un examen\"\u003eInscribirse a un examen →\u003c/a\u003e\u003c/p\u003e\n"},{id:98,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/consultar-precios-carreras/",title:"Consultar precios de carreras",description:null,content:"\u003ch3 id=\"visualizar-los-precios-de-un-producto\"\u003eVisualizar los precios de un producto\u003c/h3\u003e\n\u003cp\u003eAl hacer click en precios (18 y 23) se muestra una nueva pantalla con los precios asociados a esa carrera.\u003c/p\u003e\n\u003ch3 id=\"descargar-csv-de-precios\"\u003eDescargar CSV de precios\u003c/h3\u003e\n\u003cp\u003eAl hacer click en “Descargar CSV” se descarga automáticamente un archivo CSV con los precios de la carrera.\u003c/p\u003e\n"},{id:99,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/crear-ofertas-academicas/",title:"Crear Oferta Académica",description:null,content:"\u003col\u003e\n\u003cli\u003eAl hacer click en “Crear oferta académica” se deben ingresar los siguientes datos de una oferta:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eCódigo del período académico\u003c/li\u003e\n\u003cli\u003eEstado de la oferta (Activa- Inactiva)\u003c/li\u003e\n\u003cli\u003eSi la oferta usa o no paquetes\u003c/li\u003e\n\u003cli\u003eVigencia desde\u003c/li\u003e\n\u003cli\u003eVigencia hasta\u003c/li\u003e\n\u003cli\u003ePeríodos de las clases de estudios que formarán parte de la oferta\u003c/li\u003e\n\u003cli\u003eGuardar la oferta creada\u003c/li\u003e\n\u003cli\u003eCancelar creación de oferta\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"2\"\u003e\n\u003cli\u003eAl hacer click en “Guardar” se crea la oferta académica\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:100,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/crear-paquetes/",title:"Crear paquetes",description:null,content:"\u003col\u003e\n\u003cli\u003ePara crear un paquete hacer click en el botón “Agregar Paquete” (7).\u003c/li\u003e\n\u003cli\u003eCompletar la sección “Detalles del paquete” del formulario, en donde “Nombre” y “Agrupamiento” son campos obligatorios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eNombre del paquete: completar con la identificación interna del paquete, la cual no será vista por el estudiante.\u003c/li\u003e\n\u003cli\u003eNombre comercial: es el nombre con el que se verá el paquete en las otras aplicaciones (ejemplo, ePagos, admisión)\u003c/li\u003e\n\u003cli\u003eVigencia del paquete “desde…” y “hasta…”\u003c/li\u003e\n\u003cli\u003eAgrupamiento, en donde se puede seleccionar entre “paquete”, “sin grupo”, “período y tipo de ticket”, y “período”\u003c/li\u003e\n\u003cli\u003eTipo de estudiante, en donde se puede elegir entre “nuevo inscripto” y “re inscripto”\u003c/li\u003e\n\u003cli\u003eModalidad, como por ejemplo “a distancia”, “presencial”, etc\u003c/li\u003e\n\u003cli\u003eRegular/Especial\u003c/li\u003e\n\u003cli\u003eInactivo/Activo. Selector para desactivar o activar un paquete al momento de la creación\u003c/li\u003e\n\u003cli\u003ePlantillas de tickets\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eAl hacer click en el botón “+” (16) se muestra un formulario en donde se puede seleccionar el tipo de ticket que va a formar parte del paquete, por ejemplo “Matrícula” o “Arancel”, con sus respectivos detalles.\u003c/li\u003e\n\u003cli\u003eCompletar los campos requeridos del formulario y hacer click en “Guardar”. La plantilla de tickets agregada se muestra en la sección “Agregar paquete” y se suma a las plantillas que pudieran existir con anterioridad.\u003c/li\u003e\n\u003cli\u003eLas plantillas agregadas se pueden editar haciendo click en en icono “editar paquete“ (19).\u003c/li\u003e\n\u003cli\u003eAl hacer click en “Guardar” se pide confirmar la acción para dar por finalizada la creación del paquete (17).\u003c/li\u003e\n\u003cli\u003eEl paquete creado se muestra en en el listado de la página principal, desde donde también se puede editar y donde se puede ver el siguiente mensaje (“Paquete creado con éxito”).\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:101,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-clases-estudio/editar-paquetes-clases/",title:"Editar clases de estudio",description:null,content:"\u003ch3 id=\"ver-paquetes-asociados\"\u003eVer paquetes asociados\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003eHacer click en el icono “Editar paquetes asociados” dentro de la columna “Acciones” (4) para ver los paquetes asociados a cada clase de estudio.\u003c/li\u003e\n\u003cli\u003eEn la siguiente pantalla podemos buscar paquetes asociados utilizando el cuadro de búsqueda (5) y ver los detalles (nombre, materias, total de tickets, agrupamiento, vigencia). La columna “Estado” (6) indica si el paquete está activo o inactivo.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"desasociar-paquetes\"\u003eDesasociar paquetes\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003ePara desasociar un paquete de la clase de estudio presionar el botón “Desasociar paquete” (7). Al hacer click se confirmación para desasociar el paquete.\u003c/li\u003e\n\u003cli\u003eUna vez confirmado, el paquete deja de ser visible dentro del listado de la clase de estudio.\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:102,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/medios-pago/editar-mediosdepago/",title:"Editar medios de pago",description:"Con esta herramienta puedes configurar promlos medios de pago que se utilizarán al momento de realizar el pago de un tickets.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono \n\n\u003cimg src=\"payment.png\" alt=\"payment icon\" class=\"inlineIcon\"\u003e para que puedas acceder a la pantalla \u0026ldquo;Medios de pago\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior ingresa el nombre del medio de pago que deseas editar para que lo puedas ver en la grilla.\u003c/li\u003e\n\u003cli\u003eHaz clic en el nombre del medio de pago cuya información deseas modificar.\u003c/li\u003e\n\u003cli\u003eLa pantalla \u0026ldquo;Detalle de los medios de pago\u0026rdquo; se abrirá. Aquí, haz clic en \u003cstrong\u003eEditar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eRealiza los cambios que creas necesarios vinculados con la información general.\u003c/li\u003e\n\u003cli\u003eUna vez que hayas finalizado, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la parte inferior de la pantalla, puedes configurar las reglas o criterios a los que va aplicar este medio de pago en particular.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de \u0026ldquo;Entradas\u0026rdquo; para elegir la población para quiénes aplican estas reglas. Puedes optar entre: Tipo de producto, Clase estudio, Modalidad, SubModalidad, Carrera, Sede/CAU, Rol, Tipo de estudiante, Período, Turno, Arancel completo y Promoción. Todas estas opciones tienen listas desplegables.\u003c/li\u003e\n\u003cli\u003ePresiona el botón para activar la promoción y si deseas agrega una nota.\u003c/li\u003e\n\u003cli\u003eSi deseas configurar esta promoción para que su aplicación abarque diferentes opciones de población, tendrás que seleccionar el botón \u003cstrong\u003e+ AGREGAR\u003c/strong\u003e y definir estos valores para todos los escenarios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas reglas se aplican con un orden de prioridad de arriba hacia abajo. Puedes agregar tantas reglas como desees. Las siguientes acciones están disponibles en esta grilla:\n\u003cbr\u003e\n\n\u003cb\u003eClonar\u003c/b\u003e: si una regla ya está definida, al hacer clic en este icono puedes copiar debajo exactamente la misma información.\n\u003cbr\u003e\n\n\u003cb\u003eOrdenar\u003c/b\u003e: cuando tengas varias reglas y quieras asignarles un nuevo orden en la grilla, puedes hacer clic en este ícono en el renglón de la regla que deseas mover y arrastrarla hacia su nuevo lugar. La herramienta te informa acerca de esta posibilidad con un mensaje en la parte inferior de la grilla.\n\u003cbr\u003e\n\n\u003cb\u003eEliminar\u003c/b\u003e: usa este botón para eliminar una regla.\n\u003cbr\u003e\n\nPor último, si has incluido varios criterios, será necesario que en la última fila definas cómo se aplicará la promoción a la parte de la población excluida. Si colocas un cero en el campo valor, esto significa que no se desea incluir ningún otro tipo de población a la promoción y si ingresas otro valor (por ejemplo, cinco) este descuento será aplicado al resto de la población que se excluyó en los criterios anteriores.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez definidas las reglas o los criterios de aplicación, haz clic en el botón \u003cstrong\u003eGuardar.\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/medios-pago/consultar-mediosdepago/\" title=\"Consultar medios de pago\"\u003eConsultar medios de pago →\u003c/a\u003e\u003c/p\u003e\n"},{id:103,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/editar-ofertas-academicas/",title:"Editar Oferta Académica",description:null,content:"\u003cp\u003eAl hacer click en “Editar” se habilitan todos los campos que pueden ser modificados de una oferta académica:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eCancelar los cambios\u003c/li\u003e\n\u003cli\u003eGuardar los cambios\u003c/li\u003e\n\u003c/ul\u003e\n"},{id:104,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-paquetes-estudio/editar-paquetes/",title:"Editar paquetes",description:null,content:"\u003col\u003e\n\u003cli\u003ePara editar un paquete, hacer click en el icono “editar paquete” ubicado en el extremo derecho.\u003c/li\u003e\n\u003cli\u003eA continuación se muestra una ventana informativa listando las ofertas vigentes afectadas por el paquete seleccionado, en donde se puede seleccionar “Volver” para regresar al listado de paquetes o “Aceptar” para iniciar la edición.\u003c/li\u003e\n\u003cli\u003eEn la siguiente pantalla se pueden ver y modificar todos los detalles y plantillas asociadas con el paquete. En el caso de querer modificar seguir las instrucciones detalladas en el apartado “Crear paquete”.\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:105,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-carreras/editar-productos/",title:"Editar productos",description:null,content:"\u003ch3 id=\"editar-los-productos-asociados-a-un-site\"\u003eEditar los productos asociados a un Site\u003c/h3\u003e\n\u003cp\u003eAl hacer click en “Editar Productos” (10) aparecen las siguientes opciones:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eCambiar el estado\u003c/li\u003e\n\u003cli\u003eCancelar los cambios\u003c/li\u003e\n\u003cli\u003eGuardar los cambios\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eAl cambiar el estado y hacer click en “Guardar” se obtiene el siguiente mensaje: \u003cstrong\u003eProductos actualizados con éxito ✔\u003c/strong\u003e\u003c/p\u003e\n\u003ch3 id=\"desactivar-todos-los-productos-asociados-a-un-site\"\u003eDesactivar todos los productos asociados a un site\u003c/h3\u003e\n\u003cp\u003eAl hacer click en “Desactivar productos” (11) aparecen las siguientes opciones:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eCancelar los cambios\u003c/li\u003e\n\u003cli\u003eConfirmar los cambios\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eAl hacer click en “Confirmar”, el producto queda desactivado.\u003c/p\u003e\n"},{id:106,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/inscribirse-a-materias/",title:"Inscribirse a materias",description:"Utiliza esta funcionalidad para inscribirte a las materias que deseas cursar para un período.",content:"\u003cp\u003e\u003cstrong\u003eGenerar tickets\u003c/strong\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa al portal de estudiantes e inicia sesión con tu usuario y contraseña.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, haz clic en el icono de materias \n\n\u003cimg src=\"materias.png\" alt=\"materias icon\" class=\"inlineIcon\"\u003e. La pantalla de inscripción a materias se abrirá.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eVerifica que los datos de tu carrera y legajo sean correctos. Si estudias más de una carrera corrobora estos datos antes de realizar la inscripción.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eSelecciona un período y un subperíodo habilitados.\u003c/li\u003e\n\u003cli\u003eHaz clic en \u003cstrong\u003e+ GENERAR TICKETS\u003c/strong\u003e. Verás los paquetes que tienes disponibles para un período o para varios subperíodos.\u003c/li\u003e\n\u003cli\u003eElige el paquete que deseas pagar. Al hacer clic, se desplegarán los detalles de cada uno. Si hubiese promociones, descuentos, becas o beneficios disponibles los puedes ver desde aquí.\u003c/li\u003e\n\u003cli\u003ePresiona \u003cstrong\u003eSeleccionar paquete\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLa sección “Resumen” se autocompletará con las opciones que elegiste. Haz clic en \u003cstrong\u003eGenerar y pagar\u003c/strong\u003e para continuar.\u003c/li\u003e\n\u003cli\u003eUn mensaje de confirmación se abrirá. Presiona \u003cstrong\u003eConfirmar\u003c/strong\u003e para finalizar.\u003c/li\u003e\n\u003cli\u003eEl sistema abrirá automáticamente la aplicación de pagos electrónicos en una nueva pestaña de tu navegador. Para más información sobre cómo realizar los pagos consulta los documentos disponibles en la sección \u003cstrong\u003eVéase también\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eInscribirse a materias habilitadas\u003c/strong\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa al portal de estudiantes e inicia sesión con tu usuario y contraseña.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, haz clic en el icono de materias \n\n\u003cimg src=\"materias.png\" alt=\"materias icon\" class=\"inlineIcon\"\u003e. La pantalla de inscripción a materias se abrirá.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eVerifica que los datos de tu carrera y legajo sean correctos.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eSelecciona el período y subperíodo en el que deseas inscribirte.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa selección de períodos únicamente o períodos y subperíodos depende del tipo de modalidad de tu carrera.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eEn el campo “Matrícula” puedes verificar si está habilitada o inhabilitada y un contador con el detalle de cuántas inscripciones puedes realizar en el período seleccionado.\u003c/li\u003e\n\u003cli\u003eAdemás, en la pantalla se muestran tres pestañas:\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003e\u003cstrong\u003eHabilitadas\u003c/strong\u003e: incluye aquellas materias cuyas cátedras están disponibles para que los estudiantes puedan inscribirse en ese período y cuyos requerimientos de materias correlativas se cumplen (ya sea porque estén regularizadas o aprobadas por quien está intentando inscribirse).\n\u003cbr\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003e\u003cstrong\u003eInhabilitadas\u003c/strong\u003e: incluye aquellas materias cuyas correlativas se cumplen (regularizadas o aprobadas), pero no hay cátedras disponibles para inscribirse (porque no se abrieron o porque están llenas) o viceversa. Un ícono de advertencia y un mensaje te informan del motivo por el que no puedes inscribirte.\n\u003cbr\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003e\u003cstrong\u003eInscriptas\u003c/strong\u003e: en esta pestaña se muestran por período aquellas materias en las que ya te has inscripto. Por ejemplo, si tienes 4 materias habilitadas para un período y te inscribiste en 3 materias, en la pantalla se verán 3 materias en la pestaña “Inscriptas” y 1 continuará en la pestaña “Habilitadas”.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eSelecciona la materia (cátedra o seminario) en la que te quieres inscribir que esté disponible en la pestaña “Habilitadas”. Una ventana emergente se abrirá para que puedas ver más información sobre los horarios disponibles, el docente asignado, etc.\u003c/li\u003e\n\u003cli\u003eUna ventana emergente te permite elegir cátedra y seminario (si corresponde).\u003c/li\u003e\n\u003cli\u003ePresiona \u003cstrong\u003eConfirmar\u003c/strong\u003e. Verás el detalle de tu inscripción en la sección “Resumen de inscripciones”.\u003c/li\u003e\n\u003cli\u003eFinalmente, presiona el botón \u003cstrong\u003eInscribirme\u003c/strong\u003e. La materia se podrá ver automáticamente en la pestaña “Inscriptas”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi deseas anular una inscripción por algún motivo, accede a la pestaña “Inscriptas”, en el registro de la materia haz clic en el icono de más opciones y presiona \u003cb\u003eAnular Inscripción\u003c/b\u003e.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/\" title=\"Consultar tu agenda académica\"\u003eConsultar tu agenda académica→\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/pagos/acceder-aplicacion/\" title=\"Acceder a la aplicación de pagos electrónicos\"\u003eAcceder a la aplicación de pagos electrónicos→\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar el estado de tu cuenta\"\u003eConsultar el estado de tu cuenta →\u003c/a\u003e\u003c/p\u003e\n"},{id:107,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/obtener-reporte/",title:"Obtener reporte",description:null,content:"\u003ch3 id=\"visualizar-reporte\"\u003eVisualizar reporte\u003c/h3\u003e\n\u003cp\u003eAl hacer click en “Reporte” (4 o 7) se obtiene un reporte de la Oferta académica y las siguientes opciones:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eDescargar un CSV masivo pricing\u003c/li\u003e\n\u003cli\u003eFiltrar por Table\u003c/li\u003e\n\u003cli\u003eFiltrar por Count\u003c/li\u003e\n\u003cli\u003eFiltrar por precios validados y publicados\u003c/li\u003e\n\u003cli\u003eFiltrar por modalidad, cursado\u003c/li\u003e\n\u003cli\u003eFiltrar por carrera\u003c/li\u003e\n\u003cli\u003eDescargar reporte en CSV\u003c/li\u003e\n\u003cli\u003eCerrar reporte y volver atrás\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch3 id=\"descargar-reporte\"\u003eDescargar Reporte\u003c/h3\u003e\n\u003cp\u003eAl hacer click en “Descargar reporte”  (34) se descarga automáticamente un reporte CSV como el que se muestra a continuación:\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAl hacer click en “Cerrar” (35) se cierra el reporte.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"descargar-csv-masivo-pricing\"\u003eDescargar CSV Masivo Pricing\u003c/h3\u003e\n\u003cp\u003eAl hacer click en “Descargar csv masivo pricing” (28) se descarga automáticamente un reporte CSV.\u003c/p\u003e\n"},{id:108,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-oferta-academica/sincronizar-oferta/",title:"Sincronizar Oferta Académica",description:null,content:"\u003cp\u003eAl hacer click en “Sincronizar” se válida si hay nuevos productos activos para las asociación carrera-sites, si los hay los agrega a la oferta académica.\nLa oferta académica debe quedar asociada a todos los productos actualizados.\u003c/p\u003e\n"},{id:109,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/sedes-cau/consultar-carreras-ofrecidas/",title:"Visualizar carreras ofrecidas en un Site",description:null,content:"\u003cp\u003eAl hacer click en “Ver carreras ofrecidas” se muestra la pantalla con los datos del Site seleccionado y las carreras disponibles en el mismo.\u003c/p\u003e\n\u003ch3 id=\"buscar-un-producto-ofrecido-carrera-en-un-site\"\u003eBuscar un producto ofrecido (Carrera) en un Site\u003c/h3\u003e\n\u003cp\u003ePara buscar un producto ofrecido (Carrera), escribir en el campo de búsqueda (8) cualquier dato conocido (nombre o  código).\u003c/p\u003e\n"},{id:110,href:"https://bitlogic.github.io/doks-algarrobo/docs/oferta-academica/gestion-carreras/consultar-paquetes-asociados/",title:"Visualizar Paquetes Asociados",description:null,content:"\u003cp\u003eAl hacer click en “Paquetes Asociados” (2) se pueden visualizar los paquetes asociados para la carrera seleccionada.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eSeleccionar Clase de Estudio.\u003c/li\u003e\n\u003cli\u003eSeleccionar reglas por Clase de Estudio o reglas por Excepción.\nLa carrera tiene dos configuraciones posibles:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003ePor clase de estudio: hereda los paquetes de la clase de estudio\u003c/li\u003e\n\u003cli\u003ePor excepción: tiene sus propios paquetes asociados.\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eDetalle de un paquete asociado a:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eAbogacia - Grado - Clase de Estudio\u003c/li\u003e\n\u003c/ul\u003e\n"},{id:111,href:"https://bitlogic.github.io/doks-algarrobo/docs/carga-de-notas/anular-notas/",title:"Anular notas",description:null,content:"\u003cp\u003eComo docente, si bien al ingresar un \u003cstrong\u003eLegajo\u003c/strong\u003e podrían listarse materias de otras cátedras diferentes a la o las que te han sido asignadas, solo podrás \u003cstrong\u003eanular\u003c/strong\u003e las notas de los TFGs y de las actividades que pertenecen a tu cátedra.\u003c/p\u003e\n\u003cp\u003eComo co-docente, podrás \u003cstrong\u003eanular\u003c/strong\u003e las notas de los TFGs y de las actividades de todos los alumnos, independientemente del docente al que se le haya asignado la cátedra a la que pertenecen las materias correspondientes.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la \u003cstrong\u003ered de Siglo 21\u003c/strong\u003e o a la \u003cstrong\u003eVPN\u003c/strong\u003e y luego ingresa a http://activitiesdev.uesiglo21.edu.ar/ e introduce las credenciales que utilizas para entrar al SGU. Al ingresar, se despliega la app \u003cstrong\u003eCarga de notas\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eCompleta el campo \u003cstrong\u003eIngresar legajo\u003c/strong\u003e con el número de legajo del estudiante cuya o cuyas notas deseas anular y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eA continuación, a la derecha del campo de búsqueda verás el \u003cstrong\u003enombre\u003c/strong\u003e y el \u003cstrong\u003eDNI\u003c/strong\u003e del estudiante y en la parte inferior de la pantalla, en el sector izquierdo la \u003cstrong\u003eLista de materias\u003c/strong\u003e, y a la derecha, el \u003cstrong\u003eDetalle de la materia\u003c/strong\u003e en donde podrás anular la calificación que el estudiante localizado obtuvo en un TFG o actividad dado.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSelecciona la materia de la que deseas anular la nota.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eCambia el \u003cstrong\u003eEstado\u003c/strong\u003e del TFG o actividad de \u003cstrong\u003eAPROBADA\u003c/strong\u003e o \u003cstrong\u003eLIBRE\u003c/strong\u003e a \u003cstrong\u003eREGULAR\u003c/strong\u003e para anular la \u003cstrong\u003eNota\u003c/strong\u003e ingresada.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e. La app \u003cstrong\u003eCarga de Notas\u003c/strong\u003e te informará que el \u003cstrong\u003eEstado\u003c/strong\u003e fue modificado con éxito.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl anular una \u003cb\u003eNota\u003c/b\u003e, los campos \u003cb\u003eNúmero de libro\u003c/b\u003e y \u003cb\u003eNúmero de folio\u003c/b\u003e que la app asigna de forma automática se limpian para permitir un nuevo registro cuando se ingrese una \u003cb\u003eNota\u003c/b\u003e nueva y definitiva.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/visualizar-notas/\" title=\"Visualizar notas\"\u003eVisualizar notas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/cargar-notas/\" title=\"Cargar notas\"\u003eCargar notas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/editar-notas/\" title=\"Editar notas\"\u003eEditar notas →\u003c/a\u003e\u003c/p\u003e\n"},{id:112,href:"https://bitlogic.github.io/doks-algarrobo/docs/carga-de-notas/cargar-notas/",title:"Cargar notas",description:null,content:"\u003cp\u003eComo docente, con la app \u003cstrong\u003eCarga de Notas\u003c/strong\u003e podrás cargar las notas de los TFGs y de las actividades que pertenecen a la cátedra que te han asignado. Como co-docente, podrás cargar las notas de los TFGs y de las actividades que obtuvieron los estudiantes independientemente del docente al que se le haya asignado la cátedra.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la \u003cstrong\u003ered de Siglo 21\u003c/strong\u003e o a la \u003cstrong\u003eVPN\u003c/strong\u003e y luego ingresa a http://activitiesdev.uesiglo21.edu.ar/ e introduce las credenciales que utilizas para entrar al SGU. Al ingresar, se despliega la app \u003cstrong\u003eCarga de notas\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eCompleta el campo \u003cstrong\u003eIngresar legajo\u003c/strong\u003e con el número de legajo del estudiante cuya o cuyas notas deseas cargar y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eA continuación, a la derecha del campo de búsqueda verás el \u003cstrong\u003enombre\u003c/strong\u003e y el \u003cstrong\u003eDNI\u003c/strong\u003e del estudiante y en la parte inferior de la pantalla, en el sector izquierdo la \u003cstrong\u003eLista de materias\u003c/strong\u003e, y a la derecha, el \u003cstrong\u003eDetalle de la materia\u003c/strong\u003e en donde podrás cargar la calificación que el estudiante localizado obtuvo en un TFG o actividad dado.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSelecciona la materia de la que deseas cargar la nota. Una vez seleccionada la materia, se podrá visualizar, entre otros datos, su \u003cstrong\u003eEstado\u003c/strong\u003e. El \u003cstrong\u003eEstado\u003c/strong\u003e, por defecto, es decir si aún no se cargó ninguna nota de la materia seleccionada, será \u003cstrong\u003eCURSANDO\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eActualiza el Estado según la nota a ingresar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003esi con la nota obtenida el estudiante aprueba la materia, el \u003cstrong\u003eEstado\u003c/strong\u003e a seleccionar será \u003cstrong\u003eAPROBADA\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003esi con la nota obtenida el estudiante \u003cstrong\u003eNO\u003c/strong\u003e aprueba la materia, el \u003cstrong\u003eEstado\u003c/strong\u003e a seleccionar será \u003cstrong\u003eLIBRE\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eA continuación, ingresa la nota obtenida por el estudiante en el campo \u003cstrong\u003eNota\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eA fin de limitar posibles inconsistencias, la app \u003cb\u003eCarga de Notas\u003c/b\u003e restringe el ingreso de notas según el \u003cb\u003eEstado\u003c/b\u003e de la materia en cuestión.\u003c/div\u003e\n\u003c/div\u003e\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003eSi el \u003cstrong\u003eEstado\u003c/strong\u003e de una materia es \u003cstrong\u003eLIBRE\u003c/strong\u003e, sólo se podrá cargar una nota entre 1 y 3. Si se ingresara, por ejemplo, un 10, se desplegará la leyenda \u003cstrong\u003e\u003cem\u003eValor mayor al permitido\u003c/em\u003e\u003c/strong\u003e y se deshabilitará el botón \u003cstrong\u003eAceptar\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSi el \u003cstrong\u003eEstado\u003c/strong\u003e de una materia es \u003cstrong\u003eAPROBADA\u003c/strong\u003e, sólo se podrá cargar una nota entre 4 y 10. Si se ingresara, por ejemplo, un 2, se desplegará la leyenda \u003cstrong\u003e\u003cem\u003eValor menor al permitido\u003c/em\u003e\u003c/strong\u003e y se deshabilitará el botón \u003cstrong\u003eAceptar\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003e\n\u003cp\u003eLuego de ingresar la \u003cstrong\u003eNota\u003c/strong\u003e, se habilitará el botón \u003cstrong\u003eAceptar\u003c/strong\u003e para guardar los cambios.\u003c/p\u003e\n\u003cp\u003eAl finalizar la carga, podrás visualizar el \u003cstrong\u003eNúmero de libro\u003c/strong\u003e y el \u003cstrong\u003eNúmero de folio\u003c/strong\u003e que la app asigna de forma automática a la nota ingresada.\u003c/p\u003e\n\u003cp\u003eAsimismo, en el sector inferior de la pantalla, la app te informará que la nota fue cargada con éxito.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/visualizar-notas/\" title=\"Visualizar notas\"\u003eVisualizar notas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/editar-notas/\" title=\"Editar notas\"\u003eEditar notas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/anular-notas/\" title=\"Anular notas\"\u003eAnular notas →\u003c/a\u003e\u003c/p\u003e\n"},{id:113,href:"https://bitlogic.github.io/doks-algarrobo/docs/carga-de-notas/editar-notas/",title:"Editar notas",description:null,content:"\u003cp\u003eComo docente, si bien al ingresar un Legajo en la app \u003cstrong\u003eCarga de Notas\u003c/strong\u003e podrían listarse materias de otras cátedras diferentes a la o las que te han sido asignadas, solo podrás \u003cstrong\u003eeditar\u003c/strong\u003e las notas de los TFGs y de las actividades que pertenecen a tu cátedra.\u003c/p\u003e\n\u003cp\u003eComo co-docente, podrás \u003cstrong\u003eeditar\u003c/strong\u003e las notas de los TFGs y de las actividades de todos los alumnos, independientemente del docente al que se le haya asignado la cátedra a la que pertenecen las materias correspondientes.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la \u003cstrong\u003ered de Siglo 21\u003c/strong\u003e o a la \u003cstrong\u003eVPN\u003c/strong\u003e y luego ingresa a http://activitiesdev.uesiglo21.edu.ar/ e introduce las credenciales que utilizas para entrar al SGU. Al ingresar, se despliega la app \u003cstrong\u003eCarga de notas\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eCompleta el campo \u003cstrong\u003eIngresar legajo\u003c/strong\u003e con el número de legajo del estudiante cuya o cuyas notas deseas cargar y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eA continuación, a la derecha del campo de búsqueda verás el \u003cstrong\u003enombre\u003c/strong\u003e y el \u003cstrong\u003eDNI\u003c/strong\u003e del estudiante y en la parte inferior de la pantalla, en el sector izquierdo la \u003cstrong\u003eLista de materias\u003c/strong\u003e, y a la derecha, el \u003cstrong\u003eDetalle de la materia\u003c/strong\u003e en donde podrás editar la calificación que el estudiante localizado obtuvo en un TFG o actividad dado.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSelecciona la materia de la que deseas modificar la nota.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003e3.1\u003c/strong\u003e Si solo debes cambiar la \u003cstrong\u003eNota\u003c/strong\u003e pero el \u003cstrong\u003eEstado\u003c/strong\u003e del TFG o actividad continua siendo \u003cstrong\u003eAPROBADA\u003c/strong\u003e, modifica la \u003cstrong\u003eNota\u003c/strong\u003e en el campo correspondiente. Por ejemplo, ingresa un 9 (en lugar de la Nota 10 ya ingresada).\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003e3.2\u003c/strong\u003e Si solo debes cambiar la \u003cstrong\u003eNota\u003c/strong\u003e pero el \u003cstrong\u003eEstado\u003c/strong\u003e del TFG o actividad continua siendo \u003cstrong\u003eLIBRE\u003c/strong\u003e, modifica la \u003cstrong\u003eNota\u003c/strong\u003e en el campo correspondiente. Por ejemplo, ingresa un 3 (en lugar de la Nota 2 ya ingresada).\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003e3.3\u003c/strong\u003e Si en cambio el \u003cstrong\u003eEstado\u003c/strong\u003e es \u003cstrong\u003eLIBRE\u003c/strong\u003e y con la nueva nota el estudiante aprueba la materia, selecciona \u003cstrong\u003eAPROBADA\u003c/strong\u003e como \u003cstrong\u003eEstado\u003c/strong\u003e y luego modifica la \u003cstrong\u003eNota\u003c/strong\u003e en el campo correspondiente. Por ejemplo, ingresa un 7 (en lugar de la Nota 3 ya ingresada).\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003e3.4\u003c/strong\u003e Si en cambio el \u003cstrong\u003eEstado\u003c/strong\u003e es \u003cstrong\u003eAPROBADA\u003c/strong\u003e y con la nueva nota el estudiante \u003cstrong\u003eNO\u003c/strong\u003e aprueba la materia, selecciona \u003cstrong\u003eLIBRE\u003c/strong\u003e como \u003cstrong\u003eEstado\u003c/strong\u003e y luego modifica la \u003cstrong\u003eNota\u003c/strong\u003e en el campo correspondiente. Por ejemplo, ingresa un 1 (en lugar de la Nota 8 ya ingresada).\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003eAceptar\u003c/strong\u003e. A continuación, la app \u003cstrong\u003eCarga de Notas\u003c/strong\u003e te informará que la nueva nota fue cargada con éxito.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eA fin de limitar posibles inconsistencias, la app \u003cb\u003eCarga de Notas\u003c/b\u003e restringe el ingreso de notas según el \u003cb\u003eEstado\u003c/b\u003e de la materia en cuestión.\u003c/div\u003e\n\u003c/div\u003e\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003eSi el \u003cstrong\u003eEstado\u003c/strong\u003e de una materia es \u003cstrong\u003eLIBRE\u003c/strong\u003e, sólo se podrá cargar una nota entre 1 y 3. Si se ingresara, por ejemplo, un 10, se desplegará la leyenda \u003cstrong\u003e\u003cem\u003eValor mayor al permitido\u003c/em\u003e\u003c/strong\u003e y se deshabilitará el botón \u003cstrong\u003eAceptar\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSi el \u003cstrong\u003eEstado\u003c/strong\u003e de una materia es \u003cstrong\u003eAPROBADA\u003c/strong\u003e, sólo se podrá cargar una nota entre 4 y 10. Si se ingresara, por ejemplo, un 2, se desplegará la leyenda \u003cstrong\u003e\u003cem\u003eValor menor al permitido\u003c/em\u003e\u003c/strong\u003e y se deshabilitará el botón \u003cstrong\u003eAceptar\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl editar la \u003cb\u003eNota\u003c/b\u003e, el \u003cb\u003eNúmero de libro\u003c/b\u003e y el \u003cb\u003eNúmero de folio\u003c/b\u003e que la app asigna de forma automática a la nota originalmente ingresada no cambiará.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/visualizar-notas/\" title=\"Visualizar notas\"\u003eVisualizar notas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/editar-notas/\" title=\"Editar notas\"\u003eEditar notas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/anular-notas/\" title=\"Anular notas\"\u003eAnular notas →\u003c/a\u003e\u003c/p\u003e\n"},{id:114,href:"https://bitlogic.github.io/doks-algarrobo/docs/carga-de-notas/visualizar-notas/",title:"Visualizar notas",description:null,content:"\u003cp\u003eCon la app \u003cstrong\u003eCarga de Notas\u003c/strong\u003e tanto docentes como co-docentes podrán visualizar las notas de los TFGs y de las actividades que un estudiante haya realizado con solo unos simples pasos.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la \u003cstrong\u003ered de Siglo 21\u003c/strong\u003e o a la \u003cstrong\u003eVPN\u003c/strong\u003e y luego ingresa a http://activitiesdev.uesiglo21.edu.ar/ e introduce las credenciales que utilizas para entrar al SGU. Al ingresar, se despliega la app \u003cstrong\u003eCarga de notas\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eCompleta el campo \u003cstrong\u003eIngresar legajo\u003c/strong\u003e con el número de legajo del estudiante cuya o cuyas notas deseas visualizar y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA continuación, a la derecha del campo de búsqueda verás el \u003cstrong\u003enombre\u003c/strong\u003e y el \u003cstrong\u003eDNI\u003c/strong\u003e del estudiante y en la parte inferior de la pantalla, en el sector izquierdo la \u003cstrong\u003eLista de materias\u003c/strong\u003e, y a la derecha, el \u003cstrong\u003eDetalle de la materia\u003c/strong\u003e que contendrá información una vez seleccionada una materia de la lista mencionada.\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eSelecciona la materia de la que deseas visualizar la nota – si ya se hubiera ingresado una. Una vez seleccionada la materia, podrás visualizar:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eel \u003cstrong\u003eNombre\u003c/strong\u003e de la materia seleccionada\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eTipo\u003c/strong\u003e de trabajo o actividad evaluado: TFG o Actividad\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eCódigo de la materia\u003c/strong\u003e y el \u003cstrong\u003ePeríodo\u003c/strong\u003e en que se cursó la materia,  por ejemplo, el 1/22 (el primer período del 2022)\u003c/li\u003e\n\u003cli\u003ela identificación de la \u003cstrong\u003eCátedra\u003c/strong\u003e, por ejemplo \u003cem\u003eCatedra\u003c/em\u003e \u003cstrong\u003e253548\u003c/strong\u003e de la \u003cstrong\u003emateria SEM237\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eEstado\u003c/strong\u003e del TFG o de la actividad correspondiente a dicha materia:\n\u003cul\u003e\n\u003cli\u003eSi aún no se cargó ninguna nota, el Estado será \u003cstrong\u003eCURSANDO\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eSi con la nota obtenida el estudiante aprobó la materia, el \u003cstrong\u003eEstado\u003c/strong\u003e será \u003cstrong\u003eAPROBADA\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eSi con la nota obtenida el estudiante NO aprobó la materia, el \u003cstrong\u003eEstado\u003c/strong\u003e será \u003cstrong\u003eLIBRE\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eSi se ingresó una nota y luego se anuló, el \u003cstrong\u003eEstado\u003c/strong\u003e será \u003cstrong\u003eREGULAR\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003ela sección \u003cstrong\u003e\u003cem\u003eCarga de nota final\u003c/em\u003e\u003c/strong\u003e en la que se incluye:\n\u003cul\u003e\n\u003cli\u003eel número de \u003cstrong\u003eLibro\u003c/strong\u003e donde se registró la \u003cstrong\u003eNota\u003c/strong\u003e del trabajo o actividad\u003c/li\u003e\n\u003cli\u003eel número de \u003cstrong\u003eFolio\u003c/strong\u003e donde se registró la \u003cstrong\u003eNota\u003c/strong\u003e del trabajo o actividad\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eNota\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/cargar-notas/\" title=\"Cargar notas\"\u003eCargar notas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/editar-notas/\" title=\"Editar notas\"\u003eEditar notas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/carga-de-notas/anular-notas/\" title=\"Anular notas\"\u003eAnular notas →\u003c/a\u003e\u003c/p\u003e\n"},{id:115,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/",title:"Añadir Institución educativa",description:null,content:"\u003cp\u003eAl ingresar a la app \u003cstrong\u003eEquivalencias\u003c/strong\u003e, por defecto se despliega el módulo \u003cstrong\u003eInstituciones\u003c/strong\u003e. Como co-docente, en este módulo podrás agregar las universidades o instituciones educativas con sus diferentes carreras y sus respectivos Planes de Estudio que éstas ofrecen. Esto a su vez te permitirá generar \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e que determinarán si una Materia o Actividad de una determinada institución tiene su equivalente en S21.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e con tus credenciales. A continuación, se desplegará la ventana “Lista de Instituciones” donde se listan las instituciones educativas que ya están registradas en el sistema y con las que ya se han cotejado o se cotejarán posibles equivalencias.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eAñadir Institución\u003c/strong\u003e. A continuación, se añadirá al listado una nueva fila compuesta por dos campos a completar que serán señalados por líneas en color rojo y asteriscos que indicarán su condición de campos requeridos u obligatorios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi la institución ingresada es aquella de donde proviene el estudiante (llamada 'de Origen'), deja el botón deslizable tal cual está, es decir, desactivado o grisado.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eIngresa el nombre de la institución y un código. El botón \u003cstrong\u003eGuardar\u003c/strong\u003e quedará habilitado.\u003c/li\u003e\n\u003cli\u003eConfirma que deseas añadir la institución al hacer clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e o pulsando la tecla \u003cstrong\u003eEnter\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSi el \u003cstrong\u003eCódigo\u003c/strong\u003e de la institución ya existe en el sistema, se desplegará el mensaje: \u003cem\u003e\u0026ldquo;Ya existe una institución con ese código.\u0026quot;\u003c/em\u003e Cambia el \u003cstrong\u003eCódigo\u003c/strong\u003e y vuelve a hacer clic el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y confirma la incorporación de la nueva institución.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi se añade una institución con un 'Nombre' igual o similar a uno ya ingresado - pero el código no ha sido utilizado, se advertirá de su existencia para que puedas realizar las modificaciones pertinentes o proseguir con su incorporación.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eSi modificas el \u003cstrong\u003eNombre\u003c/strong\u003e, vuelve a hacer clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y confirma la incorporación de la nueva institución.\u003c/li\u003e\n\u003cli\u003eSi no realizas ninguna modificación, haz clic en el botón \u003cstrong\u003eContinuar\u003c/strong\u003e. Al finalizar con la incorporación de la nueva institución, se desplegará el mensaje: \u003cem\u003e\u0026ldquo;La institución se ha creado exitosamente.\u0026quot;\u003c/em\u003e\u003c/li\u003e\n\u003cli\u003eAutomáticamente serás redirigido a la pantalla \u003cstrong\u003eEditar Institución\u003c/strong\u003e donde podrás modificar el \u003cstrong\u003eNombre\u003c/strong\u003e de la institución y su condición de institución \u003cstrong\u003eOrigen\u003c/strong\u003e o \u003cstrong\u003eDestino\u003c/strong\u003e –si bien no su \u003cstrong\u003eCódigo\u003c/strong\u003e, y agregar el o los Planes y carreras asociadas para continuar, si así lo deseas, con la carga de la nueva institución.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUna institución recién añadida no tendrá Planes o carreras asociados. Para añadir un Plan/Carrera a la institución recién agregada, ver \u003cb\u003eEditar Instituciones\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:116,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/",title:"Añadir Regla de Equivalencia",description:null,content:"\u003cp\u003eLa app \u003cstrong\u003eEquivalencias\u003c/strong\u003e consta de varios módulos, entre ellos, el módulo \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e. En este módulo podrás configurar las \u003cstrong\u003eReglas de Equivalencia\u003c/strong\u003e que establecen cuáles son la o las Materias o Actividades aprobadas en una institución de \u003cem\u003eOrigen\u003c/em\u003e que serán reconocidas como aprobadas por una institución de \u003cem\u003eDestino\u003c/em\u003e.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e con tus credenciales. A continuación, se desplegará la ventana “Lista de Instituciones”. Haz clic en el ícono \u003cstrong\u003eEquivalencias\u003c/strong\u003e en el panel izquierdo de la pantalla para desplegar la ventana \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eNUEVA REGLA DE EQUIVALENCIA\u003c/strong\u003e para cargar una regla nueva. A continuación, se desplegará la ventana \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e donde podrás especificar qué \u003cstrong\u003eMateria\u003c/strong\u003e o \u003cstrong\u003eActividad\u003c/strong\u003e proveniente de una determinada institución de \u003cstrong\u003e\u003cem\u003eOrigen\u003c/em\u003e\u003c/strong\u003e tendrá su homólogo o equivalencia en la institución de \u003cstrong\u003e\u003cem\u003eDestino\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLos campos requeridos u obligatorios están indicados por un asterisco en color rojo. A medida que ingreses información en estos campos, se colocará una marca de \u003cb\u003eCheck\u003c/b\u003e para indicar que fueron completados y desaparecerán las leyendas que indican que falta ingresar información. Asimismo, una vez que el formulario esté completo se habilitará el botón \u003cb\u003eGuardar\u003c/b\u003e para asegurarte de que no faltó ningún dato para crear la \u003cb\u003eRegla de Equivalencia\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003e\n\u003cp\u003eIngresa un nombre para la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e que sea lo suficientemente descriptivo para poder identificarla.\u003c/p\u003e\n\u003cp\u003eSi lo deseas, podrás hacer clic en el botón \u003cstrong\u003eGenerar\u003c/strong\u003e para que la app ingrese un nombre inicial en el campo \u003cstrong\u003eNombre\u003c/strong\u003e que identificará la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e. Este nombre se irá autocompletando a medida que vayas completando los demás campos hasta formular un nombre que describa la regla de forma unívoca que más tarde, si lo deseas, podrás cambiar.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eCompleta el campo \u003cstrong\u003eResolución\u003c/strong\u003e. Este es el número de \u003cstrong\u003eResolución rectoral\u003c/strong\u003e de la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eActiva el botón deslizable \u003cstrong\u003eRegla activa\u003c/strong\u003e para indicar si la \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e estará vigente al finalizar su creación.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eActiva el botón deslizable \u003cstrong\u003eRequiere revisión\u003c/strong\u003e, el cual, como su nombre lo indica, podrá activarse para indicar que alguna materia o actividad de esta \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e que se está agregando debe ser revisada antes de aplicarse cuando un estudiante solicite que se le considere una equivalencia – es decir, una verificación manual antes de otorgar la equivalencia de la materia que el estudiante aprobó en la institución de la que proviene.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"sección-origen\"\u003eSección “Origen”\u003c/h2\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eIngresa la \u003cstrong\u003eInstitución de origen\u003c/strong\u003e, es decir, la institución de la que proviene el estudiante con materias o actividades aprobadas y por la que solicita que se analice si existen materias o actividades homólogas en la institución de destino para que esta última se las acredite como aprobadas.\u003c/li\u003e\n\u003cli\u003eIngresa el \u003cstrong\u003ePlan/carrera de origen\u003c/strong\u003e, es decir, la carrera junto con su Plan de estudios que el estudiante ha cursado en la institución de origen.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"sección-destino\"\u003eSección “Destino”\u003c/h2\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003eIngresa la \u003cstrong\u003eInstitución de destino\u003c/strong\u003e, la cual es la institución a la que el estudiante solicita que analice si las materias o actividades aprobadas en la institución de donde ha estado cursando pueden ser acreditadas como aprobadas.\u003c/li\u003e\n\u003cli\u003eIngresa el \u003cstrong\u003ePlan/carrera de destino\u003c/strong\u003e, es decir, la carrera junto con su Plan de estudios que el estudiante aspira a cursar en la Institución de destino.\u003c/li\u003e\n\u003cli\u003eActiva el botón deslizable \u003cstrong\u003eTodos\u003c/strong\u003e si la actividad o materia aprobada en la institución de origen se considerará como equivalente de las actividades o materias de destino seleccionadas para todos los planes de todas las carreras.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"sección-asociar-actividades--materias\"\u003eSección \u0026ldquo;Asociar Actividades / Materias\u0026rdquo;\u003c/h2\u003e\n\u003cp\u003eEn esta sección, debes seleccionar las materias y actividades que al habilitar la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e que está siendo creada se convertirán en materias o actividades homólogas.\n12. Selecciona la o las materias o actividades de la \u003cstrong\u003eInstitución de origen\u003c/strong\u003e.\n13. Selecciona la o las materias o actividades de la \u003cstrong\u003eInstitución de destino\u003c/strong\u003e que se darán como aprobadas de acuerdo a la o las materias o actividades ingresadas en la Institución de origen.\u003c/p\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUna actividad o materia de origen puede tener una o más actividades o materias equivalentes, y viceversa.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"14\"\u003e\n\u003cli\u003eAntes de guardar la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e, cerciórate de que el \u003cstrong\u003eNombre\u003c/strong\u003e sea lo más descriptivo posible para poder luego filtrarla al hacer una búsqueda. Si hiciste clic en el botón \u003cstrong\u003eGenerar\u003c/strong\u003e para crear un nombre de forma automática, lo verás autocompletado, pero podrás modificarlo si lo consideraras necesario.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y confirma los cambios. A continuación, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eLa regla se ha creado exitosamente\u003c/em\u003e\u003c/strong\u003e y se habilitará el botón \u003cstrong\u003eClonar\u003c/strong\u003e para duplicar la \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e en caso de tener que generar una regla en donde se contemplen diferentes escenarios de equivalencias entre las materias de las instituciones mencionadas.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003ePor ejemplo, si la materia \u003cstrong\u003eDerecho Penal I\u003c/strong\u003e de origen tuviera sólo como equivalencia la materia \u003cstrong\u003e\u003cem\u003eLeyes 1\u003c/em\u003e\u003c/strong\u003e de destino, y la materia \u003cstrong\u003eDerecho Penal II\u003c/strong\u003e tuviera \u003cstrong\u003e\u003cem\u003eLeyes 2\u003c/em\u003e\u003c/strong\u003e y \u003cstrong\u003e\u003cem\u003eLeyes 3\u003c/em\u003e\u003c/strong\u003e como equivalencia, se podrá establecer una primera regla para el primer escenario, y luego \u003cstrong\u003eCLONAR\u003c/strong\u003e esta primera \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e para contemplar el segundo escenario.\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:117,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/",title:"Clonar Plan de Estudio",description:null,content:"\u003cp\u003eEl \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e permite buscar un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e de una carrera determinada para clonarlo y así utilizar como base los atributos y las materias que lo componen.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la carrera cuyo \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e deseas clonar primero mediante el filtro \u003cstrong\u003eNivel de estudio\u003c/strong\u003e para que se habiliten los demás filtros disponibles y el botón de búsqueda. Utiliza los demás filtros disponibles para así limitar los resultados y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez localizada la carrera, haz clic sobre la misma para desplegar los diferentes planes de estudio que tenga asociados y localiza el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e que deseas clonar.\u003c/li\u003e\n\u003cli\u003eSelecciona el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e que deseas clonar y haz clic en el ícono \u003cstrong\u003eClonar plan\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla que se despliega, selecciona una \u003cstrong\u003eModalidad\u003c/strong\u003e y un \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e – ya que son los datos que combinados indefectiblemente deben ser diferentes, y luego haz clic en el botón \u003cstrong\u003eAgregar\u003c/strong\u003e. A continuación, el \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e te llevará a la página inicial donde se lista la carrera y todos sus \u003cstrong\u003ePlanes de Estudio\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eRealiza una búsqueda del \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e recién clonado – cuyo Estado será de \u003cstrong\u003eBorrador\u003c/strong\u003e, para revisarlo y editar lo que sea necesario.\u003c/li\u003e\n\u003cli\u003eEdita si fuera necesario el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e recién clonado en la pantalla de edición del plan. Para más detalles acerca de cómo editar un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e, dirígete a la sección \u003cem\u003eEditar Plan de Estudio\u003c/em\u003e (ver vínculo más abajo).\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:118,href:"https://bitlogic.github.io/doks-algarrobo/docs/sis-config/nivel-de-estudio/",title:"Configurar Nivel de Estudio",description:null,content:"\u003cp\u003eAl término de la creación de dicha combinación, se deberá relacionar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eun \u003cstrong\u003eTipo de materia\u003c/strong\u003e (MIA, MEC, de Proceso, etc.) a la nueva combinación. Así, por ejemplo, se podría relacionar una materia MEC con una combinación dada: MEC + Grado + a Distancia + Tutoría bimestral + Grupo de Seguridad.\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eCriterio de regularidad\u003c/strong\u003e (Por ejemplo, “MEC con Asistencia Teleclases - 2023”)\n\u003cbr\u003e\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa al \u003cstrong\u003eSistema de Configuraciones Académicas\u003c/strong\u003e también llamado \u003cstrong\u003eSIS Config\u003c/strong\u003e con las mismas credenciales que utilizas para entrar al SGU. Por defecto, se desplegará el \u003cstrong\u003eMódulo Nivel de estudio\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn esta primera pantalla, a la izquierda se visualiza la lista \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e con el primer ítem seleccionado por defecto. A la derecha de esta lista, se visualizan tres listas desplegables o secciones:\n\u003cul\u003e\n\u003cli\u003eSección \u003cstrong\u003eConfiguraciones:\u003c/strong\u003e Aquí se listan las combinaciones existentes con el ítem seleccionado en la lista \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e y se registran las nuevas combinaciones.\u003c/li\u003e\n\u003cli\u003eSección \u003cstrong\u003eRequisitos de visado:\u003c/strong\u003e En esta sección, se confecciona la lista de requisitos que se debe repasar para considerar que el estudiante ha completado una materia y no adeuda ninguna documentación o pago. Asimismo, la misma lista de requisitos tendrá un tiempo de vigencia, el cual se denomina \u003cstrong\u003eDuración de la vigencia de visado\u003c/strong\u003e: 30, 120, 180 días, etc.\u003c/li\u003e\n\u003cli\u003eSección \u003cstrong\u003eResoluciones requeridas:\u003c/strong\u003e Aquí el usuario deberá marcar o activar con un botón deslizable cuáles son las resoluciones que ya han sido expedidas y están vigentes, siendo éstas la Resolución  rectoral, la Resolución ministerial, y el número de Expediente C.O.N.E.A.U.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEstas son las resoluciones que necesitan tener los \u003cb\u003ePlanes de Estudio\u003c/b\u003e, por lo que su configuración impacta en el \u003cb\u003eAdministrador de carreras\u003c/b\u003e cuando desde allí se intenta activar un \u003cb\u003ePlan de Estudio\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eEjemplo:\u003c/strong\u003e Si desde el \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e se intenta activar un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e para una carrera de GRADO y dicho plan no tuviera \u003cstrong\u003e\u003cem\u003eResolución ministerial\u003c/em\u003e\u003c/strong\u003e, y en SIS Config el \u003cstrong\u003eNivel de estudio\u003c/strong\u003e GRADO tiene la opción \u003cstrong\u003e\u003cem\u003eResolución ministerial\u003c/em\u003e\u003c/strong\u003e activa, va a arrojar un mensaje de error. Sin embargo, si se intenta activar un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e para un CURSO, y en SIS Config no está establecido que requiere \u003cstrong\u003e\u003cem\u003eResolución ministerial\u003c/em\u003e\u003c/strong\u003e,  dicho plan SÍ se va a poder activar desde el \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e si no cuenta con una resolución de este tipo.\u003c/p\u003e\n\u003ch4 id=\"sección-configuraciones\"\u003eSECCIÓN CONFIGURACIONES\u003c/h4\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eSelecciona un \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e de la lista ubicada a la izquierda de la pantalla -por ejemplo, \u003cstrong\u003eExtragrado\u003c/strong\u003e. A continuación, se mostrará cómo asociarlo o combinarlo a una \u003cstrong\u003eModalidad de Estudio\u003c/strong\u003e, a un \u003cstrong\u003eTurno de cursado\u003c/strong\u003e, y a un \u003cstrong\u003eGrupo de Seguridad\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla principal, se observan 3 listas: \u003cstrong\u003e\u003cem\u003eConfiguraciones\u003c/em\u003e\u003c/strong\u003e, \u003cstrong\u003e\u003cem\u003eRequisitos de visado\u003c/em\u003e\u003c/strong\u003e, y \u003cstrong\u003e\u003cem\u003eResoluciones Requeridas\u003c/em\u003e\u003c/strong\u003e. Haz clic en \u003cstrong\u003eConfiguraciones\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eModo Edición\u003c/strong\u003e. A continuación, se habitará el botón desplegable \u003cstrong\u003eSedes\u003c/strong\u003e lo que te permitirá asociarle a este \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e que hemos seleccionado como ejemplo, es decir, \u003cstrong\u003eExtragrado\u003c/strong\u003e, una \u003cstrong\u003eModalidad de Estudio\u003c/strong\u003e, por ejemplo, \u003cstrong\u003e\u003cem\u003ePresencial (P)\u003c/em\u003e\u003c/strong\u003e para un \u003cstrong\u003eTurno de cursado\u003c/strong\u003e que podría ser, por ejemplo, \u003cstrong\u003e\u003cem\u003eDiplomaturas Extragrado\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona una \u003cstrong\u003eSede\u003c/strong\u003e para indicar la \u003cstrong\u003e\u003cem\u003eModalidad de Estudio\u003c/em\u003e\u003c/strong\u003e (presencial o virtual).\u003c/li\u003e\n\u003cli\u003eSelecciona la \u003cstrong\u003e\u003cem\u003eSubmodalidad\u003c/em\u003e\u003c/strong\u003e (\u003cstrong\u003e\u003cem\u003ePresencial (P)\u003c/em\u003e\u003c/strong\u003e” (a veces indicada como “Presencial .”),  \u003cstrong\u003ePresencial Home (PH)\u003c/strong\u003e, \u003cstrong\u003eEducación Distribuida (ED)\u003c/strong\u003e y \u003cstrong\u003eEducación Distribuida Home (EDH)\u003c/strong\u003e).\u003c/li\u003e\n\u003cli\u003eSelecciona el \u003cstrong\u003eTipo de cursado\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAsí como se puede seleccionar más de una Submodalidad para cada Sede-Modalidad seleccionada, también se podrá seleccionar más de un \u003cb\u003eTipo de cursado\u003c/b\u003e para cada asociación de \u003cb\u003eNiveles de Estudio\u003c/b\u003e y \u003c/b\u003eModalidad de Estudio”.\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003eSelecciona el \u003cstrong\u003eGrupo de Seguridad\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y luego confirma los cambios.\u003c/li\u003e\n\u003cli\u003eLuego de confirmar los cambios el \u003cstrong\u003eSIS Config\u003c/strong\u003e te informará que el \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e se actualizó con éxito.\u003c/li\u003e\n\u003cli\u003eCerciórate de que la nueva combinación de \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e,  \u003cstrong\u003eModalidad de Estudio\u003c/strong\u003e, \u003cstrong\u003eTurno de cursado\u003c/strong\u003e y \u003cstrong\u003eGrupo de seguridad\u003c/strong\u003e se haya añadido.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch5 id=\"relacionar-un-nivel-de-estudio-con-un-tipo-de-materia-y-un-criterio-de-regularidad\"\u003eRelacionar un Nivel de Estudio con un “Tipo de materia” y un “Criterio de Regularidad”\u003c/h5\u003e\n\u003cp\u003eRecuerda que luego de haber definido una combinación de \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e + \u003cstrong\u003eModalidad de Estudio\u003c/strong\u003e + \u003cstrong\u003eTurno de cursado\u003c/strong\u003e + \u003cstrong\u003eGrupos de Seguridad\u003c/strong\u003e, a continuación deberás asociar un \u003cstrong\u003eTipo de materia\u003c/strong\u003e (MEC, MIA, de Proceso, etc.) y un \u003cstrong\u003eCriterio de regularidad\u003c/strong\u003e a la combinación creada.\u003c/p\u003e\n\u003col start=\"13\"\u003e\n\u003cli\u003eSi saliste del \u003cstrong\u003eSistema de Configuraciones Académicas\u003c/strong\u003e o \u003cstrong\u003eSIS Config\u003c/strong\u003e, vuelve a asegurarte de estar conectado a la red de Siglo 21 o a la VPN y vuelve a ingresar al SIS Config con las mismas credenciales que utilizas para entrar al SGU. Por defecto, se desplegará el Módulo \u003cstrong\u003eNivel de estudio\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la lista \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e que se encuentra a la izquierda de la pantalla, localiza el \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e con el que debas relacionar un \u003cstrong\u003eTipo de materia\u003c/strong\u003e determinado. Por ejemplo, localiza el \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e \u003cstrong\u003e\u003cem\u003eExtragrado\u003c/em\u003e\u003c/strong\u003e para relacionarlo con el \u003cstrong\u003eTipo de materia\u003c/strong\u003e MEC.\u003c/li\u003e\n\u003cli\u003eHaz clic en la opción desplegable \u003cstrong\u003eConfiguraciones\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eMODO EDICIÓN\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA continuación, haz clic en el ícono \u003cstrong\u003eAsociar tipos de materia\u003c/strong\u003e que se encuentra debajo del \u003cstrong\u003eTurno de cursado\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEn la ventana que se despliega, podrás observar si ya existe un \u003cstrong\u003eTipo de materia\u003c/strong\u003e o no ya asociado al \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e que seleccionaste, por ejemplo, Extragrado y podrás modificar la asociación existente o eliminarla, o agregar una asociación nueva.\u003c/p\u003e\n\u003col start=\"18\"\u003e\n\u003cli\u003ePara agregar una asociación, haz clic en el botón \u003cstrong\u003eMODO EDICIÓN\u003c/strong\u003e. A continuación, verás la misma pantalla pero con los botones \u003cstrong\u003eGUARDAR\u003c/strong\u003e y \u003cstrong\u003eCANCELAR\u003c/strong\u003e desplegados.\u003c/li\u003e\n\u003cli\u003eHaz clic en el signo \u003cstrong\u003e+\u003c/strong\u003e que se encuentra en el sector inferior de la pantalla.\u003c/li\u003e\n\u003cli\u003eA continuación, se habilitarán dos listas desplegables: \u003cstrong\u003eTipo de materia\u003c/strong\u003e y \u003cstrong\u003eCriterio\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en la lista desplegable \u003cstrong\u003eTipo de materia\u003c/strong\u003e y selecciona una de las opciones que se despliegan -por ejemplo, podrás seleccionar el \u003cstrong\u003eTipo de materia\u003c/strong\u003e MEC.\u003c/li\u003e\n\u003cli\u003eHaz clic en la lista desplegable \u003cstrong\u003eCriterio\u003c/strong\u003e y selecciona una de las opciones que se despliegan. Por ejemplo, selecciona el \u003cstrong\u003eCriterio de regularidad\u003c/strong\u003e: \u003cstrong\u003e\u003cem\u003eMEC CON ASISTENCIA TELECLASES – 2023\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGUARDAR\u003c/strong\u003e y verifica que deseas realizar estos cambios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA continuación, la app \u003cstrong\u003eSIS Config\u003c/strong\u003e desplegará el mensaje \u003cstrong\u003e\u003cem\u003eLos criterios de regularidad se han asociado de forma correcta\u003c/em\u003e\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eEn este ejemplo, hemos entonces asociado al \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e Extragrado con sus combinaciones de \u003cstrong\u003eModalidad de Estudio\u003c/strong\u003e, \u003cstrong\u003eTurno de cursado\u003c/strong\u003e, y \u003cstrong\u003eGrupo de seguridad\u003c/strong\u003e a un \u003cstrong\u003eTipo de materia\u003c/strong\u003e MEC y a un \u003cstrong\u003eCriterio de regularidad\u003c/strong\u003e llamado \u003cstrong\u003e\u003cem\u003eMEC CON ASISTENCIA TELECLASES – 2023\u003c/em\u003e\u003c/strong\u003e que ya estaba establecido con anterioridad y que será el responsable de determinar la condición o Estado de una materia MEC para un estudiante que curse una materia Extragrado con las características mencionadas.\u003c/p\u003e\n\u003ch4 id=\"sección-requisitos-de-visado\"\u003eSECCIÓN REQUISITOS DE VISADO\u003c/h4\u003e\n\u003cp\u003eEl visado consiste en verificar por parte de la universidad una serie de requisitos que los estudiantes deben cumplir ya sea de carácter administrativo (el pago de un ticket), en relación a la biblioteca (material prestado y adeudado), o a la documentación que se debe presentar (foto del DNI, Certificado Analítico, etc.).\u003c/p\u003e\n\u003cp\u003eEn esta sección, se establece para cada \u003cstrong\u003eNivel de estudio\u003c/strong\u003e los requisitos a nivel Administrativo y en relación a la Biblioteca y a la Documentación a presentar que los estudiantes deben cumplir para que el visado sea satisfactorio.\u003c/p\u003e\n\u003col start=\"24\"\u003e\n\u003cli\u003eUna vez que se haya añadido una nueva combinación de \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e,  \u003cstrong\u003eModalidad de Estudio\u003c/strong\u003e, \u003cstrong\u003eTurno de cursado\u003c/strong\u003e y \u003cstrong\u003eGrupo de seguridad\u003c/strong\u003e, procede a establecer cuáles son los \u003cstrong\u003eRequisitos de Visado\u003c/strong\u003e para dicha combinación. Para ello, primero selecciona un \u003cstrong\u003eNivel de estudio\u003c/strong\u003e del sector izquierdo de la pantalla, y luego haz clic en el botón \u003cstrong\u003eMODO EDICIÓN\u003c/strong\u003e. A modo de ejemplo, selecciona el \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e \u003cstrong\u003e\u003cem\u003eExtragrado\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en la lista desplegable \u003cstrong\u003eRequisitos de visado\u003c/strong\u003e para desplegar la sección.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA continuación verás que la sección consta de dos campos: uno en donde se lee \u003cstrong\u003eDuración de la vigencia de visado\u003c/strong\u003e, el cual establece por cuánto tiempo el visado será válido y por lo que al término de dicho lapso de tiempo la universidad podría volver a requerir una acción por parte del estudiante, y el campo \u003cstrong\u003eNueva documentación\u003c/strong\u003e, que como su nombre lo indica, especificará qué documento, copia o certificado el estudiante necesita presentar.\u003c/p\u003e\n\u003col start=\"26\"\u003e\n\u003cli\u003eEn el campo donde se lee \u003cstrong\u003eDuración de la vigencia de visado\u003c/strong\u003e establece, en números, el tiempo de vigencia del visado, por ejemplo, 180 (días).\u003c/li\u003e\n\u003cli\u003eHaz clic en el signo \u003cstrong\u003e+\u003c/strong\u003e ubicado en el extremo derecho del campo \u003cstrong\u003eNueva documentación\u003c/strong\u003e y luego agrega la documentación que los estudiantes deban presentar para el \u003cstrong\u003eNivel de estudio\u003c/strong\u003e seleccionado.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDe ser necesario, agrega cualquier otro tipo de documentación que los estudiantes deban presentar para el \u003cb\u003eNivel de estudio\u003c/b\u003e seleccionado.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"28\"\u003e\n\u003cli\u003eUna vez cargados todos los requisitos, haz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y luego confirma el cambio que deseas realizar.\u003c/li\u003e\n\u003cli\u003eVerifica que los cambios fueron realizados.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch4 id=\"sección-resoluciones-requeridas\"\u003eSECCIÓN RESOLUCIONES REQUERIDAS\u003c/h4\u003e\n\u003cp\u003eEn esta sección, se indicará cuáles son las Resoluciones que se necesitan para activar el \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e de una \u003cstrong\u003ecarrera\u003c/strong\u003e que se inserta dentro de una combinación de \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e en particular. Las resoluciones existentes son: la Resolución Ministerial, la Resolución Rectoral, y el Expediente C.O.N.E.A.U.\u003c/p\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn esta sección, se indica que, si por ejemplo, una carrera se inserta dentro de la combinación \u003c/b\u003eNivel de Estudio\u003c/b\u003e Grado; \u003cb\u003eModalidad de Estudio\u003c/b\u003e Presencial (P); \u003cb\u003eTurno de cursado\u003c/b\u003e Cuatrimestral; y \u003cb\u003eGrupo de seguridad\u003c/b\u003e UE21_ALUMNOS, el \u003cb\u003ePlan de Estudios\u003c/b\u003e de dicha carrera sólo podrá activarse desde la app \u003cb\u003eAdministrador de Carreras\u003c/b\u003e una vez que se emitan la o las Resoluciones Ministerial, Rectoral, o Expediente C.O.N.E.A.U. aquí indicadas.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"31\"\u003e\n\u003cli\u003ePara activar el \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e de una carrera que esté comprendida dentro de un \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e ya configurado, y una vez ya establecidos los \u003cstrong\u003e\u003cem\u003eRequisitos de Visado\u003c/em\u003e\u003c/strong\u003e para dicha combinación, indica cuáles son las \u003cstrong\u003eResoluciones\u003c/strong\u003e. Para ello, primero selecciona un \u003cstrong\u003eNivel de estudio\u003c/strong\u003e del sector izquierdo de la pantalla, y luego haz clic en el botón \u003cstrong\u003eMODO EDICIÓN\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en la lista desplegable \u003cstrong\u003eResoluciones requeridas\u003c/strong\u003e para desplegar la sección.\u003c/li\u003e\n\u003cli\u003eEsta sección cuenta con 3 campos, uno para cada tipo de \u003cstrong\u003eResolución\u003c/strong\u003e y a la derecha de cada campo se puede observar un botón deslizable. Desliza el botón correspondiente para indicar si la \u003cstrong\u003eResolución\u003c/strong\u003e es requerida para activar el \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e de una materia que se inserte dentro de una combinación dada de \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eA modo de ejemplo, si solo se activa la \u003cb\u003eResolución Ministerial\u003c/b\u003e, el \u003cb\u003ePlan de Estudios\u003c/b\u003e de dicha carrera sólo se activará una vez que se emita la \u003cb\u003eResolución Ministerial\u003c/b\u003e y sin necesidad de que se emitan o expidan la \u003cb\u003eResolución rectoral\u003c/b\u003e y el \u003cb\u003eExpediente C.O.N.E.A.U.\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"34\"\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y luego confirma los cambios realizados.\u003c/li\u003e\n\u003cli\u003eVerifica que los cambios se hayan guardado. Para ello, simplemente selecciona el \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e, y haz clic en la sección \u003cstrong\u003eResoluciones requeridas\u003c/strong\u003e para verificar que las resoluciones que activaste se encuentren de hecho activas.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/sis-config/evaluaciones-y-expresiones/\" title=\"Evaluaciones y Expresiones\"\u003eEvaluaciones y Expresiones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/sis-config/criterios-de-regularidad/\" title=\"Criterios de Regularidad\"\u003eCriterios de Regularidad →\u003c/a\u003e\u003c/p\u003e\n"},{id:119,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/",title:"Consultar Estado de solicitud de Equivalencia",description:null,content:"\u003cp\u003eExisten dos formas de consultar el \u003cstrong\u003eEstado\u003c/strong\u003e de tu solicitud de equivalencias:\na) Mediante el enlace o vínculo que la app Equivalencias te proporcionó al finalizar tu pedido de equivalencias. Para hacer la consulta debes contar con el enlace que puedes haber guardado como \u003cstrong\u003e\u003cem\u003eFavoritos\u003c/em\u003e\u003c/strong\u003e.\nb) Ingresando a la app y haciendo clic en la opción \u003cstrong\u003eBuscar solicitud\u003c/strong\u003e, para lo cual debes tener el Número de Seguimiento de tu solicitud.\u003c/p\u003e\n\u003ch4 id=\"consulta-el-estado-de-tu-solicitud-de-equivalencias-mediante-el-enlace-proporcionado-al-finalizar-el-pedido-de-equivalencias\"\u003eConsulta el Estado de tu solicitud de equivalencias mediante el enlace proporcionado al finalizar el pedido de equivalencias:\u003c/h4\u003e\n\u003col\u003e\n\u003cli\u003eBusca y abre\tel enlace que te proporcionó la app Equivalencias cuando finalizaste tu solicitud. A continuación, se desplegará tu \u003cstrong\u003ePedido de equivalencias\u003c/strong\u003e en donde podrás visualizar, en la sección inferior de la pantalla, la institución o universidad a la que asististe anteriormente y la carrera que cursaste y la carrera en la que aspiras que se te adjudiquen equivalencias al cursar en \u003cstrong\u003eSiglo 21\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl Estado de tu solicitud puede ser \u003cb\u003ePendiente\u003c/b\u003e, \u003cb\u003eAprobado\u003c/b\u003e, o \u003cb\u003eRechazado\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch4 id=\"consulta-el-estado-de-tu-solicitud-de-equivalencias-ingresando-a-la-app-equivalencias\"\u003eConsulta el Estado de tu solicitud de equivalencias ingresando a la app Equivalencias:\u003c/h4\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a https://tusestudiosprevios.21.edu.ar.\u003c/li\u003e\n\u003cli\u003eHaz clic en \u003cstrong\u003eBuscar solicitud\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA continuación, se desplegará una ventana donde debes ingresar el \u003cstrong\u003eNúmero de Seguimiento\u003c/strong\u003e de tu \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e y tu tipo y número de documento.\u003c/li\u003e\n\u003cli\u003eUna vez completados los datos, se habilitará el botón \u003cstrong\u003eBuscar\u003c/strong\u003e. Haz clic en este botón para localizar tu solicitud de equivalencias.\nA continuación, podrás ver:\n\u003cul\u003e\n\u003cli\u003ela institución o universidad a la que asististe anteriormente\u003c/li\u003e\n\u003cli\u003ela carrera que cursaste\u003c/li\u003e\n\u003cli\u003ela carrera en la que aspiras que se te adjudiquen equivalencias al cursar en \u003cstrong\u003eSiglo 21\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eEstado\u003c/strong\u003e de tu solicitud la cual si recién la enviaste será \u003cstrong\u003e\u003cem\u003ePendiente\u003c/em\u003e\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003elas materias que se te otorgarán como equivalencias si la documentación presentada está completa y avala la información ingresada\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-visualizar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar una solicitud de Equivalencias\"\u003eRealizar una solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:120,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/",title:"Crear carreras",description:null,content:"\u003cp\u003ePara crea carreras nuevas con sus características y \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e propios, comienza completando un formulario con los requisitos mínimos.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón verde con el signo \u003cstrong\u003e+\u003c/strong\u003e que se encuentra en la esquina inferior derecha de la pantalla para desplegar el ícono \u003cstrong\u003eCrear carrera\u003c/strong\u003e. Haz clic en este ícono.\u003c/li\u003e\n\u003cli\u003eA continuación se desplegará el formulario \u003cstrong\u003eCrear carrera\u003c/strong\u003e. Completa como mínimo los campos requeridos que están señalados con un asterisco: \u003cstrong\u003eDescripción\u003c/strong\u003e, \u003cstrong\u003eCódigo\u003c/strong\u003e, \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e, \u003cstrong\u003eDecanato\u003c/strong\u003e y \u003cstrong\u003eTítulo final\u003c/strong\u003e. Completa el \u003cstrong\u003eTítulo Intermedio\u003c/strong\u003e y la \u003cstrong\u003eOrientación\u003c/strong\u003e según corresponda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi la carrera contase con uno o más títulos intermedios y con una o más orientaciones, se deben completar los campos correspondientes al seleccionar una o más opciones de la lista desplegable.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eSi el \u003cstrong\u003eTítulo final\u003c/strong\u003e, el \u003cstrong\u003eTítulo Intermedio\u003c/strong\u003e, o la \u003cstrong\u003eOrientación\u003c/strong\u003e no estuviese en la lista, podrás crearlos haciendo clic en \u003cstrong\u003e\u003cem\u003eAgregar un nuevo título\u003c/em\u003e\u003c/strong\u003e. En la ventana que se despliega, ingresa un \u003cstrong\u003eNombre femenino\u003c/strong\u003e, como por ejemplo, \u003cem\u003eIngeniera de Testeo\u003c/em\u003e, y un \u003cstrong\u003eNombre masculino\u003c/strong\u003e, que en línea con el nombre femenino del ejemplo mencionado será \u003cem\u003eIngeniero de Testeo\u003c/em\u003e. Este será el nombre del título otorgado que figurará en el diploma y en el certificado analítico.\u003c/li\u003e\n\u003cli\u003eSi estás agregando un \u003cstrong\u003eTítulo Final\u003c/strong\u003e o un \u003cstrong\u003eTítulo Intermedio\u003c/strong\u003e, si la carrera tuviera una \u003cstrong\u003eOrientación\u003c/strong\u003e, ingresa cuál será el nombre que va a permitir identificar dicha \u003cstrong\u003eOrientación\u003c/strong\u003e en el campo \u003cstrong\u003eDescripción\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona el \u003cstrong\u003eTipo de título\u003c/strong\u003e de la lista desplegable de acuerdo a lo que estés agregando: Final, Intermedio, u Orientación.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eAgregar\u003c/strong\u003e. A continuación se desplegará el mensaje \u003cem\u003e“El Título se creó con éxito”\u003c/em\u003e y los campos de la ventana \u003cem\u003e“Agregar un nuevo título”\u003c/em\u003e se limpiarán.\u003c/li\u003e\n\u003cli\u003eDe contar con esta información, completa la sección \u003cem\u003e“Dirección”\u003c/em\u003e con un \u003cstrong\u003eDirector\u003c/strong\u003e y un \u003cstrong\u003eCo Director\u003c/strong\u003e para la carrera.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. Se desplegará el mensaje \u003cem\u003e“La carrera se creó con éxito”\u003c/em\u003e, los campos completados se limpiarán, y podrás escoger entre crear otra carrera o agregar un \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e a la carrera recién creada.\u003c/li\u003e\n\u003cli\u003ePara verificar que la carrera ha sido creada, cierra el Formulario \u003cstrong\u003eCrear carrera\u003c/strong\u003e para volver a la ventana \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e. Una vez allí, haz una búsqueda utilizando al menos los filtros \u003cstrong\u003eNivel de estudio\u003c/strong\u003e y \u003cstrong\u003eDescripción o código de carrera\u003c/strong\u003e para visualizar la carrera recién creada.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl Estado de la carrera recién creada será Borrador debido a que aun no tiene un Plan de Estudio asociado vigente (es decir,  con Resolución Ministerial). Tener la carrera en Estado BORRADOR te permitirá ir diseñando un Plan de Estudio, y una vez que dicho Plan esté completo, generar una resolución rectoral para luego solicitar la resolución ministerial.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003ePara continuar con la creación de esta carrera, deberás añadir un Plan de estudio. Podrás hacerlo a partir de cualquiera de las siguientes dos instancias:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eEn el mensaje desplegado inmediatamente después de crear la carrera, al hacer clic en el botón \u003cstrong\u003eAñadir Plan\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eAl corroborar que la carrera ha sido creada, al hacer clic en el signo \u003cstrong\u003e+\u003c/strong\u003e ubicado a la derecha del encabezado que detalla el Decanato y el Estado de la carrera.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi intentaras crear otra carrera y colocaras una misma Descripción, Código, o Código Presencial, al hacer clic en el botón Guardar el sistema no te permitirá crearla y te informará que dichos campos deben ser únicos.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003ePara añadir un Plan de estudio, dirígete a la sección \u003cem\u003eDiseñar Plan de Estudio\u003c/em\u003e(ver link más abajo).\u003c/li\u003e\n\u003cli\u003ePara editar la carrera, dirígete a la sección \u003cem\u003eEditar carreras\u003c/em\u003e (ver link más abajo).\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:121,href:"https://bitlogic.github.io/doks-algarrobo/docs/sis-config/criterios-de-regularidad/",title:"Crear Criterios de Regularidad",description:null,content:"\u003cp\u003eUn criterio de regularidad es un conjunto de condiciones que se aplican sobre diferentes tipos de evaluaciones tales como Trabajos Prácticos (TPs) o parciales y sobre la Asistencia (porcentaje permitido de ausentes) que al cumplirse (o al no cumplirse) determina el Estado académico final (regular, libre por nota, libre por inasistencia) de un estudiante en una materia.\u003c/p\u003e\n\u003cp\u003eLos Criterios de regularidad son los siguientes y deben establecerse en un cierto orden para cada \u003cstrong\u003eTipo de materia\u003c/strong\u003e: MIA, MEC, de Proceso, etc.\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003ePromoción directa\u003c/strong\u003e (el estudiante ha obtenido notas que lo eximen de rendir un examen final)\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePromoción indirecta\u003c/strong\u003e (el estudiante ha obtenido notas que lo eximen de rendir un examen final)\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eRegular\u003c/strong\u003e (el estudiante ha obtenido notas en los exámenes parciales que no lo eximen de rendir un examen final)\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eLibre por nota\u003c/strong\u003e (el estudiante se ha quedado libre por aplazo)\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eLibre por asistencia\u003c/strong\u003e (el estudiante se ha quedado libre por inasistencias)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eConfigurar un \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e significa tomar, por ejemplo, una materia \u003cstrong\u003eMEC\u003c/strong\u003e y establecer de acuerdo a ciertos parámetros en qué condición de regularidad está el estudiante en relación a la materia. Las fórmulas relacionadas con obtener una calificación o nota mayor o menor a un número dado, por ejemplo, \u003cstrong\u003eMEC\u003c/strong\u003e / \u003cstrong\u003eNota de TPA mayor a 7\u003c/strong\u003e, o con respecto a un porcentaje de asistencia, por ejemplo, \u003cstrong\u003eMEC\u003c/strong\u003e / \u003cstrong\u003eAsistencia 75%\u003c/strong\u003e, se configuran previamente en un \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eDe este modo, si la universidad decidiera que para una materia \u003cstrong\u003eMEC\u003c/strong\u003e los \u003cstrong\u003eTRABAJOS PRÁCTICOS ADICIONALES (TPA)\u003c/strong\u003e deben tener una nota \u003cstrong\u003emayor a 7\u003c/strong\u003e para promocionar la materia, es decir para no tener que rendir examen final (Criterio de Regularidad), se deberá especificar en un \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e cuya configuración sería: \u003cstrong\u003eMEC\u003c/strong\u003e, \u003cstrong\u003ePROMOCIÓN DIRECTA\u003c/strong\u003e, \u003cstrong\u003eNota de TPA \u0026gt; 7\u003c/strong\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara el \u003cb\u003eCriterio de regularidad\u003c/b\u003e de este ejemplo, el \u003cb\u003eGrupo de Evaluaciones y Expresiones\u003c/b\u003e que indica que para Materias MEC la \u003cb\u003eNota de TPA \u003e 7\u003c/b\u003e debe haberse establecido anteriormente.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa al \u003cstrong\u003eSistema de Configuraciones Académicas\u003c/strong\u003e también llamado \u003cstrong\u003eSIS Config\u003c/strong\u003e con las mismas credenciales que utilizas para entrar al SGU. Por defecto, se desplegará el Módulo ** de estudio**.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el Módulo \u003cstrong\u003eCriterios de regularidad\u003c/strong\u003e. Por defecto, se desplegará el primer criterio de la lista de criterios ya establecidos.\u003c/p\u003e\n\u003cp\u003eSi recorremos la lista de la columna \u003cstrong\u003eCriterios de regularidad\u003c/strong\u003e podremos ver otros criterios en donde se especifica qué debe suceder para que la condición o \u003cstrong\u003eEstado\u003c/strong\u003e de una materia sea de \u003cstrong\u003ePromoción directa\u003c/strong\u003e, \u003cstrong\u003ePromoción indirecta\u003c/strong\u003e, \u003cstrong\u003eRegular\u003c/strong\u003e, \u003cstrong\u003eLibre por nota\u003c/strong\u003e, o \u003cstrong\u003eLibre por asistencia\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA continuación se procederá a la creación del \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e llamado \u003cstrong\u003ePROCESO – PRESENCIAL 2023\u003c/strong\u003e para mostrar todo el proceso desde su inicio.\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eMODO EDICIÓN\u003c/strong\u003e y luego en el signo \u003cstrong\u003e+\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA continuación, ingresa un nombre para el \u003cstrong\u003eCriterio de regularidad\u003c/strong\u003e que estás por configurar. Este nombre debe incluir:\n\u003cul\u003e\n\u003cli\u003eel tipo de materia: EFIP, MEC, MIA, De Proceso, etc.\u003c/li\u003e\n\u003cli\u003ela modalidad: Presencial, Sin asistencia, etc.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA modo de ejemplo, ingresa el nombre \u003cstrong\u003ePROCESO – PRESENCIAL\u003c/strong\u003e, y luego se desliza el botón desplegable \u003cstrong\u003eEjecutar al inicio del período\u003c/strong\u003e si el \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e que se está creando se debe aplicar al inicio de un Período.\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. El \u003cstrong\u003eNombre\u003c/strong\u003e del nuevo criterio será agregado en el sector izquierdo de la pantalla, al final de la lista.\u003c/li\u003e\n\u003cli\u003ePosiciónate en el nuevo criterio agregado y haz clic en \u003cstrong\u003eMODO EDICIÓN\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la ventana que se despliega, haz clic en \u003cstrong\u003eAGREGAR GRUPO DE EVALUACIÓN\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la ventana que se despliega, selecciona un ítem de evaluación – Parciales, TPs, TPAs, o un ítem de Asistencia.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e. El \u003cstrong\u003eGrupo de Evaluación\u003c/strong\u003e recién agregado se desplegará en la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEste grupo de evaluación ya debe haber sido creado en el Módulo \u003cb\u003eGrupo de Evaluaciones y Expresiones\u003c/b\u003e del \u003cb\u003eSIS Config\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"10\"\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en \u003cstrong\u003eAgregar tipo\u003c/strong\u003e. Esto definirá como se utilizará la \u003cstrong\u003eExpresión\u003c/strong\u003e (FÓRMULA) establecida en el \u003cstrong\u003eGrupo de evaluación y expresión\u003c/strong\u003e seleccionado.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eEn \u003cstrong\u003eAgregar tipo\u003c/strong\u003e, selecciona \u003cstrong\u003eAprobación\u003c/strong\u003e. A continuación, se despliega la ventana \u003cstrong\u003eAprobación\u003c/strong\u003e, en donde deberás completar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eel \u003cstrong\u003eNombre\u003c/strong\u003e que definirá la condición de regularidad: \u003cstrong\u003ePromoción directa\u003c/strong\u003e, \u003cstrong\u003ePromoción Indirecta\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eExpresión\u003c/strong\u003e, la cual se debe haber establecido en un \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e para el ítem evaluador (puede haber más de una Expresión dentro del \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e para el ítem evaluador)\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eEstado\u003c/strong\u003e de la materia, el cual es el Estado que tendrá la materia de acuerdo al criterio de regularidad que se está creando o definiendo.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez completados los campos de la ventana \u003cstrong\u003eAprobación\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eCONFIRMAR\u003c/strong\u003e. A continuación, se desplegará una ventana en donde podemos observar que para una materia del tipo \u003cstrong\u003eProceso\u003c/strong\u003e, cuya modalidad es \u003cstrong\u003ePresencial\u003c/strong\u003e, hasta ahora hemos establecido que la condición o Estado será de \u003cstrong\u003ePromoción Directa\u003c/strong\u003e con respecto a un ítem de evaluación dado.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSelecciona la \u003cstrong\u003eCondición\u003c/strong\u003e. En este ejemplo, \u003cstrong\u003eSin final\u003c/strong\u003e es la única opción disponible porque el \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e es \u003cstrong\u003e\u003cem\u003ePromoción Directa\u003c/em\u003e\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en \u003cstrong\u003eAgregar Grupo de Evaluación\u003c/strong\u003e nuevamente para agregar otro ítem de evaluación que se corresponda con el \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e: \u003cstrong\u003e\u003cem\u003ePromoción Directa\u003c/em\u003e\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA modo de ejemplo, selecciona \u003cstrong\u003eTrabajos Prácticos (TPs)\u003c/strong\u003e.\u003c/p\u003e\n\u003col start=\"15\"\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e. El \u003cstrong\u003eGrupo de Evaluación\u003c/strong\u003e recién agregado se desplegará en la pantalla, debajo del primer \u003cstrong\u003eGrupo de Evaluación\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003ePara terminar de definir el \u003cstrong\u003eCriterio de regularidad\u003c/strong\u003e con respecto a los Trabajos Prácticos, debes establecer una \u003cstrong\u003eCondición\u003c/strong\u003e. Haz clic en la lista desplegable, y selecciona una condición.\u003c/li\u003e\n\u003cli\u003eHaz clic en \u003cstrong\u003eAgregar Grupo de Evaluación\u003c/strong\u003e nuevamente para agregar un ítem de asistencia que se corresponda con el \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e: \u003cstrong\u003e\u003cem\u003ePromoción Directa\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez seleccionado el \u003cstrong\u003eGrupo de Evaluación\u003c/strong\u003e: \u003cstrong\u003e\u003cem\u003eAsistencia\u003c/em\u003e\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003ePara terminar de definir el \u003cstrong\u003eCriterio de regularidad\u003c/strong\u003e con respecto a la \u003cstrong\u003eAsistencia\u003c/strong\u003e, debes establecer una \u003cstrong\u003eCondición\u003c/strong\u003e. Haz clic en la lista desplegable, y selecciona una condición.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003ePara el \u003cstrong\u003eCriterio de regularidad\u003c/strong\u003e: \u003cstrong\u003e\u003cem\u003ePromoción Directa\u003c/em\u003e\u003c/strong\u003e, la universidad puede fijar condiciones para la asistencia o no. Dependiendo de los estándares que desee fijar, podrá optar por fijar un \u003cstrong\u003e75% de asistencia a módulos\u003c/strong\u003e o por no fijar ninguna restricción al respecto.\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl criterio de regularidad \u003cb\u003ePromoción directa\u003c/b\u003e se le pueden agregar más \u003cb\u003eGrupos de Evaluación\u003c/b\u003e tales como \u003cb\u003eParciales\u003c/b\u003e o \u003cb\u003eCorrelativas\u003c/b\u003e para así establecer más condiciones para que los estudiantes obtengan la condición o Estado de \u003cb\u003ePromoción directa\u003c/b\u003e para un tipo de materia dada.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"20\"\u003e\n\u003cli\u003ePara crear el siguiente \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e para el mismo \u003cstrong\u003eTipo de materia\u003c/strong\u003e + \u003cstrong\u003eModalidad:\u003c/strong\u003e \u003cstrong\u003e\u003cem\u003eProceso – Presencial\u003c/em\u003e\u003c/strong\u003e, haz clic en \u003cstrong\u003eAgregar tipo\u003c/strong\u003e, selecciona \u003cstrong\u003eAprobación\u003c/strong\u003e, y en \u003cstrong\u003eNombre\u003c/strong\u003e, coloca \u003cstrong\u003e\u003cem\u003ePromoción Indirecta\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona una de las opciones del campo \u003cstrong\u003eExpresión\u003c/strong\u003e. En este ejemplo, se seleccionará \u003cstrong\u003eExamen final con 4 o más\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona el \u003cstrong\u003eEstado\u003c/strong\u003e de la materia, el cual es el Estado que tendrá la materia de acuerdo al criterio de regularidad que se está creando o definiendo.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e. A continuación, verás el nuevo criterio desplegado a la derecha del de \u003cstrong\u003ePromoción directa\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eAgrega las condiciones para los ítems de evaluación y asistencia que ya ingresaste para \u003cstrong\u003ePromoción directa\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch4 id=\"ejemplo-al-agregar-tipo-igual-a-requiere-examen\"\u003eEjemplo al “Agregar tipo” igual a “Requiere Examen”\u003c/h4\u003e\n\u003col start=\"25\"\u003e\n\u003cli\u003ePara crear el siguiente \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e para el mismo tipo de materia + Modalidad: \u003cstrong\u003eProceso – Presencial\u003c/strong\u003e, haz clic en \u003cstrong\u003eAgregar tipo\u003c/strong\u003e, pero esta vez, en vez de \u003cstrong\u003e\u003cem\u003eAprobación\u003c/em\u003e\u003c/strong\u003e, selecciona \u003cstrong\u003e\u003cem\u003eRequiere examen\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona el \u003cstrong\u003eNombre:\u003c/strong\u003e \u003cstrong\u003e\u003cem\u003eRegular\u003c/em\u003e\u003c/strong\u003e, y las opciones restantes teniendo en cuenta que el Estado que se está configurando es el de \u003cstrong\u003eRegular\u003c/strong\u003e y luego haz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e. A continuación, se desplegará el nuevo \u003cstrong\u003eEstado\u003c/strong\u003e a la derecha de los otros ya creados.\u003c/li\u003e\n\u003cli\u003eAgrega las condiciones para los ítems de evaluación y asistencia que ya ingresaste para \u003cstrong\u003ePromoción directa\u003c/strong\u003e y de ser necesario, agrega un ítem de evaluación adicional, por ejemplo, \u003cstrong\u003eCorrelativas\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y confirma los cambios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch4 id=\"ejemplo-al-agregar-tipo-igual-a-desaprobación\"\u003eEjemplo al “Agregar tipo” igual a “Desaprobación”\u003c/h4\u003e\n\u003col start=\"29\"\u003e\n\u003cli\u003eHaz clic nuevamente en \u003cstrong\u003eAgregar tipo\u003c/strong\u003e y selecciona \u003cstrong\u003eDesaprobación\u003c/strong\u003e. A continuación, se desplegará la ventana \u003cstrong\u003eDesaprobación\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la ventana \u003cstrong\u003eDesaprobación\u003c/strong\u003e, completa el \u003cstrong\u003eNombre\u003c/strong\u003e que definirá que sucederá si el estudiante no aprueba cualquier tipo de evaluación. Es decir, la condición o \u003cstrong\u003e\u003cem\u003eEstado\u003c/em\u003e\u003c/strong\u003e en la que quedará el estudiante en relación a una materia de un tipo determinado si es aplazado en los exámenes con los que la universidad evalúa su desempeño – o si su asistencia no alcanza al nivel establecido por la universidad: \u003cstrong\u003eLibre por nota\u003c/strong\u003e y \u003cstrong\u003eLibre por inasistencia\u003c/strong\u003e. Ingresa, por ejemplo, \u003cstrong\u003eLibre por Nota\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez completados los campos de la ventana \u003cstrong\u003eDesaprobación\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eCONFIRMAR\u003c/strong\u003e. A continuación, verás el \u003cstrong\u003eEstado\u003c/strong\u003e \u003cstrong\u003e\u003cem\u003eLibre por Nota\u003c/em\u003e\u003c/strong\u003e a la derecha del último Estado configurado.\u003c/li\u003e\n\u003cli\u003eAgrega las condiciones por \u003cstrong\u003eGrupo de evaluación\u003c/strong\u003e (Asistencia, Trabajos Prácticos, Finales, Parciales).\u003c/li\u003e\n\u003cli\u003eHaz clic nuevamente en \u003cstrong\u003eAgregar tipo\u003c/strong\u003e y vuele a seleccionar \u003cstrong\u003eDesaprobación\u003c/strong\u003e, pero esta vez en vez de crear el \u003cstrong\u003eEstado\u003c/strong\u003e \u003cstrong\u003e\u003cem\u003eLibre por Nota\u003c/em\u003e\u003c/strong\u003e, establece el Estado \u003cstrong\u003e\u003cem\u003eLibre por Asistencia\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez completados los campos de la ventana \u003cstrong\u003eDesaprobación\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eCONFIRMAR\u003c/strong\u003e. A continuación, verás el \u003cstrong\u003eEstado\u003c/strong\u003e \u003cstrong\u003e\u003cem\u003eLibre por Asistencia\u003c/em\u003e\u003c/strong\u003e a la derecha del último Estado configurado.\u003c/li\u003e\n\u003cli\u003eAgrega las condiciones por \u003cstrong\u003eGrupo de evaluación\u003c/strong\u003e (Asistencia, Trabajos Prácticos, Finales, Parciales).\u003c/li\u003e\n\u003cli\u003eRealiza el mismo procedimiento para otros tipos de \u003cstrong\u003ematerias + modalidad\u003c/strong\u003e. Recuerda que al crear un \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e debes contar con:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eNiveles de Estudio\u003c/strong\u003e en donde se asocian \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e + \u003cstrong\u003eModalidad\u003c/strong\u003e + \u003cstrong\u003eTurno de cursado\u003c/strong\u003e y \u003cstrong\u003eGrupos de Seguridad\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eEvaluaciones y Expresiones\u003c/strong\u003e que establecen:\n\u003cul\u003e\n\u003cli\u003eUna configuración que indica que para un \u003cstrong\u003eítem evaluador\u003c/strong\u003e (Trabajos Prácticos (TPs), Parciales, Actividades Prácticas Integradoras (APIs), etc.) hay una \u003cstrong\u003eFÓRMULA\u003c/strong\u003e (“expresión”) que puede combinar, entre otros ítems, Notas + % de Asistencia\u003c/li\u003e\n\u003cli\u003ey una configuración que establece el \u003cstrong\u003eporcentaje de Asistencia\u003c/strong\u003e que un estudiante debe tener para poder promocionar la materia\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/sis-config/nivel-de-estudio/\" title=\"Niveles de Estudio\"\u003eNiveles de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/sis-config/evaluaciones-y-expresiones/\" title=\"Evaluaciones y Expresiones\"\u003eEvaluaciones y Expresiones →\u003c/a\u003e\u003c/p\u003e\n"},{id:122,href:"https://bitlogic.github.io/doks-algarrobo/docs/sis-config/evaluaciones-y-expresiones/",title:"Crear Evaluaciones y Expresiones",description:null,content:"\u003cp\u003e\u003cstrong\u003eGrupo de Evaluaciones y Expresiones de un ítem de evaluación:\u003c/strong\u003e Esta es una configuración que establece que para un ítem evaluador (Trabajos Prácticos (TPs), Parciales, Finales, Actividades Prácticas Integradoras (APIs), etc.) haya una FÓRMULA (“expresión”) que puede combinar, entre otros ítems, Notas + % de Asistencia, para que luego al configurar un \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e se establezca que el Estado del estudiante sea \u0026ldquo;regular\u0026rdquo;, “promoción”, “libre”, etc.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eGrupo de Evaluaciones y Expresiones de la asistencia:\u003c/strong\u003e Esta configuración establece que, por ejemplo, para la Asistencia en la modalidad Presencial haya una FÓRMULA (“expresión”) que indique cuál debe ser el porcentaje de módulos a una materia a los que los estudiantes deben concurrir para que luego el Módulo \u003cstrong\u003eCriterios de Regularidad\u003c/strong\u003e lo utilice en sus propias fórmulas.\u003c/p\u003e\n\u003ch4 id=\"crear-grupos-de-evaluaciones-y-expresiones-para-un-ítem-evaluador\"\u003eCrear “Grupos de Evaluaciones y Expresiones” para un Ítem Evaluador\u003c/h4\u003e\n\u003cp\u003eCuando se agrega un \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e primero se agrega el ítem evaluador, por ejemplo, Finales, y luego la \u003cstrong\u003eExpresión\u003c/strong\u003e (FÓRMULA).\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa al \u003cstrong\u003eSistema de Configuraciones Académicas\u003c/strong\u003e también llamado \u003cstrong\u003eSIS Config\u003c/strong\u003e con las mismas credenciales que utilizas para entrar al SGU. Por defecto, se desplegará el Módulo \u003cstrong\u003eNivel de estudio\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el Módulo \u003cstrong\u003eEvaluaciones y expresiones\u003c/strong\u003e. Por defecto, se desplegarán la o las instancias de evaluación y expresión ya establecidas del primer ítem evaluador o de Asistencia listado a la izquierda de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003ePara agregar un ítem de evaluación (TP, Parciales, etc.), haz clic en el botón \u003cstrong\u003eMODO EDICIÓN\u003c/strong\u003e para habilitar el botón que te permitirá añadir un nuevo \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e. Recuerda que debes comenzar por añadir un ítem evaluador o de asistencia.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón verde con el signo \u003cstrong\u003e+\u003c/strong\u003e para desplegar la ventana \u003cstrong\u003eCrear grupo de evaluaciones y expresiones\u003c/strong\u003e – y agrega un Nombre para el grupo (puede ser el mismo nombre del ítem evaluador, por ejemplo, “PARCIALES”).\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, verás desplegado el nombre del grupo (siguiendo con el mismo ejemplo, “PARCIALES”) en el panel izquierdo de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el nuevo grupo creado para desplegar la pantalla que tendrá el nombre del ítem de evaluación (por ejemplo, “PARCIALES”) y las solapas “EVALUACIONES” y “EXPRESIONES”.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003e+\u003c/strong\u003e para agregar una \u003cstrong\u003eEVALUACIÓN\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eA continuación, se habilitarán los campos para la pestaña \u003cstrong\u003eEvaluaciones\u003c/strong\u003e donde debes ingresar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eun \u003cstrong\u003eNombre interno\u003c/strong\u003e (no visible para los estudiantes): Nombre con el que se identificará la \u003cstrong\u003eEvaluación\u003c/strong\u003e (el ítem de evaluación o de asistencia) de este \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e. Puede ser igual al ítem agregado (“PARCIALES”), o un poco más descriptivo.\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eNombre externo\u003c/strong\u003e (visible para los estudiantes): Puede ser igual al \u003cstrong\u003eNombre interno\u003c/strong\u003e o más descriptivo  - o menos formal. Es el Nombre con el que los estudiantes verán la \u003cstrong\u003eEvaluación\u003c/strong\u003e. Por ejemplo, \u003cstrong\u003eParcial 20 preguntas\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eCódigo\u003c/strong\u003e que identifique el ítem de evaluación, por ejemplo, \u003cstrong\u003eFFF\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eFuente\u003c/strong\u003e: se refiere a si se está agregando un \u003cstrong\u003eítem de evaluación\u003c/strong\u003e como lo es un examen, o si se está agregando una actividad o una \u003cstrong\u003eAsistencia\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eTipo\u003c/strong\u003e: Se desplegará de acuerdo a la \u003cstrong\u003eFuente\u003c/strong\u003e seleccionada.\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eObjetivo\u003c/strong\u003e: En ítem evaluador \u003cstrong\u003eParciales\u003c/strong\u003e y \u003cstrong\u003eTPs\u003c/strong\u003e, el \u003cstrong\u003eObjetivo\u003c/strong\u003e hace referencia a los ID en Base de Datos de cada uno de estos. Por ejemplo, en Primer Parcial, el Objetivo es igual a 19, que es el ID de la tabla “ue_tipos_examenes”. Esto sirve para evaluar la expresión posteriormente y buscar, en base de datos, la nota correspondiente. En \u003cstrong\u003eTPs\u003c/strong\u003e, el Objetivo es 1, 2, 3, 4 según el número de TP. En otros ítems evaluadores, solo es un valor numérico sin significado.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eDirígete a la pestaña \u003cstrong\u003eExpresiones\u003c/strong\u003e y haz clic en el botón \u003cstrong\u003e+\u003c/strong\u003e. A continuación, se desplegará la pantalla donde debes ingresar la \u003cstrong\u003eExpresión\u003c/strong\u003e o FÓRMULA para terminar de configurar el \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e cuyo nombre es el del ítem de evaluación (por ejemplo, “PARCIALES”).\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eEn esta pantalla deberás completar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eun \u003cstrong\u003eNombre interno\u003c/strong\u003e (no visible para los estudiantes): Nombre con el que el Usuario (co-docente) identificará la \u003cstrong\u003eExpresión\u003c/strong\u003e (FÓRMULA)\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eNombre externo\u003c/strong\u003e (visible para los estudiantes): Nombre con el que los estudiantes verán la \u003cstrong\u003eExpresión\u003c/strong\u003e (FÓRMULA)\u003c/li\u003e\n\u003cli\u003eel Tipo de expresión que identifique si la FÓRMULA será utilizada para un \u003cstrong\u003eCálculo de estado\u003c/strong\u003e, un \u003cstrong\u003eCálculo de nota de aprobación\u003c/strong\u003e o una combinación de notas y cálculo de estado.\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eExpresión\u003c/strong\u003e o FÓRMULA que especifique un cálculo que luego será utilizado por un \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e que determinará que si la calificación (o asistencia) del estudiante se ajusta o coincide con la FÓRMULA del ítem evaluador (en este ejemplo, con qué calificación o nota se aprueba un examen final), su condición de regularidad frente a una materia será de “regular”, “promoción”, “no promoción”, o “libre”. Por ejemplo: \u003cstrong\u003eFFF \u0026gt; 4\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y luego confirma que quieres realizar los cambios. A continuación, se desplegará un mensaje informando que \u003cstrong\u003e\u003cem\u003eEl grupo de evaluaciones y expresiones se creó con éxito\u003c/em\u003e\u003c/strong\u003e y verás el grupo \u003cstrong\u003eEvaluación + Expresión\u003c/strong\u003e (por ejemplo, “PARCIALES”) listado en el sector izquierdo de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA modo de ejemplo, se ha creado entonces un \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e para un ítem evaluador llamado \u003cstrong\u003ePARCIALES\u003c/strong\u003e cuyo \u003cstrong\u003eCódigo\u003c/strong\u003e es \u003cstrong\u003eFFF\u003c/strong\u003e con una \u003cstrong\u003eExpresión\u003c/strong\u003e o FÓRMULA que simplemente dice: \u003cstrong\u003eFFF \u0026gt; 4\u003c/strong\u003e. Es decir, aún no se establece qué sucede si el estudiante obtiene una nota mayor a 4 con este \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e.\u003c/p\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara indicar qué sucede cuando un estudiante obtiene una calificación o nota mayor a 4 en un examen parcial, se debe crear un \u003cb\u003eCriterio de Regularidad\u003c/b\u003e que lo determine. Para ello, ver el \u003cb\u003eMódulo Criterios de regularidad\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"12\"\u003e\n\u003cli\u003eVerifica que el \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e llamado \u003cstrong\u003ePARCIALES\u003c/strong\u003e contenga la información que ingresaste al crearlo. Para ello, haz clic en \u003cstrong\u003ePARCIALES\u003c/strong\u003e en el sector izquierdo de la pantalla y luego en las pestañas \u003cstrong\u003eEvaluaciones\u003c/strong\u003e y \u003cstrong\u003eExpresiones\u003c/strong\u003e para verificar su contenido.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch4 id=\"crear-grupos-de-evaluaciones-y-expresiones-para-una-asistencia\"\u003eCrear “Grupos de Evaluaciones y Expresiones” para una Asistencia\u003c/h4\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eCuando se agrega un \u003cb\u003eGrupo de Evaluaciones y Expresiones\u003c/b\u003e primero se agrega el tipo de Asistencia, por ejemplo, \u003cb\u003ePresencial\u003c/b\u003e, y luego la \u003cb\u003eExpresión\u003c/b\u003e (FÓRMULA).\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"13\"\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa al \u003cstrong\u003eSistema de Configuraciones Académicas\u003c/strong\u003e también llamado \u003cstrong\u003eSIS Config\u003c/strong\u003e con las mismas credenciales que utilizas para entrar al SGU. Por defecto, se desplegará el Módulo \u003cstrong\u003eNivel de estudio\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el Módulo \u003cstrong\u003eEvaluaciones y expresiones\u003c/strong\u003e. Por defecto, se desplegarán la o las instancias de evaluación y expresión ya establecidas del primer ítem de evaluación o de Asistencia listado a la izquierda de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003eMODO EDICIÓN\u003c/strong\u003e para habilitar el botón que te permitirá añadir un nuevo \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e. Recuerda que debes comenzar por añadir un tipo de \u003cstrong\u003eASISTENCIA\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón verde con el signo \u003cstrong\u003e+\u003c/strong\u003e para desplegar la ventana \u003cstrong\u003eCrear grupo de evaluaciones y expresiones\u003c/strong\u003e – y agrega un Nombre para el grupo (es el nombre del tipo de asistencia, por ejemplo, \u003cstrong\u003eASISTENCIA HÍBRIDA\u003c/strong\u003e).\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, verás desplegada la asistencia recién agregada (en este ejemplo, \u003cstrong\u003eASISTENCIA HÍBRIDA\u003c/strong\u003e) en el sector izquierdo de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el nuevo grupo creado – en \u003cstrong\u003eASISTENCIA HÍBRIDA\u003c/strong\u003e, ubicado en el sector izquierdo de la pantalla para desplegar la pantalla \u003cstrong\u003eASISTENCIA HÍBRIDA\u003c/strong\u003e con las solapas \u003cstrong\u003eEVALUACIONES\u003c/strong\u003e y \u003cstrong\u003eEXPRESIONES\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003ePara agregar una \u003cstrong\u003eEVALUACIÓN\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003e+\u003c/strong\u003e. A continuación, se habilitarán los campos para la pestaña \u003cstrong\u003eEvaluaciones\u003c/strong\u003e donde debes ingresar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eun \u003cstrong\u003eNombre interno\u003c/strong\u003e (no visible para los estudiantes): Nombre con el que el Usuario (co-docente) identificará la \u003cstrong\u003eEvaluación\u003c/strong\u003e (el ítem de evaluación o de asistencia) de este \u003cstrong\u003eGrupo de Evaluaciones y Expresiones\u003c/strong\u003e. Puede ser igual al ítem agregado (en este ejemplo, \u003cstrong\u003eAsistencia Híbrida\u003c/strong\u003e), o un poco más descriptivo, por ejemplo, \u003cstrong\u003e\u003cem\u003eNúmero de Asistencias a Clases Híbridas\u003c/em\u003e\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eNombre externo\u003c/strong\u003e (visible para los estudiantes): Puede ser igual al \u003cstrong\u003eNombre interno\u003c/strong\u003e o más descriptivo  - o menos formal. Es el Nombre con el que los estudiantes verán la \u003cstrong\u003eEvaluación\u003c/strong\u003e. Por ejemplo, \u003cstrong\u003e\u003cem\u003eNúmero de Asistencias\u003c/em\u003e\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eCódigo\u003c/strong\u003e que identifique la evaluación, por ejemplo, CCHT (Cantidad Clases Híbridas Teleclases)\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eFuente\u003c/strong\u003e: se refiere a si se está agregando un ítem evaluador, una actividad o una Asistencia.\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eTipo\u003c/strong\u003e: aquí se desplegarán las opciones de acuerdo a la \u003cstrong\u003eFuente\u003c/strong\u003e seleccionada. Como se está configurando una \u003cstrong\u003eAsistencia\u003c/strong\u003e, el \u003cstrong\u003eTipo\u003c/strong\u003e será el número de módulos presenciales o virtuales a los que los estudiantes deberán asistir o el mayor número de ausentes que podrán tener en una u otra modalidad.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eDirígete a la pestaña \u003cstrong\u003eExpresiones\u003c/strong\u003e y haz clic en el botón \u003cstrong\u003e+\u003c/strong\u003e. A continuación, se desplegará la pantalla donde debes ingresar la \u003cstrong\u003eExpresión\u003c/strong\u003e (FÓRMULA) para terminar de configurar la \u003cstrong\u003eEvaluación y Expresión\u003c/strong\u003e ingresada (en este ejemplo, \u003cstrong\u003eAsistencia Híbrida\u003c/strong\u003e). En esta pantalla deberás completar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eun \u003cstrong\u003eNombre interno\u003c/strong\u003e (no visible para los estudiantes): Un nombre que indique el porcentaje de asistencias que se requiere para la porción de teleclases de las Clases Híbridas, por ejemplo, \u003cstrong\u003e\u003cem\u003e75% Asistencia\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eun \u003cstrong\u003eNombre externo\u003c/strong\u003e (visible para los estudiantes): El mismo Porcentaje de Asistencias un poco más descriptivo. Por ejemplo \u003cstrong\u003e\u003cem\u003e75% de Asistencia a Teleclases\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eTipo\u003c/strong\u003e de expresión que identifique si la FÓRMULA será utilizada para un \u003cstrong\u003eCálculo de estado\u003c/strong\u003e, un \u003cstrong\u003eCálculo de nota de aprobación\u003c/strong\u003e o una combinación de notas y cálculo de estado según la asistencia del estudiante.\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eExpresión\u003c/strong\u003e (FÓRMULA) que especifique cómo se realiza el cálculo, según el \u003cstrong\u003eTipo de expresión\u003c/strong\u003e establecido, que luego será utilizado por un \u003cstrong\u003eCriterio de Regularidad\u003c/strong\u003e que determinará según el resultado que arroje la fórmula en relación a la asistencia del estudiante su condición de regularidad frente a una materia dada.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003ePor último, haz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, se desplegará un mensaje informando que el grupo de evaluaciones y expresiones se creó con éxito y verás la \u003cstrong\u003eEvaluación + Expresión\u003c/strong\u003e que en este ejemplo es \u003cstrong\u003eASISTENCIA HÍBRIDA\u003c/strong\u003e listada en el sector izquierdo de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/sis-config/nivel-de-estudio/\" title=\"Niveles de Estudio\"\u003eNiveles de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/sis-config/criterios-de-regularidad/\" title=\"Criterios de Regularidad\"\u003eCriterios de Regularidad →\u003c/a\u003e\u003c/p\u003e\n"},{id:123,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/",title:"Crear materias",description:null,content:"\u003cp\u003eEl \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e te permite crear materias para luego agregárselas a un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e de una carrera determinada.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el ícono \u003cstrong\u003eMaterias\u003c/strong\u003e ubicado en el panel izquierdo de la pantalla del \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e para abrir el \u003cstrong\u003eMódulo “Materias”\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla que se despliega, para crear una materia nueva, haz clic en el botón con el \u003cstrong\u003esigno +\u003c/strong\u003e ubicado en el extremo inferior derecho de la ventana. En seguida se desplegará un ícono. Haz clic en este ícono para desplegar el formulario \u003cstrong\u003eCrear materia\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la sección \u003cstrong\u003eDatos\u003c/strong\u003e, ingresa la información necesaria para la creación de la nueva materia:\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eÁrea disciplinar\u003c/strong\u003e: Selecciona el área a la que pertenece la materia que estás creando mediante la lista desplegable. Por ejemplo, \u003cstrong\u003eCiencias de la comunicación\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eCódigo\u003c/strong\u003e: El \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e le asignará un código a la materia que se forma con el código del \u003cstrong\u003eÁrea disciplinar\u003c/strong\u003e más un número que es el más alto que el sistema encuentra – y que podrás cambiar si fuera necesario.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eDescripción\u003c/strong\u003e: Ingresa el nombre de la materia, por ejemplo, \u003cem\u003ePeriodismo deportivo\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eResponsable\u003c/strong\u003e: Ingresa parte del nombre para filtrar y seleccionar de la lista desplegable al docente que estará encargado de supervisar el contenido y las características de la materia.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eCréditos\u003c/strong\u003e: Introduce el número de créditos que serán otorgados una vez que el estudiante aprueba la materia.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eHoras reloj / cátedra\u003c/strong\u003e: Ingresa el número de horas reloj o cátedra que insumirá cursar la materia.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eTipo de materia:\u003c/strong\u003e Indica si es una materia “De Proceso”, EFIP, MIA, etc.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e para salvar los cambios. Si no hubo ningún problema, tales como un \u003cstrong\u003eCódigo\u003c/strong\u003e o \u003cstrong\u003eDescripción\u003c/strong\u003e duplicado, los campos del formulario se limpiarán y se desplegará el mensaje \u003cem\u003e\u0026ldquo;La materia se creó con éxito.\u0026quot;\u003c/em\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi el Código o la Descripción ya hubiesen sido utilizados, el sistema desplegará el mensaje “El código de la materia ya existe.” o “La Descripción de la materia ya existe.”\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eSi deseas agregar el programa de la materia más tarde, haz clic en el botón \u003cstrong\u003eCrear otra materia\u003c/strong\u003e y luego cierra la ventana \u003cstrong\u003eCrear materia\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eConfirma que deseas cancelar la creación de la materia para volver a la pantalla de inicio del \u003cstrong\u003eMódulo Materias\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eSi en cambio deseas añadir un \u003cstrong\u003ePrograma\u003c/strong\u003e de inmediato para la materia recién creada, haz clic en el botón \u003cstrong\u003eAñadir programa\u003c/strong\u003e y luego dirígete a la sección \u003cem\u003e“Alta de Programas de una Materia”\u003c/em\u003e (ver más adelante en esta misma pantalla)\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eInicia una búsqueda para verificar que la materia se ha creado correctamente. Ingresa la \u003cstrong\u003eDescripción\u003c/strong\u003e - o parte de esta, o el \u003cstrong\u003eCódigo\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eRepite este proceso para crear o ingresar tantas materias como sea necesario.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLuego de crear una carrera y las materias que la conforman, el Administrador de Carreras te permite diseñar un Plan de estudio y agregarle las materias a dicho Plan.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eAlta de Programas de una Materia\u003c/strong\u003e\u003c/p\u003e\n\u003cp\u003eAl localizar una materia, junto a los íconos de edición y de “Más información” se puede observar un ícono \u003cstrong\u003eAñadir programa\u003c/strong\u003e, lo que permitirá dar de alta a un \u003cstrong\u003ePrograma\u003c/strong\u003e para la materia localizada. Asimismo, inmediatamente después de crear una materia, también se podrá añadir un \u003cstrong\u003ePrograma\u003c/strong\u003e para dicha materia.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003ePara añadir un \u003cstrong\u003ePrograma\u003c/strong\u003e a una materia, podrás hacerlo a partir de cualquiera de las dos instancias siguientes:\ni. En el mensaje desplegado inmediatamente después de crear la materia, al hacer clic en el botón \u003cstrong\u003eAñadir Programa\u003c/strong\u003e.\nii. Al localizar una materia, al hacer clic en el \u003cstrong\u003esigno +\u003c/strong\u003e ubicado debajo del encabezado \u003cem\u003e**“Añadir programa”\u003c/em\u003e**.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eTanto si haces clic en el botón \u003cstrong\u003eAñadir Programa\u003c/strong\u003e luego de crear una materia o en el \u003cstrong\u003esigno +\u003c/strong\u003e que se encuentra en el encabezado de la materia que se despliega al localizarla, a continuación, se desplegará la pantalla \u003cstrong\u003e\u003cem\u003e“Creación de programa para la materia\u003c/em\u003e\u003c/strong\u003e [Nombre de la Materia] – [Código de Materia]”.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEste formulario para crear Programas consta de 4 botones:\u003c/p\u003e\n\u003cpre\u003e\u003ccode\u003e- Información General: Al hacer clic en este botón se desplegará un formulario a completar con ciertas características del Programa.\n- Seleccionar Bibliografía: Al hacer clic en este botón, se desplegará un formulario desde donde podrás seleccionar la bibliografía que se utilizará para este Programa específico de la materia. La grilla que se encuentra debajo del botón \u0026quot;Seleccionar Bibliografía\u0026quot; se auto-completará a medida que se selecciona la bibliografía.\n- Seleccionar Competencias: Al hacer clic en este botón, se desplegará una lista de competencias que podrás seleccionar para indicar las habilidades que se desarrollarán durante el dictado de la materia seleccionada. La grilla que se encuentra debajo del botón \u0026quot;Seleccionar Competencias\u0026quot; se completará a medida que se seleccionen las competencias.\n- Agregar contenido: Este botón sólo se habilitará una vez que completes el campo Fundamentación del formulario \u0026quot;Información General\u0026quot;. Mediante este botón, podrás agregar los temas o Unidades que conforman la materia.\n\u003c/code\u003e\u003c/pre\u003e\n\u003cp\u003ePara dar de alta a un \u003cstrong\u003ePrograma\u003c/strong\u003e, asegúrate de obtener el archivo que lista:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eObjetivos\u003c/li\u003e\n\u003cli\u003eContenidos\u003c/li\u003e\n\u003cli\u003eUnidades\u003c/li\u003e\n\u003cli\u003eTemas y subtemas\u003c/li\u003e\n\u003cli\u003eMetodología\u003c/li\u003e\n\u003cli\u003eBibliografía\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eInicia la carga del \u003cstrong\u003ePrograma\u003c/strong\u003e. Haz clic en el botón \u003cstrong\u003eInformación General\u003c/strong\u003e. A continuación, se desplegará un \u003cstrong\u003eFormulario\u003c/strong\u003e en donde debes ingresar información que describe las características principales del Programa que estás cargando. Completa al menos el campo obligatorio \u003cstrong\u003eFundamentación\u003c/strong\u003e. Se puede escribir o copiar y pegar texto.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa información será guardada automáticamente ni bien se ingresa.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003ePara continuar con la carga del \u003cstrong\u003ePrograma\u003c/strong\u003e de la materia seleccionada, haz clic en el botón \u003cstrong\u003eSeleccionar Bibliografía\u003c/strong\u003e. Se desplegará una ventana en donde podrás iniciar una búsqueda para localizar la bibliografía utilizada para el dictado de la materia.\u003c/li\u003e\n\u003cli\u003eUtiliza cualquier combinación de los campos \u003cstrong\u003eAutor\u003c/strong\u003e, \u003cstrong\u003eAño\u003c/strong\u003e, \u003cstrong\u003eEdición\u003c/strong\u003e, \u003cstrong\u003eTítulo\u003c/strong\u003e y \u003cstrong\u003eEditorial\u003c/strong\u003e para acotar la búsqueda y luego haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e o pulsa \u003cstrong\u003eEnter\u003c/strong\u003e para iniciar la búsqueda de la bibliografía que necesitas cargar.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn esta pantalla de búsqueda de bibliografía puedes buscar y seleccionar toda la bibliografía pertinente al Programa de la materia en cuestión – es decir, puedes seleccionar varias bibliografías a la vez.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa bibliografía seleccionada será guardada automáticamente ni bien sea ingresada.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eCierra la ventana \u003cstrong\u003eBuscar bibliografía\u003c/strong\u003e. La bibliografía seleccionada (por ejemplo, un libro) se verá desplegada en el Formulario principal del Programa en donde podrás especificar si esta bibliografía es del tipo \u003cstrong\u003eBásica\u003c/strong\u003e –es decir, esencial, o \u003cstrong\u003eAmpliatoria\u003c/strong\u003e, es decir, extra.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa bibliografía recién añadida podrá eliminarse al hacer clic en el ícono de eliminar.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003ePara continuar con la carga del \u003cstrong\u003ePrograma\u003c/strong\u003e de la materia, haz clic en \u003cstrong\u003eSeleccionar Competencias\u003c/strong\u003e. En la pantalla que se despliega podrás buscar la competencia que debes añadir al programa de la materia.\u003c/li\u003e\n\u003cli\u003eLocaliza la competencia con la ayuda del campo \u003cstrong\u003eDescripción\u003c/strong\u003e. Puedes insertar una palabra, por ejemplo \u0026ldquo;motivación\u0026rdquo; - y luego hacer clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eCierra la ventana. A continuación, verás la competencia añadida a la ventana “Creación de programa para la materia [Nombre de materia – Código]\u003c/li\u003e\n\u003cli\u003eComo último paso para crear un \u003cstrong\u003ePrograma\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eAgregar contenido\u003c/strong\u003e para agregar los temas y subtemas o Unidades que conforman la materia. A continuación, se desplegará una ventana con información básica de la materia, como \u003cstrong\u003eDescripción\u003c/strong\u003e y \u003cstrong\u003eEstado\u003c/strong\u003e, la fundamentación que se agregó mediante el botón \u003cstrong\u003eInformación General\u003c/strong\u003e, y un encabezado titulado \u003cstrong\u003eContenidos\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en la palabra \u003cstrong\u003eContenidos\u003c/strong\u003e para activar en su extremo derecho un \u003cstrong\u003esigno +\u003c/strong\u003e que te permitirá agregar los \u003cstrong\u003eMódulos\u003c/strong\u003e, \u003cstrong\u003eUnidades\u003c/strong\u003e, \u003cstrong\u003eTemas\u003c/strong\u003e y \u003cstrong\u003eSubtemas\u003c/strong\u003e de la materia.\u003c/li\u003e\n\u003cli\u003eHaz clic en el \u003cstrong\u003esigno +\u003c/strong\u003e. En la pantalla que se despliega podrás comenzar a agregar contenido. Por ejemplo, podrá agregar la Unidad 1 del Módulo 1 con los Temas y Subtemas correspondientes (1.1, 1.2, 1.3, 1.4, 1.5 / 1.5.1, 1.5.2, 1.5.3).\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, verás esa Unidad agregada al Contenido del Programa de la materia y un mensaje del \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e anunciando que el contenido se ha creado con éxito.\u003c/li\u003e\n\u003cli\u003eAgrega todo el temario de la materia necesario, y luego haz clic en el botón \u003cstrong\u003eFinalizar\u003c/strong\u003e. El \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e desplegará el \u003cstrong\u003ePrograma\u003c/strong\u003e que acabas de añadirle a la materia.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eCuando agregas un Programa, su Estado inicial será el de “Inactivo”, el que podrás cambiar a “Activo” al hacer clic en el botón deslizable ubicado debajo de la columna “Cambiar estado”.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"15\"\u003e\n\u003cli\u003eVerifica que el \u003cstrong\u003eContenido\u003c/strong\u003e fue agregado mediante la visualización del Programa al hacer clic en el ícono con forma de ojo ubicado debajo de la columna \u003cstrong\u003eDetalles\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara agregar una materia a un Plan de Estudios, el Programa de la materia debe estar “Activo”.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"16\"\u003e\n\u003cli\u003ePor último, activa el \u003cstrong\u003ePrograma\u003c/strong\u003e que acabas de dar de alta. La fecha de activación la verás reflejada debajo de la columna \u003cstrong\u003eActivación\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:124,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/",title:"Dar de alta un aula",description:null,content:"\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eIngresa a \u003cstrong\u003ewww.gestionedilicia.ues21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU para desplegar la app Gestión Edilicia. Por defecto, se desplegará el módulo \u003cstrong\u003eGestión de edificios\u003c/strong\u003e. Haz clic en el ícono de \u003cstrong\u003eAulas\u003c/strong\u003e ubicado en el panel izquierdo de la pantalla para desplegar \u003cstrong\u003eGestión de aulas\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón verde con el signo \u003cstrong\u003emás\u003c/strong\u003e \n\n\u003cimg src=\"plus.png\" alt=\"plus icon\" class=\"inlineIcon\"\u003e ubicado en el extremo inferior derecho de la pantalla. A continuación, se desplegará la pantalla “Crear Aula”, desde donde podrás seleccionar los Atributos del aula a habilitar:\n\u003cbr\u003e\n\u003cbr\u003e\na. En el campo \u003cstrong\u003eNombre de aula\u003c/strong\u003e, introduce el nombre que identificará al \u003cstrong\u003eAula\u003c/strong\u003e.\n\u003cbr\u003e\nb. Selecciona el \u003cstrong\u003eTipo de aula\u003c/strong\u003e y el \u003cstrong\u003eSub tipo de aula\u003c/strong\u003e.\n\u003cbr\u003e\nc. Especifica el \u003cstrong\u003eEdificio\u003c/strong\u003e en donde se encuentra el \u003cstrong\u003eAula\u003c/strong\u003e al seleccionar una opción de la lista desplegable.\n\u003cbr\u003e\nd.\tIndica la \u003cstrong\u003eCapacidad\u003c/strong\u003e – es decir, el número de personas que entran en el aula – ya sea mediante las flechas hacia arriba o abajo del campo o borrando el que figura por defecto y escribiendo el número correspondiente.\n\u003cbr\u003e\ne. Indica la superficie del aula al establecer los \u003cstrong\u003eMetros cuadrados\u003c/strong\u003e del mismo modo que ingresaste la \u003cstrong\u003eCapacidad\u003c/strong\u003e.\n\u003cbr\u003e\nf. Habilita o deshabilita el botón deslizable \u003cstrong\u003eDisponible\u003c/strong\u003e para dejar al \u003cstrong\u003eAula\u003c/strong\u003e en una u otra condición según corresponda.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e para guardar los cambios.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003ePor último, haz una búsqueda del \u003cstrong\u003eAula\u003c/strong\u003e para verificar que haya sido creada.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Visualizar edificios\"\u003eVisualizar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta un edificio\"\u003eDar de alta un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aulas\"\u003eVisualizar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja un aula →\u003c/a\u003e\u003c/p\u003e\n"},{id:125,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/",title:"Dar de alta un Edificio",description:null,content:"\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eIngresa a \u003cstrong\u003ewww.gestionedilicia.ues21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU para desplegar la app Gestión Edilicia. Por defecto, se desplegará el módulo \u003cstrong\u003eGestión de edificios\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón verde con el signo \u003cstrong\u003emás\u003c/strong\u003e \n\n\u003cimg src=\"plus.png\" alt=\"plus icon\" class=\"inlineIcon\"\u003e ubicado en el extremo inferior derecho de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eA continuación, se desplegará la pantalla “Crear Edificio”, desde donde podrás seleccionar los atributos del \u003cstrong\u003eEdificio\u003c/strong\u003e a habilitar.\na. En el campo \u003cstrong\u003eNombre\u003c/strong\u003e, introduce el nombre que identificará al Edificio.\nb. Luego, selecciona uno de los botones de opción: \u003cstrong\u003eSede\u003c/strong\u003e o \u003cstrong\u003eCAU\u003c/strong\u003e para que la lista desplegable filtre según la opción elegida las sedes o CAUs existentes.\nc. Habilita o deshabilita el botón deslizable \u003cstrong\u003eDisponible\u003c/strong\u003e para dejar al edificio en una u otra condición según corresponda.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón Confirmar para guardar los cambios.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003ePor último, haz una búsqueda del \u003cstrong\u003eEdificio\u003c/strong\u003e para verificar que haya sido creado.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Visualizar edificios\"\u003eVisualizar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aulas\"\u003eVisualizar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja un aula →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta un aula →\u003c/a\u003e\u003c/p\u003e\n"},{id:126,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/",title:"Dar de baja un aula",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003ewww.gestionedilicia.ues21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU para desplegar la app Gestión Edilicia. Por defecto, se desplegará el módulo \u003cstrong\u003eGestión de edificios\u003c/strong\u003e. Haz clic en el ícono de \u003cstrong\u003eAulas\u003c/strong\u003e ubicado en el panel izquierdo de la pantalla para desplegar \u003cstrong\u003eGestión de aulas\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza el \u003cstrong\u003eAula\u003c/strong\u003e que debes dar de baja mediante una búsqueda utilizando los filtros disponibles para así limitar los resultados.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón deslizable que indica el Estado del \u003cstrong\u003eAula\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA continuación, se desplegará la pantalla donde deberás confirmar que deseas cambiar el Estado de \u003cstrong\u003eDisponible\u003c/strong\u003e a \u003cstrong\u003eNo disponible\u003c/strong\u003e del Aula seleccionada.\u003c/li\u003e\n\u003cli\u003ePor último, haz una búsqueda del \u003cstrong\u003eAula\u003c/strong\u003e que diste de baja y cerciórate de que ha pasado a tener el \u003cstrong\u003eEstado\u003c/strong\u003e de \u003cstrong\u003eNo disponible\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Visualizar edificios\"\u003eVisualizar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta un edificio\"\u003eDar de alta un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aulas\"\u003eVisualizar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta un aula →\u003c/a\u003e\u003c/p\u003e\n"},{id:127,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/",title:"Dar de baja un Edificio",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003ewww.gestionedilicia.ues21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU para desplegar la app Gestión Edilicia. Por defecto, se desplegará el módulo \u003cstrong\u003eGestión de edificios\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza el \u003cstrong\u003eEdificio\u003c/strong\u003e que deseas visualizar con ayuda de los filtros disponibles para así limitar los resultados de la búsqueda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePuedes filtrar por Edificio –el nombre del mismo, Provincia, Localidad, Tipo (Todos, Sede, o CAU), o por Estado (Disponible / No disponible) del edificio, siendo este último el que indica si el edificio está siendo utilizado o no.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eUna vez localizado el \u003cstrong\u003eEdificio\u003c/strong\u003e, haz clic en el botón deslizable que indica el Estado.\u003c/li\u003e\n\u003cli\u003eA continuación, se desplegará la pantalla donde deberás confirmar que deseas cambiar el Estado de \u003cstrong\u003eDisponible\u003c/strong\u003e a \u003cstrong\u003eNo disponible\u003c/strong\u003e del Edificio seleccionado.\n\u003c/b\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUn Edificio que tenga aulas asociadas no podrá ser dado de baja.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003ePor último, haz una búsqueda del \u003cstrong\u003eEdificio\u003c/strong\u003e que diste de baja y cerciórate de que ha pasado a tener el \u003cstrong\u003eEstado\u003c/strong\u003e de \u003cstrong\u003eNo disponible\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Visualizar edificios\"\u003eVisualizar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta un edificio\"\u003eDar de alta un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aulas\"\u003eVisualizar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja un aula →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta un aula →\u003c/a\u003e\u003c/p\u003e\n"},{id:128,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/",title:"Diseñar Plan de Estudio",description:null,content:"\u003cp\u003eEl \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e te permite crear o diseñar un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e para una carrera determinada. Parte del proceso al diseñarlo incluye especificar qué materias formarán parte del mismo.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eTanto si haces clic en el botón \u003cstrong\u003eAñadir Plan\u003c/strong\u003e luego de crear una carrera o en el signo \u003cstrong\u003e+\u003c/strong\u003e que se encuentra en el encabezado de la carrera que se despliega al localizarla, a continuación, se desplegará la ventana \u003cem\u003e\u0026ldquo;Creación de plan de estudio para\u003c/em\u003e [Nombre de la carrera + Descripción o Código de carrera + Nivel de Estudio]”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eEjemplo:\u003c/strong\u003e Creación de plan de estudio para Abogacía - ABG - GRADO\u003c/p\u003e\n\u003col start=\"2\"\u003e\n\u003cli\u003ePara comenzar a crear el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e, selecciona una \u003cstrong\u003eModalidad\u003c/strong\u003e de la lista desplegable: Educación Distribuida (ED), Educación Distribuida Home (EDH) - o Presencial (P) (también llamada Presencial \u0026ldquo;punto\u0026rdquo;) o Presencial Home (PH).\u003c/li\u003e\n\u003cli\u003eLuego, selecciona un \u003cstrong\u003ePlan de estudio\u003c/strong\u003e de la lista desplegable.\u003c/li\u003e\n\u003cli\u003eProcede con la sección \u003cem\u003eResoluciones\u003c/em\u003e y selecciona la o las \u003cstrong\u003eSedes\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePodrás seleccionar más de una sede para una carrera determinada.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eUna vez seleccionada la(s) \u003cstrong\u003eSede(s)\u003c/strong\u003e, se desplegarán los campos \u003cstrong\u003eResolución ministerial\u003c/strong\u003e, \u003cstrong\u003eResolución rectoral\u003c/strong\u003e y \u003cstrong\u003eExpediente CONEAU\u003c/strong\u003e que podrás completar una vez que obtengas estos datos.\u003c/li\u003e\n\u003cli\u003eCompleta la Sección \u003cstrong\u003eDatos\u003c/strong\u003e. Para ello selecciona:\ni) la \u003cstrong\u003eUnidad de tiempo\u003c/strong\u003e de la lista desplegable, que es la unidad se va a medir la duración de la carrera, por ejemplo, por \u003cstrong\u003eAÑO\u003c/strong\u003e o por \u003cstrong\u003eCUATRIMESTRE\u003c/strong\u003e\nii) la \u003cstrong\u003eDuración\u003c/strong\u003e, que identifica cuántas \u003cstrong\u003eUnidades de tiempo\u003c/strong\u003e tiene la carrera. Por ejemplo, si en el campo \u003cstrong\u003eUnidad de tiempo\u003c/strong\u003e ingresamos \u003cstrong\u003eAÑO\u003c/strong\u003e, y en \u003cstrong\u003eDuración\u003c/strong\u003e ingresamos 2 - esto significa que en este Plan de estudios la carrera durará 2 años.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eCuando se añade un Plan de Estudios, éste siempre se crea en Estado Borrador.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eAl hacer clic en el botón \u003cstrong\u003eAgregar materias\u003c/strong\u003e, se despliega la pantalla \u003cem\u003e\u0026ldquo;Gestión de materias para\u003c/em\u003e [Nombre de la carrera + Plan]”.\nEn esta pantalla se desplegará:\n\u003cul\u003e\n\u003cli\u003eel segmento \u003cem\u003e“Grupo de materias 1”\u003c/em\u003e que se considera “común” a todas las Titulaciones y Orientaciones de la carrera\u003c/li\u003e\n\u003cli\u003euna sección o segmento por \u003cstrong\u003eTitulación\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLos segmentos correspondientes a las titulaciones se despliegan según lo establecido al crear la carrera, por lo que si se estableció el Titulo final, el Título Intermedio y la o las Orientaciones, se desplegará un segmento para cada una de estas titulaciones.\u003c/div\u003e\n\u003c/div\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eRecuerda que para crear la carrera ésta debe tener al menos una titulación – por lo que la pantalla Gestión de materias para [Nombre de la carrera + Plan] podría tener solo el segmento común “Grupo de materias 1” y solo uno más para la titulación establecida durante la creación de la carrera.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eAñadir materias al Segmento agrupador de materias comunes inicial\u003c/strong\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eComienza a añadir materias al segmento común e inicial \u003cstrong\u003e“Grupo de materias 1”\u003c/strong\u003e. Para ello, haz clic en el campo desplegable \u003cstrong\u003eMaterias\u003c/strong\u003e y escribe las primeras letras o al menos 3 letras que conformen el nombre de la materia.\u003c/li\u003e\n\u003cli\u003eInmediatamente después de seleccionar una materia se desplegará una ventana con 3 Pestañas: \u003cem\u003eConfiguración de materia en el plan\u003c/em\u003e - donde debes indicar los atributos de la \u003cstrong\u003eMateria\u003c/strong\u003e, y las pestañas \u003cem\u003eInformación de la materia\u003c/em\u003e, y \u003cem\u003ePrograma activo de la materia\u003c/em\u003e, en donde podrás visualizar información extra acerca de la materia como por ejemplo criterios de regularidad y un resumen del Programa activo respectivamente. Por defecto, se despliega la pestaña \u003cem\u003eConfiguración de Materia en el Plan\u003c/em\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi no encontraras una materia – o si la carga de la materia no ha sido finalizada y no cuenta con un Programa activo, deberás ingresarla o editarla desde el Módulo de Materias. Ver Crear Materias (ver link más abajo).\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"10\"\u003e\n\u003cli\u003eCompleta el campo obligatorio \u003cstrong\u003eCuatrimestre\u003c/strong\u003e, que indica el cuatrimestre en el que se va a dictar la materia. Por ejemplo, si se selecciona 1, esto indica que la materia se dictará en el primer cuatrimestre.\u003c/li\u003e\n\u003cli\u003eEn el campo \u003cstrong\u003eCantidad de encuentros\u003c/strong\u003e, indica, si fuera aplicable, la cantidad de veces que se deberá asistir en forma presencial.\u003c/li\u003e\n\u003cli\u003eSelecciona el “Tipo de Materia”: \u003cstrong\u003eComplementarias CN\u003c/strong\u003e, \u003cstrong\u003eContenido Idioma\u003c/strong\u003e, \u003cstrong\u003eCursillo\u003c/strong\u003e, \u003cstrong\u003eElectiva\u003c/strong\u003e, \u003cstrong\u003eProgramática\u003c/strong\u003e, \u003cstrong\u003eIntegradora\u003c/strong\u003e, etc.\u003c/li\u003e\n\u003cli\u003eIndica en cuál período se comenzará a dictar la materia: 1A, 2A, 3A, 1B, 2B.\u003c/li\u003e\n\u003cli\u003eEn caso de que la materia tuviera una materia correlativa, es decir, una materia que el estudiante debe tener cursada o aprobada para poder cursar la materia que estoy agregando al Plan de estudio - completa el campo \u003cstrong\u003eCorrelativas\u003c/strong\u003e mediante el uso de la lista desplegable.\u003c/li\u003e\n\u003cli\u003eEn la parte inferior de esta pantalla, se podrán seleccionar indicadores que al deslizarlos se activan o desactivan para informar si está habilitada la \u003cstrong\u003eInscripción automática\u003c/strong\u003e o si la materia \u003cstrong\u003eConsume ticket\u003c/strong\u003e, es decir, si se genera un ticket de pago a abonar por el estudiante.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, podrás visualizar la materia en el segmento agrupador de materias común e inicial llamado \u003cem\u003eGrupo de materias 1\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eAgrega las materias necesarias al Segmento agrupador de materias comunes inicial.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eAñadir materias al Segmento agrupador de materias de una Titulación en particular\u003c/strong\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eDirígete a un segmento de una titulación u orientación, y agrega las materias que correspondan. Para ello, haz clic en el campo desplegable \u003cstrong\u003eMaterias\u003c/strong\u003e y escribe las primeras letras o al menos 3 letras que conformen el nombre de la materia.\u003c/li\u003e\n\u003cli\u003eUna vez agregadas las materias, haz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, podrás ver que la materia se lista dentro del Segmento en el que fue agregada.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi necesitas visualizar las materias que comprende un título en particular, podrás filtrar por titulación mediante el campo Visualizar materias de un título\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eFinalizar\u003c/strong\u003e para salvar la configuración del \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi fuera necesario, mientras estés diseñando un Plan de estudio, podrás editar la configuración de una materia al hacer clic en el ícono de lápiz situado en el extremo derecho de la materia para así modificar el Cuatrimestre, la Cantidad de encuentros, para editar o agregar una o más Correlativas, como así también para indicar mediante los indicadores deslizables si, por ejemplo, la materia tiene habilitada la inscripción automática.\u003c/div\u003e\n\u003c/div\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eTambién podrás quitar la Materia asociada al Plan de estudios al seleccionar el ícono de eliminar ubicado junto al ícono de lápiz. El “Administrador de Carreras” desplegará una ventana para que confirmes que deseas eliminar la materia.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:129,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/",title:"Editar aulas",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003ewww.gestionedilicia.ues21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU para desplegar la app Gestión Edilicia. Por defecto, se desplegará el módulo \u003cstrong\u003eGestión de edificios\u003c/strong\u003e. Haz clic en el ícono de \u003cstrong\u003eAulas\u003c/strong\u003e ubicado en el panel izquierdo de la pantalla para desplegar \u003cstrong\u003eGestión de aulas\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza el \u003cstrong\u003eAula\u003c/strong\u003e a editar mediante una búsqueda utilizando los filtros disponibles para así limitar los resultados.\u003c/li\u003e\n\u003cli\u003eUna vez localizada el Aula, haz clic en el ícono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"plus icon\" class=\"inlineIcon\"\u003e ubicado en el extremo derecho del registro del aula. A continuación, se desplegará la pantalla “Editar Aula”, desde donde podrás editar los atributos del aula seleccionada.\u003c/li\u003e\n\u003cli\u003eUna vez realizada la edición de uno o más atributos del \u003cstrong\u003eAula\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e para guardar los cambios.\u003c/li\u003e\n\u003cli\u003ePor último, haz una búsqueda del \u003cstrong\u003eAula\u003c/strong\u003e editada para verificar que los cambios se hayan realizado.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/visualizar-edificios/\" title=\"Visualizar edificios\"\u003eVisualizar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta un edificio\"\u003eDar de alta un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aulas\"\u003eVisualizar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja un aula →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta un aula →\u003c/a\u003e\u003c/p\u003e\n"},{id:130,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/",title:"Editar carreras",description:null,content:"\u003cp\u003eEl \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e te permite editar una carrera al realizar modificaciones en el \u003cstrong\u003eNivel de Estudio\u003c/strong\u003e, el \u003cstrong\u003eDecanato\u003c/strong\u003e, \u003cstrong\u003eDirector\u003c/strong\u003e, \u003cstrong\u003eCo Director\u003c/strong\u003e, etc.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la carrera a editar: selecciona una opción del campo obligatorio \u003cstrong\u003eNivel de estudio\u003c/strong\u003e para que se habiliten los demás filtros disponibles y el botón de búsqueda. Utiliza los filtros disponibles para así limitar los resultados y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez localizada la carrera a editar, haz clic sobre esta para abrirla y luego haz clic en el ícono de lápiz \u003cstrong\u003eEditar carrera\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la ventana \u003cstrong\u003eEditar carrera\u003c/strong\u003e que se despliega, se indica el \u003cstrong\u003eEstado de carrera\u003c/strong\u003e – Activo, Inactivo o Borrador, y el \u003cstrong\u003eNivel de estudio\u003c/strong\u003e. En esta ventana podrás editar \u003cem\u003ealgunos\u003c/em\u003e campos, tales como: \u003cstrong\u003eDecanato\u003c/strong\u003e, \u003cstrong\u003eCódigo presencial\u003c/strong\u003e, \u003cstrong\u003eDirector\u003c/strong\u003e, y \u003cstrong\u003eCo Director\u003c/strong\u003e como así también la sección \u003cem\u003eTitulaciones\u003c/em\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDescripción y Código NO son editables - independientemente del Estado de la carrera.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e para salvar los cambios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi seleccionas una carrera cuyo Estado es ACTIVO, solo podrás editar los campos Director y Co Director y la sección Titulaciones.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:131,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/",title:"Editar edificios",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003ewww.gestionedilicia.ues21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU para desplegar la app Gestión Edilicia. Por defecto, se desplegará el módulo \u003cstrong\u003eGestión de edificios\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza el \u003cstrong\u003eEdificio\u003c/strong\u003e que deseas visualizar con ayuda de los filtros disponibles para así limitar los resultados de la búsqueda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePuedes filtrar por Edificio –el nombre del mismo, Provincia, Localidad, Tipo (Todos, Sede, o CAU), o por Estado (Disponible / No disponible) del edificio, siendo este último el que indica si el edificio está siendo utilizado o no.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eUna vez localizado el \u003cstrong\u003eEdificio\u003c/strong\u003e, haz clic en el ícono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e ubicado en el extremo derecho del registro obtenido. A continuación, se desplegará la pantalla “Editar Edificio”, desde donde podrás editar algunos de los atributos del edificio seleccionado.\u003c/li\u003e\n\u003cli\u003eUna vez realizada la edición de uno o más atributos del \u003cstrong\u003eEdificio\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e para guardar los cambios.\u003c/li\u003e\n\u003cli\u003ePor último, haz una búsqueda del \u003cstrong\u003eEdificio\u003c/strong\u003e editado para verificar que los cambios se hayan realizado.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Visualizar edificios\"\u003eVisualizar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta un edificio\"\u003eDar de alta un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aulas\"\u003eVisualizar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja un aula →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta un aula →\u003c/a\u003e\u003c/p\u003e\n"},{id:132,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/",title:"Editar Institución educativa",description:null,content:"\u003cp\u003eComo co-docente, en este módulo podrás editar una institución, lo que implica tanto modificar el \u003cstrong\u003eNombre\u003c/strong\u003e de la institución y su condición de institución \u003cstrong\u003e\u003cem\u003eOrigen\u003c/em\u003e\u003c/strong\u003e o \u003cstrong\u003e\u003cem\u003eDestino\u003c/em\u003e\u003c/strong\u003e –si bien no su \u003cstrong\u003eCódigo\u003c/strong\u003e, como modificar o añadirle una carrera con su respectivo Plan de Estudios.\u003c/p\u003e\n\u003ch3 id=\"edita-el-nombre-o-condición-de-destinoorigen-de-una-institución\"\u003eEdita el Nombre o condición de Destino/Origen de una Institución\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al \u003cstrong\u003eSGU\u003c/strong\u003e. A continuación, se desplegará la ventana \u003cstrong\u003e\u003cem\u003eLista de Instituciones\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la institución a editar con la ayuda del filtro \u003cstrong\u003eNombre\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic sobre el \u003cstrong\u003eícono de lápiz\u003c/strong\u003e debajo de la columna \u003cstrong\u003eAcciones\u003c/strong\u003e para abrir la pantalla \u003cstrong\u003eEditar institución\u003c/strong\u003e. En esta pantalla podrás modificar el \u003cstrong\u003eNombre\u003c/strong\u003e de la institución o cambiar su condición de institución de \u003cstrong\u003e\u003cem\u003eDestino\u003c/em\u003e\u003c/strong\u003e o de \u003cstrong\u003e\u003cem\u003eOrigen\u003c/em\u003e\u003c/strong\u003e y editar los \u003cstrong\u003ePlanes de Estudio\u003c/strong\u003e de las diferentes carreras que ofrece la institución.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl \u003cb\u003eCódigo\u003c/b\u003e no puede editarse.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eModifica el \u003cstrong\u003eNombre\u003c/strong\u003e o la condición de institución de \u003cstrong\u003e\u003cem\u003eDestino\u003c/em\u003e\u003c/strong\u003e o de \u003cstrong\u003e\u003cem\u003eOrigen\u003c/em\u003e\u003c/strong\u003e según corresponda y luego haz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eLa institución se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e.\u0026quot;\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"edita-un-plancarrera-existente\"\u003eEdita un Plan/Carrera existente\u003c/h3\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn la misma pantalla donde se despliega la institución, en la sección \u003cstrong\u003ePlanes/carreras asociadas\u003c/strong\u003e localiza el Plan/Carrera que deseas modificar. Para ello, utiliza el campo \u003cstrong\u003eNombre\u003c/strong\u003e (o en el ícono de lupa) e ingresa parte del nombre del Plan.\u003c/li\u003e\n\u003cli\u003eUna vez localizado el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e, por ejemplo, el plan \u003cstrong\u003e\u003cem\u003eAbogacía 2007\u003c/em\u003e\u003c/strong\u003e, haz clic en el ícono de lápiz ubicado en la columna \u003cstrong\u003eAcciones\u003c/strong\u003e para desplegar la pantalla donde se listan todas las materias y actividades asociadas al \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e y desde donde podrás editarlo.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEn la pantalla \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e podrás:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eEditar el \u003cstrong\u003eNombre del Plan/Carrera\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eEditar \u003cstrong\u003ematerias\u003c/strong\u003e o \u003cstrong\u003eactividades\u003c/strong\u003e existentes\u003c/li\u003e\n\u003cli\u003eAsociar al Plan/Carrera una o más \u003cstrong\u003ematerias\u003c/strong\u003e o \u003cstrong\u003eactividades\u003c/strong\u003e existentes\u003c/li\u003e\n\u003cli\u003eCambiar el orden en que se despliegan las \u003cstrong\u003ematerias\u003c/strong\u003e o \u003cstrong\u003eactividades\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eAgregar una \u003cstrong\u003eMateria\u003c/strong\u003e o \u003cstrong\u003eActividad\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eEliminar una \u003cstrong\u003eMateria\u003c/strong\u003e o \u003cstrong\u003eActividad\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch3 id=\"edita-el-nombre-de-la-plancarrera\"\u003eEdita el Nombre de la Plan/Carrera\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003ePara editar el \u003cstrong\u003eNombre\u003c/strong\u003e del Plan/Carrera, simplemente modifícalo en el mismo campo.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eConfirma los cambios. Al confirmar los cambios, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"edita-materias-o-actividades-existentes\"\u003eEdita materias o actividades existentes\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003ePara editar una \u003cstrong\u003emateria\u003c/strong\u003e o \u003cstrong\u003eactividad\u003c/strong\u003e existente, primero debes localizarla. Para ello, haz clic en la columna Nombre del listado de actividades para habilitar el filtro que te permitirá localizarla más fácilmente.\u003c/li\u003e\n\u003cli\u003eUna vez localizada la \u003cstrong\u003emateria\u003c/strong\u003e o \u003cstrong\u003eactividad\u003c/strong\u003e, haz clic en cualquier lugar de la línea en que se encuentra o en el ícono de lápiz ubicado en la columna \u003cstrong\u003eAcciones\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA continuación, la \u003cstrong\u003emateria\u003c/strong\u003e o \u003cstrong\u003eactividad\u003c/strong\u003e quedará en la misma ventana pero en modo edición, por lo que podrás cambiarle \u003cstrong\u003eNombre\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el ícono de \u003cstrong\u003e\u003cem\u003eCheck\u003c/em\u003e\u003c/strong\u003e para salir del modo Edición.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eConfirma los cambios. Al confirmar los cambios, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"asocia-al-plancarrera-una-o-más-actividades-existentes\"\u003eAsocia al Plan/Carrera una o más actividades existentes\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003ePara asociar una \u003cstrong\u003emateria\u003c/strong\u003e o \u003cstrong\u003eactividad\u003c/strong\u003e existente al Plan/Carrear, haz clic en el campo desplegable que se encuentra debajo de la sección \u003cstrong\u003eMaterias/Actividades\u003c/strong\u003e para desplegar todas las materias y actividades que ofrece la institución.\u003c/li\u003e\n\u003cli\u003eLocaliza la materia o actividad que deseas asociar al \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e. Para ello, utiliza el mismo campo que encabeza la lista de materias y actividades e ingresa parte del nombre de la materia o actividad.\u003c/li\u003e\n\u003cli\u003eUna vez localizada la \u003cstrong\u003emateria\u003c/strong\u003e o \u003cstrong\u003eactividad\u003c/strong\u003e, selecciónala y luego haz clic en el botón \u003cstrong\u003eAsociar\u003c/strong\u003e para agregarla a la lista de materias y actividades de este Plan/Carrera.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eConfirma los cambios. Al confirmar los cambios, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi deseas cerciorarte de que la materia o actividad se asoció al Plan/Carrera, búscala mediante el filtro que se habilita al hacer clic en la columna 'Nombre' o en el ícono de lupa del encabezado de las materias y actividades asociadas al Plan/Carrera que estás editando.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch3 id=\"cambia-el-orden-en-que-se-despliegan-las-materias-o-actividades\"\u003eCambia el orden en que se despliegan las materias o actividades\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003ePara cambiar el orden en que se despliegan las materias o actividades, haz clic en el ícono de puntos y arrastra la actividad hasta el lugar de la lista en donde quieras visualizarla.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eConfirma los cambios. Al confirmar los cambios, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"agrega-una-materia-o-actividad\"\u003eAgrega una materia o actividad\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003ePara agregar una \u003cstrong\u003emateria\u003c/strong\u003e o \u003cstrong\u003eactividad\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003e+ NUEVA ACTIVIDAD/MATERIA\u003c/strong\u003e. A continuación, se añadirá una fila en el listado de materias/actividades donde podrás ingresar el \u003cstrong\u003eNombre\u003c/strong\u003e de la actividad.\u003c/li\u003e\n\u003cli\u003eIngresa el \u003cstrong\u003eNombre\u003c/strong\u003e de la \u003cstrong\u003emateria\u003c/strong\u003e o \u003cstrong\u003eactividad\u003c/strong\u003e que deseas agregar.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl ingresar la nueva actividad o materia, el \u003cb\u003eAdministrador de Equivalencias\u003c/b\u003e agregará una marca de \u003ci\u003eCheck\u003c/i\u003e para indicar que el número de caracteres utilizado es aceptable y además le asignará un \u003cb\u003eCódigo\u003c/b\u003e único.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eHaz clic en el ícono de \u003cstrong\u003e\u003cem\u003eCheck\u003c/em\u003e\u003c/strong\u003e para salir del modo Edición.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eConfirma los cambios. Al confirmar los cambios, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"elimina-una-materia-o-actividad\"\u003eElimina una materia o actividad\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003ePara eliminar una \u003cstrong\u003emateria\u003c/strong\u003e o \u003cstrong\u003eactividad\u003c/strong\u003e, haz clic en la columna \u003cstrong\u003eNombre\u003c/strong\u003e del listado de materias y actividades para habilitar el filtro que te permitirá localizarla.\u003c/li\u003e\n\u003cli\u003eUna vez localizada la actividad, haz clic en el ícono de \u003cstrong\u003ePapelera\u003c/strong\u003e ubicado en la columna \u003cstrong\u003eAcciones\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA continuación, podrás:\n\u003cul\u003e\n\u003cli\u003eDeshacer esta acción al hacer clic en el ícono \u003cstrong\u003eDeshacer\u003c/strong\u003e cuya leyenda \u003cstrong\u003e\u003cem\u003eDeshacer eliminado\u003c/em\u003e\u003c/strong\u003e se despliega por unos instantes.\u003c/li\u003e\n\u003cli\u003eProseguir con esta acción al hacer clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003eLuego de hacer clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e, haz clic en \u003cstrong\u003eConfirmar\u003c/strong\u003e para eliminar la \u003cstrong\u003eactividad\u003c/strong\u003e o \u003cstrong\u003emateria\u003c/strong\u003e. Al confirmar la eliminación, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"añade-un-plan-de-estudiocarrera-a-la-institución\"\u003eAñade un Plan de Estudio/Carrera a la Institución\u003c/h2\u003e\n\u003col\u003e\n\u003cli\u003ePara agregar un \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e, primero debes desplegar la pantalla \u003cstrong\u003e\u003cem\u003eEditar institución\u003c/em\u003e\u003c/strong\u003e – a la que puedes llegar inmediatamente luego de añadir una Institución - o al localizar una Institución y hacer clic en el ícono de lápiz debajo de la columna \u003cstrong\u003eAcciones\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez en la pantalla \u003cstrong\u003e\u003cem\u003eEditar institución\u003c/em\u003e\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eAñadir Plan/Carrera\u003c/strong\u003e. A continuación, se añadirá una línea donde podrás ingresar el \u003cstrong\u003eNombre\u003c/strong\u003e del plan/carrera.\u003c/li\u003e\n\u003cli\u003eAgrega un \u003cstrong\u003eNombre\u003c/strong\u003e para el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e. Por ejemplo, el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e \u003cstrong\u003e\u003cem\u003e2020-Abogacía\u003c/em\u003e\u003c/strong\u003e. Luego, haz clic en el botón deslizante para activarlo.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e o pulsa \u003cstrong\u003eEnter\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eConfirma que deseas añadir el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e a la institución al hacer clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e o bien pulsando la tecla \u003cstrong\u003eEnter\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA continuación se desplegará la ventana \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e con un mensaje anunciando que el plan se ha agregado con éxito. Desde esta ventana podrás:\n-Agregar \u003cstrong\u003eMaterias\u003c/strong\u003e / \u003cstrong\u003eActividades\u003c/strong\u003e para luego asociarlas a este \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e\no\n\u003cul\u003e\n\u003cli\u003eAsociar \u003cstrong\u003eMaterias\u003c/strong\u003e / \u003cstrong\u003eActividades\u003c/strong\u003e existentes, es decir, que ya hayan sido agregadas a la institución pero aún no a este \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003ePara agregar Materias / Actividades para luego asociarlas al plan ver \u003cstrong\u003eAgregar una materia o actividad\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003ePara asociar \u003cstrong\u003eMaterias\u003c/strong\u003e / \u003cstrong\u003eActividades\u003c/strong\u003e ya agregadas a la institución para luego asociarlas al plan, ver \u003cstrong\u003eAsociar al Plan una o más actividades existentes\u003c/strong\u003e.\u003c/p\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn el caso de que ingresaras un \u003cb\u003ePlan/Carrera\u003c/b\u003e con un nombre similar o igual a uno ya ingresado, el \u003cb\u003eAdministrador de Equivalencias\u003c/b\u003e te lo advertirá con un mensaje contextual, tras lo cual podrás: \u003ci\u003eCancelar\u003c/i\u003e para modificar el Nombre del Plan/Carrera; \u003ci\u003eCancelar\u003c/i\u003e toda la acción por ser un duplicado; \u003ci\u003eContinuar\u003c/i\u003e ya que el nombre es similar, pero no igual.\u003c/div\u003e\n\u003c/div\u003e\n\u003cp\u003eUna vez agregado el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha creado exitosamente.\u003c/em\u003e\u003c/strong\u003e\u003c/p\u003e\n\u003cp\u003eDesde esta ventana podrás:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eAgregar \u003cstrong\u003eMaterias\u003c/strong\u003e / \u003cstrong\u003eActividades\u003c/strong\u003e para luego asociarlas a este \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eAsociar \u003cstrong\u003eMaterias\u003c/strong\u003e / \u003cstrong\u003eActividades\u003c/strong\u003e ya agregadas a la institución al Plan/Carrera. Para más detalles, dirígete a la sección \u003cstrong\u003eAsociar al Plan una o más actividades existentes\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"desactiva-un-plancarrera\"\u003eDesactiva un Plan/Carrera\u003c/h2\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003e Solo podrás activar o desactivar un \u003cb\u003ePlan de Estudio/Carrera\u003c/b\u003e para una institución dada siempre que dicho \u003cb\u003ePlan de Estudio/Carrera\u003c/b\u003e no forme parte de una \u003cb\u003eRegla de Equivalencia\u003c/b\u003e.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eLocaliza la institución donde está inscripto el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez encontrada la institución, localiza el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e y haz clic en el ícono de lápiz ubicado en el extremo derecho de dicho \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón deslizable que se encuentra en la columna \u003cstrong\u003eActivo\u003c/strong\u003e para que el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e quede desactivado o deshabilitado.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e para salvar los cambios.\u003c/li\u003e\n\u003cli\u003eConfirma la acción. A continuación, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e ya que desactivar el plan se considera una edición.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eSi el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e que intentas desactivar formara parte de una \u003cstrong\u003eRegla de Equivalencias\u003c/strong\u003e, al hacer clic en el botón \u003cstrong\u003eConfirmar\u003c/strong\u003e para guardar los cambios, el \u003cstrong\u003eAdministrador de Equivalencias\u003c/strong\u003e desplegará el mensaje \u003cstrong\u003e\u003cem\u003eNo se puede desactivar un plan que está asociado a reglas de equivalencia.\u003c/em\u003e\u003c/strong\u003e\u003c/p\u003e\n\u003ch2 id=\"activa-un-plancarrera\"\u003eActiva un Plan/Carrera\u003c/h2\u003e\n\u003col\u003e\n\u003cli\u003eLocaliza la institución donde está inscripto el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez encontrada la institución, localiza el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e y haz clic en el ícono de lápiz ubicado en el extremo derecho de dicho \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón deslizable que se encuentra en la columna \u003cstrong\u003eActivo\u003c/strong\u003e para que el \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e quede activado o habilitado.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e para salvar los cambios.\u003c/li\u003e\n\u003cli\u003eConfirma la acción. A continuación, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eEl plan se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e ya que activar el plan se considera una edición.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:133,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/",title:"Editar materias",description:null,content:"\u003cp\u003eEl \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e te permite editar una materia al modificar algunos de sus atributos y el o los Programas asociados.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el ícono \u003cstrong\u003eMaterias\u003c/strong\u003e ubicado en el panel izquierdo de la pantalla del \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e para abrir el \u003cstrong\u003eMódulo “Materias”\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la materia a editar mediante la aplicación de los filtros tales como \u003cstrong\u003eDescripción\u003c/strong\u003e o \u003cstrong\u003ecódigo de materia\u003c/strong\u003e o \u003cstrong\u003eEstado de materia\u003c/strong\u003e (Activo o Inactivo).\u003c/li\u003e\n\u003cli\u003eUna vez localizada la materia, haz clic sobre la misma. A continuación, se desplegará debajo del nombre de la materia una sección donde se indica el \u003cstrong\u003eEstado\u003c/strong\u003e (Activo o Inactivo), el \u003cstrong\u003eTipo de Materia\u003c/strong\u003e (por ejemplo, “NP”), y el \u003cstrong\u003eÁrea disciplinar\u003c/strong\u003e, y en el extremo derecho, un sector con \u003cstrong\u003eAcciones\u003c/strong\u003e entre las cuales encontrarás el ícono de lápiz que habilitará la edición.\u003c/li\u003e\n\u003cli\u003eHaz clic en este ícono de lápiz. A continuación, se desplegará la ventana \u003cstrong\u003eEditar materia\u003c/strong\u003e en donde podrás editar algunos campos, tales como los campos \u003cstrong\u003eResponsable\u003c/strong\u003e -que señala quién es la persona responsable de la materia, el número de \u003cstrong\u003eCréditos\u003c/strong\u003e, el número de \u003cstrong\u003eHoras reloj / cátedra\u003c/strong\u003e, y el \u003cstrong\u003eEstado de materia\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLuego de modificar el o los campos necesarios, haz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e para salvar los cambios. El \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e desplegará el mensaje \u003cem\u003e“La materia se editó con éxito”\u003c/em\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eEdición de Programas de una Materia\u003c/strong\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eSi fuera necesario, edita uno o más \u003cstrong\u003eProgramas de la materia\u003c/strong\u003e. Para ello, localiza la materia cuyo \u003cstrong\u003ePrograma\u003c/strong\u003e debes modificar.\u003c/li\u003e\n\u003cli\u003eLuego, haz clic sobre la materia. A continuación, haz clic en el ícono \u003cstrong\u003eMás información\u003c/strong\u003e que se encuentra junto al ícono de edición. Esto te permitirá visualizar el o los programas de la materia.\u003c/li\u003e\n\u003cli\u003eLocaliza el \u003cstrong\u003ePrograma\u003c/strong\u003e que deseas editar y haz clic en el ícono de lápiz para editarlo. A continuación, se desplegará la ventana \u003cstrong\u003e\u003cem\u003e“Edición de programa para la materia\u003c/em\u003e [Nombre de Materia – Código]\u0026quot;\u003c/strong\u003e, con sus botones y secciones:\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eInformación General:\u003c/strong\u003e Al hacer clic en este botón se desplegará un formulario que contiene ciertas características del Programa y que podrás editar – y si estuviera vacío, completar.\u003c/li\u003e\n\u003cli\u003eBotón \u003cstrong\u003eSeleccionar Bibliografía:\u003c/strong\u003e Al hacer clic en este botón, se abrirá un formulario desde donde podrás seleccionar la bibliografía para agregar a este Programa específico de la materia.\u003c/li\u003e\n\u003cli\u003eSección \u003cstrong\u003eBibliografía seleccionada:\u003c/strong\u003e La grilla que se encuentra debajo del botón Seleccionar Bibliografía se completa al seleccionar la bibliografía. Desde esta pantalla podrás eliminar bibliografía o modificar su condición de Básica o Ampliatoria.\u003c/li\u003e\n\u003cli\u003eBotón \u003cstrong\u003eSeleccionar Competencias:\u003c/strong\u003e Al hacer clic en este botón, se desplegará una lista de competencias que podrás seleccionar para indicar las habilidades que se desarrollarán durante el dictado de la materia seleccionada.\u003c/li\u003e\n\u003cli\u003eSección  \u003cstrong\u003eSeleccionar Competencias:\u003c/strong\u003e La grilla que se encuentra debajo del botón \u003cstrong\u003eSeleccionar Competencias\u003c/strong\u003e se completará al seleccionar las competencias. Desde esta pantalla podrás eliminar \u003cstrong\u003eCompetencias\u003c/strong\u003e o modificar su atributo de \u003cstrong\u003eInstitucionales\u003c/strong\u003e, \u003cstrong\u003eGenérica\u003c/strong\u003e, \u003cstrong\u003eEspecífica\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eBotón \u003cstrong\u003eEditar contenido\u003c/strong\u003e: Al hacer clic en este botón, se desplegará el \u003cstrong\u003ePrograma\u003c/strong\u003e con su encabezado, \u003cstrong\u003eFundamentación\u003c/strong\u003e, \u003cstrong\u003eObjetivos\u003c/strong\u003e, y la sección \u003cstrong\u003eContenidos\u003c/strong\u003e donde se cargó el contenido propiamente dicho, es decir, los tema o Unidades que se dictarán en la materia.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003eHaz clic en la línea de contenido que deseas editar. Por ejemplo, seleccionar un título del Tema 1.1 de la primera Unidad para activar 3 íconos:\n\u003col\u003e\n\u003cli\u003eUn ícono con el signo + para agregar un Sub-Tema a este Tema\u003c/li\u003e\n\u003cli\u003eUn ícono de lápiz para modificar la línea de contenido seleccionada\u003c/li\u003e\n\u003cli\u003eUn ícono para eliminar la línea de contenido\u003c/li\u003e\n\u003c/ol\u003e\n\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eAñade una línea de contenido al contenido existente:\u003c/strong\u003e Haz clic en el \u003cstrong\u003esigno +\u003c/strong\u003e. A continuación, al estar posicionado en un Tema, se desplegará la ventana \u003cstrong\u003eAgregar Contenido\u003c/strong\u003e, y solo estarán habilitados los campos \u003cstrong\u003eSub-Tema\u003c/strong\u003e y \u003cstrong\u003eMódulo\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, verás el \u003cstrong\u003eSub-Tema\u003c/strong\u003e agregado al Contenido del Programa de la materia.\u003c/li\u003e\n\u003cli\u003eUtiliza el ícono de lápiz para para modificar la línea de contenido seleccionada: Posiciónate en la línea a editar, y haz clic en el ícono de lápiz. A continuación, se desplegará la ventana \u003cstrong\u003eEditar Contenido\u003c/strong\u003e, y solo estarán habilitados los campos que se corresponden con la línea de contenido seleccionad (\u003cstrong\u003eSub-Tema\u003c/strong\u003e y \u003cstrong\u003eMódulo\u003c/strong\u003e).\u003c/li\u003e\n\u003cli\u003eEdita el contenido seleccionado.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, .verás el Sub-Tema editado.\u003c/li\u003e\n\u003cli\u003eSi en cambio deseas eliminar contenido, posiciónate en la línea a editar y haz clic en el ícono de Papelera para eliminar la línea de contenido seleccionada.\u003c/li\u003e\n\u003cli\u003eConfirma que desas eliminar el contenido seleccionado. A continuación, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eContenido borrado con éxito\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003ePara finalizar la edición del \u003cstrong\u003ePrograma\u003c/strong\u003e de la materia, haz clic en el botón \u003cstrong\u003eFinalizar\u003c/strong\u003e para volver a la pantalla que lista todos los \u003cstrong\u003eProgramas\u003c/strong\u003e de la materia.\u003c/li\u003e\n\u003cli\u003eLocaliza el \u003cstrong\u003ePrograma\u003c/strong\u003e que acabas de editar para visualizarlo y así cerciorarte de que el \u003cstrong\u003eContenido\u003c/strong\u003e del \u003cstrong\u003ePrograma\u003c/strong\u003e ha sido editado.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:134,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/",title:"Editar Plan de Estudio",description:null,content:"\u003cp\u003eEl \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e permite editar el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e de una carrera determinada, lo que significa que puedes activar un \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e- que su Estado pase de Borrador a Activo – o modificar ciertos atributos del plan. Lo primero que debes hacer es localizar la carrera, y luego el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e a editar.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la carrera cuyo \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e necesites editar. Para ello, primero utiliza el filtro \u003cstrong\u003eNivel de estudio\u003c/strong\u003e para que se habiliten los demás filtros disponibles y el botón de búsqueda. Luego, utiliza los demás filtros para así limitar los resultados de la búsqueda. Haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez localizada la carrera, haz clic sobre la misma para desplegar los diferentes \u003cstrong\u003ePlanes de Estudio\u003c/strong\u003e que tenga y localiza el que deseas editar.\u003c/li\u003e\n\u003cli\u003eUna vez localizado el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e que deseas editar, podrás realizar modificaciones al plan o, si el Estado del plan es \u003cstrong\u003eBorrador\u003c/strong\u003e, podrás activarlo.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara que la carrera entre en vigencia, deberá tener al menos un Plan de Estudio cuyo Estado sea “Activo”.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eActivar un Plan de Estudio\u003c/strong\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eHaz clic en el ícono de lápiz para proceder a editar el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla siguiente, localiza el campo \u003cstrong\u003eEstado\u003c/strong\u003e y selecciona \u003cstrong\u003eACTIVO\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eEditar Materias\u003c/strong\u003e. A continuación, si aún no hubieses completado las \u003cstrong\u003eResoluciones\u003c/strong\u003e, se desplegará el mensaje de advertencia \u003cem\u003e\u0026ldquo;Se requiere al menos una resolución\u0026rdquo;\u003c/em\u003e. Completa esta sección para poder activar el \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSi aún no completaste la sección \u003cstrong\u003eResoluciones\u003c/strong\u003e, selecciona una \u003cstrong\u003eSede\u003c/strong\u003e. Las opciones disponibles coincidirán con la “Modalidad del Plan”. Por ejemplo:\n\u003cul\u003e\n\u003cli\u003eSi la Modalidad es \u003cstrong\u003ePRESENCIAL\u003c/strong\u003e, las opciones de Sede serán \u003cstrong\u003ePresencial – Córdoba\u003c/strong\u003e o \u003cstrong\u003ePresencial – Río Cuarto\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eSi la Modalidad es \u003cstrong\u003eDistancia - Educación Distribuida\u003c/strong\u003e, la única opción será \u003cstrong\u003eE-CAMPUS MTD\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA continuación se desplegará una sección para completar el número de la \u003cstrong\u003eResolución Ministerial\u003c/strong\u003e, el de la \u003cstrong\u003eResolución Rectoral\u003c/strong\u003e, y el \u003cstrong\u003eExpediente CONEAU\u003c/strong\u003e. Si hubiere más de una \u003cstrong\u003eSede\u003c/strong\u003e, se desplegará una sección para cada sede y estas podrán tener los mismos números de resolución ministerial y rectoral – y de Expediente CONEAU.\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003ePara terminar de activar el \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eEditar Materias\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSi no hubiera que realizar ningún cambio en cuanto a las materias y titulaciones, haz clic en el botón \u003cstrong\u003eFinalizar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eCorrobora que el \u003cstrong\u003eEstado\u003c/strong\u003e del \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e que has activado sea \u003cstrong\u003eActivo\u003c/strong\u003e localizando nuevamente la carrera y el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e correspondiente.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eEditar un Plan de Estudio\u003c/strong\u003e\nAdemás de activar un \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e, podrás modificarlo al agregar o quitar materias o al modificar la configuración de dichas materias.\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUn Plan de Estudio cuyo Estado sea Activo no podrá editarse.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez localizado el \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e que deseas modificar, haz clic en el ícono de lápiz para proceder a editarlo. Por ejemplo, podrás editar la \u003cstrong\u003eDuración\u003c/strong\u003e de la materia.\u003c/li\u003e\n\u003cli\u003eUna vez realizados los cambios necesarios, haz clic en el botón \u003cstrong\u003eEditar Materias\u003c/strong\u003e para guardarlos.\u003c/li\u003e\n\u003cli\u003eEn la ventana que se despliega podrás agregar o quitar materias – siempre que no sea correlativa de alguna otra materia que aún no has eliminado, y agregar o quitar segmentos para las diferentes titulaciones.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi no encontraras una materia – o si no puedes agregarla porque la carga de la materia no ha sido finalizada y la materia cuenta con un “Programa activo”, deberás ingresarla o editarla desde el Módulo de Materias. Para ello, dirígete a la sección “Crear Materias” (ver vínculo más abajo).\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eAgregar materias a un Plan de Estudio\u003c/strong\u003e\nEl Administrador de Carreras te permite agregar materias a un Plan de Estudio por segmentos que agrupan materias de acuerdo al título y orientaciones que otorga la carrera.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eAñadir materias al Segmento agrupador de materias comunes inicial\u003c/strong\u003e\u003c/p\u003e\n\u003col start=\"11\"\u003e\n\u003cli\u003eAñade materias al segmento común e inicial \u003cstrong\u003eGrupo de materias 1\u003c/strong\u003e. Para ello, haz clic en el campo desplegable \u003cstrong\u003eMaterias\u003c/strong\u003e y escribe las primeras letras o al menos 3 letras que conformen el nombre de la materia. Inmediatamente después de agregar una materia, se desplegará una ventana con 3 Pestañas:\n\u003col\u003e\n\u003cli\u003e\u003cem\u003e“Configuración de materia en el plan”\u003c/em\u003e: aquí debes indicar los atributos de la \u003cstrong\u003eMateria\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003e\u003cem\u003e“Información de la materia”\u003c/em\u003e: aquí podrás visualizar información extra acerca de la materia como por ejemplo criterios de regularidad\u003c/li\u003e\n\u003cli\u003e\u003cem\u003e“Programa activo de la materia”\u003c/em\u003e: aquí obtendrás un resumen del \u003cstrong\u003ePrograma activo\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi no encontraras una materia – o si la carga de la materia no ha sido finalizada y no cuenta con un Programa activo, deberás ingresarla o editarla desde el Módulo de Materias. Para ello, dirígete a la sección “Crear Materias” (ver vínculo más abajo).\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"12\"\u003e\n\u003cli\u003eCompleta el campo obligatorio \u003cstrong\u003eCuatrimestre\u003c/strong\u003e, que indica el cuatrimestre en el que se va a dictar la materia. Por ejemplo, si se selecciona 1, esto indica que la materia se dictará en el primer cuatrimestre.\u003c/li\u003e\n\u003cli\u003eEn el campo \u003cstrong\u003eCantidad de encuentros\u003c/strong\u003e, indica, si fuera aplicable, la cantidad de veces que se deberá asistir en forma presencial.\u003c/li\u003e\n\u003cli\u003eSelecciona el “Tipo de Materia”: \u003cstrong\u003eComplementarias CN\u003c/strong\u003e, \u003cstrong\u003eContenido Idioma\u003c/strong\u003e, \u003cstrong\u003eCursillo\u003c/strong\u003e, \u003cstrong\u003eElectiva\u003c/strong\u003e, \u003cstrong\u003eProgramática\u003c/strong\u003e, \u003cstrong\u003eIntegradora\u003c/strong\u003e, etc.\u003c/li\u003e\n\u003cli\u003eIndica en cuál período se comenzará a dictar la materia.\u003c/li\u003e\n\u003cli\u003eEn caso de que la materia tuviera una materia correlativa, es decir, una materia que el estudiante debe tener cursada o aprobada para poder cursar la materia que estoy agregando al \u003cstrong\u003ePlan de estudio\u003c/strong\u003e - completa el campo \u003cstrong\u003eCorrelativas\u003c/strong\u003e mediante el uso de la lista desplegable.\u003c/li\u003e\n\u003cli\u003eEn la parte inferior de la pantalla, se podrán seleccionar indicadores que al deslizarlos se activan o desactivan para informar si está habilitada la \u003cstrong\u003eInscripción automática\u003c/strong\u003e o si la materia \u003cstrong\u003eConsume ticket\u003c/strong\u003e, es decir, si se genera un ticket de pago a abonar por el estudiante.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, podrás visualizar la materia en el Segmento agrupador de materias común e inicial denominado \u003cstrong\u003eGrupo de materias 1\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eAgrega las materias necesarias al \u003cstrong\u003eSegmento\u003c/strong\u003e agrupador de materias comunes inicial.\u003c/li\u003e\n\u003cli\u003eEn esta pantalla también podrás eliminar materias – siempre y cuando no sean correlativas de otras que no hayan sido o eliminadas o cuya correlatividad no haya sido editada.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eAñadir materias al Segmento agrupador de materias de una Titulación en particular\u003c/strong\u003e\u003c/p\u003e\n\u003col start=\"22\"\u003e\n\u003cli\u003eAñade o quita materias de los segmentos de una titulación u orientación en particular. Para ello, haz clic en el campo desplegable \u003cstrong\u003eMaterias\u003c/strong\u003e y escribe las primeras letras o al menos 3 letras que conformen el nombre de la materia.\u003c/li\u003e\n\u003cli\u003eUna vez agregada la materia del segmento escogido, haz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e. A continuación, podrás ver la materia agregada a dicho Segmento.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eFinalizar\u003c/strong\u003e para salvar la configuración del \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLa edición de un \u003cstrong\u003ePlan de estudio\u003c/strong\u003e, también contempla la edición de una materia que esté incluida en el plan. Para ello, haz clic en el ícono de lápiz situado en el extremo derecho de la materia para así modificar el \u003cstrong\u003eCuatrimestre\u003c/strong\u003e, la \u003cstrong\u003eCantidad de encuentros\u003c/strong\u003e, el \u003cstrong\u003eTipo de materia\u003c/strong\u003e, para editar o agregar una o más \u003cstrong\u003eCorrelativas\u003c/strong\u003e, como así también para indicar mediante los indicadores deslizables si, por ejemplo, la materia tiene habilitada la inscripción automática.\u003c/li\u003e\n\u003cli\u003eTambién podrás \u003cem\u003equitar\u003c/em\u003e la \u003cstrong\u003eMateria\u003c/strong\u003e asociada al \u003cstrong\u003ePlan de estudios\u003c/strong\u003e al seleccionar el ícono de eliminar ubicado junto al ícono de lápiz. El \u003cstrong\u003e\u003cem\u003eAdministrador de Carreras\u003c/em\u003e\u003c/strong\u003e desplegará una ventana para que confirmes que deseas eliminar la materia.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:135,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/",title:"Editar Regla de Equivalencia",description:null,content:"\u003cp\u003eLa app \u003cstrong\u003eEquivalencias\u003c/strong\u003e consta de varios módulos, entre ellos, el módulo \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e. En este módulo podrás modificar las \u003cstrong\u003eReglas de Equivalencia\u003c/strong\u003e que establecen cuáles son la o las Materias o Actividades aprobadas en una institución de \u003cem\u003eOrigen\u003c/em\u003e que serán reconocidas como aprobadas por una institución de \u003cem\u003eDestino\u003c/em\u003e.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e con tus credenciales. A continuación, se desplegará la ventana “Lista de Instituciones”. Haz clic en el ícono \u003cstrong\u003eEquivalencias\u003c/strong\u003e en el panel izquierdo de la pantalla para desplegar la ventana \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLocaliza la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e que deseas editar mediante el uso del campo \u003cstrong\u003eBuscar\u003c/strong\u003e para filtrar los resultados. En este campo podrás:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eIngresar parte del nombre de la \u003cstrong\u003eInstitución\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eIngresar parte del \u003cstrong\u003eNombre del Plan\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eIngresar parte del nombre de la \u003cstrong\u003eResolución\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez localizada la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e, haz clic en cualquier parte de la línea desplegada o en el ícono de lápiz para comenzar a editarla. En esta ventana de edición podrás:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003emodificar los campos de la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eagregar o quitar materias y actividades en la Sección \u003cstrong\u003eAsociar Actividades / Materias\u003c/strong\u003e tanto si son de origen o de destino\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eModifica el nombre de la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e según corresponda.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eModifica el campo \u003cstrong\u003eResolución\u003c/strong\u003e según corresponda.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eActiva o desactiva según corresponda el botón deslizable \u003cstrong\u003eRegla activa\u003c/strong\u003e para indicar si la \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e está vigente.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eActiva o desactiva según corresponda el botón deslizable \u003cstrong\u003eRequiere revisión\u003c/strong\u003e para indicar que alguna materia o actividad de esta \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e que se está editando debe ser revisada antes de aplicarse cuando un estudiante solicite que se le considere una equivalencia – es decir, una verificación manual antes de otorgar la equivalencia de la materia que el estudiante aprobó en la institución de la que proviene.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"sección-origen\"\u003eSección “Origen”\u003c/h2\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eModifica según corresponda la \u003cstrong\u003e\u003cem\u003eInstitución de origen\u003c/em\u003e\u003c/strong\u003e de la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e, es decir, la institución de la que proviene el estudiante con materias o actividades aprobadas y por la que solicita que se analice si existen materias o actividades homólogas en la institución de destino para que esta última se las acredite como aprobadas.\u003c/li\u003e\n\u003cli\u003eModifica según corresponda el \u003cstrong\u003ePlan/carrera de origen\u003c/strong\u003e, es decir, la Carrera junto con su Plan de Estudios que el estudiante ha cursado en la institución de origen.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"sección-destino\"\u003eSección “Destino”\u003c/h2\u003e\n\u003col start=\"10\"\u003e\n\u003cli\u003eModifica según corresponda la \u003cstrong\u003e\u003cem\u003eInstitución de destino\u003c/em\u003e\u003c/strong\u003e, la cual es la institución a la que el estudiante solicita que analice si las materias o actividades aprobadas en la institución de donde ha estado cursando pueden ser acreditadas como aprobadas.\u003c/li\u003e\n\u003cli\u003eModifica según corresponda el \u003cstrong\u003ePlan/carrera de destino\u003c/strong\u003e, es decir, la Carrera junto con su Plan de Estudios que el estudiante aspira a cursar en la institución de destino.\u003c/li\u003e\n\u003cli\u003eActiva o desactiva según corresponda el botón deslizable \u003cstrong\u003eTodos\u003c/strong\u003e. Este botón deberá estar activo si la actividad o materia aprobada en la institución de origen se considera como equivalente de las actividades o materias de destino seleccionadas para todos los planes de todas las carreras. Por ejemplo, la materia \u003cem\u003eInglés I\u003c/em\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"sección-asociar-actividades--materias\"\u003eSección \u0026ldquo;Asociar Actividades / Materias\u0026rdquo;\u003c/h2\u003e\n\u003cp\u003eModifica esta sección según corresponda al agregar o eliminar materias o actividades que la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e establece que son homólogas.\n13. Agrega o elimina materias o actividades de la \u003cstrong\u003e\u003cem\u003eInstitución de origen\u003c/em\u003e\u003c/strong\u003e según corresponda.\n14. Agrega o elimina materias o actividades de la \u003cstrong\u003e\u003cem\u003eInstitución de destino\u003c/em\u003e\u003c/strong\u003e según corresponda, es decir, aquellas que se darán como aprobadas de acuerdo a la o las materias o actividades ingresadas en la Institución de origen.\u003c/p\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUna actividad o materia de origen puede tener una o más actividades o materias equivalentes, y viceversa.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"13\"\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y confirma los cambios. A continuación, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eLa regla se ha editado exitosamente\u003c/em\u003e\u003c/strong\u003e y se habilitará el botón \u003cstrong\u003eClonar\u003c/strong\u003e para duplicar la \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e en caso de tener que generar una regla en donde se contemplen diferentes escenarios de equivalencias entre las materias de las instituciones mencionadas.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003ePor ejemplo, si la materia \u003cstrong\u003eDerecho Penal I\u003c/strong\u003e de origen tuviera sólo como equivalencia la materia \u003cstrong\u003e\u003cem\u003eLeyes 1\u003c/em\u003e\u003c/strong\u003e de destino, y la materia \u003cstrong\u003eDerecho Penal II\u003c/strong\u003e tuviera \u003cstrong\u003e\u003cem\u003eLeyes 2\u003c/em\u003e\u003c/strong\u003e y \u003cstrong\u003e\u003cem\u003eLeyes 3\u003c/em\u003e\u003c/strong\u003e como equivalencia, se podrá establecer una primera regla para el primer escenario, y luego \u003cstrong\u003eCLONAR\u003c/strong\u003e esta primera \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e para contemplar el segundo escenario.\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:136,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/",title:"Eliminar Institución educativa",description:null,content:"\u003cp\u003eAl ingresar a la app \u003cstrong\u003eEquivalencias\u003c/strong\u003e, por defecto se despliega el módulo \u003cstrong\u003eInstituciones\u003c/strong\u003e. Como co-docente, en este módulo podrás eliminar instituciones con sus diferentes carreras y respectivos Planes de Estudio siempre y cuando no exista ninguna \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e que involucre a la institución a eliminar.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al \u003cstrong\u003eSGU\u003c/strong\u003e. A continuación, se desplegará la ventana \u003cstrong\u003e\u003cem\u003eLista de Instituciones\u003c/em\u003e\u003c/strong\u003e en donde se listan las instituciones educativas que ya están registradas en el sistema.\u003c/li\u003e\n\u003cli\u003eRealiza una búsqueda de la institución que deseas eliminar ingresando parte del nombre de la misma – o una o más palabras que la identifiquen, o el nombre completo en el campo \u003cstrong\u003eNombre\u003c/strong\u003e y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e o pulsa la tecla \u003cstrong\u003eEnter\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eVerifica en esta primera pantalla los datos básicos de la institución, es decir, el \u003cstrong\u003eNombre\u003c/strong\u003e y el \u003cstrong\u003eCódigo\u003c/strong\u003e de la institución, y si ésta ha sido considerada como una institución \u003cstrong\u003e\u003cem\u003eOrigen\u003c/em\u003e\u003c/strong\u003e o \u003cstrong\u003e\u003cem\u003eDestino\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el \u003cstrong\u003eícono de Papelera\u003c/strong\u003e para así eliminar la institución.\u003c/li\u003e\n\u003cli\u003eConfirma la acción. A continuación, se desplegará el mensaje \u003cstrong\u003e\u003cem\u003eLa institución se ha eliminado exitosamente.\u003c/em\u003e\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi una institución estuviese involucrada en una Regla de Equivalencia, es decir, si hubiese un registro de una correspondencia de materias con S21 que acreditaría dichas materias si estas hubieran sido aprobadas por el estudiante en la institución que deseas eliminar, no podrás eliminarla.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:137,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/",title:"Realizar solicitud de Equivalencia",description:null,content:"\u003cp\u003eInicia un pedido de equivalencias para que \u003cstrong\u003eSiglo 21\u003c/strong\u003e te reconozca la o las materias que cursaste y aprobaste en la misma o en otra institución a través del \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003e\u003cem\u003ehttps://tusestudiosprevios.21.edu.ar\u003c/em\u003e\u003c/strong\u003e. La ventana \u003cstrong\u003eSolicitud de equivalencias\u003c/strong\u003e que se despliega por defecto te informa acerca de los 5 pasos que necesitas realizar para completar tu solicitud:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003ePaso # 1:\u003c/strong\u003e Completa tus datos personales y de contacto\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePaso # 2:\u003c/strong\u003e Selecciona institución, Carrera y Plan de Estudios de donde vienes\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePaso # 3:\u003c/strong\u003e Selecciona las materias que tienes aprobadas y carga aquellas materias que no estén en el listado\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePaso # 4:\u003c/strong\u003e Completa los datos académicos de todas las materias que quedaron seleccionadas y cargadas en el paso anterior.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePaso # 5:\u003c/strong\u003e Adjunta la documentación obligatoria (Documento Único (DU), Analítico Oficial y Plan de Estudio)\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"2\"\u003e\n\u003cli\u003eLee detenidamente los 5 pasos para asegurarte de que dispones de la información que se te pedirá que realices la solicitud de equivalencias y luego haz clic en el botón \u003cstrong\u003eComenzar\u003c/strong\u003e. A continuación, se desplegará la ventana \u003cstrong\u003eDATOS PERSONALES Y DE CONTACTO\u003c/strong\u003e para completar el \u003cspan style=\"color:red\"\u003e\u003cstrong\u003ePaso# 1:\u003c/strong\u003e \u003cem\u003eCompleta tus datos personales y de contacto\u003c/em\u003e\u003c/span\u003e.\u003c/li\u003e\n\u003cli\u003eLuego de completar el formulario \u003cstrong\u003eDATOS PERSONALES Y DE CONTACTO\u003c/strong\u003e correspondiente al \u003cstrong\u003ePaso# 1\u003c/strong\u003e, haz clic en el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla que se despliega, podrás completar el \u003cspan style=\"color:red\"\u003e\u003cstrong\u003ePaso# 2:\u003c/strong\u003e \u003cem\u003eSelecciona institución, Carrera y Plan de Estudios de donde vienes\u003c/em\u003e\u003c/span\u003e. Simplemente debes informar en cuál institución o universidad aprobaste materias y qué Carrera y Plan de Estudio cursaste, y si no encuentras la institución o la \u003cstrong\u003eCarrera/Plan de Estudio\u003c/strong\u003e como opción en las listas desplegables, podrás cargarlas de forma manual.\u003c/li\u003e\n\u003cli\u003eSi el \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e no tuviese en su listado la institución o universidad en la que cursaste, por ejemplo, la \u003cstrong\u003e\u003cem\u003eUniversidad del Museo Social Argentino\u003c/em\u003e\u003c/strong\u003e \u003cstrong\u003e(UMSA)\u003c/strong\u003e, podrás agregarla de forma manual. Al agregarla, debajo se despliega el mensaje \u003cstrong\u003e“Añadir opción “[Nombre de la universidad o institución]”\u003c/strong\u003e. Haz clic en este mensaje para agregar la institución o universidad.\u003c/li\u003e\n\u003cli\u003eSi el \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e no tuviese en su listado la institución o universidad en la que cursaste, agrega en forma manual las materias o actividades que tienes aprobadas en dicha institución o universidad.\u003c/li\u003e\n\u003cli\u003eTanto como si la institución o universidad y las materias que cursaste fueron ingresadas de forma manual o pudiste seleccionarlas de las listas desplegables, asegúrate de que la información sea exacta y luego haz clic en el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e para proceder al \u003cstrong\u003ePaso# 3\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA continuación, se desplegará la pantalla para completar el \u003cspan style=\"color:red\"\u003e\u003cstrong\u003ePaso# 3:\u003c/strong\u003e \u003cem\u003eSelecciona las materias que tienes aprobadas y carga aquellas materias que no estén en el listado\u003c/em\u003e\u003c/span\u003e. Repasa el listado de materias que se encuentra a la izquierda de la pantalla, y selecciona aquellas materias que has aprobado. Si faltase alguna materia, podrás agregarla de forma manual.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eA la derecha de la pantalla, el \u003cb\u003ePortal de Equivalencias\u003c/b\u003e te informa si para la carrera que aspiras cursar existen o no equivalencias que podrán serte concedidas.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003eSi el \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e lista equivalencias posibles, haz clic en el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e para proceder al \u003cstrong\u003ePaso# 4\u003c/strong\u003e. Si las materias que seleccionaste \u003cstrong\u003e\u003cem\u003eNO\u003c/em\u003e\u003c/strong\u003e tuviesen una equivalencia, procede de todos modos con la solicitud al hacer clic en el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e ya que la universidad analizará si la o las equivalencias deberían ser otorgadas.\u003c/li\u003e\n\u003cli\u003eTanto si el \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e listó equivalencias posibles o no listó ninguna,  haz clic en el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e para proceder al \u003cstrong\u003ePaso# 4\u003c/strong\u003e ya que si no se encontraron equivalencias, la universidad analizará si la o las equivalencias deberían ser otorgadas.\u003c/li\u003e\n\u003cli\u003eSi la o las materias que aprobaste no se encuentran listadas, ingrésala de forma manual.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLuego de agregar la materia de forma manual, en el paso siguiente, al completar los datos académicos deberás cargar el \u003cb\u003ePrograma de la Materia\u003c/b\u003e para que la universidad evalúe si puede tener una equivalencia.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"12\"\u003e\n\u003cli\u003eA continuación, se desplegará la pantalla para completar el \u003cspan style=\"color:red\"\u003e\u003cstrong\u003ePaso# 4:\u003c/strong\u003e \u003cem\u003eCompleta los datos académicos de todas las materias que quedaron seleccionadas y cargadas en el paso anterior\u003c/em\u003e\u003c/span\u003e. Aquí debes ingresar las notas que obtuviste en cada una de las materias que agregaste en el paso anterior, la fecha en la que obtuviste dicha nota, y el Folio y Libro donde figura la nota. En caso de que hubieras ingresado una materia de forma manual, debes cargar el \u003cstrong\u003ePrograma de la Materia\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez completadas todas las notas, fechas, y Folio / Libro se habilitará el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e. Haz clic en este botón para proceder al \u003cstrong\u003ePaso # 5\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn este \u003cspan style=\"color:red\"\u003e\u003cstrong\u003ePaso # 5:\u003c/strong\u003e \u003cem\u003eAdjunta la documentación obligatoria (Documento Único (DU), Analítico Oficial y Plan de Estudio)\u003c/em\u003e\u003c/span\u003e, deberás cargar la documentación requerida.\u003c/li\u003e\n\u003cli\u003eUna vez subida toda la documentación, accede al link \u003cstrong\u003e\u003cem\u003eTérminos y condiciones\u003c/em\u003e\u003c/strong\u003e relacionados con la información ingresada y, si estás de acuerdo con los mismos, haz clic en el casillero \u003cstrong\u003eAcepto los términos y condiciones\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez subida toda la documentación, se habilitará el botón \u003cstrong\u003eFinalizar\u003c/strong\u003e. Haz clic en este botón terminar el proceso de solicitud de equivalencias. A continuación se desplegará un mensaje anunciando que tu solicitud se registró correctamente y que la universidad S21 la analizará en detalle.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEl \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e te proporcionará un \u003cstrong\u003evínculo\u003c/strong\u003e que podrás guardar en tu navegador como \u003cem\u003e“Favoritos”\u003c/em\u003e para consultar el \u003cstrong\u003eEstado\u003c/strong\u003e de tu solicitud cuantas veces quieras, como así también un \u003cstrong\u003eCódigo\u003c/strong\u003e que si bien NO deberás ingresarlo si copias y guardas el enlace, sí deberás hacerlo cuando intentes consultar el \u003cstrong\u003eEstado\u003c/strong\u003e de tu pedido de equivalencias ingresando a la app Equivalencias.\u003c/p\u003e\n\u003col start=\"17\"\u003e\n\u003cli\u003eHaz clic en el \u003cstrong\u003evínculo\u003c/strong\u003e para verificar que abre la solicitud de equivalencias que acabas de enviar.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eTambién podrás hacer clic derecho en el vínculo para copiarlo y luego pégalo en la barra de direcciones de tu buscador y agregarlo a tus \u003cb\u003eFavoritos\u003c/b\u003e para poder volver a él cuando necesites consultar el estado de tu solicitud de equivalencias.\u003c/div\u003e\n\u003c/div\u003e\n\u003cp\u003eEn la sección inferior de la pantalla podrás ver listadas la institución o universidad a la que asististe anteriormente y la carrera que cursaste y la carrera en la que aspiras que se te adjudiquen equivalencias al cursar en \u003cstrong\u003eSiglo 21\u003c/strong\u003e.\u003c/p\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDebido a que recién has recién enviado la solicitud, el \u003cb\u003eEstado\u003c/b\u003e de la misma será \u003cb\u003ePendiente\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi has cerrado esta ventana que abriste con el vínculo proporcionado y no lo has guardado, podrás acceder a tu solicitud de Equivalencias ingresando nuevamente a \u003ci\u003etusestudiosprevios.21.edu.ar\u003c/i\u003e y luego haciendo clic en \u003cb\u003eBuscar solicitud\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"18\"\u003e\n\u003cli\u003e\n\u003cp\u003eSi has cerrado la ventana que abrió el vínculo proporcionado por el \u003cstrong\u003ePortal de Equivalencias\u003c/strong\u003e, ingresa nuevamente a \u003cstrong\u003e\u003cem\u003etusestudiosprevios.21.edu.ar\u003c/em\u003e\u003c/strong\u003e y haz clic en \u003cstrong\u003eBuscar solicitud\u003c/strong\u003e. Luego, ingresa el \u003cstrong\u003eNúmero de Seguimiento\u003c/strong\u003e de tu \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e y tu tipo y número de documento.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez completados los datos, se habilitará el botón \u003cstrong\u003eBuscar\u003c/strong\u003e. Haz clic en este botón para localizar tu solicitud de equivalencias. A continuación, podrás ver:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003ela institución o universidad a la que asististe anteriormente\u003c/li\u003e\n\u003cli\u003ela carrera que cursaste\u003c/li\u003e\n\u003cli\u003ela carrera en la que aspiras que se te adjudiquen equivalencias al cursar en \u003cstrong\u003eSiglo 21\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eEstado\u003c/strong\u003e de tu solicitud, la cual si recién la enviaste será \u003cstrong\u003ePendiente\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003elas materias que se te otorgarán como equivalencias si la documentación presentada está completa y avala la información ingresada\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-visualizar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:138,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/",title:"Revisar solicitud de Equivalencia",description:null,content:"\u003cp\u003eLa app \u003cstrong\u003eEquivalencias\u003c/strong\u003e consta de varios módulos, entre ellos, el módulo \u003cstrong\u003ePedido de equivalencia\u003c/strong\u003e. A través de este módulo podrás revisar las \u003cstrong\u003esolicitudes de Equivalencia\u003c/strong\u003e que realizaron los estudiantes para que se les otorgue o acredite materias o actividades como aprobadas en Siglo 21.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e con tus credenciales y luego haz clic en el ícono \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e situado en el panel izquierdo de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLocaliza el \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e que deseas revisar. Para ello, utiliza uno o más de los campos disponibles para filtrar la búsqueda: \u003cstrong\u003eNombre\u003c/strong\u003e, \u003cstrong\u003eNro identificación\u003c/strong\u003e (DNI o pasaporte), \u003cstrong\u003eNúmero de trámite\u003c/strong\u003e y \u003cstrong\u003eEstado\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez localizado el \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e, haz clic en el ícono de lápiz ubicado en el extremo derecho de la solicitud listada para revisar – y aprobar o rechazar cada una de las actividades o materias presentadas por el solicitante y cada una de las equivalencias a otorgar.\u003c/p\u003e\n\u003cp\u003eA continuación, se despliega la ventana \u003cstrong\u003eDetalle solicitud de equivalencia\u003c/strong\u003e donde debes revisar la información de las actividades o materias presentadas. En esta pantalla podrás visualizar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eEl \u003cstrong\u003eNúmero de trámite:\u003c/strong\u003e El número que el sistema le asignó a la solicitud de equivalencias que realizó el estudiante.\u003c/li\u003e\n\u003cli\u003eEl mensaje que anuncia si la solicitud de equivalencia ha sido \u003cstrong\u003eFinalizada\u003c/strong\u003e o si está \u003cstrong\u003ePendiente\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLas instituciones de origen y destino con sus carreras y planes respectivos.\u003c/li\u003e\n\u003cli\u003eLa sección \u003cstrong\u003eActividades/Materias presentadas por el alumno\u003c/strong\u003e en donde se listan las materias o actividades con su respectivo \u003cstrong\u003eCódigo\u003c/strong\u003e, su \u003cstrong\u003eEstado\u003c/strong\u003e en el extremo izquierdo y su respectiva \u003cstrong\u003eNota\u003c/strong\u003e en el extremo derecho.\n\u003cbr\u003e\n\u003cbr\u003e\nDebajo de esta información se detalla nuevamente la \u003cstrong\u003eNota\u003c/strong\u003e y se agrega su \u003cstrong\u003eFecha de aprobación\u003c/strong\u003e, y el \u003cstrong\u003eLibro\u003c/strong\u003e y \u003cstrong\u003eFolio\u003c/strong\u003e en donde fue registrada la \u003cstrong\u003eActividad/Materia\u003c/strong\u003e en la institución de origen.\n\u003cbr\u003e\n\u003cbr\u003e\nAsimismo, en el extremo derecho, se desplegarán dos íconos: uno para \u003cstrong\u003erechazar\u003c/strong\u003e la actividad o materia presentada por el estudiante, por ejemplo, por inconsistencias al contrastarlo con el \u003cstrong\u003eCertificado Analítico\u003c/strong\u003e, y otro ícono de \u003cstrong\u003e\u003cem\u003eCheck\u003c/em\u003e\u003c/strong\u003e para aprobarla.\n\u003cbr\u003e\n\u003cbr\u003e\u003c/li\u003e\n\u003cli\u003ela sección \u003cstrong\u003eEquivalencias de esta solicitud\u003c/strong\u003e, en donde luego de aprobar o rechazar las actividades o materias presentadas por el estudiante que solicita la o las equivalencias, se listarán la o las materias o actividades otorgadas como equivalencia, listadas una por una con su respectivo \u003cstrong\u003eCódigo\u003c/strong\u003e y \u003cstrong\u003eEstado\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eValiéndote del Certificado Analítico, verifica que los datos ingresados por el estudiante en el \u003cstrong\u003ePedido de equivalencias\u003c/strong\u003e estén correctos – y si fuese necesario, modifícalos.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el ícono que corresponda para \u003cstrong\u003erechazar\u003c/strong\u003e o dar por finalizada la revisión (y así darla como válida) de la o las materias o actividades presentadas en la solicitud de equivalencias.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eVerifica la información ingresada de cada una de las materias o actividades.\n6. Dirígete a la sección \u003cstrong\u003e\u003cem\u003eActividades/Materias de equivalencias disponibles para el alumno\u003c/em\u003e\u003c/strong\u003e. Aquí debes aprobar o rechazar las equivalencias de las materias o actividades presentadas por el estudiante que solicita la o las equivalencias.\n8. Para rechazar el \u003cstrong\u003ePedido de equivalencia\u003c/strong\u003e, haz clic en la cruz que se encuentra en la columna \u003cstrong\u003eAcciones\u003c/strong\u003e. El \u003cstrong\u003eEstado\u003c/strong\u003e cambiará inmediatamente a \u003cstrong\u003eRechazado\u003c/strong\u003e.\u003c/p\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi rechazaste un \u003cb\u003ePedido de equivalencia\u003c/b\u003e por error y deseas revertir esta acción, haz clic en ícono de \u003cb\u003eDeshacer\u003c/b\u003e ubicado debajo de la columna \u003cb\u003eAcciones\u003c/b\u003e.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eRevisa cada una de las materias de esta sección – es decir, de la sección \u003cstrong\u003e\u003cem\u003eActividades/Materias de equivalencias disponibles para el alumno\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eRecuerda que puedes rechazar una equivalencia por más que su \u003cb\u003eEstado\u003c/b\u003e disponga que la aprobación es automática.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003e\n\u003cp\u003ePara aprobar una equivalencia, si la \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e que estableció cuál o cuáles materias son homólogas indica que:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eNO\u003c/strong\u003e requiere de revisión manual, la o las equivalencias son otorgadas al hacer clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eSÍ\u003c/strong\u003e requiere de una revisión manual, haz dicha revisión y luego haz clic en el ícono de \u003cstrong\u003e\u003cem\u003eCheck\u003c/em\u003e\u003c/strong\u003e para \u003cstrong\u003eaprobar\u003c/strong\u003e la equivalencia – o en el ícono con forma de cruz para \u003cstrong\u003erechazarla\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLas materias o actividades del \u003cstrong\u003ePedido de equivalencia\u003c/strong\u003e que requieren revisión manual son señaladas con un ícono de un dedo índice apuntando un pequeño círculo. Procede a aprobar o rechazar cada materia presentada tal como indicado en el paso anterior.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el botón \u003cstrong\u003eGuardar\u003c/strong\u003e y luego confirma la acción al hacer clic en el botón \u003cstrong\u003eContinuar\u003c/strong\u003e:\na. Si sólo se lista una materia o actividad a dar como equivalencia, y esta fue rechazada, el \u003cstrong\u003eEstado\u003c/strong\u003e del \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e será \u003cstrong\u003eRechazado\u003c/strong\u003e.\nb. Si hubiera materias o actividades a dar como equivalencia donde algunas fueron \u003cem\u003eaprobadas\u003c/em\u003e y otras \u003cem\u003erechazadas\u003c/em\u003e, el \u003cstrong\u003eEstado\u003c/strong\u003e del \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e será \u003cstrong\u003eFinalizado\u003c/strong\u003e.\nc. Si hubiera materias o actividades a dar como equivalencia donde todas fueron \u003cem\u003erechazadas\u003c/em\u003e, el \u003cstrong\u003eEstado\u003c/strong\u003e del \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e será \u003cstrong\u003eRechazado\u003c/strong\u003e.\nd. Si aún no se ha revisado las materias y la información presentada por el estudiante o las equivalencias posibles, el \u003cstrong\u003eEstado\u003c/strong\u003e del \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e será \u003cstrong\u003ePendiente\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUn \u003cb\u003ePedido de Equivalencias\u003c/b\u003e cuyo \u003cb\u003eEstado\u003c/b\u003e sea \u003cb\u003eFINALIZADO\u003c/b\u003e o \u003cb\u003eRECHAZADO\u003c/b\u003e no se puede editar o modificar. Si fuera necesario, el estudiante deberá realizar una nueva solicitud de equivalencias.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:139,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/",title:"Visualizar aulas",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003ewww.gestionedilicia.ues21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU para desplegar la app Gestión Edilicia. Por defecto, se desplegará el módulo \u003cstrong\u003eGestión de edificios\u003c/strong\u003e. Haz clic en el ícono de \u003cstrong\u003eAulas\u003c/strong\u003e ubicado en el panel izquierdo de la pantalla para desplegar \u003cstrong\u003eGestión de aulas\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003ePara iniciar una búsqueda de un \u003cstrong\u003eAula\u003c/strong\u003e en particular, debes localizarla mediante el uso de los filtros disponibles para así limitar los resultados de la búsqueda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePuedes filtrar por Nombre de Aula, Tipo de aula (Aula, Anfiteatro, Auditorio, Laboratorio, Escuela de Negocios), Subtipo de aula (Aula magna, Laboratorio con PC, Taller), Estado (Disponible / No disponible), Edificio en donde se encuentra, Capacidad mínima y máxima, y Metros cuadrados.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003e\n\u003cp\u003ePor ejemplo, en el campo \u003cstrong\u003eNombre de aula\u003c/strong\u003e, ingresa alguna de las letras que componen el nombre del aula que quieres visualizar y si tuvieras este dato, coloca el Estado en \u003cem\u003eDisponible\u003c/em\u003e o en \u003cem\u003eNo disponible\u003c/em\u003e según corresponda. A continuación, haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eSi la búsqueda arroja un solo resultado, se desplegará el registro del \u003cstrong\u003eAula\u003c/strong\u003e con la información de sus atributos, y si hubiera más de un resultado, el listado de registros que coincide con los criterios de búsqueda\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi el resultado de la búsqueda arrojara una lista de más de 10 Aulas, se habilitará una herramienta de paginación que indica el total de Aulas obtenidas y utiliza flechas de navegación para avanzar de página y así mostrar más resultados.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003ePara realizar otra búsqueda de \u003cstrong\u003eAulas\u003c/strong\u003e, limpia los filtros al hacer clic en \u003cstrong\u003eLIMPIAR FILTROS\u003c/strong\u003e y vuelve a ingresar datos en uno o más filtros de esta ventana.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/visualizar-edificios/\" title=\"Visualizar edificios\"\u003eVisualizar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta un edificio\"\u003eDar de alta un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja un aula →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta un aula →\u003c/a\u003e\u003c/p\u003e\n"},{id:140,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/",title:"Visualizar carreras",description:null,content:"\u003cp\u003ePara visualizar información acerca de una carrera como por ejemplo los Planes de Estudio y las materias que componen cada uno de estos planes, primero debes localizarla mediante una búsqueda que puedes optimizar mediante el uso de los diferentes filtros disponibles.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003ePara iniciar una búsqueda de una \u003cstrong\u003eCarrera\u003c/strong\u003e en particular, debes localizarla mediante el uso de los filtros disponibles para así limitar los resultados de la búsqueda. Puedes filtrar por:\u003c/p\u003e\n\u003cp\u003e\u003cem\u003eFiltros en relación a la carrera\u003c/em\u003e:\u003c/p\u003e\n\u003cpre\u003e\u003ccode\u003e  - Nivel de estudio: Cloud21, Extragrado, In Company, Maestría, Grado, etc.\n  - Descripción o código de carrera: Por ejemplo, CDT.\n  - Decanato: Por ejemplo, Decanato de Ciencias Aplicadas o Sin Decanato.\n  - Estado de carrera: Activo, Inactivo, y Borrador.\n\u003c/code\u003e\u003c/pre\u003e\n\u003cp\u003e\u003cem\u003eFiltros en relación al Plan de estudio y la Modalidad\u003c/em\u003e:\u003c/p\u003e\n\u003cpre\u003e\u003ccode\u003e  - Plan de estudio: Lista desplegable de Planes ordenados por año del más reciente al más antiguo.\n  - Modalidad: Presencial, Presencial Home, Educación Distribuida, y Educación Distribuida Home.\n  - Estado de plan: Activo, Inactivo.\n\u003c/code\u003e\u003c/pre\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSi el resultado de la búsqueda arrojara una lista de más de 20 carreras, se habilitará una herramienta de paginación que indica el total de carreras obtenidas y utiliza flechas de navegación para avanzar de página y así mostrar más resultados.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi la búsqueda no arrojara ningún resultado, el aplicativo desplegará un mensaje advirtiendo que no ha encontrado ninguna carrera para los filtros aplicados.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez localizada la carrera haz clic sobre esta para visualizar los detalles siguientes:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eel \u003cstrong\u003eDecanato\u003c/strong\u003e al cual pertenece la carrera\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eEstado de la carrera\u003c/strong\u003e: ACTIVO, INACTIVO, o BORRADOR\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003ePlan de estudio\u003c/strong\u003e al que pertenece la carrera y la \u003cstrong\u003eModalidad\u003c/strong\u003e con la que se dicta\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eLos \u003cstrong\u003ePlanes de Estudio\u003c/strong\u003e que tenga la carrera se agruparán de acuerdo al \u003cstrong\u003eEstado\u003c/strong\u003e del Plan el cual puede ser ACTIVO o INACTIVO.\u003c/p\u003e\n\u003cp\u003eAsimismo, para cada Plan de estudio de la carrera, se despliegan dos Botones:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eel ícono \u003cstrong\u003eEditar plan\u003c/strong\u003e, que tal como su nombre lo indica, al hacer clic en él podrás editar el Plan de estudio.\u003c/li\u003e\n\u003cli\u003eel ícono \u003cstrong\u003eMás información\u003c/strong\u003e, que al hacer clic en él, desplegará información extra acerca de la carrera.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eAl hacer clic en el ícono \u003cstrong\u003eMás información\u003c/strong\u003e se desplegará una ventana con detalles tales como el \u003cstrong\u003eTítulo final\u003c/strong\u003e a obtener, el \u003cstrong\u003eTítulo intermedio\u003c/strong\u003e y la o las \u003cstrong\u003eOrientaciones\u003c/strong\u003e si hubiere, el año del \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e, la \u003cstrong\u003eModalidad\u003c/strong\u003e y las horas totales que comprende todo el Plan de Estudio.\u003c/p\u003e\n\u003cp\u003eDebajo de esta información, se orden el Plan de Estudios por \u003cstrong\u003eCuatrimestre\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eEn cada \u003cstrong\u003eCuatrimestre\u003c/strong\u003e, podrás hacer clic en la flecha ubicada junto a \u003cstrong\u003eHoras totales\u003c/strong\u003e para desplegar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003elas materias que se cursan en el \u003cstrong\u003eCuatrimestre\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel total de horas semanales que requiere cada una de las materias en el \u003cstrong\u003eCuatrimestre\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel total de horas en todo el \u003cstrong\u003eCuatrimestre\u003c/strong\u003e que requiere cada una de las materias\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eHaz clic en el botón Descargar para guardar el Plan de Estudios de la carrera seleccionada en tu ordenador en formato PDF.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:141,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/visualizar-edificios/",title:"Visualizar edificios",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003ewww.gestionedilicia.ues21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU para desplegar la app Gestión Edilicia. Por defecto, se desplegará el módulo \u003cstrong\u003eGestión de edificios\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza el \u003cstrong\u003eEdificio\u003c/strong\u003e que deseas visualizar con ayuda de los filtros disponibles para así limitar los resultados de la búsqueda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePuedes filtrar por Edificio –el nombre del mismo, Provincia, Localidad, Tipo (Todos, Sede, o CAU), o por Estado (Disponible / No disponible) del edificio, siendo este último el que indica si el edificio está siendo utilizado o no.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eA continuación, haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e. Si la búsqueda arroja un solo resultado, se desplegará el registro del \u003cstrong\u003eEdificio\u003c/strong\u003e con la información de sus atributos tales como el nombre, ubicación y su condición de Sede o CAU, y si hubiera más de un resultado, el listado de registros que coincide con los criterios de búsqueda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi el resultado de la búsqueda arrojara una lista de más de 10 Edificios, se habilitará una herramienta de paginación que indica el total de Edificios obtenidos y utiliza flechas de navegación para avanzar de página y así mostrar más resultados.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003ePara realizar otra búsqueda de \u003cstrong\u003eEdificios\u003c/strong\u003e, limpia los filtros al hacer clic en \u003cstrong\u003eLIMPIAR FILTROS\u003c/strong\u003e y vuelve a ingresar datos en uno o más filtros de esta ventana.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/editar-edificios/\" title=\"Editar edificios\"\u003eEditar edificios →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-baja-edificios/\" title=\"Dar de baja un edificio\"\u003eDar de baja un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-edificios/dar-de-alta-edificios/\" title=\"Dar de alta un edificio\"\u003eDar de alta un edificio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/visualizar-aulas/\" title=\"Visualizar aulas\"\u003eVisualizar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/editar-aulas/\" title=\"Editar aulas\"\u003eEditar aulas →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-baja-aulas/\" title=\"Dar de baja un aula\"\u003eDar de baja un aula →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/gestion-edilicia/visualizar-abm-aulas/dar-de-alta-aulas/\" title=\"Dar de alta un aula\"\u003eDar de alta un aula →\u003c/a\u003e\u003c/p\u003e\n"},{id:142,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/",title:"Visualizar Institución educativa",description:null,content:"\u003cp\u003eAl ingresar a la app \u003cstrong\u003eEquivalencias\u003c/strong\u003e, por defecto se despliega el módulo \u003cstrong\u003eInstituciones\u003c/strong\u003e. Como co-docente, en este módulo podrás visualizar las universidades o instituciones educativas con sus diferentes carreras y sus respectivos Planes de Estudio que éstas ofrecen. Esto a su vez te permitirá generar \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e que determinarán si una Materia o Actividad de una institución Origen tiene su equivalente en S21.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e con tus credenciales. A continuación, se desplegará la ventana “Lista de Instituciones” donde se listan las instituciones educativas que ya están registradas en el sistema y con las que ya se han cotejado o se cotejarán posibles equivalencias.\u003c/li\u003e\n\u003cli\u003eIngresa el nombre completo o parte del nombre de la institución a visualizar en el campo \u003cstrong\u003eNombre\u003c/strong\u003e y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e (o pulsa la tecla \u003cstrong\u003eEnter\u003c/strong\u003e).\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEn el resultado de la búsqueda accederás a la siguiente información:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eEl \u003cstrong\u003eNombre\u003c/strong\u003e de la institución\u003c/li\u003e\n\u003cli\u003eEl \u003cstrong\u003eCódigo\u003c/strong\u003e de la institución\u003c/li\u003e\n\u003cli\u003eUn botón deslizable que, si se visualiza grisado (desactivado), significa que la institución está siendo considerada como una institución \u003cstrong\u003e\u003cem\u003eOrigen\u003c/em\u003e\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUn ícono de lápiz que te permitirá editar la institución\u003c/li\u003e\n\u003cli\u003eUn botón \u003cstrong\u003eAñadir institución\u003c/strong\u003e en el borde inferior de la pantalla que te permitirá sumar una institución a la lista existente.\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eHaz clic sobre la institución para visualizarla en detalle. A continuación, se despliega la ventana \u003cstrong\u003eEditar institución\u003c/strong\u003e en donde podrás visualizar la o las \u003cstrong\u003eCarreras/Planes de Estudio\u003c/strong\u003e asociados de la institución que ya se han ingresado al sistema.\u003c/li\u003e\n\u003cli\u003eHaz clic en una \u003cstrong\u003eCarrera\u003c/strong\u003e y \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e en particular para visualizar las materias que conforman dicho \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:143,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/",title:"Visualizar materias",description:null,content:"\u003cp\u003eEl \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e permite visualizar una \u003cstrong\u003eMateria\u003c/strong\u003e para obtener información acerca de ella o para cerciorarte de que fue agregada con éxito.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eHaz clic en el ícono \u003cstrong\u003eMaterias\u003c/strong\u003e ubicado en el panel izquierdo de la pantalla del \u003cem\u003e“Administrador de carreras”\u003c/em\u003e para abrir el \u003cstrong\u003eMódulo “Materias”\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la materia a visualizar. Para ello debes ingresar al menos el \u003cstrong\u003eTipo de materia\u003c/strong\u003e para habilitar los demás filtros y activar el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi no conoces el “Tipo de materia” podrás seleccionar la opción “Todos”.\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eUna vez localizada la materia, haz clic sobre la misma para obtener más información.\nDebajo del \u003cstrong\u003eNombre\u003c/strong\u003e de la materia y el \u003cstrong\u003eCódigo\u003c/strong\u003e se observa:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eEl \u003cstrong\u003eEstado\u003c/strong\u003e en el que se encuentra la \u003cstrong\u003eMateria\u003c/strong\u003e: por ejemplo,“Activo”\u003c/li\u003e\n\u003cli\u003eEl \u003cstrong\u003eTipo de materia\u003c/strong\u003e: por ejemplo, “NP Común” (No Proceso o Común)\u003c/li\u003e\n\u003cli\u003eEl \u003cstrong\u003eÁrea disciplinar\u003c/strong\u003e de la materia.\u003c/li\u003e\n\u003cli\u003eUna sección de acciones que permitirán editar la materia, obtener más información acerca de ésta, y añadir un \u003cstrong\u003ePrograma\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cstrong\u003eVisualización de Programas de una Materia\u003c/strong\u003e\nLuego de localizar una materia, junto al ícono de edición se observa el ícono de \u003cstrong\u003eMás información\u003c/strong\u003e, lo que permitirá visualizar el o los programas de la materia.\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eHaz clic en el ícono \u003cstrong\u003eMás información\u003c/strong\u003e de la materia. A continuación, se listarán los Programas correspondientes a la materia en una grilla donde se detalla:\n\u003cul\u003e\n\u003cli\u003eel \u003cstrong\u003eEstado\u003c/strong\u003e para indicar si el programa de la materia está activo (o vigente) o no.\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eCarga\u003c/strong\u003e o fecha de carga para indicar la fecha en la que se creó o subió el programa de la materia\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eActivación\u003c/strong\u003e o fecha en la que el \u003cstrong\u003eEstado\u003c/strong\u003e del Programa quedó activo\u003c/li\u003e\n\u003cli\u003ela \u003cstrong\u003eDescripción\u003c/strong\u003e formado por un \u003cstrong\u003eCódigo\u003c/strong\u003e y el nombre de la materia\u003c/li\u003e\n\u003cli\u003eun botón deslizable \u003cstrong\u003eCambiar estado\u003c/strong\u003e para activar o desactivar el Programa de la materia según corresponda\u003c/li\u003e\n\u003cli\u003ey una sección \u003cstrong\u003eEditar | Detalles\u003c/strong\u003e de acciones con los íconos \u003cstrong\u003eEditar programa\u003c/strong\u003e y \u003cstrong\u003eMás información\u003c/strong\u003e para editar cada uno de los programas o para visualizarlos en detalle respectivamente\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003eUtiliza el campo desplegable \u003cstrong\u003eEstado de programa\u003c/strong\u003e ubicado en la parte superior de la pantalla para desplegar solo los Programas activos o solo los Programas inactivos.\u003c/li\u003e\n\u003cli\u003eHaz clic en el ícono \u003cstrong\u003eMás información\u003c/strong\u003e para visualizar en detalle el programa de la materia. A continuación, se desplegará el programa de la materia seleccionada en donde se detalla:\n\u003cul\u003e\n\u003cli\u003eEl nombre o descripción del Programa\u003c/li\u003e\n\u003cli\u003eEl Estado del programa de la materia\u003c/li\u003e\n\u003cli\u003eLa fundamentación para el dictado de la materia\u003c/li\u003e\n\u003cli\u003eLos objetivos de la materia\u003c/li\u003e\n\u003cli\u003eLas competencias que se desarrollarán al término de la cursada\u003c/li\u003e\n\u003cli\u003eLos contenidos\u003c/li\u003e\n\u003cli\u003eLa bibliografía\u003c/li\u003e\n\u003cli\u003eLos recursos\u003c/li\u003e\n\u003cli\u003eLa carga horaria\u003c/li\u003e\n\u003cli\u003eLa metodología\u003c/li\u003e\n\u003cli\u003eEl sistema de evaluación\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/\" title=\"Visualizar Plan de Estudio\"\u003eVisualizar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:144,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-de-estudio/",title:"Visualizar Plan de Estudio",description:null,content:"\u003cp\u003eEl Administrador de carreras permite buscar un Plan de Estudio de una carrera determinada para visualizar las características y las materias que lo componen.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLocaliza la carrera cuyo \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e deseas visualizar: selecciona una opción del campo \u003cstrong\u003eNivel de estudio\u003c/strong\u003e para que se habiliten los demás filtros disponibles y el botón de búsqueda. Utiliza los demás filtros disponibles para así limitar los resultados y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez localizada la carrera, haz clic sobre la misma para desplegar los diferentes planes de estudio que tenga asociados y localiza el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e que deseas visualizar.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el ícono \u003cstrong\u003eMás información\u003c/strong\u003e del \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e seleccionado para desplegar la ventana \u003cem\u003ePlan de estudios\u003c/em\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cem\u003eLa parte superior de la ventana despliega detalles tales como el \u003cstrong\u003eTítulo final\u003c/strong\u003e a obtener, y, si hubiere, el \u003cstrong\u003eTítulo intermedio\u003c/strong\u003e y la o las \u003cstrong\u003eOrientaciones\u003c/strong\u003e, el año del \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e, la \u003cstrong\u003eModalidad\u003c/strong\u003e, y las horas totales que comprende todo el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e\u003cem\u003eDebajo de esta información, se lista el \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e por Cuatrimestre\u003c/em\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEn cada \u003cstrong\u003eCuatrimestre\u003c/strong\u003e, podrás hacer clic en la flecha ubicada junto a \u003cstrong\u003eHoras totales\u003c/strong\u003e para desplegar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003elas materias que se cursan en un \u003cstrong\u003eCuatrimestre\u003c/strong\u003e dado\u003c/li\u003e\n\u003cli\u003eel total de horas semanales que requiere cada una de las materias en el \u003cstrong\u003eCuatrimestre\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel total de horas en todo el \u003cstrong\u003eCuatrimestre\u003c/strong\u003e que requiere cada una de las materias\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eHaz clic en el botón Descargar para guardar el Plan de Estudios de la carrera seleccionada en tu ordenador en formato PDF.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:145,href:"https://bitlogic.github.io/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/visualizar-plan-estudio/",title:"Visualizar Plan de Estudio",description:null,content:"\u003cp\u003eEl Administrador de carreras permite buscar un Plan de Estudio de una carrera determinada para visualizar las características y las materias que lo componen.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eAsegúrate de estar conectado a la red de Siglo 21 o a la VPN y luego ingresa a \u003cstrong\u003ehttps://admincarreras.uesiglo21.edu.ar\u003c/strong\u003e e introduce las credenciales que utilizas para entrar al SGU. A continuación, se abrirá la app \u003cstrong\u003eAdministrador de carreras\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLocaliza la carrera cuyo \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e deseas visualizar: selecciona una opción del campo \u003cstrong\u003eNivel de estudio\u003c/strong\u003e para que se habiliten los demás filtros disponibles y el botón de búsqueda. Utiliza los demás filtros disponibles para así limitar los resultados y haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez localizada la carrera, haz clic sobre la misma para desplegar los diferentes planes de estudio que tenga asociados y localiza el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e que deseas visualizar.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en el ícono \u003cstrong\u003eMás información\u003c/strong\u003e del \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e seleccionado para desplegar la ventana \u003cem\u003ePlan de estudios\u003c/em\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cem\u003eLa parte superior de la ventana despliega detalles tales como el \u003cstrong\u003eTítulo final\u003c/strong\u003e a obtener, y, si hubiere, el \u003cstrong\u003eTítulo intermedio\u003c/strong\u003e y la o las \u003cstrong\u003eOrientaciones\u003c/strong\u003e, el año del \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e, la \u003cstrong\u003eModalidad\u003c/strong\u003e, y las horas totales que comprende todo el \u003cstrong\u003ePlan de Estudio\u003c/strong\u003e\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e\u003cem\u003eDebajo de esta información, se lista el \u003cstrong\u003ePlan de Estudios\u003c/strong\u003e por Cuatrimestre\u003c/em\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEn cada \u003cstrong\u003eCuatrimestre\u003c/strong\u003e, podrás hacer clic en la flecha ubicada junto a \u003cstrong\u003eHoras totales\u003c/strong\u003e para desplegar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003elas materias que se cursan en un \u003cstrong\u003eCuatrimestre\u003c/strong\u003e dado\u003c/li\u003e\n\u003cli\u003eel total de horas semanales que requiere cada una de las materias en el \u003cstrong\u003eCuatrimestre\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel total de horas en todo el \u003cstrong\u003eCuatrimestre\u003c/strong\u003e que requiere cada una de las materias\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eHaz clic en el botón Descargar para guardar el Plan de Estudios de la carrera seleccionada en tu ordenador en formato PDF.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/visualizar-carreras/\" title=\"Visualizar carreras\"\u003eVisualizar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/crear-carreras/\" title=\"Crear carreras\"\u003eCrear carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-carreras/editar-carreras/\" title=\"Editar carreras\"\u003eEditar carreras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/dise%C3%B1ar-plan-de-estudio/\" title=\"Diseñar Plan de Estudio\"\u003eDiseñar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/clonar-plan-de-estudio/\" title=\"Clonar Plan de Estudio\"\u003eClonar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-plan-estudio/editar-plan-de-estudio/\" title=\"Editar Plan de Estudio\"\u003eEditar Plan de Estudio →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/visualizar-materias/\" title=\"Visualizar materias\"\u003eVisualizar materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/crear-materias/\" title=\"Crear materias\"\u003eCrear materias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/administrador-carreras/visualizar-crear-editar-materias/editar-materias/\" title=\"Editar materias\"\u003eEditar materias →\u003c/a\u003e\u003c/p\u003e\n"},{id:146,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/",title:"Visualizar Regla de Equivalencia",description:null,content:"\u003cp\u003eLa app \u003cstrong\u003eEquivalencias\u003c/strong\u003e consta de varios módulos, entre ellos, el módulo \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e. En este módulo podrás visualizar las \u003cstrong\u003eReglas de Equivalencia\u003c/strong\u003e que establecen cuáles son la o las Materias o Actividades aprobadas en una institución de \u003cem\u003eOrigen\u003c/em\u003e que serán reconocidas como aprobadas por una institución de \u003cem\u003eDestino\u003c/em\u003e.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e con tus credenciales. A continuación, se desplegará la ventana “Lista de Instituciones”. Haz clic en el ícono \u003cstrong\u003eEquivalencias\u003c/strong\u003e en el panel izquierdo de la pantalla para desplegar la ventana \u003cstrong\u003eReglas de equivalencia\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e que deseas visualizar mediante el uso de los filtros \u003cstrong\u003eInstitución de origen\u003c/strong\u003e, \u003cstrong\u003eInstitución de destino\u003c/strong\u003e, \u003cstrong\u003ePlan/carrera de origen\u003c/strong\u003e y \u003cstrong\u003ePlan/carrera de destino\u003c/strong\u003e o directamente utiliza el campo \u003cstrong\u003eBuscar\u003c/strong\u003e para filtrar los resultados.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEn el campo \u003cstrong\u003eBuscar\u003c/strong\u003e podrás:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eIngresar parte del nombre de la \u003cstrong\u003eInstitución\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eIngresar parte del \u003cstrong\u003eNombre del Plan\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eIngresar parte del nombre de la \u003cstrong\u003eResolución\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eHaz clic en el ícono de lápiz de la \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e para visualizarla en detalle.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eEn la pantalla \u003cstrong\u003eRegla de equivalencia\u003c/strong\u003e, podrás visualizar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003eEl Nombre de la \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eEl número o código de \u003cstrong\u003eResolución\u003c/strong\u003e de la equivalencia\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eEl botón deslizable \u003cstrong\u003eRegla activa\u003c/strong\u003e que indica si la regla está vigente o no\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eEl botón deslizable \u003cstrong\u003eRequiere revisión\u003c/strong\u003e que indica que - si bien la regla está configurada, va a necesitar una revisión extra para ser aprobada o rechazada total o parcialmente (algunas materias aprobadas y otras rechazadas) en forma manual\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLos campos correspondientes a la institución de Origen: \u003cstrong\u003eInstitución de origen\u003c/strong\u003e y \u003cstrong\u003ePlan/carrera de origen\u003c/strong\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLos campos correspondientes a la institución de Destino: \u003cstrong\u003eInstitución de destino\u003c/strong\u003e y \u003cstrong\u003ePlan/carrera de destino\u003c/strong\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eEl botón deslizable \u003cstrong\u003eTodos\u003c/strong\u003e que, si está activo, indica que el \u003cstrong\u003ePlan/carrera\u003c/strong\u003e de la institución de origen tendrá una o más equivalencias en todos los Planes de todas las Carreras. Por ejemplo, la materia \u003cstrong\u003eInglés\u003c/strong\u003e dictada en una institución de origen, podría tener equivalencias en todas las carreras de todos los planes de estudio de la institución de destino.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna sección \u003cstrong\u003eAsociar Actividades/Materias\u003c/strong\u003e donde podrás agregar, como así también eliminar si fuera necesario, las materias o actividades que forman parte de cada uno de los \u003cstrong\u003ePlanes/Carrera\u003c/strong\u003e de la institución \u003cstrong\u003e\u003cem\u003eOrigen\u003c/em\u003e\u003c/strong\u003e y \u003cstrong\u003e\u003cem\u003eDestino\u003c/em\u003e\u003c/strong\u003e que ya fueron establecidas como equivalencias. Para más detalles, ver la sección \u003cstrong\u003eEditar Regla de Equivalencia\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eEl botón \u003cstrong\u003eClonar\u003c/strong\u003e para duplicar la \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e en caso de tener que generar una regla para la misma institución de origen y destino y para el mismo \u003cstrong\u003ePlan/Carrera\u003c/strong\u003e en donde se contemplen diferentes escenarios de equivalencias entre las materias de las instituciones mencionadas. Para más detalles, ver la sección \u003cstrong\u003eAñadir Regla de Equivalencia\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eEjemplo de clonación\u003c/strong\u003e: En el caso de que la materia \u003cstrong\u003eDerecho Penal I\u003c/strong\u003e de origen tuviera sólo como equivalencia la materia \u003cstrong\u003e\u003cem\u003eLeyes 1\u003c/em\u003e\u003c/strong\u003e de destino, y la materia \u003cstrong\u003eDerecho Penal II\u003c/strong\u003e tuviera \u003cstrong\u003e\u003cem\u003eLeyes 2\u003c/em\u003e\u003c/strong\u003e y \u003cstrong\u003e\u003cem\u003eLeyes 3\u003c/em\u003e\u003c/strong\u003e como equivalencia, se podrá establecer una primera regla para el primer escenario, y luego \u003cstrong\u003eCLONAR\u003c/strong\u003e esta primera \u003cstrong\u003eRegla de Equivalencia\u003c/strong\u003e para contemplar el segundo escenario.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Visualizar solicitud de Equivalencias\"\u003eVisualizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:147,href:"https://bitlogic.github.io/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-visualizar-solicitud/",title:"Visualizar solicitud de Equivalencia",description:null,content:"\u003cp\u003eLa app \u003cstrong\u003eEquivalencias\u003c/strong\u003e consta de varios módulos, entre ellos, el módulo \u003cstrong\u003ePedido de equivalencia\u003c/strong\u003e. A través de este módulo podrás visualizar las \u003cstrong\u003esolicitudes de Equivalencia\u003c/strong\u003e que realizaron los estudiantes para que se les otorgue o acredite materias o actividades como aprobadas en Siglo 21.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eIngresa a \u003cstrong\u003eequivalencias.uesiglo21.edu.ar\u003c/strong\u003e con tus credenciales y luego haz clic en el ícono \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e situado en el panel izquierdo de la pantalla.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLocaliza el \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e que deseas visualizar. Para ello, utiliza uno o más de los campos disponibles para filtrar la búsqueda: \u003cstrong\u003eNombre\u003c/strong\u003e, \u003cstrong\u003eNro identificación\u003c/strong\u003e (DNI o pasaporte), \u003cstrong\u003eNúmero de trámite\u003c/strong\u003e y \u003cstrong\u003eEstado\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eAl localizar el \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e, tendrás una primera visualización del mismo en donde obtendrás:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eel \u003cstrong\u003eNúmero de trámite\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel nombre completo de la persona que realizó el \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel número de documento de la persona que realizó el \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel \u003cstrong\u003eEstado\u003c/strong\u003e del \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e:Finalizado, Pendiente o Rechazado\u003c/li\u003e\n\u003cli\u003eun ícono de lápiz para editar el \u003cstrong\u003ePedido de Equivalencia\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eHaz clic en cualquier lugar del \u003cstrong\u003ePedido de Equivalencias\u003c/strong\u003e para poder visualizarlo en detalle. En esta pantalla podrás visualizar:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eEl \u003cstrong\u003eNúmero de trámite:\u003c/strong\u003e El número que el sistema le asignó a la solicitud de equivalencias que realizó el estudiante.\u003c/li\u003e\n\u003cli\u003eEl mensaje que anuncia el \u003cstrong\u003eEstado\u003c/strong\u003e de la solicitud: \u003cstrong\u003eFinalizada\u003c/strong\u003e, \u003cstrong\u003eRechazada\u003c/strong\u003e o \u003cstrong\u003ePendiente\u003c/strong\u003e de revisión.\u003c/li\u003e\n\u003cli\u003eEl nombre completo del solicitante y su tipo y número de documento.\u003c/li\u003e\n\u003cli\u003eLas instituciones de origen y destino con sus carreras y planes respectivos.\u003c/li\u003e\n\u003cli\u003eLa sección \u003cstrong\u003eActividades/Materias presentadas por el alumno\u003c/strong\u003e en donde se listan las materias o actividades con su respectivo \u003cstrong\u003eEstado\u003c/strong\u003e de \u003cstrong\u003eAprobado\u003c/strong\u003e, \u003cstrong\u003ePendiente\u003c/strong\u003e o \u003cstrong\u003eRechazado\u003c/strong\u003e en el extremo izquierdo y su respectiva \u003cstrong\u003eNota\u003c/strong\u003e en el extremo derecho.\n\u003cbr\u003e\n\u003cbr\u003e\nDebajo de esta información se detalla nuevamente la \u003cstrong\u003eNota\u003c/strong\u003e y se agrega su \u003cstrong\u003eFecha de aprobación\u003c/strong\u003e, y el \u003cstrong\u003eLibro\u003c/strong\u003e y \u003cstrong\u003eFolio\u003c/strong\u003e en donde fue registrada la \u003cstrong\u003eActividad/Materia\u003c/strong\u003e en la institución de origen.\n\u003cbr\u003e\n\u003cbr\u003e\u003c/li\u003e\n\u003cli\u003eLa sección \u003cstrong\u003eEquivalencias de esta solicitud\u003c/strong\u003e, en donde figuran la o las materias o actividades otorgadas como equivalencia a aquellas presentadas por el solicitante, listadas una por una con su respectivo \u003cstrong\u003eCódigo\u003c/strong\u003e y \u003cstrong\u003eEstado\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-visualizar-institucion/\" title=\"Visualizar instituciones\"\u003eVisualizar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-a%C3%B1adir-institucion/\" title=\"Añadir instituciones\"\u003eAñadir instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-eliminar-institucion/\" title=\"Eliminar instituciones\"\u003eEliminar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-instituciones-editar-institucion/\" title=\"Editar instituciones\"\u003eEditar instituciones →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-visualizar-regla/\" title=\"Visualizar Regla de Equivalencias\"\u003eVisualizar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-a%C3%B1adir-regla/\" title=\"Añadir Regla de Equivalencias\"\u003eAñadir Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-equivalencias-editar-regla/\" title=\"Editar Regla de Equivalencias\"\u003eEditar Regla de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/admin-de-equivalencias/modulo-solicitud-equivalencia-revisar-solicitud/\" title=\"Revisar solicitud de Equivalencias\"\u003eRevisar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/realizar-solicitud-de-equivalencia/\" title=\"Realizar solicitud de Equivalencias\"\u003eRealizar solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/equivalencias/portal-de-equivalencias/consultar-estado-solicitud-de-equivalencia/\" title=\"Consultar Estado de solicitud de Equivalencias\"\u003eConsultar Estado de solicitud de Equivalencias →\u003c/a\u003e\u003c/p\u003e\n"},{id:148,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/1-datos-oferta-academica/",title:"Paso 1 - Ingresar datos de la oferta académica",description:null,content:"\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa Admisión no genera tickets y deja al estudiante en Estado “Activo”: 1) se despliega el “Check” de Matrícula paga, 2) el estado de las materias es “Pre-inscripto” y 3) el período de cursada de la materia es IGUAL al Periodo vigente de cursada.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa Pre admisión genera tickets de pago de Matrícula y Arancel y deja al estudiante en Estado “Pre-inscripto”: 1) no se despliega el “Check” de Matrícula paga, 2) el estado de las materias es “No cursada” y 3) una vez realizado el pago, el Estado del estudiante pasa a ser “Activo” (detalles en la nota anterior).\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eIngresa a la app \u003cstrong\u003eAdmisión masiva\u003c/strong\u003e con tus credenciales. A continuación, se despliega la ventana “Admisión masiva a carreras” y se activa el Paso 1 a completar para procesar admisiones o pre admisiones.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eCompleta el formulario \u003cstrong\u003eDatos de la oferta académica\u003c/strong\u003e. Comienza por ingresar un nombre que identifique la admisión o pre admisión para que luego sea más fácil de localizar en una búsqueda y a continuación completa los campos restantes:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eTipo de admisión:\u003c/strong\u003e Selecciona Admisión o Pre admisión.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eCarrera, Modalidad, Turno, Sede/CAU, Fecha inicio cursado, y Paquete:\u003c/strong\u003e Selecciona una opción mediante las listas desplegables.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eA medida que ingresas estos datos, el sistema autocompleta los campos restantes si la combinación de estos es única.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e. Se desplegará la ventana “Cargar archivo” la cual es el Paso 2 a completar para procesar admisiones o pre admisiones.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara volver a la pantalla anterior, haz clic en el vínculo Volver. Los datos ingresados no se perderán y podrás editar solo aquellos que necesites modificar.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/2-cargar-archivo/\" title=\"Paso 2 - Cargar archivo\"\u003ePaso 2 - Cargar archivo →\u003c/a\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/3-resultado-importacion/\" title=\"Paso 3 - Resultado de la importación\"\u003ePaso 3 - Resultado de la importación →\u003c/a\u003e\u003c/p\u003e\n"},{id:149,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/verificar-admision/",title:"Verificar admisión",description:null,content:"\u003cp\u003e\u003cstrong\u003eVerificación de Admisión mediante el SGU\u003c/strong\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eDirígete al \u003cstrong\u003eSGU\u003c/strong\u003e y luego a la opción “Reporte de Alumnos”.\u003c/li\u003e\n\u003cli\u003eIngresa el Legajo del estudiante para desplegar su Estado. Este Estado deberá ser \u003cstrong\u003eInscripto\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eVerificación de Admisión mediante \u0026ldquo;ePagos\u0026rdquo;\u003c/strong\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eCopia el Usuario o el DNI del estudiante y dirígete a \u0026ldquo;ePagos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eRealiza una búsqueda con el \u003cstrong\u003eUsuario\u003c/strong\u003e o el \u003cstrong\u003eDNI\u003c/strong\u003e del estudiante en la Pasarela de Pagos. Si localizas al estudiante, esto quiere decir que si bien éste no tiene tickets pendientes, ya que lo que has cargado ha sido una Admisión, el Legajo está activo.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/verificar-preadmision/\" title=\"Verificar Pre admisión\"\u003eVerificar Pre admisión →\u003c/a\u003e\n\u003c/b\u003e\u003c/p\u003e\n"},{id:150,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/verificar-preadmision/",title:"Verificar pre admisión",description:null,content:"\u003cp\u003e\u003cstrong\u003eVerificación de Pre admisión mediante el SGU\u003c/strong\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eDirígete al \u003cstrong\u003eSGU\u003c/strong\u003e y luego a la opción “Reporte de Alumnos”.\u003c/li\u003e\n\u003cli\u003eIngresa el Legajo del estudiante para desplegar su Estado. Este Estado deberá ser \u003cstrong\u003ePre inscripto\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eVerificación de Pre admisión mediante \u0026ldquo;ePagos\u0026rdquo;\u003c/strong\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eCopia el Usuario o el DNI del estudiante y dirígete a \u0026ldquo;ePagos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eRealiza una búsqueda con el \u003cstrong\u003eUsuario\u003c/strong\u003e o \u003cstrong\u003eDNI\u003c/strong\u003e del estudiante en la Pasarela de Pagos.\u003c/li\u003e\n\u003cli\u003eHaz clic en el resultado pertinente (debajo de “Coincidencias encontradas”) para desplegar la plataforma de Pagos. Aquí podrás ver que el Legajo está activo y que se generaron 2 tickets que se encuentran pendientes de pago - ya que lo que has cargado ha sido una Pre admisión.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón Matrícula y Aranceles para ver el detalle de los tickets generados.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUna vez que los tickets hayan sido pagados, el Estado del estudiante pasará de “Pre-inscripto” a “Activo”, es decir, como en el Estado en el que queda luego de una Admisión.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/verificar-admision-preadmision/verificar-admision/\" title=\"Verificar Admisión\"\u003eVerificar Admisión →\u003c/a\u003e\n\u003c/b\u003e\u003c/p\u003e\n"},{id:151,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/visualizar-admision-preadmision/buscar-admision-preadmision/",title:"Visualizar admisión o pre admisión",description:null,content:"\u003col\u003e\n\u003cli\u003eEn la pantalla “Admisión masiva a carreras”, haz clic en el botón \u003cstrong\u003eBuscar admisión\u003c/strong\u003e. A continuación se desplegará la ventana “Buscar admisión”.\u003c/li\u003e\n\u003cli\u003eHaz clic en la lista desplegable “Tus admisiones registradas” para ver las últimas admisiones (o pre admisiones) realizadas con tu usuario.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas admisiones (o pre admisiones) en el sector “Tus admisiones registradas” pueden ordenarse por ID, Nombre, Fecha, o Estado (Completado, En progreso, Inválido).\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003ePara obtener el detalle de una admisión (o pre admisión), procede del siguiente modo (tienes 2 opciones):\n\u003cul\u003e\n\u003cli\u003eingresa el \u003cstrong\u003eID de la Admisión\u003c/strong\u003e (o de la Pre admisión) en el campo \u003cstrong\u003eBuscar admisión\u003c/strong\u003e y luego haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003cbr\u003e\n\u003cem\u003e\u003cstrong\u003eo en su defecto\u003c/strong\u003e\u003c/em\u003e\u003c/li\u003e\n\u003cli\u003eselecciona la admisión (o pre admisión) a revisar de la lista de admisiones registradas\nAl cabo de unos instantes, se desplegará el detalle de la Admisión (o Pre admisión).\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003ePara ver el resultado de la Admisión (o Pre admisión), descarga el “Resumen de la importación” haciendo clic en el botón \u003cstrong\u003eDescargar\u003c/strong\u003e, tal como lo hiciste en el Paso 3.\u003c/li\u003e\n\u003cli\u003eSi en cambio deseas buscar una Admisión realizada por otro usuario, debes contar con el \u003cstrong\u003eID de la admisión\u003c/strong\u003e y simplemente ingresarlo en el campo Buscar admisión.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAntes de salir completamente de la aplicación, puedes hacer clic en el ícono de Copiar que se encuentra junto al nombre de la carrera y la fecha en el Paso 3. Esto copiará un Link que permitirá revisar el resultado de la importación, ya que al pegarlo en la barra de direcciones, se abrirá directamente la pantalla Resultado de la importación con toda la información acerca de la Admisión (o Pre admisión) realizada.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi observas el link, el último número que aparece en éste será el ID de la Admisión. En el ejemplo siguiente, el ID de la Admisión es el número 127: http://bulk-enrollment-ui.qa.algarrobo.xyz/app/127.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/1-datos-oferta-academica/\" title=\"Paso 1 - Datos de la oferta académica\"\u003ePaso 1 - Datos de la oferta académica →\u003c/a\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/2-cargar-archivo/\" title=\"Paso 2 - Cargar archivo\"\u003ePaso 2 - Cargar archivo →\u003c/a\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/3-resultado-importacion/\" title=\"Paso 3 - Resultado de la importación\"\u003ePaso 3 - Resultado de la importación →\u003c/a\u003e\u003c/p\u003e\n"},{id:152,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-abierta/",title:"Editar y registrar asistencia de forma manual - Clase Abierta mediante la App o la Botonera",description:null,content:"\u003ch4 id=\"editar-o-registrar-la-asistencia-con-clase-abierta-mediante-la-app\"\u003e\u003cstrong\u003eEditar o registrar la asistencia con Clase abierta mediante la app\u003c/strong\u003e\u003c/h4\u003e\n\u003cp\u003eSi eres docente, bedel o supervisor podrás realizar el registro manual o la modificación de asistencia de tus estudiantes a un módulo o a todos los módulos de una clase con la app si el Estado del módulo o de la clase entera es \u003cstrong\u003eAbierto\u003c/strong\u003e o \u003cstrong\u003ePendiente\u003c/strong\u003e, es decir, si aún no se ha comenzado la clase.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a la App \u003cstrong\u003easistencia.uesiglo21.edu.ar\u003c/strong\u003e con las credenciales que utilizas para entrar al \u003cstrong\u003eeCampus\u003c/strong\u003e para desplegar la ventana \u003cem\u003e“Listado de módulos”\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza el módulo en donde debes registrar o editar la asistencia con la ayuda de los filtros disponibles \u003cstrong\u003efecha\u003c/strong\u003e, \u003cstrong\u003ehora de inicio y finalización\u003c/strong\u003e del módulo, \u003cstrong\u003eedificio\u003c/strong\u003e, \u003cstrong\u003eaula\u003c/strong\u003e, como así también de un filtro adicional señalado por un ícono de lupa \n\n\u003cimg src=\"search.png\" alt=\"search icon\" class=\"inlineIcon\"\u003e que permite el ingreso de cualquier texto relacionado con el módulo para realizar su búsqueda (materia, docente, cátedra, etc).\u003c/li\u003e\n\u003cli\u003eUna vez localizado, haz clic sobre el módulo para abrirlo y luego haz clic en el botón \u003cstrong\u003eAbrir asistencia\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLuego, simplemente haz clic en el casillero \n\n\u003cimg src=\"checkbox_marked.png\" alt=\"marked checkbox icon\" class=\"inlineIcon\"\u003e que aparece junto al estado de \u003cstrong\u003ePresente\u003c/strong\u003e, \u003cstrong\u003eAusente\u003c/strong\u003e o de \u003cstrong\u003eSin asistencia\u003c/strong\u003e para así registrar o cambiar dicho estado según corresponda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl sistema identificará quién colocó la marca de Presente/Ausente de cada estudiante en la columna “Origen”.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch4 id=\"editar-o-registrar-la-asistencia-con-clase-abierta-mediante-la-botonera\"\u003e\u003cstrong\u003eEditar o registrar la asistencia con Clase abierta mediante la botonera\u003c/strong\u003e\u003c/h4\u003e\n\u003cp\u003eComo bedel o supervisor, podrás utilizar la Botonera para registrar o editar la asistencia de 1 solo estudiante a la vez a uno o más módulos de una clase durante la duración del módulo de la clase, es decir, si el estado del módulo es \u003cstrong\u003eAbierto\u003c/strong\u003e - pero no podrás hacerlo si el módulo está \u003cstrong\u003ePendiente\u003c/strong\u003e.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa al \u003cstrong\u003eeCampus\u003c/strong\u003e con tus credenciales y luego selecciona la opción \u003cem\u003e\u0026ldquo;Reporte de alumnos”\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza al estudiante por \u003cstrong\u003eDNI\u003c/strong\u003e o \u003cstrong\u003enúmero de Legajo\u003c/strong\u003e y una vez localizado, selecciona el \u003cstrong\u003eLegajo\u003c/strong\u003e para activar la \u003cstrong\u003eBotonera\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona el botón \u003cstrong\u003eAsistencia\u003c/strong\u003e. A continuación se desplegará la pantalla \u003cem\u003e\u0026ldquo;Detalle del estudiante\u0026rdquo;\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la materia cuya asistencia necesitas registrar o modificar. Para encontrarla rápidamente, puedes ingresar el nombre o parte del nombre de la materia en el campo \u003cstrong\u003eListado de cursos\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez localizada, haz clic sobre la materia para visualizar la asistencia del estudiante a todos los módulos que la conforman.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la parte superior de la pantalla, a la izquierda, tendrás información acerca del estudiante tales como la Modalidad de cursado, su número de Legajo, su email, y a la derecha algunos detalles de la Materia tales como el período en el que el estudiante la ha cursado.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eEn la parte inferior de la pantalla, en la sección \u003cem\u003e“Listado de Módulos”\u003c/em\u003e, puedes utilizar los campos \u003cstrong\u003eFecha desde\u003c/strong\u003e y \u003cstrong\u003eFecha hasta\u003c/strong\u003e para delimitar las fechas sobre las que deseas registrar o editar la asistencia de este estudiante.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLos campos Hora Inicio y Hora fin delimitan los Módulos de la clase en la fecha seleccionada.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003e\n\u003cp\u003eProcede a hacer clic en la asistencia a los Módulos de la clase en la Columna \u003cstrong\u003eEstado\u003c/strong\u003e para así registrarla o cambiarla:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eSi el Estado es \u003cstrong\u003eAusente\u003c/strong\u003e, al hacer clic cambiará a \u003cstrong\u003ePresente\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eSi el Estado es \u003cstrong\u003ePresente\u003c/strong\u003e, al hacer clic cambiará a \u003cstrong\u003eAusente\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eSi el Estado es \u003cstrong\u003eSin asistencia\u003c/strong\u003e, al hacer clic cambiará a \u003cstrong\u003ePresente\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl sistema identificará quién colocó la marca de Presente/Ausente de cada estudiante en la columna Origen e indicará la fecha en la que se realizó la modificación en la columna “Fecha de asistencia”.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/abrir-clase/\" title=\"Abrir clase\"\u003eAbrir clase →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/visualizar-asistencia/\" title=\"Visualizar asistencia\"\u003eVisualizar asistencia→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-cerrada/\" title=\"Editar o registrar asistencia de Clase Cerrada mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Cerrada mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/registrar-asistencia/\" title=\"Registra tu asistencia como estudiante mediante el código QR\"\u003eRegistra tu asistencia - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/visualizar-asistencia-estudiante/\" title=\"Visualiza tus asistencias en la app S21\"\u003eVisualiza tus asistencias en la app S21 - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n"},{id:153,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/2-cargar-archivo/",title:"Paso 2 - Cargar archivo",description:null,content:"\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eDescarga un \u003cem\u003etemplate\u003c/em\u003e o plantilla haciendo clic en el vínculo que se muestra en la segunda nota debajo del botón \u003cstrong\u003eCargar archivo\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez descargado el archivo, procede del siguiente modo para abrirlo:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003ePrimero de todo, abre Excel y crea un nuevo Libro.\u003c/li\u003e\n\u003cli\u003eA continuación, ve a la pestaña \u003cstrong\u003eDATOS\u003c/strong\u003e, y luego desde la sección \u0026ldquo;Obtener datos externos\u0026rdquo;, selecciona \u0026ldquo;Desde un archivo de texto\u0026rdquo;. Se desplegará la ventana de explorador llamada \u0026ldquo;Importar archivo de texto\u0026rdquo; para buscar y seleccionar el archivo CSV que queremos abrir - el template que descargaste.\u003c/li\u003e\n\u003cli\u003eEn este explorador, haz clic en la lista desplegable que se encuentra junto al campo \u003cstrong\u003eNombre de archivo\u003c/strong\u003e y selecciona \u0026ldquo;Todos los archivos\u0026rdquo; (*.*). Esta opción te permite visualizar la plantilla (template.csv) recién descargada (se descarga en la carpeta \u0026ldquo;Descargas\u0026rdquo;) para así seleccionarla.\u003c/li\u003e\n\u003cli\u003eUna vez seleccionada la plantilla template.csv, haz clic en el botón \u003cstrong\u003eImportar\u003c/strong\u003e. Se abrirá la ventana \u0026ldquo;Asistente para importar texto - paso 1 de 3\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eDeja la selección que aparece marcada por defecto \u003cstrong\u003eDelimitados\u003c/strong\u003e y haz clic en \u003cstrong\u003eSiguiente\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona la \u003cstrong\u003eComa\u003c/strong\u003e como delimitador. Haz clic en \u003cstrong\u003eSiguiente\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eDeja la pantalla tal cual está, y haz clic en \u003cstrong\u003eFinalizar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la ventana que se despliega, haz clic en \u003cstrong\u003eOK\u003c/strong\u003e para que la plantilla se vea en la hoja de trabajo actual. Así obtendrás la Plantilla con el formato que necesitas para armar la lista de estudiantes a ser admitidos.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez que tengas la Plantilla, completa el archivo con los siguientes datos de los estudiantes a admitir o a pre admitir en el formato que se indica a continuación:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eNombre:\u003c/strong\u003e y \u003cstrong\u003eApellido:\u003c/strong\u003e Sólo letras\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ee-mail:\u003c/strong\u003e Debe contener el  signo @ (arroba), el nombre de usuario delante y el dominio detrás\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eFecha de nacimiento:\u003c/strong\u003e DD/MM/AAAA\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eTipo de documento:\u003c/strong\u003e S/D, DNI, LE, LC, PASAPORTE, y CEDULA (en donde S/D significa “sin datos” y Cédula se escribe sin tilde)\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eNúmero de documento:\u003c/strong\u003e Sólo números\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eGénero:\u003c/strong\u003e F o M\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003ePaís:\u003c/strong\u003e, \u003cstrong\u003eProvincia:\u003c/strong\u003e, y \u003cstrong\u003eLocalidad:\u003c/strong\u003e Sólo letras\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eEstado civil:\u003c/strong\u003e SOLTERO, CASADO, DIVORCIADO, S/D, SEPARADO, VIUDO (en donde S/D significa “sin datos”)\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDebes respetar el formato arriba detallado para que el resultado de la carga del archivo no de errores y la admisión pueda realizarse.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003ePor último, guarda el archivo mediante la opción “Guardar como” en una carpeta en tu ordenador y \u003cstrong\u003easegúrate de guardarlo como archivo CSV\u003c/strong\u003e (Comma delimited) (*.csv).\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eGuárdalo con un nombre que puedas reconocer fácilmente, por ejemplo, con el nombre que utilizaste para nombrar la Admisión: Admisiones_GrupoABC.csv.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eUna vez que el archivo esté listo, haz clic en el botón \u003cstrong\u003eCargar archivo\u003c/strong\u003e para localizarlo en tu PC y seleccionarlo, o selecciona el archivo y arrástralo hacia la nueva ventana desplegada. El sistema informará que el archivo fue seleccionado, y si por algún motivo debes cambiarlo por otro, podrás eliminarlo al hacer clic en la \u003cstrong\u003emarca de cruz\u003c/strong\u003e \n\n\u003cimg src=\"round_close_black_24dp.png\" alt=\"close icon\" class=\"inlineIcon\"\u003e que se encuentra a la derecha del archivo.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e. En la sección \u0026ldquo;Resumen de la importación\u0026rdquo;, la app te advertirá que está procesando la información ingresada y luego te indicará si la importación se realizó con éxito al desplegar:\n\u003cul\u003e\n\u003cli\u003eun botón con la leyenda Error y el número de errores encontrados\u003c/li\u003e\n\u003cli\u003eun botón donde se lee Ok y el número de estudiantes admitidos con éxito\u003c/li\u003e\n\u003cli\u003eun botón donde se lee \u003cstrong\u003eTotal\u003c/strong\u003e que indica la cantidad total de estudiantes que se intentaron admitir\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUna vez importado el archivo con la información de los estudiantes, en la ventana Resultado de la importación también podrás ver la sección Datos de la oferta académica la cual contiene los datos seleccionados en el Paso 1.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/1-datos-oferta-academica/\" title=\"Paso 1 - Datos de la oferta académica\"\u003ePaso 1 - Datos de la oferta académica →\u003c/a\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/3-resultado-importacion/\" title=\"Paso 3 - Resultado de la importación\"\u003ePaso 3 - Resultado de la importación →\u003c/a\u003e\u003c/p\u003e\n"},{id:154,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/3-resultado-importacion/",title:"Paso 3 - Resultado de la importación",description:null,content:"\u003col\u003e\n\u003cli\u003eEn la ventana \u0026ldquo;Resultado de la importación\u0026rdquo;, haz clic en el botón \u003cstrong\u003eDescargar\u003c/strong\u003e para obtener un informe de cómo resultó la admisión o pre admisión. Se descargará un archivo (.csv) que contiene los datos cargados en el Paso 2) a los cuales se suman:\n\u003cul\u003e\n\u003cli\u003eel campo \u003cstrong\u003eresultado\u003c/strong\u003e, que contendrá \u003cstrong\u003eOK\u003c/strong\u003e si la admisión o pre admisión fue procesada con éxito, o la palabra \u003cstrong\u003eERROR\u003c/strong\u003e si hubo un impedimento para ser procesada;\u003c/li\u003e\n\u003cli\u003eel campo \u003cstrong\u003emensaje\u003c/strong\u003e, que indicará, en caso de \u003cstrong\u003eERROR\u003c/strong\u003e, qué fue lo que obstaculizó el procesamiento de un registro determinado;\u003c/li\u003e\n\u003cli\u003eel campo \u003cstrong\u003eusuario\u003c/strong\u003e, que contendrá el usuario del estudiante para ingresar al eCampus y a otras apps de la universidad;\u003c/li\u003e\n\u003cli\u003eel campo \u003cstrong\u003elegajo_estudiante\u003c/strong\u003e, que contendrá el Legajo generado para el estudiante.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003eSi hubiera algún error que impidió la admisión o pre admisión de uno o más registros, intenta corregirlos y vuelve al Inicio (Paso 1) para reiniciar el proceso de \u003cstrong\u003eAdmisión masiva\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/1-datos-oferta-academica/\" title=\"Paso 1 - Datos de la oferta académica\"\u003ePaso 1 - Datos de la oferta académica →\u003c/a\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/procesar-admision-predadmision/2-cargar-archivo/\" title=\"Paso 2 - Cargar archivo\"\u003ePaso 2 - Cargar archivo →\u003c/a\u003e\n\u003c/b\u003e\u003c/p\u003e\n"},{id:155,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-cerrada/",title:"Registrar o editar la asistencia de forma manual cuando la Clase esté cerrada mediante la App o la Botonera",description:null,content:"\u003ch4 id=\"registrar-o-editar-la-asistencia-de-una-clase-cerrada-mediante-la-app\"\u003e\u003cstrong\u003eRegistrar o editar la asistencia de una Clase cerrada mediante la app\u003c/strong\u003e\u003c/h4\u003e\n\u003cp\u003eComo \u003cstrong\u003ebedel\u003c/strong\u003e, podrás cargar o modificar la asistencia de los estudiantes a uno o más módulos de una clase aún si éstos finalizaron y su Estado es \u003cstrong\u003eCerrado\u003c/strong\u003e, pero sólo en el turno de cursado vigente y durante el período vigente.\u003c/p\u003e\n\u003cp\u003eComo \u003cstrong\u003esupervisor\u003c/strong\u003e, podrás cargar o modificar la asistencia de los estudiantes a uno o más módulos de una clase aún si éstos finalizaron y su Estado es \u003cstrong\u003eCerrado\u003c/strong\u003e, en cualquier turno de cursado, durante y fuera del período vigente.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eUna vez cerrada la clase o luego del cierre de toma de asistencia, ingresa a la App \u003cstrong\u003easistencia.uesiglo21.edu.ar\u003c/strong\u003e con las credenciales que utilizas para entrar al \u003cstrong\u003eeCampus\u003c/strong\u003e. A continuación se desplegará la ventana \u003cem\u003e“Listado de módulos”\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona la \u003cstrong\u003efecha\u003c/strong\u003e en la que cargarás o modificarás la asistencia para que así la app despliegue sólo las Materias dictadas en dicha fecha.\u003c/li\u003e\n\u003cli\u003eIndica un rango horario para restringir aún más los resultados.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eComienza por colocar la hora de finalización del Módulo y luego la hora de inicio.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eLocaliza la \u003cstrong\u003eMateria\u003c/strong\u003e y haz clic sobre la misma. A continuación se visualizará la \u003cem\u003ePlanilla de Asistencia\u003c/em\u003e a la materia en la fecha seleccionada y en el Módulo correspondiente al rango horario seleccionado.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eA continuación, se indica en forma resumida cómo proceder para registrar o editar la asistencia a una clase cerrada de 1 o más estudiantes a 1 módulo o a la clase completa.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eCambiar/Registrar asistencia – Clase cerrada – 1 Estudiante – 1 Módulo\u003c/strong\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eLocaliza al estudiante mediante el campo de búsqueda ubicado sobre la Planilla de Asistencia.\u003c/li\u003e\n\u003cli\u003eMarca su asistencia como \u003cstrong\u003ePresente\u003c/strong\u003e o \u003cstrong\u003eAusente\u003c/strong\u003e según corresponda.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eCambiar/Registrar asistencia – Clase cerrada – 1 Estudiante – Clase completa\u003c/strong\u003e\n\u003cbr\u003e\n1. Haz clic en el botón \u003cstrong\u003eSelección Múltiple\u003c/strong\u003e.\n2. Ve al campo desplegable \u003cstrong\u003eAlcance\u003c/strong\u003e y selecciona la opción \u003cem\u003e“Clase completa”\u003c/em\u003e.\n3. Localiza al estudiante.\n4. Marca su asistencia según corresponda.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eCambiar/Registrar asistencia – Clase cerrada – Varios o todos los estudiantes – 1 Módulo\u003c/strong\u003e\u003c/p\u003e\n\u003cpre\u003e\u003ccode\u003e  Opción 1: Recorre la lista \u0026quot;manualmente\u0026quot; y selecciona los casilleros de los estudiantes correspondientes.\n  Opción 2: Haz clic en el botón **Selección Múltiple** y selecciona todos los estudiantes.\n  Utiliza los íconos con forma de **calendario** (verde = Presente, rojo = Ausente) para aplicar la asistencia.\n\u003c/code\u003e\u003c/pre\u003e\n\u003cp\u003e\u003cstrong\u003eCambiar/Registrar asistencia – Clase cerrada – Varios o todos los estudiantes – Clase Completa\u003c/strong\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eSelección Múltiple\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eDirígete al campo desplegable \u003cstrong\u003eAlcance\u003c/strong\u003e y selecciona la opción \u003cem\u003e“Clase completa”\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona varios o todos los estudiantes.\u003c/li\u003e\n\u003cli\u003eUtiliza los íconos con forma de \u003cstrong\u003ecalendario\u003c/strong\u003e (verde=Presente, rojo=Ausente) para aplicar la asistencia \n\n\u003cimg src=\"calendar.png\" alt=\"calendar icon\" class=\"inlineIcon\"\u003e\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara seleccionar TODOS los estudiantes, haz clic en el casillero que se encuentra en la parte superior de la Planilla de Asistencia a la izquierda de la columna “Nombre”\u003c/div\u003e\n\u003c/div\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl sistema identificará quién colocó la marca de Presente/Ausente de cada estudiante en la columna “Origen”.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch4 id=\"registrar-o-editar-la-asistencia-de-una-clase-cerrada-mediante-la-botonera\"\u003e\u003cstrong\u003eRegistrar o editar la asistencia de una Clase cerrada mediante la Botonera\u003c/strong\u003e\u003c/h4\u003e\n\u003cp\u003eComo \u003cstrong\u003ebedel\u003c/strong\u003e, podrás cargar o modificar la asistencia de 1 estudiante a uno o más módulos de una clase aún si éstos finalizaron y su Estado es \u003cstrong\u003eCerrado\u003c/strong\u003e, pero sólo en el turno de cursado vigente y durante el período vigente.\u003c/p\u003e\n\u003cp\u003eComo \u003cstrong\u003esupervisor\u003c/strong\u003e, podrás cargar o modificar la asistencia de 1 estudiante a uno o más módulos de una clase aún si éstos finalizaron y su Estado es \u003cstrong\u003eCerrado\u003c/strong\u003e, en cualquier turno de cursado, durante y fuera del período vigente.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa al \u003cstrong\u003eeCampus\u003c/strong\u003e con tus credenciales y luego selecciona la opción \u003cem\u003eReporte de alumnos”\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza al estudiante por \u003cstrong\u003eDNI\u003c/strong\u003e o \u003cstrong\u003enúmero de Legajo\u003c/strong\u003e, y una vez localizado, selecciónalo para activar la \u003cstrong\u003eBotonera\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona el botón \u003cstrong\u003eAsistencia\u003c/strong\u003e. A continuación se desplegará la pantalla \u003cem\u003e\u0026ldquo;Detalle del estudiante\u0026rdquo;\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la materia cuya asistencia necesitas registrar o modificar. Para encontrarla rápidamente, puedes ingresar el nombre o parte del nombre de la materia en el campo \u003cstrong\u003eListado de cursos\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez localizada, haz clic sobre la materia para visualizar la asistencia del estudiante a todos los módulos que la conforman.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la parte superior de la pantalla, a la izquierda, tendrás información acerca del estudiante tales como la Modalidad de cursado, su número de Legajo, su email, y a la derecha algunos detalles de la Materia tales como el período en el que el estudiante la ha cursado.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eEn la parte inferior de la pantalla, en la sección \u003cem\u003e“Listado de Módulos”\u003c/em\u003e, puedes utilizar los campos \u003cstrong\u003eFecha desde\u003c/strong\u003e y \u003cstrong\u003eFecha hasta\u003c/strong\u003e para delimitar las fechas sobre las que deseas editar la asistencia de este estudiante.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLos campos Hora Inicio y Hora fin delimitan los Módulos de la clase en la fecha seleccionada.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003e\n\u003cp\u003ePara modificar la asistencia a la clase completa, modifica los campos \u003cstrong\u003eHora Inicio\u003c/strong\u003e y \u003cstrong\u003eHora fin\u003c/strong\u003e que delimitan los Módulos de la clase en la fecha seleccionada para que abarquen todos los Módulos de la clase.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eProcede a hacer clic en la asistencia a los Módulos de la clase en la Columna \u003cstrong\u003eEstado\u003c/strong\u003e para así registrarla o cambiarla:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eSi el Estado es \u003cstrong\u003eAusente\u003c/strong\u003e, al hacer clic cambiará a \u003cstrong\u003ePresente\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eSi el Estado es \u003cstrong\u003ePresente\u003c/strong\u003e, al hacer clic cambiará a \u003cstrong\u003eAusente\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eSi el Estado es \u003cstrong\u003eSin asistencia\u003c/strong\u003e, al hacer clic cambiará a \u003cstrong\u003ePresente\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl sistema identificará quién colocó la marca de Presente/Ausente de cada estudiante en la columna Origen e indicará la fecha en la que se realizó la modificación en la columna “Fecha de asistencia”.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/abrir-clase/\" title=\"Abrir clase\"\u003eAbrir clase →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/visualizar-asistencia/\" title=\"Visualizar asistencia\"\u003eVisualizar asistencia→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-abierta/\" title=\"Editar o registrar asistencia de Clase Abierta mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Abierta mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/registrar-asistencia/\" title=\"Registra tu asistencia como estudiante mediante el código QR\"\u003eRegistra tu asistencia - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/visualizar-asistencia-estudiante/\" title=\"Visualiza tus asistencias en la app S21\"\u003eVisualiza tus asistencias en la app S21 - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n"},{id:156,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/errores-admision-preadmision/errores-archivo/",title:"Errores a nivel archivo",description:null,content:"\u003cp\u003eCuando existe un error a nivel archivo, la app \u003cstrong\u003eAdmisión masiva\u003c/strong\u003e te lo advertirá al desplegar un \u003cstrong\u003emensaje de error\u003c/strong\u003e ni bien cargues el archivo con los registros de estudiantes a admitir o pre admitir. Los errores a nivel archivo se observan en casos en los que:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003esobran o faltan columnas en el archivo\u003c/li\u003e\n\u003cli\u003eel archivo a subir no es del tipo .csv\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003ePor ejemplo, si intentas cargar un archivo Excel en vez de “.csv”, el sistema te lo advertirá al desplegar el mensaje de error \u003cstrong\u003e\u003cem\u003eSolo se admiten archivos con extensión .csv!\u003c/em\u003e\u003c/strong\u003e y no procesa el archivo.\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/errores-admision-preadmision/errores-datos/\" title=\"Errores a nivel datos\"\u003eErrores a nivel datos →\u003c/a\u003e\u003c/p\u003e\n"},{id:157,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision-masiva/errores-admision-preadmision/errores-datos/",title:"Errores a nivel datos",description:null,content:"\u003col\u003e\n\u003cli\u003eCuando existe un error en los datos cargados, la app \u003cstrong\u003eAdmisión masiva\u003c/strong\u003e te lo advertirá mediante el indicador de Error (círculo con un número) del \u0026ldquo;Resultado de la importación\u0026rdquo;. Un error podría ser que en un registro (la admisión de 1 estudiante):\n\u003cul\u003e\n\u003cli\u003eel tipo de dato no se corresponda con el campo: \u003cem\u003epor ejemplo, se ingresaron números en el campo\u003c/em\u003e \u003cstrong\u003eNombre\u003c/strong\u003e\u003c/li\u003e\n\u003cli\u003eel formato del dato no sea como debería ser: \u003cem\u003epor ejemplo, el\u003c/em\u003e \u003cstrong\u003eemail\u003c/strong\u003e \u003cem\u003eno tiene\u003c/em\u003e @\u003c/li\u003e\n\u003cli\u003eno se ingresó nada: \u003cem\u003ehay campos que se dejaron en blanco\u003c/em\u003e\u003c/li\u003e\n\u003cli\u003eel estudiante ya fue admitido: \u003cem\u003eel estudiante fue admitido o pre admitido a la carrera indicada en el\u003c/em\u003e \u003cstrong\u003ePaso 1\u003c/strong\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003ePara ver en detalle cuáles registros dieron error y cuál fue el error, descarga el archivo “Resultado de la importación”. A continuación, se describen 2 ejemplos de errores posibles:\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003eSi ingresaste por equivocación en el campo \u003cstrong\u003eNombre\u003c/strong\u003e un número o una serie de letras y números, por ejemplo, \u003cstrong\u003eMarcel0\u003c/strong\u003e (número cero en vez de la letra \u0026ldquo;o\u0026rdquo;), en la columna \u003cstrong\u003eResultado\u003c/strong\u003e se observa la palabra ERROR, y en la columna \u003cstrong\u003eMensaje\u003c/strong\u003e se desplegará \u003cem\u003eNombre inválido\u003c/em\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSi cargaste los datos de estudiantes que ya han sido admitidos a una carrera determinada, en la columna \u003cstrong\u003eResultado\u003c/strong\u003e se observa la palabra ERROR, y en la columna Mensaje se lee \u003cem\u003e\u0026ldquo;El estudiante ya está registrado en la carrera elegida. Legajo del estudiante: VAGB126014\u003c/em\u003e.”\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePodrás cargar un estudiante ya admitido a una carrera porque este proceso lo que crea, es un Legajo, y el estudiante podría estar inscribiéndose a una segunda carrera, para la que tendrá un segundo Legajo. Por lo tanto, para admitir a un estudiante a una carrera diferente de la que ya ha sido admitido, deberás crear una admisión nueva.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLos registros que dan error NO logran terminar el proceso de admisión o pre admisión y por lo tanto NO se crea ni el Usuario ni el Legajo del estudiante.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"/doks-algarrobo/docs/admision-masiva/errores-admision-preadmision/errores-archivo/\" title=\"Errores a nivel archivo\"\u003eErrores a nivel archivo →\u003c/a\u003e\u003c/p\u003e\n"},{id:158,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/registrar-asistencia/",title:"Registrar tu asistencia a uno o más Módulos",description:null,content:"\u003col\u003e\n\u003cli\u003eSi aún no lo hiciste, descarga la app \u003cstrong\u003eUniversidad Siglo 21\u003c/strong\u003e desde tu tienda de aplicaciones.\u003c/li\u003e\n\u003cli\u003eSelecciona la app e ingresa con tu usuario de \u003cstrong\u003eeCampus\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez que el docente (o el bedel o supervisor) ponga a disposición el \u003cstrong\u003ecódigo QR\u003c/strong\u003e, abre la App Móvil y pulsa el ícono de lector de \u003cstrong\u003ecódigo QR\u003c/strong\u003e \n\n\u003cimg src=\"qr_code.png\" alt=\"QR code icon\" class=\"inlineIcon\"\u003e ubicado en el extremo superior derecho de la pantalla.\u003c/li\u003e\n\u003cli\u003eSi es la primera vez que escaneas este \u003cstrong\u003ecódigo QR\u003c/strong\u003e para registrar tu asistencia, otorga el permiso para que la app \u003cstrong\u003eUniversidad Siglo 21\u003c/strong\u003e pueda acceder a tu cámara.\u003c/li\u003e\n\u003cli\u003eEscanea el \u003cstrong\u003ecódigo QR\u003c/strong\u003e que te facilitó el docente (o el bedel o supervisor) y asegúrate de que la App Móvil te muestre el mensaje \u003cstrong\u003e\u003cem\u003e\u0026quot;¡Ya estás presente!\u0026quot;\u003c/em\u003e\u003c/strong\u003e, lo cual indica que tu asistencia al módulo ha quedado registrada.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi el docente o el bedel o supervisor cargó tu ausencia al módulo, la aplicación te lo informará.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSolo podrás registrar tu asistencia una vez.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003eSi intentaras escanear el \u003cstrong\u003ecódigo QR\u003c/strong\u003e nuevamente y tu asistencia ya estuviera registrada, la app desplegará el mensaje \u003cstrong\u003e\u003cem\u003e\u0026quot;¡Ya estás presente!\u0026quot;\u003c/em\u003e\u003c/strong\u003e.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSi intentaras escanear el \u003cstrong\u003ecódigo QR\u003c/strong\u003e de un módulo que ya se cerró, la app te notificará que ya no es posible registrar tu asistencia.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSi no estuvieras inscripto al módulo, la app te notificará que no se ha encontrado tu inscripción al módulo.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eSi el docente (o el bedel o supervisor) hubiera marcado tu asistencia a un módulo como \u003cstrong\u003eAusente\u003c/strong\u003e, al intentar escanear el \u003cstrong\u003ecódigo QR\u003c/strong\u003e de dicho módulo la app te informará que el docente (o el bedel o supervisor) ha marcado tu inasistencia al mismo.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/abrir-clase/\" title=\"Abrir clase\"\u003eAbrir clase →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/visualizar-asistencia/\" title=\"Visualizar asistencia\"\u003eVisualizar asistencia→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-abierta/\" title=\"Editar o registrar asistencia de Clase Abierta mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Abierta mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-cerrada/\" title=\"Editar o registrar asistencia de Clase Cerrada mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Cerrada mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/visualizar-asistencia-estudiante/\" title=\"Visualiza tus asistencias en la app S21\"\u003eVisualiza tus asistencias en la app S21 - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n"},{id:159,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/visualizar-asistencia-estudiante/",title:"Visualiza tu asistencia a uno o más Módulos",description:null,content:"\u003col\u003e\n\u003cli\u003eSi aún no lo hiciste, descarga la app \u003cstrong\u003eUniversidad Siglo 21\u003c/strong\u003e desde tu tienda de aplicaciones.\u003c/li\u003e\n\u003cli\u003eSelecciona la app e ingresa con tu usuario de \u003cstrong\u003eeCampus\u003c/strong\u003e. En el sector superior de la pantalla, se desplegarán la carrera o carreras que estás cursando.\u003c/li\u003e\n\u003cli\u003ePulsa sobre una carrera en particular para visualizar tu asistencia a las diferentes materias que la conforman.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa app desplegará en color naranja las inasistencias si estás cerca de alcanzar el límite de inasistencias dispuesto para la materia.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eTu asistencia será desplegada de forma que muestre cuántas inasistencias tienes de un total máximo posible de inasistencias. Por ejemplo, si visualizas \u003cstrong\u003eInasistencias 13/20\u003c/strong\u003e, esto significa que tienes 13 inasistencias – y que el máximo de inasistencias permitidas para no quedar libre es 20.\u003c/li\u003e\n\u003cli\u003ePulsa sobre una materia para obtener un detalle de las Inasistencias.\u003c/li\u003e\n\u003cli\u003eEn el detalle desplegado podrás ver la cantidad de Módulos que tiene la materia y el porcentaje de asistencia que tienes en la materia seleccionada.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/abrir-clase/\" title=\"Abrir clase\"\u003eAbrir clase →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/visualizar-asistencia/\" title=\"Visualizar asistencia\"\u003eVisualizar asistencia→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-abierta/\" title=\"Editar o registrar asistencia de Clase Abierta mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Abierta mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-cerrada/\" title=\"Editar o registrar asistencia de Clase Cerrada mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Cerrada mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/registrar-asistencia/\" title=\"Registra tu asistencia como estudiante mediante el código QR\"\u003eRegistra tu asistencia - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n"},{id:160,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/visualizar-asistencia/",title:"Visualizar asistencia mediante la app o botonera",description:null,content:"\u003ch4 id=\"visualizar-asistencia-con-app\"\u003e\u003cstrong\u003eVisualizar asistencia con app\u003c/strong\u003e\u003c/h4\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003easistencia.uesiglo21.edu.ar\u003c/strong\u003e con las credenciales que utilizas para entrar al \u003cstrong\u003eeCampus\u003c/strong\u003e para desplegar la ventana \u003cem\u003e“Listado de módulos”\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza el módulo a visualizar con la ayuda de los filtros disponibles \u003cstrong\u003efecha\u003c/strong\u003e, \u003cstrong\u003ehora de inicio y finalización\u003c/strong\u003e del módulo, \u003cstrong\u003eedificio\u003c/strong\u003e, \u003cstrong\u003eaula\u003c/strong\u003e, como así también de un filtro adicional señalado por un ícono de lupa \n\n\u003cimg src=\"search.png\" alt=\"search icon\" class=\"inlineIcon\"\u003e que permite el ingreso de cualquier texto relacionado con el módulo para realizar su búsqueda (materia, docente, cátedra, etc).\u003c/li\u003e\n\u003cli\u003eUna vez localizado el módulo, haz clic sobre el mismo. En la sección inferior de la pantalla, podrás ver el listado de estudiantes inscriptos en el módulo que has desplegado y en la columna Estado su condición de \u003cstrong\u003ePresente\u003c/strong\u003e, \u003cstrong\u003eAusente\u003c/strong\u003e o \u003cstrong\u003eSin asistencia\u003c/strong\u003e al mismo.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara realizar una búsqueda de un estudiante en particular, podrás utilizar el filtro para buscar estudiantes por Nombre, Apellido, DNI, Legajo, etc.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch4 id=\"visualizar-asistencia-con-botonera\"\u003e\u003cstrong\u003eVisualizar asistencia con botonera\u003c/strong\u003e\u003c/h4\u003e\n\u003col\u003e\n\u003cli\u003eIngresa al \u003cstrong\u003eeCampus\u003c/strong\u003e con tus credenciales y luego selecciona la opción \u003cem\u003e\u0026ldquo;Reporte de alumnos”\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza al estudiante por \u003cstrong\u003eDNI\u003c/strong\u003e o \u003cstrong\u003enúmero de Legajo\u003c/strong\u003e y una vez localizado, selecciónalo para activar la \u003cstrong\u003eBotonera\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eSelecciona el botón \u003cstrong\u003eAsistencia\u003c/strong\u003e. A continuación se desplegará la pantalla \u003cem\u003e\u0026ldquo;Detalle del estudiante\u0026rdquo;\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza la materia cuya asistencia necesitas visualizar. Para encontrarla rápidamente, puedes ingresar el nombre o parte del nombre de la materia en el campo \u003cstrong\u003eListado de cursos\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez localizada, haz clic sobre la materia para visualizar la asistencia del estudiante a todos los módulos que la conforman.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la parte superior de la pantalla, a la izquierda, tendrás información acerca del estudiante tales como la Modalidad de cursado, su número de Legajo, su email, y a la derecha algunos detalles de la Materia tales como el período en el que el estudiante la ha cursado.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eEn la parte inferior de la pantalla, en la sección \u003cem\u003e\u0026ldquo;Listado de Módulos\u0026rdquo;\u003c/em\u003e, puedes hacer uso de los campos \u003cstrong\u003eFecha desde\u003c/strong\u003e y \u003cstrong\u003eFecha hasta\u003c/strong\u003e para delimitar las fechas sobre las que deseas visualizar la asistencia de este estudiante en particular.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas columnas Hora Inicio y Hora fin de la Planilla de Asistencia delimitan los Módulos de la clase en la fecha seleccionada.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/abrir-clase/\" title=\"Abrir clase\"\u003eAbrir clase →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-abierta/\" title=\"Editar o registrar asistencia de Clase Abierta mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Abierta mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-cerrada/\" title=\"Editar o registrar asistencia de Clase Cerrada mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Cerrada mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/registrar-asistencia/\" title=\"Registra tu asistencia como estudiante mediante el código QR\"\u003eRegistra tu asistencia - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/visualizar-asistencia-estudiante/\" title=\"Visualiza tus asistencias en la app S21\"\u003eVisualiza tus asistencias en la app S21 - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n"},{id:161,href:"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/abrir-clase/",title:"Abrir clase",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa a \u003cstrong\u003easistencia.uesiglo21.edu.ar\u003c/strong\u003e con las credenciales que utilizas para entrar al \u003cstrong\u003eeCampus\u003c/strong\u003e. A continuación se desplegará la ventana \u003cem\u003e“Listado de módulos”\u003c/em\u003e.\u003c/li\u003e\n\u003cli\u003eLocaliza el módulo a dictar con la ayuda de los filtros disponibles: \u003cstrong\u003efecha\u003c/strong\u003e, \u003cstrong\u003ehora de inicio y finalización\u003c/strong\u003e del módulo, \u003cstrong\u003eedificio\u003c/strong\u003e, \u003cstrong\u003eaula\u003c/strong\u003e. También podrás hacer uso de un filtro adicional señalado por un ícono de lupa \n\n\u003cimg src=\"search.png\" alt=\"search icon\" class=\"inlineIcon\"\u003e que permite el ingreso de cualquier texto relacionado con el módulo para realizar su búsqueda (materia, docente, cátedra, etc).\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003eUna vez localizado el módulo, éste tendrá tres indicadores:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003e\u003cstrong\u003eIndicador de estado:\u003c/strong\u003e Señala el estado del módulo en relación su apertura: \u003cstrong\u003ePendiente\u003c/strong\u003e, \u003cstrong\u003eAbierto\u003c/strong\u003e, o \u003cstrong\u003eCerrado\u003c/strong\u003e. Para iniciar el registro de asistencia o para registrar o editar la asistencia, tanto docentes como bedeles y supervisores podrán hacerlo al abrir un módulo cuyo estado sea \u003cstrong\u003ePendiente\u003c/strong\u003e.\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eSólo los bedeles y supervisores podrán editar o registrar la asistencia de los módulos cuyo estado sea \u003cstrong\u003eCerrado\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003e\u003cstrong\u003eIndicador de advertencia:\u003c/strong\u003e \n\n\u003cimg src=\"erroroutline.png\" alt=\"error icon\" class=\"inlineIcon\"\u003e Se encuentra en el vértice superior derecho de la etiqueta de estado y cambia de color de acuerdo al tiempo restante del que se dispone para abrir el módulo y tomar asistencia:\n- \u003cstrong\u003everde\u003c/strong\u003e si aún faltan 30  minutos para el vencimiento de la toma de asistencia y de la generación del \u003cstrong\u003ecódigo QR\u003c/strong\u003e.\n- \u003cstrong\u003eamarillo\u003c/strong\u003e si se está a 20 minutos del vencimiento de la toma de asistencia y del QR.\n- \u003cstrong\u003erojo\u003c/strong\u003e si se está a 10 minutos del vencimiento de la toma de asistencia y del QR.\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eAl abrir el módulo, el indicador pasará a ser un \u0026ldquo;Check\u0026rdquo; \n\n\u003cimg src=\"checkmark.png\" alt=\"check icon\" class=\"inlineIcon\"\u003e en color verde.\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003e\u003cstrong\u003eIndicador de candado:\u003c/strong\u003e \n\n\u003cimg src=\"padlock.png\" alt=\"padlock icon\" class=\"inlineIcon\"\u003e Si está abierto, indica que la asistencia aún puede ser modificada por el docente o por el bedel o supervisor. Si estuviera cerrado, la asistencia solo será editable por el supervisor.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi el módulo no es abierto durante el período de 30 minutos en el que está en Estado Pendiente, el módulo se cerrará y pondrá Presente a todos los estudiantes inscriptos en ese módulo.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eSelecciona el módulo para visualizarlo y haz clic en el botón \u003cstrong\u003eAbrir asistencia\u003c/strong\u003e. A continuación, se abrirá una nueva ventana con el \u003cstrong\u003ecódigo QR\u003c/strong\u003e recién generado.\u003c/li\u003e\n\u003cli\u003eProporciona el \u003cstrong\u003ecódigo QR\u003c/strong\u003e a los estudiantes para que puedan registrar su asistencia al módulo. Puedes ofrecerles que se acerquen a tu ordenador o proyectar tu pantalla sobre el pizarrón para que puedan escanearlo.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn caso de que quieras llevar la pestaña del código QR a una nueva pantalla, bastará con seleccionar la pestaña de tu navegador, mantenerla presionada y desplazarla hacia la pantalla extendida.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eAdvierte a tus estudiantes que la duración del \u003cstrong\u003ecódigo QR\u003c/strong\u003e es de \u003cstrong\u003e30 minutos\u003c/strong\u003e a partir del horario programado del inicio de clase y que vencido ese plazo se cerrará la toma de asistencia.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi por algún motivo la ventana que muestra el código QR se cerrara dentro de la vigencia del QR, se podrá volver a hacer visible desde la ventana “Gestión de asistencias” al hacer clic nuevamente en el botón Abrir QR.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eRecuerda que en caso de que se deba modificar o cargar una asistencia de forma manual, debes hacerlo para cada uno de los módulos de la clase ya que la única asistencia que se replica en todos los módulos es la registrada por el código QR.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl finalizar la clase la asistencia solo podrá ser modificada por el supervisor.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/visualizar-asistencia/\" title=\"Visualizar asistencia\"\u003eVisualizar asistencia→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-abierta/\" title=\"Editar o registrar asistencia de Clase Abierta mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Abierta mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/docentes-bedeles-supervisores/editar-registrar-asistencia-clase-cerrada/\" title=\"Editar o registrar asistencia de Clase Abierta mediante la App o la Botonera\"\u003eEditar o registrar asistencia de Clase Cerrada mediante la App o la Botonera→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/registrar-asistencia/\" title=\"Registra tu asistencia como estudiante mediante el código QR\"\u003eRegistra tu asistencia - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/registro-asistencia/estudiantes/visualizar-asistencia-estudiante/\" title=\"Visualiza tus asistencias en la app S21\"\u003eVisualiza tus asistencias en la app S21 - Estudiantes→\u003c/a\u003e\u003c/p\u003e\n"},{id:162,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/",title:"Abrir cátedras",description:"Usa esta funcionalidad para habilitar las cátedras para que los estudiantes se puedan inscribir.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eIngresa los datos necesarios para realizar la búsqueda de la materia cuyas cátedras relacionadas deseas abrir.\u003c/li\u003e\n\u003cli\u003eEn los detalles que se despliegan debajo del encabezado con el nombre y código de la cátedra, desliza el interruptor hacia a derecha para cambiar el estado de la carrera. En la grilla de búsqueda las cátedras disponibles para abrirse se ordenarán por las que están más próximas a llenarse y según la configuración de las carreras puedes ver también el orden de apertura para cada una de ellas de acuerdo con las carreras.\u003c/li\u003e\n\u003cli\u003eEl sistema desplegará un mensaje para completar la acción. Haz clic en \u003cstrong\u003eAceptar\u003c/strong\u003e. La cátedra cambiará de estado cerrado a abierto.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-periodos/gestionar-periodos/\" title=\"Habilitar inscripciones\"\u003eHabilitar inscripciones →\u003c/a\u003e\u003c/p\u003e\n"},{id:163,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/pagos/acceder-aplicacion/",title:"Acceder a la aplicación de pagos electrónicos",description:null,content:"\u003col\u003e\n\u003cli\u003eSi deseas realizar el pago de una matrícula o examen, ingresa al portal de estudiantes con tus credenciales.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, selecciona el icono de examen \n\n\u003cimg src=\"receipt.png\" alt=\"payment icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003cli\u003eAutomáticamente el sistema abrirá la aplicación de pagos electrónicos en una nueva pestaña en tu buscador.\u003c/li\u003e\n\u003cli\u003eDesde aquí podrás comenzar a realizar el pago de sus aranceles, matrículas, u otros conceptos. Para más información sobre el uso de la aplicación de pagos, lee el artículo relacionado en la siguiente sección de este documento.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-estudiante/\" title=\"Consultar tu historial de pagos\"\u003eConsultar tu historial de pagos →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar tus tickets pendientes de pago\"\u003eConsultar tus tickets pendientes de pago →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/cuenta/consultar-cuenta-estudiante/\" title=\"Consultar el estado de tu cuenta\"\u003eConsultar el estado de tu cuenta →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-estudiante/\" title=\"Cargar saldo a tu cuenta\"\u003eCargar saldo a tu cuenta →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/otros/realizar-otros-pagos-estudiante/\" title=\"Realizar otros pagos\"\u003eRealizar otros pagos →\u003c/a\u003e\u003c/p\u003e\n"},{id:164,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-asignar-docentes/",title:"Asignar docentes",description:"Usa esta funcionalidad para buscar docentes y asignarlos a las materias.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, se encuentra el formulario de búsqueda. Ingresa los datos de las cátedras cuyos docentes deseas modificar.\u003c/li\u003e\n\u003cli\u003eEn la grilla de resultados, selecciona la cátedra cuya información docente quieres editar y haz clic en el icono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e. La ventana “Editar cátedra presencial“ se abrirá.\u003c/li\u003e\n\u003cli\u003eBusca y asigna un docente, un primer suplente y un segundo suplente.\u003c/li\u003e\n\u003cli\u003eAl finalizar, presionar \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:165,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/",title:"Buscar cátedras",description:"Consulta las cátedras que están guardadas",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono de menú \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, se encuentra el formulario de búsqueda. Cuatro de estos campos marcados con asterisco son obligatorios: “Período”, “Subperíodo” y “Estado de cátedra”. En el campo \u0026ldquo;Tipo de cátedra\u0026rdquo; puedes optar por valores como Experimenta, Presencial, Seminario, Virtual, Todos los tipos o combinarlos. Una vez que hayas ingresado estos datos se habilita el botón \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePuedes completar algunos de los siguientes campos adicionales para realizar una búsqueda avanzada:\n\u003cbr\u003e\n\n- En \"Modalidad\" de estudio puedes definir si estás buscando una cátedra presencial o virtual.\n\u003cbr\u003e\n\n- En el campo \"Docente titular\" puedes filtrar ingresando el nombre de un docente.\n\u003c/br\u003e\n\n- El botón selector de \"Sólo contenido\" te permite filtrar la búsqueda de cátedras por materias de solo contenido.\n\u003cbr\u003e\n\n- En el campo \"Materias\" puedes ingresar el nombre de una materia específica.\n\u003cbr\u003e\n\n- Puedes decidir buscar por una u otra \"Carreras\" en particular. Las opciones del menú de selección que tendrás disponible dependerán directamente de tu selección en el campo \"Materias\".\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eCuando termines de agregar todos los criterios de tu búsqueda, haz clic en el botón \u003cstrong\u003eBuscar\u003c/strong\u003e. En la sección \u0026ldquo;Materias/cátedras\u0026rdquo; verás los resultados de los filtros que aplicaste.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn esta sección también podrás realizar las siguientes acciones con los resultados de la búsqueda:\n\u003cbr\u003e\n\n- Si quieres, en la sección \"Materias/cátedras\", puedes marcar la casilla de verificación “Cátedras llenas” para incluir en la búsqueda aquellas cátedras que hayan alcanzado el cupo máximo de inscriptos.\n\u003cbr\u003e\n\n- Una vez que se realizó la búsqueda puedes descargar esta información en formato .csv haciendo clic en el ícono de descarga.\n\u003cbr\u003e\n\n- Puedes hacer clic en los dos iconos de menú para expandir/colapsar los detalles de todas las cátedras que se incluyen en el resultado de la búsqueda.\n\u003cbr\u003e\n\n- Además, puedes ver el \"Alias\" de la materia haciendo clic en el icono con forma de árbol. En la ventana emergente verás los otros nombres que esta materia tiene en otras carreras u otros planes de estudio.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eSelecciona una materia o cátedra sobre la que desees conocer más detalles haciendo clic sobre su registro. Dentro de cada materia podrás ver las cátedras que se crearon abiertas y cerradas.  Aquí podrás ver datos como: nombre y código de la materia/cátedra (los códigos de las cátedras contienen letras y los de los seminarios, números), cantidad total de cátedras de la materia, cantidad de cátedras llenas/abiertas/cerradas. Además se desplegará toda su información debajo del nombre. Algunos de los datos que encontrarás son:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eNombre y tipo de cátedra y modalidad.\u003c/li\u003e\n\u003cli\u003eNombre del docente titular.\u003c/li\u003e\n\u003cli\u003eAquellas que sean de modelo \u0026ldquo;Coach\u0026rdquo; tendrán una etiqueta que lo indique a continuación de los datos mencionados anteriormente.\u003c/li\u003e\n\u003cli\u003eEl término “Estándar” hace referencia a la capacidad/cupo de una cátedra para cada materia. También se puede ver el estado actual, con mensajes como: \u003cem\u003e“Esta cátedra está a punto de llenarse”\u003c/em\u003e, \u003cem\u003e“Esta cátedra tiene entre un 80% y un 90% de ocupación”\u003c/em\u003e o \u003cem\u003e“Esta cátedra está llena”.\u003c/em\u003e\u003c/li\u003e\n\u003cli\u003eEl término “Cupo” hace referencia al total de inscriptos/cupo total de la cátedra.\u003c/li\u003e\n\u003cli\u003eEl término “Apertura” se refiere al orden en el que se abren las cátedras (en orden ascendente).\u003c/li\u003e\n\u003cli\u003eEl icono de lápiz sirve para abrir la ventana “Editar cátedra presencial“. Aquí puedes ver o modificar los detalles de una cátedra. Para más información, dirígete al artículo relacionado incluido en la sección \u003cstrong\u003eVeáse también\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEs importante saber que diferentes carreras pueden compartir una misma materia en sus planes de estudio y por consecuencia en una misma cátedra puede haber estudiantes que estén inscriptos en distintas carreras. Mediante el planificador, puedes gestionar las cátedras y abrirlas a medida que se van sumando estudiantes y su cupo se está por cumplir. De esta manera, te evitas abrir varias cátedras con pocos estudiantes cada una. En la grilla de resultados de la búsqueda, las cátedras que siguen el siguiente orden (de arriba hacia abajo) para hacer la tarea de apertura de cátedras más sencilla:\n\u003cbr\u003e\n\n- Las cátedras cuyo cupo está a punto de llenarse se mostrarán en primer lugar. Las cátedras suben de prioridad a medida que se van llenando.\n\u003cbr\u003e\n\n- Las cátedras pueden también ordenarse por turno.\n\u003cbr\u003e\n\n- Según el orden de apertura de las cátedras que se haya definido cuando se crearon se ubicarán en la grilla. Es decir, mientras más alto sea el número de apertura  más baja es la prioridad. Supongamos que una cátedra se llena, entonces se deberá abrir la que sigue según el orden de apertura que se definió anteriormente.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDependiendo de los roles que tengas configurado podrás ver diferentes detalles en la grilla. Por ejemplo: \n\u003cbr\u003e\n\n- Si tienes un rol de \"Mesa de ayuda\", lo único que puede hacer en el planificador es visualizar la pantalla de \"Gestión de cátedras\" y dentro de la grilla de resultados puedes ver el listado de los estudiantes junto con su correo electrónico y teléfono. Además, puedes descargar un reporte con estos datos.\n\u003cbr\u003e\n\n- Si tu usuario tiene un rol de \"Codocente SGA\" verás lo mismo que la persona con rol de mesa de ayuda pero tú si podrás realizar algunas modificaciones como asignar docente titular, suplente y segundo suplente. \n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:166,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-asistente/",title:"Cargar saldo a la cuenta de un estudiante (Asesores)",description:"Puedes cargar dinero a la cuenta de un estudiante para que realice el pago de futuros tickets.",content:"\u003col\u003e\n\u003cli\u003eHacer click en el botón “Pago a Cuenta” para entrar\u003c/li\u003e\n\u003cli\u003eIngresar el monto que se desea abonar en el campo “Agregar dinero a mi cuenta” (1) y presionar el botón “Continuar” (2).\u003c/li\u003e\n\u003cli\u003eSeleccionar la forma de pago haciendo click en la opción deseada (sección “¿Cómo vas a pagar?“), la cual cambiará de color al ser seleccionada.\u003c/li\u003e\n\u003cli\u003eEn la sección “Tu resumen”, si todos los detalles son los correctos, presionar “Siguiente” (4). Las opciones en datos de facturación pueden variar dependiendo de la región (5).\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cem\u003eLa pantalla de pago puede variar dependiendo de la selección anterior (3)\u003c/em\u003e\u003c/p\u003e\n"},{id:167,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-estudiante/",title:"Cargar saldo a tu cuenta (Estudiantes)",description:"Puedes cargar dinero que quedará disponible para realizar el pago de futuros tickets.",content:"\u003col\u003e\n\u003cli\u003eInicia sesión con tu usuario y credenciales en el portal de estudiante (web o app móvil).\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, selecciona el icono de examen \n\n\u003cimg src=\"receipt.png\" alt=\"payment icon\" class=\"inlineIcon\"\u003e. Este link te lleva la aplicación de pagos electrónicos en una nueva pestaña en tu buscador.\u003c/li\u003e\n\u003cli\u003eEn la pantalla, haz clic al botón \u0026ldquo;Pago a cuenta\u0026rdquo;. Una nueva pantalla se abrirá.\u003c/li\u003e\n\u003cli\u003eEn el campo \u0026ldquo;Agregar dinero a mi cuenta\u0026rdquo; ingresa el monto que luego vas a utilizar para realizar tus pagos.\u003c/li\u003e\n\u003cli\u003ePresiona el botón \u003cstrong\u003eContinuar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la sección “¿Cómo vas a pagar?“ presiona la forma de pago deseada. Esta opción cambiará de color y dependiendo del método de pago que elijas, la pantalla de pago puede variar.\u003c/li\u003e\n\u003cli\u003eEn la sección “Tu resumen” de la pantalla puedes validar si los detalles son los correctos.\u003c/li\u003e\n\u003cli\u003eSi deseas confirmar la carga de saldo, presionar \u003cstrong\u003eSiguiente\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003ePor último, las opciones en datos de facturación pueden variar dependiendo de la región.\n\u003c/br\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara realizar cambios en los datos del contacto de facturación consulta el artículo relacionado en la sección Véase también.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/metodos-pago/consultar-formas-pago/\" title=\"Consultar formas de pago\"\u003eConsultar formas de pago →\u003c/a\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/editar-facturacion/editar-contacto/\" title=\"Editar contacto de facturación \"\u003eEditar contacto de facturación →\u003c/a\u003e\u003c/p\u003e\n"},{id:168,href:"https://bitlogic.github.io/doks-algarrobo/docs/examenes/configuracion/crear-tipo-examen/",title:"Configurar un tipo de examen",description:null,content:"\u003col\u003e\n\u003cli\u003eEn la pantalla a la que accedes desde la herramienta de gestión de evaluaciones, haz clic en el icono de lupa \n\n\u003cimg src=\"search.png\" alt=\"search icon\" class=\"inlineIcon\"\u003e del panel de navegación lateral e ingresa el código o nombre de la materia cuyo contenido deseas incluir en el tipo de examen.\u003c/li\u003e\n\u003cli\u003ePresiona \u003cstrong\u003eBuscar\u003c/strong\u003e. Los resultados se mostrarán en la sección “Seleccionar materia”.\u003c/li\u003e\n\u003cli\u003eHaz clic en la materia cuyos exámenes quieras configurar. A la derecha verás los programas relacionados en sus diferentes estados (activos e inactivos).\u003c/li\u003e\n\u003cli\u003eEn la grilla de resultados, desplázate con la barra inferior hacia la derecha y presiona el icono de ojo\n\n\u003cimg src=\"eye.png\" alt=\"eye icon\" class=\"inlineIcon\"\u003epara ver los enunciados en aquellos programas que se encuentren activos.\u003c/li\u003e\n\u003cli\u003eEn la pantalla “Gestión de evaluaciones”, haz clic en el ícono de configuración \n\n\u003cimg src=\"settings.png\" alt=\"settings icon\" class=\"inlineIcon\"\u003eubicado en la parte superior derecha de la pantalla.\u003c/li\u003e\n\u003cli\u003eEn la primera pantalla del asistente de configuración de exámenes, debes seleccionar las unidades, temas y/o subtemas que deseas evaluar. Aquí debes desplegar el contenido de la materia y seleccionar los casilleros que correspondan con lo que quieres evaluar.\u003c/li\u003e\n\u003cli\u003eLuego, presiona la flecha \n\n\u003cimg src=\"arrow%20right.png\" alt=\"arrow icon\" class=\"inlineIcon\"\u003e para pasar a la segunda pantalla del asistente.\u003c/li\u003e\n\u003cli\u003eEn la pantalla número 2, define el nombre del examen, la cantidad de preguntas que quieres evaluar, el tipo de generación, y el porcentaje del  total de enunciados se van a incluir dependiendo de su configuración previa como preguntas que evalúan competencia o contenido.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi el sistema detecta que la cantidad de enunciados configurados no se corresponde con el porcentaje definido, se muestra un mensaje de alerta en la última pantalla del asistente.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003eHaz clic nuevamente en la flecha \n\n\u003cimg src=\"arrow%20right.png\" alt=\"arrow icon\" class=\"inlineIcon\"\u003e para continuar.\u003c/li\u003e\n\u003cli\u003eEn la tercera pantalla, configura si el examen cuenta con control de tiempo e instancia de revisión con sus respectivos tiempos máximos de ejecución. Además, puedes definir si el estudiante tiene la posibilidad de reiniciar el examen (por ejemplo, si corta la conexión a internet o si hay un corte de energía eléctrica mientras se está realizando la evaluación) y cuántas veces puede realizar esta acción. Por último, elige el tipo de cálculo de nota y si ésta se mostrará al finalizar el examen.\u003c/li\u003e\n\u003cli\u003eNuevamente avanza hacia la última pantalla haciendo clic en la flecha \n\n\u003cimg src=\"arrow%20right.png\" alt=\"arrow icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003cli\u003eLa pantalla de revisión final muestra un resumen de los datos que se configuraron. Si fuese necesario, desde aquí puedes ver si es necesario realizar algunos cambios en las pantallas anteriores o cambiar los estados de algunos enunciados.\u003c/li\u003e\n\u003cli\u003ePara finalizar, haz clic en el botón \u003cstrong\u003eGuardar configuración\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez que se guardaron los cambios en la parte superior del asistente podrás ver el título del examen acabas de configurar. Si deseas generar un nuevo tipo de examen, presiona nuevamente el signo más en el centro de la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/examenes/configuracion/gestionar-enunciados/\" title=\"Gestionar enunciados\"\u003eGestionar enunciados →\u003c/a\u003e\u003c/p\u003e\n"},{id:169,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-asistente/",title:"Consulta el historial de pagos de un estudiante",description:"Si eres asesor o trabajas en la mesa de ayuda y necesitas consultar los pagos que estudiante realizó, puedes hacerlo desde esta opción.",content:"\u003col\u003e\n\u003cli\u003eIngresa el DNI del estudiante y presiona \u003cstrong\u003eBuscar\u003c/strong\u003e. El sistema abrirá la aplicación de pagos electrónicos en una nueva pestaña en tu buscador.\u003c/li\u003e\n\u003cli\u003eEn la barra superior ingresa a la sección \u0026ldquo;Historial de pagos\u0026rdquo;. Se desplegará un listado con las intenciones de pago del estudiante.\u003c/li\u003e\n\u003cli\u003eHaz clic en cada registro para que puedas consultar más detalles.\u003c/li\u003e\n\u003cli\u003eUna vez que finalices puedes regresar a la pantalla de pagos electrónicos presionando el botón \u003cstrong\u003eVolver\u003c/strong\u003e. Para salir, presionar la \u0026ldquo;x\u0026rdquo; en la esquina superior derecha.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-asistente/\" title=\"Consultar el estado de la cuenta de un estudiante\"\u003eConsultar el estado de la cuenta de un estudiante →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-asistente/\" title=\"Cargar saldo a tu cuenta\"\u003eCargar saldo a la cuenta de un estudiante →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n"},{id:170,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-estudiante/",title:"Consulta tu historial de pagos",description:"Si eres estudiante de la universidad y quieres consultar los pagos que haz realizado, puedes hacerlo desde esta opción en el portal de estudiante.",content:"\u003col\u003e\n\u003cli\u003eInicia sesión con tu usuario y credenciales en el portal de estudiante (web o app móvil).\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, selecciona el icono de examen \n\n\u003cimg src=\"receipt.png\" alt=\"payment icon\" class=\"inlineIcon\"\u003e. Este link te lleva la aplicación de pagos electrónicos en una nueva pestaña en tu buscador.\u003c/li\u003e\n\u003cli\u003eEn la barra superior ingresa a la sección \u0026ldquo;Historial de pagos\u0026rdquo;. En la pantalla se desplegará un listado con tus intenciones de pago.\u003c/li\u003e\n\u003cli\u003eHaz clic en cada registro para que puedas consultar más detalles.\u003c/li\u003e\n\u003cli\u003eUna vez que finalices puedes regresar a la pantalla de pagos electrónicos presionando el botón \u003cstrong\u003eVolver\u003c/strong\u003e. Para salir, presionar la \u0026ldquo;x\u0026rdquo; en la esquina superior derecha.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar el estado de tu cuenta\"\u003eConsultar el estado de tu cuenta →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-estudiante/\" title=\"Cargar saldo a tu cuenta\"\u003eCargar saldo a la cuenta de un estudiante →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n"},{id:171,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-agenda/",title:"Consultar calendario académico/agenda",description:null,content:"\u003col\u003e\n\u003cli\u003eInicia sesión en la app con tu usuario y credenciales.\u003c/li\u003e\n\u003cli\u003eDesde la pantalla principal de la app, en la sección \u0026ldquo;Próximos eventos\u0026rdquo; puedes ver a simple vista los últimos 5 eventos en los que te has inscripto. Estos eventos pueden ser clases o exámenes. Deslizándote horizontalmente hacia la derecha y la izquierda puedes navegar por estos eventos.\u003c/li\u003e\n\u003cli\u003ePresiona en el botón \u003cb\u003eVER TODO\u003c/b\u003e para acceder a la agenda académica completa.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eOtra forma de acceder a la agenda es desde el panel de navegación en la barra inferior, pulsando el icono de más opciones y seleccionando la opción \u003cb\u003eAgenda\u003c/b\u003e.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eDesde la vista del calendario se puede visualizar la información por mes y por semana. Si te encuentras en la vista por semana y deseas ver los eventos de un día puedes deslizarte verticalmente hacia arriba y hacia abajo. Si te deslizas hacia la derecha y la izquierda puedes ver tus eventos por semana. Para cambiar a la vista mensual, pulsa en la parte superior derecha de la pantalla y selecciona la opción \u0026ldquo;Mes\u0026rdquo;. Los eventos aparecerán como puntos y si los pulsas podrás ver más detalles de cada uno en el día seleccionado.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eCada vez que presiones en un evento o día que contenga eventos, se abrirá una ventana emergente para que puedas ver los detalles. Los exámenes se ven en color amarillo y los demás eventos en color verde.\n\u003cbr\u003e\n\nEn caso de que un evento haya finalizado se lo visualizará en formato transparente.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eSi deseas volver a la pantalla principal, pulsa la flecha \n\n\u003cimg src=\"navigate%20before.png\" alt=\"navigate before icon\" class=\"inlineIcon\"\u003e junto \u003cstrong\u003eAgenda\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/\" title=\"Navegar la aplicación\"\u003eNavegar la aplicación →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/\" title=\"Consultar historial de inscripciones a exámenes\"\u003eConsultar historial de inscripciones a exámenes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-notas/\" title=\"Consultar las últimas notas obtenidas\"\u003eConsultar las últimas notas obtenidas →\u003c/a\u003e\u003c/p\u003e\n"},{id:172,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/politicas-seguridad/consultar-canales-contacto/",title:"Consultar canales de contacto",description:null,content:"\u003cul\u003e\n\u003cli\u003eUbicación de los centros\u003c/li\u003e\n\u003cli\u003eComunicación por teléfono\u003c/li\u003e\n\u003cli\u003eConsulta Online\u003c/li\u003e\n\u003c/ul\u003e\n"},{id:173,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-carreras-e-historial-cursado/",title:"Consultar carreras e historial de cursado",description:null,content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla de inicio del portal de estudiantes.\u003c/li\u003e\n\u003cli\u003eEn la sección legajo de la pantalla verás el nombre y algunos detalles de la carrera en la que te has inscripto. Si estás inscripto en numerosas carreras puedes moverte entre ellas haciendo clic en la flecha \n\n\u003cimg src=\"navigate%20next.png\" alt=\"arrow icon\" class=\"inlineIcon\"\u003e. Cada carrera muestra, entre otros datos, la cantidad de materias aprobadas y el total de materias existentes en la carrera.\u003c/li\u003e\n\u003cli\u003eAdemás de esta información que puedes ver a simple vista, puedes acceder a más detalles haciendo clic en \u003cstrong\u003eHistorial\u003c/strong\u003e. En la pantalla se desplegará la sección materias que tiene tres pestañas relacionadas con sus estados: \u0026ldquo;Aprobadas\u0026rdquo;, \u0026ldquo;Pendientes\u0026rdquo; y \u0026ldquo;Regulares\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003ePuedes navegar por los estados de las materias y dentro de cada uno de los listados puedes hacer clic para ver más detalles de cada una de ellas.\u003c/li\u003e\n\u003cli\u003eDentro de cada materia se incluye una sección \u0026ldquo;Nota\u0026rdquo; que luego se subdivide por tipo de examen:  \u0026ldquo;Finales\u0026rdquo; o \u0026ldquo;Parciales\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003ePara volver a la pantalla principal del portal presiona la flecha \n\n\u003cimg src=\"navigate%20before.png\" alt=\"arrow icon\" class=\"inlineIcon\"\u003e ubicada en el extremo superior izquierdo junto a “Carreras”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/\" title=\"Consultar tu agenda académica\"\u003eConsultar tu agenda académica→\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-historial-inscripciones/\" title=\"Consultar historial de inscripción a exámenes\"\u003eConsultar historial de inscripción a exámenes →\u003c/a\u003e\u003c/p\u003e\n"},{id:174,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/cuenta/consultar-cuenta-asistente/",title:"Consultar el estado de la cuenta de un estudiante (asesor)",description:"Utiliza esta funcionalidad para consultar el detalle de los pagos que realizó un estudiante y sus correspondientes comprobantes y próximos vencimientos.",content:"\u003col\u003e\n\u003cli\u003eIngresa el DNI del estudiante y presiona \u003cstrong\u003eBuscar\u003c/strong\u003e. El sistema abrirá la aplicación de pagos electrónicos en una nueva pestaña en tu buscador.\u003c/li\u003e\n\u003cli\u003eEn la barra superior ingresa a la sección \u0026ldquo;Cuenta\u0026rdquo;. En la pantalla puedes ver todas las transacciones disponibles en un un período seleccionado.\u003c/li\u003e\n\u003cli\u003eHaz clic en cada registro para que puedas consultar más detalles.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eA continuación se detalla la información que puedes ver:\n\u003cbr\u003e\n\n- Saldo actual disponible\n\u003c/br\u003e\n\n- Cantidad de tickets próximos a vencerse\n\u003c/br\u003e\n\n- Todas las transacciones disponibles en un período definido\n\u003c/br\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eSi lo deseas puedes ver, descargar o imprimir los comprobantes asociados con los pagos.\u003c/li\u003e\n\u003cli\u003eUna vez que finalices puedes regresar a la pantalla de pagos electrónicos presionando el botón \u003cstrong\u003eVolver\u003c/strong\u003e. Para salir, presionar la \u0026ldquo;x\u0026rdquo; en la esquina superior derecha.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-asistente/\" title=\"Consultar el historial de pagos de un estudiante\"\u003eConsultar el historial de pagos de un estudiante →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-asistente/\" title=\"Cargar saldo a tu cuenta\"\u003eCargar saldo a la cuenta de un estudiante →\u003c/a\u003e\u003c/p\u003e\n"},{id:175,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/cuenta/consultar-cuenta-estudiante/",title:"Consultar el estado de tu cuenta",description:"Utiliza esta funcionalidad para consultar el detalle de los pagos que ya realizaste y sus correspondientes comprobantes y tus próximos vencimientos.",content:"\u003col\u003e\n\u003cli\u003eInicia sesión con tu usuario y credenciales en el portal de estudiante (web o app móvil).\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, selecciona el icono de examen \n\n\u003cimg src=\"receipt.png\" alt=\"payment icon\" class=\"inlineIcon\"\u003e. Este link te lleva la aplicación de pagos electrónicos en una nueva pestaña en tu buscador.\u003c/li\u003e\n\u003cli\u003eEn la barra superior ingresa a la sección \u0026ldquo;Cuenta\u0026rdquo;. En la pantalla puedes ver todas las transacciones disponibles en un un período seleccionado.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eA continuación se detalla la información que puedes ver:\n\u003cbr\u003e\n\n- Saldo actual disponible\n\u003c/br\u003e\n\n- Cantidad de tickets próximos a vencerse\n\u003c/br\u003e\n\n- Todas las transacciones disponibles en un período definido\n\u003c/br\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eSi lo deseas, en esta pantalla, puedes ver el comprobante de pago haciendo clic en el ícono de comprobante de cada registro de pago. Si fuera necesario, puedes imprimirlo o guardarlo.\u003c/li\u003e\n\u003cli\u003eUna vez que finalices puedes regresar a la pantalla de pagos electrónicos presionando el botón \u003cstrong\u003eVolver\u003c/strong\u003e. Para salir, presionar la \u0026ldquo;x\u0026rdquo; en la esquina superior derecha.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar el historial de pagos de tu cuenta\"\u003eConsultar tu historial de pagos →\u003c/a\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/cargar-saldo-estudiante/\" title=\"Cargar saldo a tu cuenta\"\u003eCargar saldo a tu cuenta →\u003c/a\u003e\n\u003c/br\u003e\u003c/p\u003e\n"},{id:176,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-historial-inscripciones-examenes/",title:"Consultar historial de inscripciones a exámenes",description:"Revisa los exámenes a los que te has inscripto.",content:"\u003col\u003e\n\u003cli\u003eInicia sesión en la aplicación usando tus credenciales de acceso.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación ubicado en la barra inferior, pulsa el icono \n\n\u003cimg src=\"exam%20icon.png\" alt=\"Botón \u0026#39;Examen\u0026#39;\" class=\"inlineImage\"\u003e. En la pantalla verás todas las \u0026ldquo;Inscripciones a exámenes\u0026rdquo; divididas en dos solapas: \u0026ldquo;Por rendir\u0026rdquo; e \u0026ldquo;Histórico\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eIngresa a la solapa \u0026ldquo;Histórico\u0026rdquo;. Aquí verás rápidamente todas las inscripciones a los exámenes finales que hayas realizado e incluso en los que luego estas inscripciones se anularon.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eCada registro de inscripción contiene datos tales como: tipo de examen, nombre de la materia, fecha, lugar, manera de rendir, anulaciones realizadas por estudiantes y reprogramaciones realizadas por personal de la universidad.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-historial-materias/\" title=\"Consultar historial de materias de la carrera\"\u003eConsultar historial de materias de la carrera →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-notas/\" title=\"Consultar las últimas notas obtenidas\"\u003eConsultar las últimas notas obtenidas →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/inscribirse-examen/\" title=\"Inscribirse a un examen\"\u003eInscribirse a un examen →\u003c/a\u003e\u003c/p\u003e\n"},{id:177,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/cursado/consultar-historial-materias/",title:"Consultar historial de materias de la carrera",description:null,content:"\u003col\u003e\n\u003cli\u003eInicia sesión con tu usuario y credenciales.\u003c/li\u003e\n\u003cli\u003eEn la sección con los datos de legajo y datos de tu carrera, pulsa \u003cstrong\u003eHistorial\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla verás la sección \u003cstrong\u003eMaterias\u003c/strong\u003e con un detalle de todas las materias vinculadas con la carrera en la que te encuentras separadas en tres solapas: \u0026ldquo;Pendientes\u0026rdquo;, \u0026ldquo;Cursando\u0026rdquo;, \u0026ldquo;Regulares\u0026rdquo;, \u0026ldquo;Aprobadas\u0026rdquo; y \u0026ldquo;Libres por nota\u0026rdquo;. Puedes recorrer las solapas deslizando tu dedo horizontalmente hacia la izquierda y la derecha.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi no puedes ver algunas de estas pestañas es porque no tienes materias en ese estado.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eSelecciona una materia de las diferentes solapas para ver un detalle de los exámenes \u0026ldquo;Finales\u0026rdquo; y \u0026ldquo;Parciales\u0026rdquo; y los \u0026ldquo;Trabajos prácticos\u0026rdquo; y las \u0026ldquo;Actividades prácticas integradoras\u0026rdquo; correspondientes a la materia.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eRecuerda que existen casos donde las materias solo disponen de parciales y finales y otros en los que las materias contienen exámenes parciales y finales, trabajos prácticos y actividades integradoras.\n\u003cbr\u003e\n\nEl color verde significa que la evaluación está \u003cb\u003eAPROBADA\u003c/b\u003e. El magenta significa que la evaluación se encuentra \u003cb\u003eDESAPROBADA\u003c/b\u003e.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/mas-opciones/navegar-app/\" title=\"Navegar la aplicación\"\u003eNavegar la aplicación →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-historial-inscripciones-examenes/\" title=\"Consultar historial de inscripciones a exámenes\"\u003eConsultar historial de inscripciones a exámenes →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-movil/examenes/consultar-notas/\" title=\"Consultar las últimas notas obtenidas\"\u003eConsultar las últimas notas obtenidas →\u003c/a\u003e\u003c/p\u003e\n"},{id:178,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/",title:"Consultar tu agenda académica",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa al portal de estudiantes con tus credenciales.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, en la parte inferior, haz clic en el ícono de más opciones \n\n\u003cimg src=\"more%20actions%20V.png\" alt=\"more actions vertical icon\" class=\"inlineIcon\"\u003e y selecciona la opción \u003cstrong\u003eAgenda\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eOtra forma de acceder a la agenda es desde la pantalla principal del portal, en la sección \"Próximos eventos\" haciendo clic en el botón \u003cb\u003eVER TODO\u003c/b\u003e.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"2\"\u003e\n\u003cli\u003eDesde el calendario se puede filtrar por tipo de evento desplegando las opciones del botón \u003cstrong\u003eTodos\u003c/strong\u003e. Éstos pueden hacer referencia a clases, exámenes, u otros eventos (marcados en color azul).\u003c/li\u003e\n\u003cli\u003eTambién puedes seleccionar para ver el calendario por “Semana” o “Mes” haciendo clic en la opción deseada. Usa las flechas  \n\n\u003cimg src=\"navigate%20before.png\" alt=\"arrow icon\" class=\"inlineIcon\"\u003e y \n\n\u003cimg src=\"navigate%20next.png\" alt=\"arrow icon\" class=\"inlineIcon\"\u003e ubicadas sobre el calendario para seleccionar mes y año.\u003c/li\u003e\n\u003cli\u003eHaz clic sobre una fecha en el calendario, en la pantalla se abrirá una ventana con los eventos correspondientes a la agenda académica de ese día. Dependiendo de la forma de visualización que elegiste la información se verá de manera diferente ya sea con puntos o con tarjetas con detalles.\u003c/li\u003e\n\u003cli\u003eSi lo deseas, puedes presionar el botón \u003cstrong\u003eHOY\u003c/strong\u003e para que se muestre el día actual en el calendario.\u003c/li\u003e\n\u003cli\u003ePara volver a la sección \u0026ldquo;Cursado\u0026rdquo;, presionar la flecha \n\n\u003cimg src=\"navigate%20before.png\" alt=\"arrow icon\" class=\"inlineIcon\"\u003eubicada en el extremo superior izquierdo junto a “Agenda\u0026quot;.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-carreras-e-historial-cursado/\" title=\"Consultar carreras e historial de cursado\"\u003eConsultar carreras e historial de cursado→\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-historial-inscripciones/\" title=\"Consultar historial de inscripción a exámenes\"\u003eConsultar historial de inscripción a exámenes →\u003c/a\u003e\u003c/p\u003e\n"},{id:179,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-otros-seminarios/",title:"Crear otros seminarios",description:"Cargar nuevos seminarios usando esta funcionalidad.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de signo más \u003cstrong\u003e+\u003c/strong\u003e ubicado en la parte inferior derecha de la pantalla. Se desplegarán cuatro opciones.\u003c/li\u003e\n\u003cli\u003eSelecciona la opción “Seminario común”.\u003c/li\u003e\n\u003cli\u003eEn el formulario “Crear seminario común”, completa los campos “Modalidad”, “Período”, “Subperíodo”, “Materia”, “Cátedra”, “Turno” y “Cupo”. Los campos marcados con asterisco son obligatorios. La mayoría de los campos son requeridos a excepción de “Docente”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi es la primera vez que creas un Seminario, verifica la información que debes incluir en cada uno de los siguientes campos:\n\u003cbr\u003e\n\n- En “Seminario” ingresa el código identificatorio de la cátedra.\n\u003cbr\u003e\n\n- En “Cupo” agrega la cantidad máxima de inscriptos permitida para dicha cátedra.\n\u003cbr\u003e\n\n- El botón “LMS” hace referencia a las clases que se dictan por medio de la plataforma online. Se muestra desactivado por defecto y no se puede cambiar por ser un seminario de práctica presencial.\n\u003cbr\u003e\n\n- En “Turno” selecciona el segmento del día en el que se van a dictar las clases.\n\u003cbr\u003e\n\n- En “Docente” escribe el nombre del titular de la cátedra.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn la sección “Carreras/Plan” a la derecha de la pantalla, indica el orden de apertura para cada carrera afectada por el seminario.\u003c/li\u003e\n\u003cli\u003eLuego, ve a la grilla del Calendario y haz clic en alguna celda.\u003c/li\u003e\n\u003cli\u003eLa ventana “Crear” se abrirá automáticamente. Completa los campos “Edificio”, “Aula”, “Hora de inicio” y “Hora de fin”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi deseas agregar una nueva clase el mismo día, seleccione el botón \u003cb\u003e+ Agregar horario\u003c/b\u003e. Si deseas eliminar alguno de los registros creados, presiona el ícono eliminar.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez que hayas ingresado todos los datos, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e en la ventana de creación.\u003c/li\u003e\n\u003cli\u003ePor último, el botón \u003cstrong\u003eGUARDAR\u003c/strong\u003e ubicado en la parte superior derecha de la pantalla se habilita cuando todos los campos están completos. Luego de presionar el botón, se desplegará un mensaje comunicando el éxito de la transacción en la parte inferior de la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl seminario común que acabas de crear se podrá ver en la grilla de la pantalla de búsqueda. Por defecto, se creará cerrado. Para poder abrir cualquier cátedra/seminario desde esta pantalla, usa el botón de encendido y apagado a al derecha del registro.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:180,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-seminario-experimenta/",title:"Crear un seminario Experimenta",description:"Usa esta funcionalidad para cargar nuevos seminarios Experimenta.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de signo más \u003cstrong\u003e+\u003c/strong\u003e ubicado en la parte inferior derecha de la pantalla. Se desplegarán cuatro opciones.\u003c/li\u003e\n\u003cli\u003eSelecciona la opción “Seminario Experimenta”.\u003c/li\u003e\n\u003cli\u003eEn el formulario “Crear seminario Experimenta”, completa los campos “Modalidad”, “Período”, “Subperíodo”, “Materia”, “Cátedra”, “Turno” y “Cupo”. Los campos marcados con asterisco son obligatorios. La mayoría de los campos son requeridos a excepción de “Docente”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi es la primera vez que creas un seminario Experimenta, verifica la información que debes incluir en cada uno de los siguientes campos:\n\u003cbr\u003e\n\n- En “Seminario Exp.” ingresa el número identificatorio de la cátedra.\n\u003cbr\u003e\n\n- En “Cupo” agrega la cantidad máxima de inscriptos permitida para dicha cátedra.\n\u003cbr\u003e\n\n- El botón “LMS” ) hace referencia a las clases que se dictan por medio de la plataforma online. Se muestra desactivado por defecto y no se puede cambiar ya que este es un seminario de práctica presencial.\n\u003cbr\u003e\n\n- En “Docente” escribe el nombre del titular de la cátedra.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn la sección “Carreras/Plan” a la derecha de la pantalla, indica el orden de apertura para cada carrera afectada por el seminario.\u003c/li\u003e\n\u003cli\u003eLuego, ve a la grilla del Calendario y haz clic en alguna celda.\u003c/li\u003e\n\u003cli\u003eLa ventana “Crear” se abrirá automáticamente. Completa los campos “Edificio”, “Aula”, “Hora de inicio” y “Hora de fin”.\u003c/li\u003e\n\u003cli\u003eUna vez que hayas ingresado todos los datos, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e en la ventana de creación.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara este tipo de seminario se deben seleccionar 5 fechas en las que se van a llevar a cabo los encuentros/clases. Si superas el número máximo de encuentros, se desplegará un mensaje notificándote esta situación.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003ePor último, el botón \u003cstrong\u003eGUARDAR\u003c/strong\u003e ubicado en la parte superior derecha de la pantalla se habilita cuando todos los campos están completos. Luego de presionar el botón, se desplegará un mensaje comunicando el éxito de la transacción en la parte inferior de la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl seminario Experimenta que acabas de crear se podrá ver en la grilla de la pantalla de búsqueda. Por defecto, se creará cerrado. Para poder abrir cualquier cátedra/seminario desde esta pantalla, usa el botón de encendido y apagado a al derecha del registro.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:181,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-catedra-presencial/",title:"Crear una cátedra presencial",description:"Usa esta funcionalidad para generar nuevas cátedras presenciales.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de signo más \u003cstrong\u003e+\u003c/strong\u003e ubicado en la parte inferior derecha de la pantalla. Se desplegarán cuatro opciones.\u003c/li\u003e\n\u003cli\u003eSelecciona la opción “Cátedra presencial”.\u003c/li\u003e\n\u003cli\u003eEn el formulario “Crear cátedra presencial”, completa los campos “Modalidad”, “Período”, “Subperíodo”, “Materia”, “Cátedra”, “Turno” y “Cupo”. Los campos marcados con asterisco son obligatorios. La mayoría de los campos son requeridos a excepción de “Docente”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi es la primera vez que creas una cátedra, verifica la información que debes incluir en cada uno de los siguientes campos:\n\u003cbr\u003e\n\n- En “Cátedra” ingresa el código identificatorio de la cátedra.\n\u003cbr\u003e\n\n- En “Cupo” agrega la cantidad máxima de inscriptos permitida para dicha cátedra.\n\u003cbr\u003e\n\n- El botón “LMS” hace referencia a las clases que se dictan por medio de la plataforma online. Se muestra activado por defecto. Si necesitas puedes desactivarlo.\n\u003cbr\u003e\n\n- En “Turno” selecciona el segmento del día en el que se van a dictar las clases.\n\u003cbr\u003e\n\n- En “Docente” escribe el nombre del titular de la cátedra.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn la sección “Carreras/Plan” a la derecha de la pantalla, indica el orden de apertura para cada carrera afectada por la cátedra.\u003c/li\u003e\n\u003cli\u003eLuego, ve al calendario con los días y horarios y haz clic en alguna celda.\u003c/li\u003e\n\u003cli\u003eLa ventana “Crear” se abrirá automáticamente. Completa los campos “Edificio”, “Aula”, “Hora de inicio” y “Hora de fin”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi deseas agregar una nueva clase el mismo día, seleccione el botón \u003cb\u003e+ Agregar horario\u003c/b\u003e. Si deseas eliminar alguno de los registros creados, presiona el ícono eliminar.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez que hayas ingresado todos los datos, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e en la ventana de creación.\u003c/li\u003e\n\u003cli\u003ePor último, el botón \u003cstrong\u003eGUARDAR\u003c/strong\u003e ubicado en la parte superior derecha de la pantalla se habilita cuando todos los campos están completos. Luego de presionar el botón, se desplegará un mensaje comunicando el éxito de la transacción en la parte inferior de la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa cátedra que acabas de crear se podrá ver en la grilla de la pantalla de búsqueda. Por defecto, la cátedra se creará cerrada. Para poder abrir cualquier cátedra desde esta pantalla, usa el botón de encendido y apagado a la derecha de la cátedra seleccionada.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:182,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/crear-catedra-virtual/",title:"Crear una cátedra virtual",description:"Usa esta funcionalidad para generar nuevas cátedras virtuales.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de signo más \u003cstrong\u003e+\u003c/strong\u003e ubicado en la parte inferior derecha de la pantalla. Se desplegarán cuatro opciones.\u003c/li\u003e\n\u003cli\u003eSelecciona la opción “Cátedra virtual”.\nEn el formulario “Crear cátedra virtual”, completa los campos “Modalidad”, “Período”, “Subperíodo”, “Materia”, “Cátedra”, “Turno” y “Cupo”. Los campos marcados con asterisco son obligatorios. La mayoría de los campos son requeridos a excepción de “Docente”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi es la primera vez que creas una cátedra, verifica la información que debes incluir en cada uno de los siguientes campos:\n\u003cbr\u003e\n\n- En “Cátedra” ingresa el código identificatorio de la cátedra.\n\u003cbr\u003e\n\n- En “Cupo” agrega la cantidad máxima de inscriptos permitida para dicha cátedra.\n\u003cbr\u003e\n\n- El botón “LMS” hace referencia a las clases que se dictan por medio de la plataforma online. En este caso particular el botón estará activado por defecto y no se podrá editar ya que este tipo de cátedra sólo se dicta de manera virtual.\n\u003cbr\u003e\n\n- En “Turno” selecciona el segmento del día en el que se van a dictar las clases.\n\u003cbr\u003e\n\n- En “Docente” escribe el nombre del titular de la cátedra.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn la sección “Carreras/Plan” a la derecha de la pantalla, indica el orden de apertura para cada carrera afectada por la cátedra.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa grilla del Calendario no se podrá modificar ya que este tipo de cátedra no requiere la carga de días y horarios.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003ePor último, el botón \u003cstrong\u003eGUARDAR\u003c/strong\u003e en la parte superior derecha de la pantalla se habilita cuando todos los campos están completos. Luego de presionar el botón, se desplegará un mensaje comunicando el éxito de la transacción en la parte inferior de la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa cátedra creada se podrá ver en la grilla de la pantalla de búsqueda. Por defecto, la cátedra se creará cerrada. Para poder abrir cualquier cátedra desde esta pantalla, use el botón de encendido y apagado a la derecha de la cátedra seleccionada. Un mensaje se abrirá para confirmar la acción.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:183,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/descargar-archivo-csv/",title:"Descargar archivo en formato CSV",description:"Obtén un reporte con el resumen de las cátedras.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, se encuentra el formulario de búsqueda. Ingresa los datos que deseas buscar e incluir en el archivo que vas a descargar.\u003c/li\u003e\n\u003cli\u003eEn la grilla de resultados, haz clic en el icono de descarga \n\n\u003cimg src=\"download%20file.png\" alt=\"downlead icon\" class=\"inlineIcon\"\u003e. Automáticamente se descargará un archivo .CSV con los datos de la búsqueda que se visualicen en la pantalla.\n\u003c/b\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi necesitas agregar más registros puedes modificar el valor de resultados por página y cuando obtengas los nuevos resultados descargar nuevamente el archivo.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:184,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/",title:"Editar cátedras",description:"Modifica la información de las cátedras usando esta herramienta.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eIngresa los datos necesarios para realizar la búsqueda de la materia y respectivas cátedras cuya información deseas modificar.\u003c/li\u003e\n\u003cli\u003eUna vez que el sistema muestre los resultados, haz clic en el registro que deseas editar. Se desplegará más información debajo del encabezado con el nombre y código de la materia/cátedra.\u003c/li\u003e\n\u003cli\u003ePresiona el icono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e para comenzar a realizar los cambios. La ventana “Editar cátedra presencial“ se abrirá. A continuación, puedes ver todos los detalles que se pueden editar en una cátedra.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eEn “Cupo” puedes modificar la capacidad de inscriptos a la cátedra.\u003c/li\u003e\n\u003cli\u003eEn “Docente” puedes agregar/cambiar al docente titular de la cátedra.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl resto de los campos solo se pueden ver y no son editables.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn la sección “Carreras/Plan” puedes ver las carreras disponibles para la cátedra que estás editando. A la derecha de este dato hay un campo editable para que indiques el orden de apertura.\u003c/li\u003e\n\u003cli\u003eEn el calendario, selecciona un evento/clase ya creado cuya información deseas editar o haz click en el calendario directamente para crear uno nuevo. El formulario de edición se abrirá. Si al editar el sistema detecta que hay una superposición, se desplegará un mensaje en la pantalla.\u003c/li\u003e\n\u003cli\u003eEn las ventanas \u0026ldquo;Crear\u0026rdquo; o \u0026ldquo;Editar\u0026rdquo; realiza los cambios que desees en los campos: “Edificio”, “Aula”, “Hora de inicio” y “Hora de fin”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEl campo “Capacidad” se encuentra protegido y no se puede editar ya que muestra la capacidad del aula seleccionada.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eCuando termines de realizar todos los cambios, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003ePor último, una vez que hayas finalizado con la edición, haz clic en el botón \u003cstrong\u003eGUARDAR\u003c/strong\u003e ubicado en la esquina superior derecha de la ventana.\u003c/li\u003e\n\u003cli\u003eSi fuese necesario, puedes habilitar o inhabilitar los planes de estudio asociados a la cátedra. Para realizar cambios deberás presionar el ícono de lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e que se encuentra a la izquierda de los planes de estudios en la grilla. Por lo general, los datos relacionados con los planes de estudios habilitados se cargan cuando se migra la información de las cátedras.\u003c/li\u003e\n\u003cli\u003ePor último, si deseas eliminar una cátedra creada puedes presionar el ícono relacionado \n\n\u003cimg src=\"delete.png\" alt=\"delete icon\" class=\"inlineIcon\"\u003e.\n\u003c/b\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cstrong\u003eVéase también\u003c/strong\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:185,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/editar-facturacion/editar-contacto/",title:"Editar facturación",description:"Acá va una descripción...",content:"\u003cp\u003eEl botón “Editar” permite asociar un nuevo contacto.\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresar en “Asociar nuevo contacto”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eIngresar un CUIT para asociar\u003c/li\u003e\n\u003cli\u003eBuscar el CUIT ingresado\u003c/li\u003e\n\u003cli\u003eMensaje para el CUIT ingresado\u003c/li\u003e\n\u003cli\u003eSalir de la pantalla de búsqueda de empresa para asociar a la facturación\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"2\"\u003e\n\u003cli\u003eSi se ingresa un CUIT incorrecto se obtiene un error que indica que el CUIT ingresado es incorrecto.\u003c/li\u003e\n\u003cli\u003eSi se ingresa un CUIT correcto, podrás hacer lo siguiente:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eSeleccionar la empresa\u003c/li\u003e\n\u003cli\u003eAsociar la empresa seleccionada\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eAl ingresar “Asociar” podré registrar mi nuevo contacto de Facturación. Al completar los datos y presionar “Crear Contacto”.\u003c/li\u003e\n\u003cli\u003eLa empresa ingresada quedará dentro de mis contactos de facturación.\u003c/li\u003e\n\u003cli\u003ePosteriormente podré asociar mi nuevo contacto de facturación.\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:186,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/editar-promos/",title:"Editar promociones comerciales",description:"Con esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets.",content:"\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEstas acciones pueden realizarse desde la pantalla de búsqueda de promociones o desde la pantalla de consulta de tickets pendientes de pago mediante el icono de lápiz. Ve a los artículos relacionados al final de este documento.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono \n\n\u003cimg src=\"price.png\" alt=\"price tag icon\" class=\"inlineIcon\"\u003e para acceder a la pantalla \u0026ldquo;Promociones comerciales\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior puedes ingresar los datos de la promoción que deseas editar.\u003c/li\u003e\n\u003cli\u003eEn la grilla con los resultados de la búsqueda, presiona el lápiz \n\n\u003cimg src=\"edit.png\" alt=\"edit icon\" class=\"inlineIcon\"\u003e en la promoción deseada para acceder a la ventana de edición.\u003c/li\u003e\n\u003cli\u003eRealiza los cambios que sean necesarios.\u003c/li\u003e\n\u003cli\u003eCuando hayas finalizado, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/crear-promos/\" title=\"Crear promociones comerciales\"\u003eCrear promociones comerciales →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/buscar-promos/\" title=\"Buscar promociones comerciales\"\u003eBuscar promociones comerciales →\u003c/a\u003e\u003c/p\u003e\n"},{id:187,href:"https://bitlogic.github.io/doks-algarrobo/docs/examenes/configuracion/gestionar-enunciados/",title:"Gestionar enunciados",description:null,content:"\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa herramienta de gestión de exámenes no permite agregar ni editar información a nivel de programas o contenidos. Estos datos y algunos enunciados relacionados se importan desde otro software o base de datos de la organización educativa. Desde aquí sólo se puede realizar la edición, creación y aprobación de preguntas o enunciados.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eAccede a la herramienta haciendo clic en el ícono de lupa \n\n\u003cimg src=\"search.png\" alt=\"search icon\" class=\"inlineIcon\"\u003e ubicado en panel de navegación lateral.\u003c/li\u003e\n\u003cli\u003eIngresa el código o nombre de la materia cuyo contenido deseas ver.\u003c/li\u003e\n\u003cli\u003ePresiona \u003cstrong\u003eBuscar\u003c/strong\u003e. Los resultados se muestran en la sección “Seleccionar materia”.\u003c/li\u003e\n\u003cli\u003eHaz clic en la materia cuyos enunciados deseas ver o editar. A la derecha se muestran los programas relacionados en sus diferentes estados (activos e inactivos).\u003c/li\u003e\n\u003cli\u003eEn la grilla de resultados, desplázate con la barra inferior hacia la derecha y presiona el ícono de ojo \n\n\u003cimg src=\"eye.png\" alt=\"eye icon\" class=\"inlineIcon\"\u003e para ver los enunciados en aquellos programas que se encuentren activos.\u003c/li\u003e\n\u003cli\u003eEn la pantalla “Gestión de evaluaciones”, usa las flechas para desplegar el contenido de la materia (unidad, tema y subtema).\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSolo podrán realizar las acciones de editar y crear nuevos enunciados (preguntas) quienes tengan el perfil requerido para tales acciones.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eHaz clic en el icono de signo más \n\n\u003cimg src=\"plus.png\" alt=\"plus icon\" class=\"inlineIcon\"\u003e para crear un nuevo enunciado. El formulario contiene 5 secciones.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl presionar el icono de lápiz puedes editar la misma información para aquellos enunciados que se hayan guardado anteriormente. Recuerda que si editas un enunciado que ya se encuentra incluído en un examen generado, deberás hacerlo con anticipación.Cuando esto suceda, el sistema te alertará de esta situación.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cp\u003eA continuación se detallan la secciones y la información que puede cargar en ellas:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eCaracterísticas\u003c/strong\u003e: selecciona los valores de los combos desplegables de los campos “Tipo de enunciado” (verdadero/falso o selección múltiple), “Dificultad” (se debe seleccionar alguno de los valores que indican el grado de dificultad), “Tiempo de resolución en minutos” (se incluyen diferentes opciones en minutos según la dificultad “Para aplicar a”, “Evalúa” (qué tipo de contenido o competencia evalúa la pregunta).\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eEnunciados\u003c/strong\u003e: en esta sección se puede redactar el enunciado utilizando texto enriquecido, imágenes (formato jpg) links, etc.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eRespuestas\u003c/strong\u003e: en esta sección se deben registrar la cantidad de opciones que se quieran proveer al estudiante. En el casillero de selección marca la o las respuestas correcta/s.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUsa el botón 'Agregar opción' y el ícono correspondiente para eliminar la/s acción/es que estén de más. Las respuestas al igual que los enunciados cuentan con la opción de crear texto enriquecido, cargar imágenes, etc.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eJustificación\u003c/strong\u003e: aquí se debe redactar la justificación de la respuesta correcta.\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003ePor último, una vez que hayas ingresado todo el contenido del enunciado presiona el botón \u003cstrong\u003eGUARDAR\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eUna vez que el enunciado se guarde, se muestra una pantalla de previsualización y validación del enunciado.\u003c/li\u003e\n\u003cli\u003eUna persona con el rol correspondiente podrá seleccionar el estado de la validación y el motivo del cambio de estado. Dependiendo de la organización, puede haber un rol o dos asignados a una o más personas a cargo de la revisión técnica y académica.\u003c/li\u003e\n\u003cli\u003eUna vez que se hayan validado los datos, presiona \u003cstrong\u003eGUARDAR\u003c/strong\u003e nuevamente.\u003c/li\u003e\n\u003cli\u003eEn la pantalla de contenido del programa se verá el nuevo enunciado que se creó.\u003c/li\u003e\n\u003cli\u003eSi el enunciado no se encuentra en estado aprobado y requiere una nueva revisión, selecciónalo y haz clic en el icono de ojo \n\n\u003cimg src=\"eye.png\" alt=\"eye icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003cli\u003eLa misma u otra persona con los permisos correspondientes, puede realizar una segunda revisión del enunciado.\u003c/li\u003e\n\u003cli\u003ePor último, guarda los cambios presionando el botón \u003cstrong\u003eGUARDAR\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eRecuerda que únicamente se encuentran disponibles para incluir en la configuración de tipos de exámenes aquellos enunciados cuyo estado es 'Aprobado'.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la grilla con los enunciados relacionados con cada programa también puedes realizar las siguientes acciones mediante los siguientes iconos.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/br\u003e\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eBuscar\u003c/strong\u003e \n\n\u003cimg src=\"search.png\" alt=\"search icon\" class=\"inlineIcon\"\u003e: esta opción habilita un campo de texto que busca los datos en las diferentes columnas.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eVer columnas\u003c/strong\u003e \n\n\u003cimg src=\"see%20columns.png\" alt=\"see columns icon\" class=\"inlineIcon\"\u003e: se abre un menú contextual con un selector de columnas para elegir qué información ver en la grilla.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eTabla de filtros\u003c/strong\u003e \n\n\u003cimg src=\"filter%20list.png\" alt=\"filter list icon\" class=\"inlineIcon\"\u003e: sirve para definir ciertos parámetros que acoten la búsqueda. Es una herramienta para una búsqueda avanzada y específica.\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/examenes/configuracion/crear-tipo-examen/\" title=\"Configurar un tipo de examen\"\u003eConfigurar un tipo de examen →\u003c/a\u003e\u003c/p\u003e\n"},{id:188,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-periodos/gestionar-periodos/",title:"Habilitar inscripciones",description:"Habilita las cátedras de manera masiva para que los estudiantes puedan inscribirse.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Habilitación de inscripciones\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"calendar.png\" alt=\"calendar icon\" class=\"inlineIcon\"\u003e en el panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, verás el formulario de búsqueda. Completa los campos \u0026ldquo;Modalidad\u0026rdquo;, \u0026ldquo;Período\u0026rdquo; y \u0026ldquo;Subperíodo\u0026rdquo; que corresponden con las cátedras que deseas habilitar masivamente.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePuedes seleccionar más de un valor para los campos si lo deseas.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eHaz clic en \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLos resultados se verán en la grilla. Aquí puedes ver el detalle la cantidad de cátedras, seminarios, seminarios Experimenta y cátedras virtuales que se relacionan con esa modalidad, período y subperíodo que se encuentran disponibles para que se habiliten y los estudiantes comiencen a inscribirse.\u003c/li\u003e\n\u003cli\u003ePresiona el botón \u003cstrong\u003eAbrir\u003c/strong\u003e para realizar la habilitación masiva de cátedras para este período. Un mensaje de confirmación se abrirá indicando la cantidad de cátedras que abrirás.\u003c/li\u003e\n\u003cli\u003eHaz clic en \u003cstrong\u003eConfirmar\u003c/strong\u003e para finalizar con esta acción.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi lo deseas, puedes descargar dos informes con datos de las cátedras que estás a punto de habilitar haciendo clic en el icono de reportes del panel de navegación. Puedes ver más detalle sobre esta acción el artículo relacionado en la sección **Véase también**.\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/obtener-reportes/\" title=\"Obtener reportes de cátedras\"\u003eObtener reportes de cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:189,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-historial-inscripciones/",title:"Historial de inscripciones a exámenes",description:null,content:"\u003col\u003e\n\u003cli\u003ePara ver información relacionada con tus exámenes, ingresa al portal de estudiantes con tus credenciales.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, selecciona el icono de examen \n\n\u003cimg src=\"exam%20icon.png\" alt=\"exam icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003cli\u003eLa pantalla de \u0026ldquo;Exámenes\u0026rdquo; se abrirá.\u003c/li\u003e\n\u003cli\u003eEn la sección “Inscripción a exámenes” se incluyen dos solapas:\n\u003c/b\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\n\u003cp\u003e\u003cstrong\u003e“Por rendir”\u003c/strong\u003e: aquí verás el detalle de aquellos exámenes en los que te has inscripto y que deberás rendir próximamente. En cada examen puedes ver información sobre el tipo de examen, la fecha y horario, el lugar, etc.\n\u003c/b\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003e\u003cstrong\u003e“Histórico”\u003c/strong\u003e: en esta sección se incluyen aquellos exámenes has rendido o aquellos que por algún motivo se anularon. En la información que se brinda en cada tarjeta del examen puedes ver a simple vista sus detalles.\n\u003c/b\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003ePara anular una inscripción, haz clic en el icono de más opciones \n\n\u003cimg src=\"more%20actions%20V.png\" alt=\"more actions icon\" class=\"inlineIcon\"\u003e y presiona “Anular pedido”. Si la operación es exitosa se mostrará un mensaje de confirmación.\u003c/li\u003e\n\u003cli\u003ePara volver a la sección “Cursado”, presiona \n\n\u003cimg src=\"navigate%20before.png\" alt=\"navigate icon\" class=\"inlineIcon\"\u003e en el extremo superior izquierdo.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/\" title=\"Consultar tu agenda académica\"\u003eConsultar tu agenda académica→\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/examenes/inscripcion-examen/\" title=\"Inscribirse a un examen\"\u003eInscribirse a un examen →\u003c/a\u003e\u003c/p\u003e\n"},{id:190,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/importar-catedras/importador-de-catedras/",title:"Importar cátedras",description:"Carga datos de cátedras de manera masiva.",content:"\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara poder migrar masivamente la información de cátedras usando esta herramienta, primero debes tener disponible el archivo que se usa como plantilla de importación y que se entrega cuando el planificador está disponible en el entorno de producción. Una vez que tengas la planilla completa con los datos que se incluyen al final de este documento, la deberás guardar de manera local.\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003ePara comenzar, en el panel de navegación selecciona el icono de almacenamiento en la nube \n\n\u003cimg src=\"cloud%20upload.png\" alt=\"upload icon\" class=\"inlineIcon\"\u003e para acceder a la pantalla \u0026ldquo;Importación de cátedras\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003eSubir archivos\u003c/strong\u003e ubicado en el centro de la pantalla para cargar la plantilla con los datos de las cátedras que deseas cargar.\u003c/li\u003e\n\u003cli\u003eLa ventana para seleccionar la plantilla desde el disco local se abrirá. Elige el archivo y haz clic en abrir.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eTambién puedes cargar el archivo arrastrándolo y soltándolo dentro de la ventana del importador.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi la planilla ya existe se mostrará el siguiente mensajes: “El archivo que deseas subir ya existe. Intenta nuevamente modificando y guardando los cambios o subiendo otro archivo”. Esta funcionalidad también valida que se suba únicamente un archivo.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eEl primer paso del proceso de importación de datos es el \u003cstrong\u003eAnálisis de importación\u003c/strong\u003e. En esta instancia se verifica que la planilla no contenga errores u omisión de datos requeridos.\u003c/li\u003e\n\u003cli\u003eSi existe alguna inconsistencia en los datos, el proceso de importación se detiene en la etapa 2 \u003cstrong\u003eDetalle del análisis\u003c/strong\u003e. El sistema ofrece la opción de descargar un reporte con los errores dónde se incluyen detalles de las filas y columnas con su tipo de error. También se muestra un mensaje con la cantidad de errores en la parte superior de la pantalla.\u003c/li\u003e\n\u003cli\u003eSi en esta etapa no se encuentran errores, puedes ver en la pantalla la cantidad de cátedras/seminarios analizados. Si lo deseas, puedes descargar este informe haciendo clic en el ícono de descarga.\u003c/li\u003e\n\u003cli\u003eSi la plantilla no contiene errores o inconsistencias en los datos, en el paso “Detalle del análisis” se habilita el botón \u003cstrong\u003eCargar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eCuando los datos se comienzan a cargar, se inicia el proceso de importación de datos.\u003c/li\u003e\n\u003cli\u003eAl finalizar, se abrirá una ventana con un mensaje que confirma que la importación se realizó con éxito. Si se detectan errores, al igual que en el análisis, se indica cuántas cátedras se procesaron correctamente y cuantos errores hubo. También se genera un reporte detallado de errores disponible para descargar.\u003c/li\u003e\n\u003cli\u003eHaz clic en \u003cstrong\u003eVer resumen\u003c/strong\u003e para controlar el total de cátedras/seminarios que se cargaron.\u003c/li\u003e\n\u003cli\u003eEn el paso 4 “Reporte de creación”, el sistema indica que la importación se completó. Si quieres, puedes presionar el botón \u003cstrong\u003eVolver a gestión\u003c/strong\u003e para regresar a la pantalla principal del planificador. Las cátedras/seminarios ya son parte del sistema y puedes cargar filtros en el buscador para verlos en la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"formato-de-la-planilla-de-importación\"\u003eFormato de la planilla de importación\u003c/h3\u003e\n\u003cp\u003eEl importador analiza el contenido de la planilla cargada. Por este motivo es importante tener en cuenta las siguientes especificaciones sobre el archivo .xls:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eEl nombre de la hoja que contenga la información de las cátedras a importar debe ser “AULERO”, evitando incluir datos como el año o período.\u003c/li\u003e\n\u003cli\u003eLos datos que se agreguen manualmente al archivo deben coincidir con los nombres que figuran en la base de datos. Por ejemplo, si en la base de datos figura como “CURSADO MODALIDAD PRESENCIAL 2-20”, se debe asegurar que el nombre en la plantilla se exactamente igual.\u003c/li\u003e\n\u003cli\u003eLa modalidad debe ser P, P. o PH. Actualmente viene como MP 1.\u003c/li\u003e\n\u003cli\u003eLa combinación de modalidad y sede debe ser correcta.\u003c/li\u003e\n\u003cli\u003eEl aula debe pertenecer al edificio seleccionado.\u003c/li\u003e\n\u003cli\u003eLa hora de fin de un módulo debe ser mayor a la hora de inicio.\u003c/li\u003e\n\u003cli\u003eLas semanas de los encuentros Experimenta deben estar dentro del rango de fechas del subperíodo seleccionado.\u003c/li\u003e\n\u003cli\u003eEl plan de estudio (currículo) no puede estar vacío cuando la importación es para una modalidad a distancia.\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch4 id=\"datos-requeridos-para-la-carga-de-datos\"\u003eDatos requeridos para la carga de datos:\u003c/h4\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003eNombre de la columna\u003c/th\u003e\n\u003cth\u003eDescripción\u003c/th\u003e\n\u003cth\u003eEjemplos\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eSede\u003c/td\u003e\n\u003ctd\u003eLugar específico en donde se cursa una modalidad\u003c/td\u003e\n\u003ctd\u003eSC\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eSubperíodo\u003c/td\u003e\n\u003ctd\u003eSubdivisión de un período académico\u003c/td\u003e\n\u003ctd\u003ePeríodo Académico 1-21 A - Marzo -Mayo 2021, Cursado cuatrimestral 1/22\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eModalidad\u003c/td\u003e\n\u003ctd\u003eModalidad de cursado\u003c/td\u003e\n\u003ctd\u003ePH, P\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eEdificio\u003c/td\u003e\n\u003ctd\u003eEspacio físico en donde se dictarán las clases/encuentros\u003c/td\u003e\n\u003ctd\u003eNVA. CBA, EXPERIMENTA 21, ARCOR\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eSala\u003c/td\u003e\n\u003ctd\u003eNombre del aula/sala\u003c/td\u003e\n\u003ctd\u003eNC 409, LAB- 7.2, L-SOF 5\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eJornada\u003c/td\u003e\n\u003ctd\u003eTurno de cursado\u003c/td\u003e\n\u003ctd\u003eM, T, N\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eDía\u003c/td\u003e\n\u003ctd\u003eDía de la semana en el que se agenda la clase/encuentro\u003c/td\u003e\n\u003ctd\u003eLUNES, MARTES, MIÉRCOLES\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eCarrera\u003c/td\u003e\n\u003ctd\u003eCódigo interno de la carrera\u003c/td\u003e\n\u003ctd\u003eCPB, AAG, AYE, SIS\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eComponente\u003c/td\u003e\n\u003ctd\u003eHace referencia al código utilizado para los tipos de cátedras y seminarios existentes\u003c/td\u003e\n\u003ctd\u003eCAT, SEM, SEM-EXP\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eCódigo asignatura\u003c/td\u003e\n\u003ctd\u003eCódigo interno de la materia\u003c/td\u003e\n\u003ctd\u003eADO204, ECO204, INF243, DER324\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eCAT/SEM\u003c/td\u003e\n\u003ctd\u003eCódigo identificador de cada cátedra/seminario\u003c/td\u003e\n\u003ctd\u003eAA, CM, 22, 45\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eProfesor código\u003c/td\u003e\n\u003ctd\u003eCódigo identificador del titular de la cátedra/seminario\u003c/td\u003e\n\u003ctd\u003e99999999\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eCupo\u003c/td\u003e\n\u003ctd\u003eMáximo de estudiantes permitido\u003c/td\u003e\n\u003ctd\u003e42\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eCurrículo\u003c/td\u003e\n\u003ctd\u003ePlan de estudio de la carrera\u003c/td\u003e\n\u003ctd\u003e7, 20, 6, 18\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eSemanas Experimenta\u003c/td\u003e\n\u003ctd\u003eSemanas del subperíodo en las que se producen los encuentros\u003c/td\u003e\n\u003ctd\u003e2,4,6,8,9\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eApertura\u003c/td\u003e\n\u003ctd\u003eOrden de apertura de la cátedra/seminario a crear\u003c/td\u003e\n\u003ctd\u003e1, 2, 3, 4\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eNum eventos\u003c/td\u003e\n\u003ctd\u003ePara completar este campo se deben tener en cuenta las consideraciones* que se incluyen más abajo\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eHorario inicio\u003c/td\u003e\n\u003ctd\u003eHora de inicio de la clase/encuentro\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eHora fin\u003c/td\u003e\n\u003ctd\u003eHora de finalización de la clase/encuentro\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003chr\u003e\n\u003cp\u003e\u003cem\u003eInformación exclusiva de la Universidad Siglo 21\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e*Consideraciones: recuerda que la duración de un módulo se define por la cantidad de eventos (horas cátedras) que lo componen. Cada evento tiene una duración de 40 minutos. Por ejemplo, un módulo compuesto por 2 eventos tendrá una duración de 80 minutos. Los módulos deben ser de 120 minutos como máximo. Por tal motivo, si fuese necesario que una cátedra tenga 4 eventos, se deberán crear 2 módulos con dos eventos cada uno.\nEn la grilla se puede definir esta información de manera numérica usando los siguientes valores:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e1, 2 y 3 eventos (\u0026lt;=3 eventos) corresponden a 1 Módulo (sin recreo).\u003c/li\u003e\n\u003cli\u003e4 y 5 eventos (\u0026gt;3 eventos \u0026lt;6) se deben dividir en 2 Módulos (con posibilidad de un recreo intermedio dependiendo de los horarios).\u003c/li\u003e\n\u003cli\u003e6 o más eventos (\u0026gt;=6 eventos) se deben dividir en 3 Módulos (con posibilidad de recreo intermedio dependiendo de los horarios en la base).\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/editar-catedras/\" title=\"Editar cátedras\"\u003eEditar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:191,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/inscripcion-ingresantes/carreras-grado-presencial/",title:"Inscribir ingresantes en carreras de grado con modalidad presencial",description:"Suma a nuevos estudiantes a carreras de modalidad presencial.",content:"\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003e El ejemplo de admisión que se menciona en este documento es para la inscripción de un estudiante interesado en cursar el tipo de carrera \u003cb\u003eGrado\u003c/b\u003e para la modalidad \u003cb\u003ePresencial\u003c/b\u003e. Las pantallas de admisión cambian si otras son las elecciones.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eEn el portal de admisiones, comienza a completar el formulario con los datos de preinscripción a la carrera:\n\u003c/b\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u0026ldquo;Carrera\u0026rdquo;: cuando la carrera es de grado se solicitarán los datos del referido.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Modalidad\u0026rdquo;: los valores disponibles dependerán de la carrera seleccionada. Para la inscripción de modalidad presencial se solicitarán los datos del secundario del estudiante.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Turno\u0026rdquo;: el turno dependerá de la carrera y la modalidad seleccionada.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Sede/CAU\u0026rdquo;: aquí debes colocar el lugar dónde estudiante desea completar sus estudios.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Fecha de inicio de cursado\u0026rdquo;: dependerá de los datos seleccionados con anterioridad.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Paquete\u0026rdquo;: selecciona el paquete basado en los datos de la carrera.\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"2\"\u003e\n\u003cli\u003eUna vez que hayas completado todos los campos, haz clic en \u003cstrong\u003eSiguiente\u003c/strong\u003e. La pantalla \u0026ldquo;Datos particulares del estudiante\u0026rdquo; se habilitará.\u003c/li\u003e\n\u003cli\u003eEn esta pantalla podrás registrar toda la información general del estudiante.\u003c/li\u003e\n\u003cli\u003ePresiona \u003cstrong\u003eSiguiente\u003c/strong\u003e para continuar con el proceso de admisión. La pantalla de \u0026ldquo;Datos de estudios secundarios\u0026rdquo; se desplegará. A continuación, se listan algunos de los campos para completar si suponemos que se el asesor comercial está inscribiendo a una persona para una carrera de grado de modalidad presencial:\n\u003c/b\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u0026ldquo;Localidad\u0026rdquo;: lugar dónde el estudiante cursó el nivel medio.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Institución\u0026rdquo;: el nombre del centro educativo dónde se graduó.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Título\u0026rdquo;: el nombre del diploma que el estudiante obtuvo al egresar del nivel medio.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Fecha de egreso\u0026rdquo;: fecha en la que se finalizaron los estudios secundarios.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Promedio\u0026rdquo;: calificación promedio obtenida en base a los resultados de los exámenes.\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eUna vez finalizados los datos de la vida académica del estudiante, haz clic en \u003cstrong\u003eSiguiente\u003c/strong\u003e para continuar. Se habilitará la pantalla \u0026ldquo;Domicilios”.\u003c/li\u003e\n\u003cli\u003eAquí puedes registrar y editar varios domicilios del estudiante. Si deseas agregar uno nuevo, presiona el botón con el mismo nombre.\u003c/li\u003e\n\u003cli\u003eCuando termines de cargar los datos, selecciona \u003cstrong\u003eSiguiente\u003c/strong\u003e. La sección “Referidos” de la admisión se verá en la pantalla.\u003c/li\u003e\n\u003cli\u003eEn esta sección puedes ingresar los datos de un referido para comenzar con su búsqueda. Cuando los referidos se asocian, ambos pueden obtener beneficios. Se pueden filtrar los datos por:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u0026ldquo;Nombre\u0026rdquo; y \u0026ldquo;Apellido\u0026rdquo; completos,\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Número de documento\u0026rdquo;, y\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Número de legajo\u0026rdquo;\nCuando hayas completado los datos, presiona \u003cstrong\u003eBuscar\u003c/strong\u003e.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl buscar un referido, puedes obtener las siguientes alertas en la pantalla:\n\n\u003cbr\u003e\n\n- El referido no posee una matrícula vigente. Esta condición no permitirá que se pueda seleccionar como referido.\n\u003cbr\u003e\n\n- El referido pertenece a una modalidad diferente a la persona cuya admisión se está completando. Esta condición lo inhabilita como referido.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez que se visualice en la pantalla al referido que cumpla con los requisitos, selecciónelo y presione \u003cstrong\u003eSiguiente\u003c/strong\u003e para pasar a la siguiente sección.\u003c/li\u003e\n\u003cli\u003eEn la pantalla \u0026ldquo;Resumen\u0026rdquo; podrás ver todos los datos que se cargaron desde la primer pantalla para que verifiques la información que has ingresado. Si tuvieses que realizar algunos cambios, agregar o borrar información puedes hacerlo dirigiéndote a cada una de las pantallas haciendo clic en el panel navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eUna vez que hayas corroborado todos los datos, haz click en \u003cstrong\u003eConfirmar\u003c/strong\u003e. Un mensaje te confirmará que la acción fue exitosa y se mostrará todos los detalles de la inscripción en la pantalla.\u003c/li\u003e\n\u003cli\u003ePor último, selecciona \u003cstrong\u003eFinalizar\u003c/strong\u003e. El sistema volverá a mostrar la primer pantalla para comenzar nuevamente con la inscripción de un nuevo ingresante.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUna vez que el asesor generó el usuario podrá brindarle al estudiante la posibilidad de registrarse en el portal de autogestión o de descargarse la aplicación móvil. Allí podrá ver los tickets que tiene pendiente de pago para completar su inscripción a una carrera y realizar muchas acciones más.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/inscripcion-ingresantes/carreras-otras-modalidades/\" title=\"Inscribir ingresantes en otras carreras de otras modalidades\"\u003eInscribir ingresantes en otras carreras de otras modalidades →\u003c/a\u003e\u003c/p\u003e\n"},{id:192,href:"https://bitlogic.github.io/doks-algarrobo/docs/admision/inscripcion-ingresantes/carreras-otras-modalidades/",title:"Inscribir ingresantes en otras carreras de otras modalidades",description:null,content:"\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003e El ejemplo de admisión que se menciona en este documento es para la inscripción de un estudiante interesado en cursar el tipo de carrera \u003cb\u003eLicenciatura\u003c/b\u003e para la modalidad \u003cb\u003eDistancia Ed-Home\u003c/b\u003e. Las pantallas de admisión cambian si otras son las elecciones.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eEn el portal de admisiones, comienza a completar el formulario con los datos de preinscripción a la carrera:\n\u003c/b\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u0026ldquo;Carrera\u0026rdquo;: cuando la carrera es de grado se solicitarán los datos del referido.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Modalidad\u0026rdquo;: los valores disponibles dependerán de la carrera seleccionada. Para la inscripción de modalidad presencial se solicitarán los datos del secundario del estudiante.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Turno\u0026rdquo;: el turno dependerá de la carrera y la modalidad seleccionada.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Sede/CAU\u0026rdquo;: aquí debes colocar el lugar dónde estudiante desea completar sus estudios.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Fecha de inicio de cursado\u0026rdquo;: dependerá de los datos seleccionados con anterioridad.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Paquete\u0026rdquo;: selecciona el paquete basado en los datos de la carrera.\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"2\"\u003e\n\u003cli\u003eUna vez que hayas completado todos los campos, haz clic en \u003cstrong\u003eSiguiente\u003c/strong\u003e. La pantalla \u0026ldquo;Datos particulares del estudiante\u0026rdquo; se habilitará.\u003c/li\u003e\n\u003cli\u003eEn esta pantalla podrás registrar toda la información general del estudiante.\u003c/li\u003e\n\u003cli\u003ePresiona \u003cstrong\u003eSiguiente\u003c/strong\u003e para continuar con el proceso de admisión. La pantalla de \u0026ldquo;Datos de estudios secundarios\u0026rdquo; se desplegará. A continuación, se listan algunos de los campos para completar si suponemos que se el asesor comercial está inscribiendo a una persona para una carrera de grado de modalidad Distancia Ed-Home:\n\u003c/b\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u0026ldquo;Localidad\u0026rdquo;: lugar dónde el estudiante cursó el nivel medio.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Institución\u0026rdquo;: el nombre del centro educativo dónde se graduó.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Título\u0026rdquo;: el nombre del diploma que el estudiante obtuvo al egresar del nivel medio.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Fecha de egreso\u0026rdquo;: fecha en la que se finalizaron los estudios secundarios.\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Promedio\u0026rdquo;: calificación promedio obtenida en base a los resultados de los exámenes.\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eUna vez finalizados los datos de la vida académica del estudiantes, haz clic en \u003cstrong\u003eSiguiente\u003c/strong\u003e para continuar. Se habilitará la pantalla \u0026ldquo;Domicilios”.\u003c/li\u003e\n\u003cli\u003eAquí puedes registrar y editar varios domicilios del estudiante. Si deseas agregar uno nuevo, presiona el botón con el mismo nombre.\u003c/li\u003e\n\u003cli\u003eCuando termines de cargar los datos, selecciona \u003cstrong\u003eSiguiente\u003c/strong\u003e. La sección “Referidos” de la admisión se verá en la pantalla.\u003c/li\u003e\n\u003cli\u003eEn esta sección puedes ingresar los datos de un referido para comenzar con su búsqueda. Cuando los referidos se asocian, ambos pueden obtener beneficios. Se pueden filtrar los datos por:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u0026ldquo;Nombre\u0026rdquo; y \u0026ldquo;Apellido\u0026rdquo; completos,\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Número de documento\u0026rdquo;, y\u003c/li\u003e\n\u003cli\u003e\u0026ldquo;Número de legajo\u0026rdquo;\nCuando hayas completado los datos, presiona \u003cstrong\u003eBuscar\u003c/strong\u003e.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl buscar un referido, puedes obtener las siguientes alertas en la pantalla:\n\n\u003cbr\u003e\n\n- El referido no posee una matrícula vigente. Esta condición no permitirá que se pueda seleccionar como referido.\n\u003cbr\u003e\n\n- El referido pertenece a una modalidad diferente a la persona cuya admisión se está completando. Esta condición lo inhabilita como referido.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez que se visualice en la pantalla al referido que cumpla con los requisitos, selecciónelo y presione \u003cstrong\u003eSiguiente\u003c/strong\u003e para pasar a la siguiente sección.\u003c/li\u003e\n\u003cli\u003eEn la pantalla \u0026ldquo;Resumen\u0026rdquo; podrás ver todos los datos que se cargaron desde la primer pantalla para que verifiques la información que has ingresado. Si tuvieses que realizar algunos cambios, agregar o borrar información puedes hacerlo dirigiéndote a cada una de las pantallas haciendo clic en el panel navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eUna vez que hayas corroborado todos los datos, haz click en \u003cstrong\u003eConfirmar\u003c/strong\u003e. Un mensaje te confirmará que la acción fue exitosa y se mostrará todos los detalles de la inscripción en la pantalla.\u003c/li\u003e\n\u003cli\u003ePor último, selecciona \u003cstrong\u003eFinalizar\u003c/strong\u003e. El sistema volverá a mostrar la primer pantalla para comenzar nuevamente con la inscripción de un nuevo ingresante.\u003c/li\u003e\n\u003cli\u003eSi intenta registrar a un ingresante que ya se encuentra inscripto se obtiene el siguiente mensaje:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi intentas registrar a un ingresante que ya se encuentra inscripto obtendrás el siguiente mensaje: La operación no se puede completar. El estudiante que intentas registrar ya se encuentra inscripto en esta carrera. Legajo: XXXXX.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/admision/inscripcion-ingresantes/carreras-grado-presencial/\" title=\"Inscribir ingresantes en carreras de grado con modalidad presencial\"\u003eInscribir ingresantes en carreras de grado con modalidad presencial →\u003c/a\u003e\u003c/p\u003e\n"},{id:193,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/examenes/inscripcion-examen/",title:"Inscribirse a un examen",description:null,content:"\u003col\u003e\n\u003cli\u003eSi deseas inscribirte para realizar un examen, ingresa al portal de estudiantes con tus credenciales.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, selecciona el icono de examen \n\n\u003cimg src=\"exam%20icon.png\" alt=\"exam icon\" class=\"inlineIcon\"\u003e. La pantalla de \u0026ldquo;Exámenes\u0026rdquo; se abrirá.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003e+NUEVA INSCRIPCIÓN\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eA la derecha en la pantalla se visualiza una sección llamada \u0026ldquo;Resumen de inscripción\u0026rdquo; en la que podrás ir viendo cómo los datos de la materia, el lugar y la mesa se van completando automáticamente de acuerdo con tus elecciones.\u003c/li\u003e\n\u003cli\u003eEn la sección “Elige la materia que quieres rendir” se muestran lo exámenes que se encuentran disponibles para que te inscribas divididos por tipo.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi se listan materias inhabilitadas, puedes hacer clic sobre ellas para ver los motivos por los que no puedes inscribirte. Puede ser que tengas un final con carga de nota pendiente o que ya tienes un pedido para rendir esa materia.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eSelecciona del listado aquel examen en el que te quieres inscribir. Tu elección se mostrará en la sección “Resumen de inscripción”, dentro del cuadro “Materia”.\u003c/li\u003e\n\u003cli\u003eLuego, selecciona de la lista el lugar dónde quieres rendir. Tu elección se mostrará en la sección “Resumen de inscripción”, dentro del cuadro “Lugar”.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi la sede que elegiste no cuenta con mesas disponibles el sistema te alertará con un mensaje y deberás elegir otro lugar.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eSi el lugar posee mesas disponibles, selecciona uno de los horarios que se muestran en la pantalla. Aquí también verás marcadas con diferentes colores las mesas en las que tengas que llevar tu dispositivo para rendir o en las que las computadoras sean provistas por la universidad.\u003c/li\u003e\n\u003cli\u003eAl finalizar estas tres selecciones, la sección “Resumen de inscripción” se mostrará completa.\u003c/li\u003e\n\u003cli\u003ePara concluir, presiona el botón \u003cstrong\u003eInscribirme al examen\u003c/strong\u003e. Un mensaje con un resumen de tus inscripción se desplegará en la pantalla.\u003c/li\u003e\n\u003cli\u003eSi todos los datos son correctos, confirma la inscripción.\u003c/li\u003e\n\u003cli\u003eLuego, el sistema volverá a la pantalla principal de “Exámenes” y se podrá ver el examen listado en la pestaña \u0026ldquo;Por rendir\u0026rdquo;. Este nuevo examen también se incluirá en la agenda académica como un evento más con todos sus detalles. Consulta los artículos relacionados para aprender más sobre la agenda y tu historial de inscripciones.\u003c/li\u003e\n\u003cli\u003ePara anular una inscripción, haz clic en el icono de más opciones \n\n\u003cimg src=\"more%20actions%20V.png\" alt=\"more actions icon\" class=\"inlineIcon\"\u003e y presiona “Anular pedido”. Si la operación es exitosa se mostrará un mensaje de confirmación.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-carreras-e-historial-cursado/\" title=\"Consultar carreras e historial de cursado\"\u003eConsultar carreras e historial de cursado→\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/\" title=\"Consultar tu agenda académica\"\u003eConsultar tu agenda académica→\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/examenes/inscripcion-examen/\" title=\"Inscribirse a un examen\"\u003eInscribirse a un examen →\u003c/a\u003e\u003c/p\u003e\n"},{id:194,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-asistente/",title:"Matrícula y aranceles (Asesores)",description:null,content:"\u003col\u003e\n\u003cli\u003eHacer click en el botón “Matrícula y Aranceles” para entrar.\u003c/li\u003e\n\u003cli\u003eEn ésta pantalla se listan los tickets pendientes de pago, los cuales incluyen la información sobre la carrera/cátedra a la cual corresponden (1). Seleccionar el ticket que se desea pagar en la sección “¿Qué vas a pagar?” (2).\u003c/li\u003e\n\u003cli\u003eEn la sección “Tu resumen” se detallan los conceptos del ticket seleccionado (3 y 4).\u003c/li\u003e\n\u003cli\u003eSi toda la información es correcta presionar el botón “Siguiente” (5).\u003c/li\u003e\n\u003cli\u003eSeleccionar la forma de pago haciendo click en la opción deseada (sección “¿Cómo vas a pagar?“), la cual cambiará de color al ser seleccionada.\u003c/li\u003e\n\u003cli\u003eEn la sección “Tu resumen”, si todos los detalles son los correctos, presionar “Siguiente” (7). Las opciones en datos de facturación pueden variar dependiendo de la región.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cem\u003eLa pantalla de pago puede variar dependiendo de la selección anterior (6)\u003c/em\u003e\u003c/p\u003e\n"},{id:195,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/",title:"Matrícula y aranceles (Estudiante)",description:null,content:"\u003col\u003e\n\u003cli\u003eHacer clic en el botón “Matrícula y Aranceles” para entrar.\u003c/li\u003e\n\u003cli\u003eEn ésta pantalla se listan los tickets pendientes de pago, los cuales incluyen la información sobre la carrera/cátedra a la cual corresponden (1). Seleccionar el ticket que se desea pagar en la sección “¿Qué vas a pagar?” (2).\u003c/li\u003e\n\u003cli\u003eEn la sección “Tu resumen” se detallan los conceptos del ticket seleccionado (3 y 4).\u003c/li\u003e\n\u003cli\u003eSi toda la información es correcta presionar el botón “Siguiente” (5).\u003c/li\u003e\n\u003cli\u003eSeleccionar la forma de pago haciendo click en la opción deseada (sección “¿Cómo vas a pagar?“), la cual cambiará de color al ser seleccionada. (6).\u003c/li\u003e\n\u003cli\u003eEn la sección “Tu resumen”, si todos los detalles son los correctos, presionar “Siguiente” (7). Las opciones en datos de facturación pueden variar dependiendo de la región.\u003c/li\u003e\n\u003cli\u003eAl hacer click en “siguiente” (8) se abrirá la pantalla de pago. La misma puede variar dependiendo de la selección anterior (6).\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cem\u003eSi deseas  editar los datos de Facturación deberás seguir los siguientes pasos. (9)\u003c/em\u003e\u003c/p\u003e\n"},{id:196,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/mover-estudiantes-individual/",title:"Mover estudiantes de una cátedra a otra",description:"Cuando un estudiante solicite cambiarse de cátedra, sigue estas instrucciones.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la pantalla \u003cstrong\u003eCAMBIO DE CÁTEDRA\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la parte superior, puedes ver los detalles académicos del estudiante.\u003c/li\u003e\n\u003cli\u003ePor defecto, se muestra el período académico actual de estudiante. Si fuese necesario, desde el combo de la tarjeta, puedes seleccionar otro subperíodo para realizar el cambio de la cátedra. En la ventana se desplegará la agenda académica para el período seleccionado con los detalles de “Cátedras”, “Seminarios” y “Seminarios Experimenta” cada uno con un color diferente.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn el calendario también se pueden observar conflictos entre dos cátedras superpuestas simbolizados mediante un icono de alerta en amarillo. \n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eEn la agenda, presiona la cátedra, el seminario o seminario experimenta que deseas cambiar.\u003c/li\u003e\n\u003cli\u003eA la derecha de la ventana puedes ver una tarjeta con más información. Si la cátedra tuviera algún conflicto por superposición de horarios, por ejemplo, se muestran los detalles de dicho conflicto en esta tarjeta.\u003c/li\u003e\n\u003cli\u003eDebajo de esta información se despliegan dos solapas con las cátedras \u003cstrong\u003eDisponibles\u003c/strong\u003e y \u003cstrong\u003eNo disponibles\u003c/strong\u003e para realizar el cambio solicitado.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLos registros de cátedras que se encuentran listados en la solapa \u003cb\u003eNo disponibles\u003c/b\u003e pueden tener el cupo lleno o estar cerradas (es decir que no están habilitadas para inscripción). Puedes consultar la sección \u003cb\u003eVéase también\u003c/b\u003e al final de este documento para acceder a los enlaces relacionados y obtener más información sobre la búsqueda y apertura de cátedras.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eEn la lista de cátedras disponibles, puedes ver tarjetas con todos sus detalles. Haz clic en el círculo de la tarjeta de cátedra que elijas para realizar el cambio. En la agenda se incluyen estos datos en un color más claro señalando el día y la hora de la nueva cátedra. Si existiese una superposición con otra cátedra se ven ambas superpuestas en ese día y horario. En esta instancia no aparece el icono de conflicto porque los cambios no se guardaron.\u003c/li\u003e\n\u003cli\u003eUna vez que confirmes que los detalles de la nueva cátedra son compatibles con las necesidades del estudiante, presiona .\u003c/li\u003e\n\u003cli\u003eUna ventana de confirmación se abrirá para que revises nuevamente los datos que seleccionaste. Haz clic en \u003cstrong\u003eConfirmar\u003c/strong\u003e.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi deseas ver la nueva cátedra en el calendario académico del estudiante selecciona el período nuevamente.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/mover-estudiantes/\" title=\"Mover estudiantes de una cátedra a otra masivamente\"\u003eMover estudiantes de una cátedra a otra masivamente →\u003c/a\u003e\u003c/p\u003e\n"},{id:197,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/mover-estudiantes/",title:"Mover estudiantes masivamente de una cátedra a otra masivamente",description:"Esta funcionalidad te permite cambiar estudiantes de una cátedra a otra.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, se encuentra el formulario de búsqueda. Completa los campos para que puedas encontrar la cátedra cuyos estudiantes deseas mover.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara más información sobre la búsqueda de cátedras ingresa a la sección \u003cb\u003eVéase también\u003c/b\u003e al final de este documento.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eEn la grilla de resultados de la búsqueda, presiona el icono de ojo \n\n\u003cimg src=\"eye.png\" alt=\"eye icon\" class=\"inlineIcon\"\u003epara acceder a la lista de estudiantes que se inscribieron.\u003c/li\u003e\n\u003cli\u003eA la izquierda de los nombres de los estudiantes hay un casilla de verificación que puedes marcar con aquellas personas que se moverán de cátedra. Si seleccionas la casilla ubicada en la parte superior al nivel de los títulos, se incluirán todos los estudiantes que pertenezcan a esa cátedra.\u003c/li\u003e\n\u003cli\u003ePresiona el botón \u003cstrong\u003eCambiar cátedra\u003c/strong\u003e para realizar el traspaso. Debajo del botón puedes ver la cantidad de estudiantes que estás a punto de mover.\u003c/li\u003e\n\u003cli\u003eLa pantalla mostrará aquellas cátedras que tienen cupo disponible. Las que están en color gris pueden encontrarse inhabilitadas porque no tienen cupo disponible, porque están cerradas o porque la cátedra no está habilitada para la carrera y plan de estudio en la que el estudiante está inscripto.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003ePara obtener más información acerca del procedimiento para abrir una cátedra, ve a la sección de artículos relacionados al final de este documento.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eHaz clic en el círculo en la cátedra disponible a la que deseas mover los estudiantes.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la tarjeta con la información de la cátedra puedes ver información detallada sobre la sede, el horario, el docente a cargo, el cupo, etc. Además, al desplegar la flecha hacia abajo de la sección carreras podrás ver todas las carreras que comparten esa cátedra.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003ePresiona el botón \u003cstrong\u003eGuardar\u003c/strong\u003e para confirmar los cambios. Un mensaje se desplegará para confirmar esta acción.\u003c/li\u003e\n\u003cli\u003eSi estás seguro de querer mover estos estudiantes, presiona \u003cstrong\u003eConfirmar\u003c/strong\u003e. Un mensaje confirmará que la acción se completó con éxito.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa grilla donde se listaban todos los estudiantes de la cátedra de la que se los quitó se verá de color gris. Esto significa que estas personas ya no se encuentran inscriptas allí. \nPor el contrario, si desde la grilla de búsqueda del planificador ingresas a la nueva cátedra a la que se movieron los estudiantes y haces clic en el icono de ojo verás los nombres de aquellas personas que acabas de mover.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\n\u003cbr/\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/abrir-catedras/\" title=\"Abrir cátedras\"\u003eAbrir cátedras →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/mover-estudiantes-individual/\" title=\"Mover estudiantes de una cátedra a otra\"\u003eMover estudiantes de una cátedra a otra →\u003c/a\u003e\u003c/p\u003e\n"},{id:198,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/metodos-pago/consultar-formas-pago/",title:"Métodos de pago",description:null,content:"\u003ch3 id=\"pay-per-tic-pago-con-tarjeta\"\u003ePay per TIC (pago con tarjeta)\u003c/h3\u003e\n\u003cp\u003eEn la pantalla de pago, completar el formulario (nombre y apellido, email, y teléfono), seleccionar medio y forma de pago, completar datos de la tarjeta, aceptar términos y condiciones de uso y, por último, presionar el botón “Pagar ahora”.\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eSi la operación es exitosa, en la pantalla siguiente se puede ver e imprimir el comprobante\u003c/li\u003e\n\u003cli\u003eSi la operación es denegada, existe la opción de “Reintentar pago” (1) o “Volver” (2) en el caso de querer cambiar los datos de la tarjeta/forma de pago\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eHacer click en el botón “Delegar pago” muestra tres opciones:\n\u003cstrong\u003eCopiar link\u003c/strong\u003e, \u003cstrong\u003eEmail\u003c/strong\u003e, y \u003cstrong\u003eWhatsapp\u003c/strong\u003e : Las tres opciones permiten compartir el link de la pantalla de pago para que un tercero haga efectivo el pago.\u003c/p\u003e\n\u003ch3 id=\"pago-fácil\"\u003ePago fácil\u003c/h3\u003e\n\u003cp\u003eSe muestra el comprobante para pagar en las agencias/sucursales habilitadas.\u003c/p\u003e\n\u003ch3 id=\"rapipago\"\u003eRapipago\u003c/h3\u003e\n\u003cp\u003eSe muestra el comprobante para pagar en las agencias/sucursales habilitadas.\u003c/p\u003e\n\u003ch3 id=\"mercadopago\"\u003eMercadoPago\u003c/h3\u003e\n\u003cp\u003eSeleccionar el modo de pago:\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eIngresar con cuenta personal\u003c/li\u003e\n\u003cli\u003ePagar como invitado\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id=\"pago-mis-cuentas\"\u003ePago mis cuentas\u003c/h3\u003e\n\u003cp\u003eSeguir las instrucciones para pagar el cupón generado.\u003c/p\u003e\n"},{id:199,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/obtener-reportes/",title:"Obtener reportes de cátedras",description:"Obtén un reporte con un resumen de las cátedras.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Reportes\u0026rdquo; del planificador haciendo clic en el icono \n\n\u003cimg src=\"report.png\" alt=\"report icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, ingresa los datos en los campos \u0026ldquo;Modalidad\u0026rdquo;, \u0026ldquo;Período\u0026quot;y \u0026ldquo;Subperíodo\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eLuego, haz clic en \u003cstrong\u003eGenerar reportes\u003c/strong\u003e. En la grilla se muestran los dos tipos de reportes que se pueden descargar: \u0026ldquo;Cátedras completo (inicio-fin)\u0026rdquo; y \u0026ldquo;Cátedras por módulo\u0026rdquo;. Se habrán completado con los valores que ingresaste en la parte de filtros de la pantalla.\u003c/li\u003e\n\u003cli\u003ePara finalizar, presiona el botón \u003cstrong\u003eDescargar\u003c/strong\u003e. Automáticamente se descargará un archivo .CSV a tu dispositivo.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:200,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/otros/realizar-otros-pagos-asistente/",title:"Otros pagos (Asesores)",description:null,content:"\u003col\u003e\n\u003cli\u003eHacer click en el botón “Otros Pagos” para entrar.\u003c/li\u003e\n\u003cli\u003eSeleccionar el concepto que se desea abonar en el campo “¿Qué vas a pagar?” (1) y establecer la cantidad (2).\u003c/li\u003e\n\u003cli\u003eEn la sección “Tu resumen” se detalla lo seleccionado anteriormente (3). Si la información es correcta presionar el botón “Continuar” (4).\u003c/li\u003e\n\u003cli\u003eSeleccionar la forma de pago haciendo click en la opción deseada (sección “¿Cómo vas a pagar?“), la cual cambiará de color al ser seleccionada.\u003c/li\u003e\n\u003cli\u003eSi la información es correcta (6) presionar “Siguiente” (7). Las opciones en datos de facturación pueden variar dependiendo de la región (8).\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:201,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/otros/realizar-otros-pagos-estudiante/",title:"Otros pagos (Estudiantes)",description:null,content:"\u003col\u003e\n\u003cli\u003eHacer clic en el botón “Otros Pagos” para ingresar.\u003c/li\u003e\n\u003cli\u003eSeleccionar el concepto que se desea abonar en el campo “¿Qué vas a pagar?” (1) y establecer la cantidad (2).\u003c/li\u003e\n\u003cli\u003eEn la sección “Tu resumen” se detalla lo seleccionado anteriormente (3). Si la información es correcta presionar el botón “Continuar” (4).\u003c/li\u003e\n\u003cli\u003eSeleccionar la forma de pago haciendo clic en la opción deseada (sección “¿Cómo vas a pagar?“), la cual cambiará de color al ser seleccionada.\u003c/li\u003e\n\u003cli\u003eSi la información es correcta (6) presionar “Siguiente” (7).\nSi se desea editar la \u003cstrong\u003efacturación\u003c/strong\u003e ingresar a \u003ca href=\"/doks-algarrobo/docs/epagos/editar-facturacion/\" title=\"Editar facturación\"\u003eEditar facturación →\u003c/a\u003e\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:202,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/politicas-seguridad/consultar-politicas/",title:"Políticas de seguridad (ePagos)",description:null,content:"\u003cp\u003eEl link siguiente es el correspondiente a \u0026ldquo;Políticas de Seguridad\u0026rdquo;.\u003c/p\u003e\n"},{id:203,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/mas-opciones/menu/",title:"Realizar más acciones",description:null,content:"\u003col\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, haz clic en el icono \n\n\u003cimg src=\"more%20actions%20V.png\" alt=\"more actions icon\" class=\"inlineIcon\"\u003e. Se desplegará un menú con las siguientes funcionalidades:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003e\u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-carreras-e-historial-cursado/\" title=\"Consultar carreras\"\u003e\n\n\u003cimg src=\"menu%20book.png\" alt=\"book icon\" class=\"inlineIcon\"\u003e Carreras →\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href=\"/doks-algarrobo/docs/portal-alumno-escritorio/cursado/consultar-calendario-academico/\" title=\"Consultar agenda\"\u003e\n\n\u003cimg src=\"event.png\" alt=\"event and calendar icon\" class=\"inlineIcon\"\u003e Agenda →\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"2\"\u003e\n\u003cli\u003ePor último, al hacer clic en el icono de “Contacto” \n\n\u003cimg src=\"contact.png\" alt=\"contact info icon\" class=\"inlineIcon\"\u003e se despliega un nuevo menú que incluye números de teléfono e información de redes sociales de la universidad.\u003c/li\u003e\n\u003cli\u003ePara regresar a la pantalla anterior y cerrar el menú, presiona la flecha \n\n\u003cimg src=\"navigate%20before.png\" alt=\"back icon\" class=\"inlineIcon\"\u003e.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eUsa el ícono “Perfil” en la parte superior del menú si deseas realizar cambios en tu información personal.\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/mas-opciones/navegar-portal/\" title=\"Inscribirse a un examen\"\u003eNavegar el portal de estudiantes →\u003c/a\u003e\u003c/p\u003e\n"},{id:204,href:"https://bitlogic.github.io/doks-algarrobo/docs/examenes/instancia-examen/rendir-examen/",title:"Rendir un examen",description:null,content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta para rendir exámenes.\u003c/li\u003e\n\u003cli\u003eEn la primera pantalla verás la lista de exámenes a los que te has inscripto y los cuales tienes disponible para rendir.\u003c/li\u003e\n\u003cli\u003ePresiona el botón \u003cstrong\u003eRENDIR\u003c/strong\u003e para continuar hacia la instancia de evaluación.\u003c/li\u003e\n\u003cli\u003eEn la pantalla del examen que seleccionaste podrás distinguir las siguientes secciones:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eEn la parte superior izquierda verás tu nombre y el de la materia.\u003c/li\u003e\n\u003cli\u003eEn la parte superior derecha podrás ir controlando mientras realizas el examen el tiempo transcurrido desde que comenzaste con esta instancia de evaluación y la cantidad de preguntas que has respondido.\u003c/li\u003e\n\u003cli\u003eEn el centro en la parte superior de la pantalla encontrarás un carrusel con botones que contienen un icono de información y la cantidad de enunciados que se incluyen en la evaluación (por defecto podrás ver 10 preguntas y si hubiese más deberás hacer clic en la flecha que señala que hay más preguntas a la derecha). Los números de las preguntas cambiarán de color dependiendo de ciertas circunstancias. Cuando posas el cursor sobre el icono de información se despliegan los colores con sus respectivas referencias: enunciados con respuesta, sin respuesta, marcados para repasar y el que se está viendo en la pantalla.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi posas el cursor sobre alguno de los números de los enunciados, podrás ver un fragmento inicial de su contenido.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn recuadro al centro de la pantalla comenzarás a ver los enunciados o preguntas que conforman el examen.\u003c/li\u003e\n\u003cli\u003eSelecciona la o las respuestas que consideres correctas.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDebajo de las respuestas puedes activar la opción Repasar respuesta. Si lo haces, antes de finalizar el examen el sistema te alertará que marcaste estas respuestas para repasar.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eUna vez que hayas respondido, haz clic en \u003cstrong\u003eSIGUIENTE\u003c/strong\u003e para continuar con la siguiente pregunta.\u003c/li\u003e\n\u003cli\u003eRepite estas acciones en todos los enunciados.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi haces clic en  \u003cb\u003eANTERIOR\u003c/b\u003e podrás regresar a las preguntas anteriores. En caso de que la conexión o la energía eléctrica se interrumpan, cuando los servicios se vuelvan a restablecer y puedas abrir la herramienta para rendir exámenes presiona en botón \u003cb\u003eCONTINUAR RINDIENDO\u003c/b\u003e. Dependiendo de la configuración del examen serán las veces que puedas reintentar continuar con la evaluación. Si llegas al límite máximo de intentos el sistema te alertará y dará por finalizado el examen.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003eUna vez que termines de responder haz clic en el botón \u003cstrong\u003eFINALIZAR EXAMEN\u003c/strong\u003e. Si el sistema detecta preguntas sin respuesta o marcadas para repasar que no han sido confirmadas, te alertará con un mensaje para que puedas verlas o finalizar el examen de todos modos.\u003c/li\u003e\n\u003cli\u003eLuego de haber finalizado el examen, podrás comenzar con la etapa de revisión de las preguntas cuyas respuestas fueron incorrectas. En la pantalla verás un resumen de la cantidad de respuestas correctas e incorrectas y para las que hayan sido configuradas de esa manera su justificación de por qué la opción que elegiste no califica como correcta.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi consideras conveniente puedes pedir a un profesor que revise tu respuesta deslizando el botón para solicitar su revisión. Además, deberás agregar el motivo de esta solicitud. El sistema alertará al profesor que corresponda que tiene una pregunta para revisar.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003c/b\u003e\u003c/p\u003e\n\u003col start=\"11\"\u003e\n\u003cli\u003ePor último, podrás hacer clic en \u003cstrong\u003eFINALIZAR REVISIÓN\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eDependiendo de la configuración del tipo de examen, en esta instancia podrás: ver la nota obtenida con un resumen de la cantidad de respuestas correctas, incorrectas; o, simplemente, recibir una notificación que te informará cuándo recibirás el resultado del examen.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi haces clic en \u003cb\u003eREPORTE\u003c/b\u003e podrás ver un resumen de tu resultado en el examen.\n\n\u003c/div\u003e\n\u003c/div\u003e\n"},{id:205,href:"https://bitlogic.github.io/doks-algarrobo/docs/portal-alumno-escritorio/pagos/simulador-precios/",title:"Simular precios",description:"Simula diferentes planes de pago antes de hacer efectivo el pago de tus aranceles por vía electrónica o presencial.",content:"\u003cp\u003e\u003cdiv class=\"alert alert-warning\" role=\"alert\"\u003e\n  \u003cdiv class=\"flex-shrink-1 alert-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M12 5.99L19.53 19H4.47L12 5.99M12 2L1 21h22L12 2zm1 14h-2v2h2v-2zm0-6h-2v4h2v-4z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eAdvertencia\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa funcionalidad está únicamente disponible desde el portal de estudiantes web y no desde la aplicación móvil.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eInicia sesión en el portal de estudiantes web usando tus credenciales.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación izquierdo, selecciona el icono \n\n\u003cimg src=\"outline_receipt_long_black_24dp.png\" alt=\"simulator icon\" class=\"inlineIcon\"\u003e de la opción “Simulador”. En la pantalla de la funcionalidad podrás ver las siguientes condiciones de la simulación.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eRecuerda que los precios son meramente estimativos y pueden variar. Los descuentos, becas y beneficios aplicados impactan en cada caso de manera puntual y podrían verse modificados o alterados. La estimación de pago que se realiza desde esta herramienta de simulación tiene una vigencia de 24 horas.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"3\"\u003e\n\u003cli\u003eUna vez que estés en la primera pantalla, presiona \u003cstrong\u003eComenzar\u003c/strong\u003e.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn la tarjeta con los datos de tu legajo puedes usar las flechas hacia la derecha o izquierda para seleccionar otras carreras en las que te inscribiste y estimar el cálculo para cada una de ellas.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eComienza seleccionando un período y un subperíodo. La herramienta muestra un valor por defecto que puedes cambiar de acuerdo con tus necesidades.\u003c/li\u003e\n\u003cli\u003eLuego, en la sección “Paquete de pago” selecciona el paquete cuyo pago quieres simular.\u003c/li\u003e\n\u003cli\u003eMarca el casillero de verificación si ya te inscribiste. Esta opción no es obligatoria y sirve para que el simulador no incluya los costos de la matrícula.\u003c/li\u003e\n\u003cli\u003eA la derecha de la pantalla comenzarás a ver el “Detalle de simulación”.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi la simulación contiene promociones, descuentos y/o becas y beneficios vigentes y aplicables para tu legajo, puedes ver estos datos en la sección de detalles.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eAl hacer clic en el enlace “¿Quieres conocer más sobre nuestras becas/beneficios?” puedes acceder a más información sobre las becas/beneficios disponibles en la institución en la que estás inscripto o estás por inscribirte.\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003ePresiona el botón \u003cstrong\u003eSiguiente\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn esta segunda pantalla del simulador, podrás optar por los “Medios de pago”.\u003c/li\u003e\n\u003cli\u003eMarca el casillero “Pago online” si deseas realizar el pago desde la aplicación de pago electrónico.\u003c/li\u003e\n\u003cli\u003eDesplázate por las opciones de tarjetas disponibles y selecciona una. Una ventana auxiliar se abrirá para que veas las diferentes opciones de planes de pago o cuotas disponibles para cada tarjeta dependiendo del tipo de tarjeta y la entidad bancaria que elegiste.\u003c/li\u003e\n\u003cli\u003eSelecciona una opción y haz clic en \u003cstrong\u003eConfirmar plan\u003c/strong\u003e para ver la simulación con las opciones que acabas de definir.\u003c/li\u003e\n\u003cli\u003eFinalmente, presiona \u003cstrong\u003eCalcular pago\u003c/strong\u003e. El sistema abrirá automáticamente una pantalla con un resumen del cálculo de lo que deberías abonar considerando las opciones que seleccionaste.\u003c/li\u003e\n\u003cli\u003eSi lo deseas, puedes hacer clic en el botón para descargar un archivo con formato PDF con los datos de la simulación que ves en la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/historial-pagos/consultar-historial-estudiante/\" title=\"Consultar tu historial de pagos\"\u003eConsultar tu historial de pagos →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/consultar-ticket-estudiante/\" title=\"Consultar tus tickets pendientes de pago\"\u003eConsultar tus tickets pendientes de pago →\u003c/a\u003e\n\u003cbr\u003e\u003c/p\u003e\n"},{id:206,href:"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/ver-estudiantes-inscriptos/",title:"Ver estudiantes con inscripción en cada cátedra",description:"Consulta de manera fácil los estudiantes que se han inscripto a una cátedra.",content:"\u003col\u003e\n\u003cli\u003eAccede a la pantalla \u0026ldquo;Gestión de cátedras\u0026rdquo; haciendo clic en el icono \n\n\u003cimg src=\"menu.png\" alt=\"hamburger menu icon\" class=\"inlineIcon\"\u003e del panel de navegación izquierdo.\u003c/li\u003e\n\u003cli\u003eEn la parte superior de la pantalla, se encuentra el formulario de búsqueda. Ingresa los datos de la materia cuyas cátedras deseas consultar.\u003c/li\u003e\n\u003cli\u003eEn la grilla de resultados, selecciona la cátedra cuyos estudiantes deseas ver.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de ojo \n\n\u003cimg src=\"eye.png\" alt=\"eye icon\" class=\"inlineIcon\"\u003e que se encuentran a la derecha del registro de la materia.\u003c/li\u003e\n\u003cli\u003eLa ventana \u0026ldquo;Estudiantes con inscripción\u0026rdquo; se abrirá. Aquí, podrás ver una lista de todos los estudiantes inscriptos en la cátedra\u003c/li\u003e\n\u003cli\u003ePara descargar dicha información un excel presiona el icono \n\n\u003cimg src=\"download%20file.png\" alt=\"download icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/planificacion/gestion-catedras-presenciales/buscar-catedras/\" title=\"Buscar cátedras\"\u003eBuscar cátedras →\u003c/a\u003e\u003c/p\u003e\n"},{id:207,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/reportes/reporte-promociones-comerciales/",title:"Obtener reporte de promociones comerciales",description:"Con esta herramienta puedes consultar las promociones comerciales que se aplicarán a los tickets definiendo ciertos filtros.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la aplicación “Gestión de ingresos”.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono \n\n\u003cimg src=\"price.png\" alt=\"icon\" class=\"inlineIcon\"\u003e para que puedas acceder a la pantalla de “Promociones comerciales”.\u003c/li\u003e\n\u003cli\u003ePosa el cursor sobre el icono más acciones \n\n\u003cimg src=\"more%20actions.png\" alt=\"more actions V icon\" class=\"inlineIcon\"\u003e ubicado en la parte inferior derecha de la pantalla.\u003c/li\u003e\n\u003cli\u003eLuego, selecciona la opción \u003cstrong\u003eReportes\u003c/strong\u003e \n\n\u003cimg src=\"reports.png\" alt=\"reports icon\" class=\"inlineIcon\"\u003e.\u003c/li\u003e\n\u003cli\u003eEn la pantalla “Reporte de promociones”, completa los datos en los campos “Clase de estudio”, “Período” y “Región”(opcional) para delimitar tu búsqueda.\u003c/li\u003e\n\u003cli\u003eHaz clic en \u003cstrong\u003eBUSCAR\u003c/strong\u003e. Los resultados de búsqueda se mostrarán en la pantalla en forma de tabla.\u003c/li\u003e\n\u003cli\u003ePuedes personalizar el reporte haciendo clic en en el icono \u0026ldquo;Mostrar panel de opciones\u0026rdquo;. Se abrirá una ventana para que puedas optar por diferentes opciones de filtrado y los datos que deseas incluir en filas, columnas, datos, campos y filtros.\n\u003cbr\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn esta ventana cada filtro contiene dos iconos: \n\u003cbr\u003e\n\n- una flecha para ordenar los datos de manera ascendente y descendente y\n\u003cbr\u003e\n\n- un embudo que te habilita a seleccionar más opciones de filtrado desde una ventana emergente si hubiese datos.\n\u003cbr\u003e\n\nTambién puedes definir la información que deseas ver marcando las casillas de verificación de la sección \"Todos los filtros\".\n\u003cbr\u003e\n\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cbr\u003e\u003c/p\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez que realices la configuración necesaria para incluir los datos que quieres ver en el reporte, presiona la cruz para cerrar la ventana.\u003c/li\u003e\n\u003cli\u003eFinalmente, para descargar el informe personalizado que ves en la pantalla en formato Excel haz clic en el icono correspondiente.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/crear-promos/\" title=\"Crear promociones comerciales\"\u003eCrear promociones comerciales →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/buscar-promos/\" title=\"Buscar promociones comerciales\"\u003eBuscar promociones comerciales →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/editar-promos/\" title=\"Editar promociones comerciales\"\u003eEditar promociones comerciales →\u003c/a\u003e\u003c/p\u003e\n"},{id:208,href:"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/reportes/consultar-tickets/",title:"Consultar tickets",description:"Con esta herramienta puedes consultar las promociones comerciales que se aplicarán a los tickets.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono reportes \n\n\u003cimg src=\"note.png\" alt=\"note icon\" class=\"inlineIcon\"\u003epara que puedas acceder a la pantalla de \u0026ldquo;Reporte de tickets\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el campo \u0026ldquo;Ticket\u0026rdquo;, ingresa en número de ticket y presiona \u003cstrong\u003eBuscar\u003c/strong\u003e para ver sus detalles.\u003c/li\u003e\n\u003cli\u003eLa pantalla se actualizará con la información del ticket que deseas consultar. En el encabezado podrás ver: número de ticket, legajo del estudiante, fecha, descripción, cuota, período, sede/CAU, carrera, tipo de estudiante, promoción, precio del ticket y monto final.\u003c/li\u003e\n\u003cli\u003eEn la sección \u0026ldquo;Medios de pago\u0026rdquo;, selecciona un medio de pago para ver sus promociones financieras y compararlas con otros medios.\u003c/li\u003e\n\u003cli\u003eEn la sección \u0026ldquo;Promociones comerciales\u0026rdquo;, puedes ver la vinculación del ticket que seleccionaste con una promoción comercial.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi tienes los permisos necesarios, desde esta pantalla también puedes ver más detalles o editar las promociones comerciales haciendo clic en el icono de lápiz.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/crear-promos/\" title=\"Crear promociones comerciales\"\u003eCrear promociones comerciales →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/editar-promos/\" title=\"Editar promociones comerciales\"\u003eEditar promociones comerciales →\u003c/a\u003e\n\u003cbr/\u003e\n\u003ca href=\"https://bitlogic.github.io/doks-algarrobo/docs/gestion-ingresos/promos-comerciales/buscar-promos/\" title=\"Buscar promociones comerciales\"\u003eBuscar promociones comerciales →\u003c/a\u003e\u003c/p\u003e\n"},{id:209,href:"https://bitlogic.github.io/doks-algarrobo/docs/",title:"Docs",description:"Software project docs",content:""},];index.add(docs);userinput.addEventListener('input',show_results,true);suggestions.addEventListener('click',accept_suggestion,true);function show_results(){var value=this.value;var results=index.search(value,5);var entry,childs=suggestions.childNodes;var i=0,len=results.length;suggestions.classList.remove('d-none');results.forEach(function(page){entry=document.createElement('div');entry.innerHTML='<a href><span></span><span></span></a>';a=entry.querySelector('a'),t=entry.querySelector('span:first-child'),d=entry.querySelector('span:nth-child(2)');a.href=page.href;t.textContent=page.title;d.textContent=page.description;suggestions.appendChild(entry);});while(childs.length>len){suggestions.removeChild(childs[i])}}
function accept_suggestion(){while(suggestions.lastChild){suggestions.removeChild(suggestions.lastChild);}
return false;}}());